(384, 'live', '34378430812', 13, 0, 2, 'Certified Negotiation Real Estate Training, Lansing, MI', 'Don''t Wing It!Get Professional Negotiation Training to Instantly Increase Your Confidence, Persuasion and Communication Skills.\nStandout against other agents when you tell prospective clients they''re working with a "Certified Negotiation Expert."\nDiscover proven persuasion principles, human psychology, and innovative strategies to gain an advantage when negotiating with buyers, sellers, lenders and opposing agents. \nWe''re now upto 57,500 graduates from our CNE classes.\nSince 2005 we''ve been training real estate agents on negotiation principle learned from hands-on Fortune 100 experiences, Harvard, Wharton, and Oxford Negotiation Training, and thousands of real estate transactions.\nWould you like to become a Certified Negotiation Expert?\nListen to what our students say...\n1. They get more offers accepted in multiple buyer scenarios. 2. They handle difficult personalities while remaining calm and in control. 3. They develop creative solutions for situations they would have thought impossible.4. They feel more confident from researching and planning before entering negotiations.5. They recognize 10, 20, 30 ore more negotiable situations which they were blind to in the past.\nTestimonial: \n"I wanted to let you know that I truly enjoyed your class. I have been a Realtor for the past 6 years and a prosecuting attorney for 21 years before that. I am also a certified mediator. Your class provides exceptional tools to real estate professionals whether or not they have a background in negotiations. This class was both a great foundation for those learning the necessary skills and also a wonderful refresher for the more experienced practitioner. I would highly recommend it to everyone!"\nAnn GarriottJD, GRI, e-Pro\nThe CNE class helps agents of all levels earn higher commissions, increased referrals and win new listings.\n\nQuickly Win Trust & Manage Client Expectations ✓\nTame Aggressive Opposing Agents ✓\nCreate Strategies that Get Lenders on Your Side ✓ \nDevelop Non-Traditional Plans That Close Deals Faster ✓\n\nQuestions? Call: 888-243-7364\n\nThis Class Gives You:\n∙ 12 CE Hours (10 Elective, 2 Legal)\n∙ The CNE® Designation\n∙ Negotiation Scripts\n∙ Live Class Role Playing\n∙ Workbook and Listing Worksheets\n∙ 24/7 Access to Online Class Materials\n∙ Membership to Our Private Facebook Group\n\nYour Instructor: Mark Wasserman, MCNE\n\nMaster Certified Negotiation Expert BIO\nMark Wasserman has been a full-time Realtor and Associate Broker in Michigan since 1987. He has received numerous honors in the real estate industry including, a top 25 agent in the Great Lakes region for Century 21, the prestigious Centurion Award, the Emerald Award and the Masters Award. Marks is most passionate about the principle of serving and teaching others . In addition to his responsibility as a RENI instructor, his repertoire includes training new real estate agents, assistant office manager and conducting public seminars for FSBO’s.\nTWO DAY CLASS AGENDA INCLUDES:\n∙ Competitive Win-Lose Hard Bargaining vs. Collaborative Win-Win Negotiation\nUnderstand the difference in these two classic approaches and how to use both approaches to get the best outcome for your client and yourself.\n∙ Psychology of Buying\nLearn how the brain makes purchase decisions and how you can impact both sides of the brain in the decision-making process. \n∙ Persuasion Principles\nScientifically proven persuasion approaches that increase your success rate at influencing others; includes scripts for real estate negotiation situations that utilize these proven persuasion approaches.\n∙ CNE Model and Planning Guide\nLearn how to proactively plan your real estate negotiations for success. \n∙ Case Studies\nSee how these principles and approaches are applied in real estate negotiation situations in all kinds of markets. \n∙ Skill Practice/Role Plays\nGet a chance to practice your new skills in a safe environment that will increase your success in the real world.  \n∙ Group Discussion Topics\nInnovative and creative approaches are discussed by small and large groups that will help take your business to new levels. \nCNE Graduate Testimonials\n\n\nFAQs\n \nWhat''s the refund policy?\nCancellations made 7 days or more from the start date of a class will receive a full refund (minus a $25 cancellation fee). Cancellations made less than 7 days before the start of a class will not receive any refund but the registration fee can be transferred to a future class within one year of the original class date.\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31131681%2F200735630743%2F1%2Foriginal.jpg?s=426a60a1570ebe02162bf0e986ddf80e', 'https://www.eventbrite.com/e/certified-negotiation-real-estate-training-lansing-mi-registration-34378430812?aff=ebapi', '2924 West Rd, East Lansing, MI 48823', 42.7633313, -84.50740129999997, '2924 West Rd, East Lansing, MI 48823', NULL, NULL, '1499850000', '1499963400', 0, 0, 0, NULL, 1),
(385, 'live', '34396749604', 13, 0, 2, 'June 2017 Functional Forum [Lansing, MI]', 'Join us as we watch and discuss the June 2017 Functional Forum: The Evolution of Neurology. The Evolution of Medicine will be bringing us footage from the annual IFM conference as well as, special footage from the EvoMed pre-conference party.  The theme for IFM’s Annual Conference is "The Dynamic Brain: Revealing the Potential of Neuroplasticity to Reverse Neurodegeneration.\n \n\nThis conference comes at an interesting time for neurology. We will be hearing from speakers who are conducting the most exciting research in the field. The keynote, Dr. Dale Bredesen, of the Buck Institute, has successfully, with his Functional Medicine protocol, reversed MCI – mild cognitive impairment, as well as, Alzheimer’s disease.\n\nDr. Bredesen will be joined by luminaries from the field of evolved neurology, along with those who are working on the front lines of care, including Dr. Kara Fitzgerald, Dr. David Perlmutter, and Dr. Mark Menolascino. Dr. Perlmutter, also known as the Empowering Neurologist, will be back on the show for a 2nd interview. Dr. Fitzgerald, an expert in the area of methylation, will join us to talk about how methylation affects the brain. Dr. Menolascino has been treating patients with these issues for two decades using Functional Medicine and will be sharing some of his best practices. Join us June 5th as we accelerate the evolution of neurology!\n\nSpeakers\nDale Bredesen, MD\nMark Menolacino, MD\nKara Fitzgerald, ND\nand the IFM Practitioner Community\n\n\n\n\n\nWhen you RSVP: As part of our educational mission, the Evolution of Medicine will also email you resources on clinical, practice development and other relevant topics for practitioners in functional integrative medicine. As a reminder, you can always adjust email frequency in the footer of each email.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31148245%2F209051300798%2F1%2Foriginal.jpg?s=1664e99337fbb1b2a350be6bd80dd0ce', 'https://www.eventbrite.com/e/june-2017-functional-forum-lansing-mi-tickets-34396749604?aff=ebapi', '209 Baker Street, Lansing, MI 48912', 42.7169065, -84.55048440000002, '209 Baker Street, Lansing, MI 48912', NULL, NULL, '1496689200', '1496698200', 0, 0, 0, NULL, 1),
(386, 'live', '34420431437', 13, 0, 2, 'High Notes & Fly Jokes', 'Attention: This is NOT The Fyre Festival and Ja rule isn''t your hostâ€¦ The multi-faceted NeNe'' Izima is actually back to throw another epic charity event at The Avenue Cafe in Lansing MI and she''s not doing it alone. Performing live alongside NeNe will be Michael Geeter from Fox Televisionâ€™s comedy showcase â€œLaughsâ€, The lady trio comedy sensation, â€œComedy Covenâ€, and Detroitâ€™s own T.Barb. Musical performances from V.Soul, Mikeyy Austin, and Justin Herrera will also be sure to blow you away. There will be dance intermissions by Iyrah as well to keep you entertained all night. All of the proceeds will go to the locally known emergency housing and support service, Haven House. Haven House is a Lansing based support service for families and children who are homeless and/or dealing with domestic violence. The event will be held at the extraordinarily eclectic Avenue CafÃ©â€™, so prepare for an amazingly eclectic show in the name of a good cause!\n\nMichael Geeter:Hailing from Pontiac, MI, Mike brings a pointed look at family and relationships that few others canâ€¦or should. From his upbringing in a family with 17 children to discussing his plight as a father and husband, Mikeâ€™s comedy is jagged mixed with a smooth delivery. Mike has worked in some of the finest comedy venues in the country opening for comedy legends Bobby Slayton, Jim Norton, Artie Lange, and Rickey Smiley. Mike was also a finalist in the â€œBorder City Comedy Festâ€ in Windsor, Canada, performed and hosted in the â€œWindsor Comedy Festivalâ€, and was recently featured on Fox Televisionâ€™s comedy showcase â€œLaughsâ€.\nComedy Coven:Comedy Coven is a group of three dynamic sketch performers (Tricia Chamberlain, Stephanie Onderchanin, and Emily Syrja) who produce and perform in a monthly variety show in their hometown of Lansing, Michigan. Combining nihilism and absurdity with their love of pop culture, current events, and the occult, Comedy Coven seeks to provide a truly original comedy experience.\nT.Barb:T.Barb, from Detroit MI, has opened for Coco&Foolish from Detroits FM 98 WJLB, AJ Johnson, Rodney Perry, Avery Sunshine, Anthony David, Turae Gordon, Mike Bonner, The Hodge Twins and many more. She won the Lucky 7 Women''s Competition at the Riverfront Marina in Detroit and has been a recurring Judge on WADL 38 Dance Battle Detroit. Sheâ€™s performed at Uptown Comedy Corner in Atlanta, The Funny Bone Toledo, Kentucy, and New York Comedy Store.\nJustin Herrera:Pop Singer Justin Herrera has been singing since he was 16 starting off in the music industry by singing Christian music. Justin is now 23 and is creating a new voice for himself in pop music! He wanted everyone to always remain confident, be unique, and always be themselves no matter what! Justin has released his new EP Hypnotized last February! Justin is getting ready a tour that will start the end of September he will be heading to Paris, London, Athens, & more! Check out Hypnotized today available everywhereMikeyy Austin:Mikeyy Austin is a 20 year-old hip-hop/soul artist and musician from Lansing, Michigan. His sound is reminiscent of the Soulaquerian era, combining hip-hop, soul, and live instrumentation. His music tells the story of discovery of ones-self, while dealing with culture, art, and community.\nV-SoulV-Soul is a neo soul old school singer from Detroit, Michigan. She is now a Lansing local that has switched her genre and is striving to prosper as a neo soul artist.\nÂ \nFAQs\nÂ \nAre there ID or minimum age requirements to enter the event?\n18+\nÂ \nWhat are my transportation/parking options for getting to and from the event?\nParking is located behind the venue and so is the entrance. There is street parking as well.\nÂ \nHow can I contact the organizer with any questions?\nFacebook: NeNe Izima\nPhone: (517)894-6282 (NeNe)\nemail: neneizima@hotmail.com\nÂ \nWhat''s the refund policy?\nNo Refunds\nÂ \nDo I have to bring my printed ticket to the event?\nprinted or online proof of purchase will suffice.\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31178322%2F161170489973%2F1%2Foriginal.jpg?s=5ad33a050458b0abe03240c1a353b544', 'https://www.eventbrite.com/e/high-notes-fly-jokes-tickets-34420431437?aff=ebapi', '2021 E Michigan Ave, Lansing, MI 48912', 42.73389, -84.52140789999999, '2021 E Michigan Ave, Lansing, MI 48912', NULL, NULL, '1498334400', '1498431600', 0, 0, 0, NULL, 1),
