(393, 'live', '34498086706', 13, 0, 2, 'ONLY $8.00! Beardpunzel - The Bearded Princess 5K & 10K - Lansing', 'Â \r\n*WE HAVE A LIMITED NUMBER OF MEDALS LEFT FROM OUR BEARDPUNZEL RACE FROM NOVEMBER! Â PURCHASE NOW FOR $8 AND COMPLETE YOUR RACE BY JUNE 30, 2017! Â THIS IS A VIRTUAL RACE, SO YOU COMPLETE YOUR RACE ON YOUR OWN, SUBMIT YOUR TIME, AND WE SHIP YOUR MEDALS TO YOU!\r\nWhy do Disney Princesses get to have all the fun? Â In honor of No Shave November, we are hosting our first annual The Bearded Princess 5K & 10K. Â  This yearâ€™s Bearded Princess is Beardpunzel. Â \r\nThis is a virtual race, so you can participate from anywhere in the world and we will ship your medal directly to you.Â  We will also be donating Â at least 20%Â of each registration toÂ LOCKS OF LOVE, Â whichÂ provides hairpieces to financially disadvantaged children under age 21 suffering from long-term medical hair loss from any diagnosis.\r\n*THIS IS A VIRTUAL RUN!\r\nWhat:Â This is a virtual run (or walk) 5K or 10K to celebrate No Shave November and Bearded Princesses.\r\nWhen:Â Complete your race anyÂ time by June 30, 2017\r\n*Medals will ship within 2 to 5 days of signing up.Â \r\nWhere:Â Â You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy:Â Â Because this is our way ofÂ celebrating No Shave November. Â We will also be donating Â at least 20%Â of each registration toÂ LOCKS OF LOVEÂ (typically about $5). Â Our goal is to raise $5,000! *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31263849%2F98886079823%2F1%2Foriginal.jpg?s=75340e68cd386cb0100f5d833e0b10a4', 'https://www.eventbrite.com/e/only-800-beardpunzel-the-bearded-princess-5k-10k-lansing-registration-34498086706?aff=ebapi', 'YOUR CHOICE, Lansing, Michigan 48924', 42.680451, -84.54876000000002, 'YOUR CHOICE, Lansing, Michigan 489