(395, 'live', '34575059935', 13, 0, 2, '40-Hour HAZWOPER OSHA Training Seminar Classes in Lansing, MI', 'Compliance Solutions, the nation''s largest provider of OSHA Hazmat training, is pleased to offer open enrollment for our 40-Hour OSHA HAZWOPER Site Worker trainingÂ in Ten (10)Â different cities every week!\r\nÂ \r\nOur instructor-led seminars meet or exceed OSHAâ€™s suggested training curricula and meet OSHAâ€™s mandated training requirements under 29 CFR 1910.120(e and q) including hands-on training!\r\nÂ \r\n40-Hour HAZWOPER training is mandated for employees who have responsibilities to remediate (clean-up) hazardous materials at controlled and un-controlled sites with hazards or work activities that present some an Immediate Danger to Life or Health (IDLH). This includes clean up operations, emergency response operations, storage, disposal or treatment of hazardous materials and hazardous waste sites. 40-Hour HAZWOPER training is also required prior to OSHA Site-Supervisor training. \r\nÂ \r\nThe 40-Hour HAZWOPER course provides structured classroom training mandated by 29 CFR1910.120 (e and q) including student exercises and a hands-on dress-out to acclimate workers with required Personal Protective Equipment (PPE). Workers attending this instructor-led course will cover 18 different OSHA suggested topics including health and safety procedures, PPE used during work operations at hazardous material sites, medical monitoring and many others.\r\nÂ \r\nInstructors emphasize a practical approach to worksite health and safety, as such, attendees learn to recognize site hazards and take appropriate steps to prevent illness or injuries while on the jobsite. \r\nÂ \r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\nÂ \r\nRegister Early! Pre-registration for all classes is required (no walk-inâ€™s) and classes do fill up quickly.\r\nÂ \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\nÂ \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\nÂ Â  5 to 9 students= 10% Â Â Â 10 or more = 15%\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31362732%2F51654302652%2F1%2Foriginal.jpg?s=84f30614e65c0e644357a6adf69d3983', 'https://www.eventbrite.com/e/40-hour-hazwoper-osha-training-seminar-classes-in-lansing-mi-tickets-34575059935?aff=ebapi', '3121 East Grand River Ave, Lansing, MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing, MI 48912', NULL, NULL, '1502784000', '1503079200', 0, 0, 0, NULL, 0),
(396, 'live', '34588578369', 13, 0, 2, 'Digital Marketing Course: Social Media 101', 'Digital Marketing Course: Social Media 101 Live Streaming Presentation!\nIf you havenâ€™t attended one of our online sessions prepare to have your mind blown! We''ll be teaching you everything you need to know when it comes to Social Media and getting started, the right way. At the core, most social media platforms work in a very similar way, once you understand the fundamentals you can dominate any social network, old and new. The best part is, anyone can do it!\n\nSome things we''ll be reviewing in this course.\n\nFacebook Personal Pages\nFacebook Fan Pages\nFacebook Groups\nFacebook Growth Marketing Strategy\n\n\nLinkedIn Profiles\nLinkedIn Company Profiles\nLinkedIn Growth and Marketing Strategy\n\n\nInstagram Personal Profiles\nInstagram Business Profiles\nInstagram Growth and Marketing Strategy\n\n\nTwitter Business Accounts\nTwitter Personal Accounts\nTwitter Growth Strategy\n\n\nOnce you understand the fundamentals of social media and how to utilize these platforms for personal use, company use and branding, you can apply the same ideas to any social media platform. After our presentation, we''ll open up to questions.\n\n\nOur sessions are led by\n\nQuintin Ford\nQuintin has an extensive background in SEO, Social Media, and Growth Hacking. Since 2008, Quintin has been using his social media to drive sales both in person and online. He has built many successful social media accounts, websites and traffic generating systems that have contributed to his success in multiple industries. Quintin is currently the Founder of knw media and focused on bringing the Los Angeles startup community together through fun and productive events focused on business growth.\n\nAbraham Gomez\nAbraham Gomez is an extremely knowledgeable and successful social media marketing professional primarily focused on Facebook and Instagram growth.Â Abraham is currently the owner of multiple Facebook pages reaching over 100 million people every week. Additionally, he has grown several viral websites reaching millions of active users. He is the creator of a top 1000 website and has gained over 1 million email subscribers.Â Abraham is currently a partner at Fishermen Labs in Playa Vista, CA and founder of Lotus Gaming.\n\nDerek Fujinaga\nDerekâ€™s background consists of social media growth, building businesses, and management. Heâ€™s participated in multiple startups over the last 6 years, including agencies, restaurants, service companies, and a brewery. When starting out, he found his love for entrepreneurship by leading young entrepreneurs in developing and creating their own startups in college. He is passionate about working with non-profits and managing their online growth.\n\nAngel Davalos\nAngel has an extensive knowledge of social media growth and advertising. He is currently the advertising director for both Fishermen Labs and Lotus Gaming.Â Over the years he has managed ads for celebrities, ecomm sites, non-profits, and startups. He is passionate about positive growth and reaches over 500,000,000 people a month.\n\n\n\n\nHow our sessions work.\nWe host these live online classes out of our office in Playa Vista, CA. Guests tune in online to watch the live presentation. During the presentation, we set up a question and answer platform where participants can submit questions and have them answered.Â You''ll be sent the live streaming link 30 minutes before our presentation goes live. The email will be labeled LIVE STREAMING SOCIAL MEDIA 101\n\n\nJoin our session now and see what all the hype is about.\nTickets are limited.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30757433%2F210380681778%2F1%2Foriginal.jpg?s=c0e9dff14877bc0a7110bd4fe0b65918', 'https://www.eventbrite.com/e/digital-marketing-course-social-media-101-tickets-34588578369?aff=ebapi', 'East Lansing, MI', 42.7369792, -84.48386540000001, 'East Lansing, MI', NULL, NULL, '1496930400', '1496934000', 0, 0, 0, NULL, 1);

