INSERT INTO `app_event` (`id`, `event_type`, `eventfull_id`, `user_id`, `category_id`, `cityID`, `title`, `description`, `cover_image`, `website`, `venue`, `lat`, `lng`, `location`, `email`, `mobile`, `start_time`, `end_time`, `totallike`, `totalshare`, `totalfavorite`, `i_date`, `deleted`) VALUES
(1, 'live', '32322655934', 13, 0, 4, 'Celebration of Success 2017', 'PLEASE JOIN US\nfor Speak It Forward''s 2017 Celebration of Success, with MC''s Gabriel Giron and Kirk Latimer of Kinetic Affect!\nThis event will showcase talented youth voices from the Kalamazoo Public Schools, Lakeside Academy, the Calhoun County Juvenile Home and Gryphon Place Crisis Center as well as local guest artists, musicians and DJ Conscious! This event isimportant for the students as it provides them a stage and experiential opportunity to share their stories in front of an audience of community members who supports them and positively reflects back the significance of their journey. The evening will be both energizing and transformational - donâ€™t miss this powerful experience to support the youth in our community and celebrate their accomplishments!\nPlease join us after the show for refreshments and conversations with the students and artists.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28639597%2F47850764966%2F1%2Foriginal.jpg?s=de3cc7269e02e506538d0fe099e70039', 'https://www.eventbrite.com/e/celebration-of-success-2017-tickets-32322655934?aff=ebapi', '714 South Westnedge Avenue, Kalamazoo, MI 49007', 42.28461799999999, -85.59042160000001, '714 South Westnedge Avenue, Kalamazoo, MI 49007', NULL, NULL, '1494595800', '1494603000', 0, 1, 0, NULL, 1),
(2, 'live', '19157619957', 13, 0, 4, 'Great Lakes Book Bash 2017', 'A two-day event in 2017, Great Lakes Book Bash is going to be an epic experience that you won''t want to miss. It''s more than just a book signing. There will be informational panels geared towards authors, readers, and bloggers.Â \nFor more information about the event, please visit our website at www.greatlakesbookbash.com.\n\nThursday 10/26/2017\n7pm - Registration will open to exhibitors and assistants\n7-9pm - Exhibitor set-up\n\nFriday 10/27/2017\n9:30-10:30am - Opening announcements and keynote speech from M.R. Polish (everyone is welcome to come to the opening announcements and keynote speech - no ticket required)\n10:00am - registration opens for ALL ticket holders\n11am-2pm - Author signing (bring your own books or buy them from the authors)\n3pm-7pm - Informational panels\n\nSaturday 10/28/2017\n10:00am - registration opens for ticket holders\n10:30am - VIP entrance to Author Signing (Rock Star ticket holders)\n11:30 am-2pm - ALL ticket holder may enter the Author SigningÂ \n2pm-3pm - Exhibitor break-down\n3pm-6pm - Informational panels\n\n(The schedule of events is subject to change at any time. The most up to date version of the schedule can be found on our website at the address listed above.)', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F17453420%2F110863023639%2F1%2Foriginal.jpg?s=2973557d0c605da8ce28f6ce3fe440c9', 'https://www.eventbrite.com/e/great-lakes-book-bash-2017-tickets-19157619957?aff=ebapi', '100 West Michigan Avenue, Kalamazoo, MI 49007', 42.292209, -85.58378900000002, '100 West Michigan Avenue, Kalamazoo, MI 49007', NULL, NULL, '1509076800', '1509186600', 0, 0, 0, NULL, 0),
(3, 'live', '32745694253', 13, 0, 4, 'Masquerade for MyTurn', 'Removing the Mask and Giving a Face to ALS\n\n\n\n\npremium hors d''oeuvres Â | Â two drink tickets + cash bar Â | Â dance floor Â | Â photo booth Â | Â silent auction Â | Â 50/50 raffle\n\n\n\n\n\nMasquerade for MyTurn is a community social and fundraising event hosted by Western Michigan University MBA students to bring awareness to amyotrophic lateral sclerosis (ALS).\nIn addition to raising ALS awareness, we also aspire to support our community partner, MyTurn, which was formed by Scott Matzka.Â  Scott is a 38-year-old father of two who was diagnosed with ALS in September 2015.\nAny donation helps. If you cannot attend, or wish to make a gift beyond the ticket purchased here, please visit our GoFundMe.\nPlease email us atÂ MBAsForMyTurn@gmail.com:\n\n\nIf you have any questions about the event.\n\n\nTo inquire about event sponsorship opportunities.\n\n\nTo contribute a donation for silent auction.\n\n\nTo sponsor an undergraduate student ticket.\n\n\n\nFAQs\nAre there ID or minimum age requirements to enter the event?\nAll ages welcome.Bar service by Radisson staff.\nWhat should I wear to the event?\nSemi-formal attire recommended.\nDo I need to bring a mask?\nWe will have complimentary masks available.But, you are welcome to bring your own!\nDo I have to bring my printed ticket to the event?\nPrint or digital (on mobile device) ticket required.\n\nThank you to our valued sponsors and silent auction donors!\nPlatinum Sponsors:\n\n\nGold Sponsors:\n\n\nSilver Sponsors:\n\n\nSilent Auction Donors:\n\n\n5-Star Pizza / Broadway Grille\n\n\nAirway Fun Center\n\n\nBell''s Brewery\n\n\nGrand Rapids Griffins\n\n\nJersey Giant Subs\n\n\nKalamazoo Growlers\n\n\nPaul Roosa, WMU MBA Student\n\n\nScott Lemons, WMU MBA Student\n\n\nThe Dome Sports Center\n\n\nSky Zone Trampoline Park', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29199639%2F204530154772%2F1%2Foriginal.jpg?s=50fc9d166d81bba947975e346017f14c', 'https://www.eventbrite.com/e/masquerade-for-myturn-tickets-32745694253?aff=ebapi', '100 West Michigan Avenue, Kalamazoo, MI 49007', 42.29220900000001, -85.58378900000002, '100 West Michigan Avenue, Kalamazoo, MI 49007', NULL, NULL, '1492781400', '1492799400', 0, 0, 0, NULL, 1),
(4, 'live', '31528034199', 13, 0, 4, 'Delta Sigma Theta Sorority, Inc. Delta Upsilon Annual Crimson and Cream Ball', 'Join the Delta Upsilon Chapter of Delta Sigma Theta Sorority, Inc. as we celebrate Scholastic Achievement and Recognition at the 54th Annual Crimson and Creme Scholarship Ball. An RSVP is required to attend the event, but it is free to attend. If you wish to support us by purchasing an ad that can be done here as well.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27738426%2F50714084878%2F1%2Foriginal.jpg?s=3714784a4b0511c819d1a0dabff79ae7', 'https://www.eventbrite.com/e/delta-sigma-theta-sorority-inc-delta-upsilon-annual-crimson-and-cream-ball-tickets-31528034199?aff=ebapi', '1903 West Michigan Avenue, Kalamazoo, MI 49008', 42.28482459999999, -85.61224270000002, '1903 West Michigan Avenue, Kalamazoo, MI 49008', NULL, NULL, '1492864200', '1492878600', 0, 0, 0, NULL, 1),
(5, 'live', '32512105583', 13, 0, 4, 'Most Likely to Succeed', 'Please join Western Michigan Universityâ€™s Office for SustainabilityÂ at the Fetzer Centerâ€™s Kirsch AuditoriumÂ for a free community event. We will screen the Sundance-selected documentary Most Likely to Succeed. Following the screening, we will host a panel discussion on systemic challenges in education and a post-show reception.\nAbout The Film:\nMost Likely to Succeed examines the history of education in the United States, revealing the growing shortcomings of conventional education methods in todayâ€™s world. The film explores compelling new approaches that aim to revolutionize education as we know it. After seeing this film, the way you think about â€œschoolâ€ may never be the same. Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â Â \nPanelists:\nDania Bazzi: SuperintendentÂ Galesburg-Augusta Community Schools Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â Â  Â  Â  Â \nDave Campbell:Â Superintendent of Kalamazoo RESA Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â \nJill Hermann-Wilmarth: WMU Professor of Socio-Cultural Studies Â  Â  Â  Â \nGary Miron:Â WMU Professor of Evaluation, Measurement and Research\nBeth Washington: Director, Diversity & Inclusion for Bronson Healthcare\nDiscussant:\nRob Riordan: Co-founder of High Tech High and President Emeritus of the HTH Graduate School of Education\nSpread The Word: Please forward this invitation to your network, share on your social media pages, and tag MLtS accounts: Twitter: @MLTSfilm and #MLTSfilm Facebook: Facebook.com/MLTSFilm\nhttps://wmich.edu/sustainability/events/mlts\n Share this event onÂ FacebookÂ andÂ Twitter  We look forward to seeing you!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28895025%2F204637403293%2F1%2Foriginal.jpg?s=b1b8ca727c3275611c3a4d700c699f48', 'https://www.eventbrite.com/e/most-likely-to-succeed-tickets-32512105583?aff=ebapi', 'Fetzer Center - Kirsch Auditorium 2350 Business Ct, Kalamazoo, MI 49006', 42.2844027, -85.61882709999998, 'Fetzer Center - Kirsch Auditorium 2350 Business Ct, Kalamazoo, MI 49006', NULL, NULL, '1492002000', '1492012800', 0, 0, 0, NULL, 1),
(6, 'live', '32886135316', 13, 0, 4, 'Kzoo Spartans 2nd Annual MSU Means Business!', 'Kzoo Spartans 2nd Annual MSU Means Business!\r\nJoin fellow Spartans for an informal networking event at Bell''s. Come when you can, leave when you must. No charge to attend, but we do ask that you RSVP. Â Appetizers will be provided and a cash bar will be available.\r\nAt the event, we will honor Dr. Bob Page for his service and contributions to the club over the past decade. Dr. Page still remains involved with the club and serves as the co-chair of the annual golf outing. During his tenure as Club President, the club contributed over $100,000 towards various MSU projects and programs. Please join us at Bell''s to celebrate his success and network with your fellow Spartans.\r\nGo Green!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29353053%2F152983004976%2F1%2Foriginal.jpg?s=55bf392e14bd44138cd5db06d8cc0bc5', 'https://www.eventbrite.com/e/kzoo-spartans-2nd-annual-msu-means-business-tickets-32886135316?aff=ebapi', '355 East Kalamazoo Avenue, Kalamazoo, MI 49007', 42.29510579999999, -85.57886389999999, '355 East Kalamazoo Avenue, Kalamazoo, MI 49007', NULL, NULL, '1492430433', '1492437633', 1, 0, 0, NULL, 1),
(7, 'live', '29221903500', 13, 0, 4, 'Just Between Friends Kalamazoo FREE ADMISSION Pass - Spring 2017', 'The Nation''s Leading Children''s Consignment Sales Event happens twice a year.Â  This is the place to find everything for your family from infant to teen, maternity, baby equipment, toys, books, and more at up to 50 -90% off retail.Â  Event opens to the public Thursday, May 4, 2017 at 4pm and runs through Saturday, May 6, 2017.Â  \nUse this FREE ADMISSION pass to join us on Thursday, May 4th from 4:00p-9:00p and save the $3 Admission Fee.\nThis is a very well organized event, all clothing organized by size and gender.Â  Visa, MC, Discover and Cash accepted at the event.\nBoutique clothing at Bargain prices.Â  Tons of baby equipment such as strollers, cribs, floor toys, bassinets, outdoor toys and more.\nFor more details visit http://kalamazoo.jbfsale.com\nOnce purchased, tickets are non-refundable however are transferable should the original purchaser wish to give their ticket to someone else!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F25698281%2F180165696121%2F1%2Foriginal.jpg?s=25afafa04bef9df6f2f6b18915d9873c', 'https://www.eventbrite.com/e/just-between-friends-kalamazoo-free-admission-pass-spring-2017-tickets-29221903500?aff=ebapi', '2900 Lake Street, Kalamazoo, MI 49048', 42.2777376, -85.54365439999998, '2900 Lake Street, Kalamazoo, MI 49048', NULL, NULL, '1493893800', '1493911800', 0, 0, 0, NULL, 1),
(8, 'live', '33084573851', 13, 0, 4, 'Project Uplift B.L.A.C.K Awards', 'No better way to end the semester than to recognize WMU''s brightest broncos! Come joinÂ ProUÂ as we acknowledge our peers for all that they do. Join us for a night of fun that will include dinner catered by the WMUÂ FetzerÂ center, music byÂ djÂ Heavy-D and lots more. please come dressedÂ professionally. Seats are limited so be sure to get RSVP now!Â \nÂ \nFAQs\nÂ \nHow can I contact the organizer with any questions?\nDeborah Wilson Deborah.a.wilson@wmich.edu\nChristian Copeland christian.a.copeland@wmich.edu\nDo I have to bring my printed ticket to the event?\nÂ Yes, you will not be permitted to enter without it!\nIs it ok if the name on my ticket or registration doesn''t match the person who attends?\nÂ NO!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29601994%2F169460800747%2F1%2Foriginal.jpg?s=f446cb6fb3c36da666e147c55d1de4c8', 'https://www.eventbrite.com/e/project-uplift-black-awards-tickets-33084573851?aff=ebapi', '2350 Business Court, Kalamazoo, MI 49008', 42.2851252, -85.618, '2350 Business Court, Kalamazoo, MI 49008', NULL, NULL, '1491744600', '1491753600', 0, 0, 0, NULL, 1),
(9, 'live', '32190130547', 13, 0, 4, 'Kalamazoo X Conference 2017', 'The Kalamazoo X ConferenceÂ is a one-day, single track, conference focused on inspiring technologists to have a fulfilling career. Â While there are many great technical conferences in the region, their focus tends toward new technologies and skills.Â The Kalamazoo X ConferenceÂ intends to uniquely complement those conferences by enabling attendees to improve their soft skills.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28458037%2F1320133699%2F1%2Foriginal.jpg?s=961e8cd1a2e5c283fe965ffd122d8388', 'https://www.eventbrite.com/e/kalamazoo-x-conference-2017-registration-32190130547?aff=ebapi', '2350 Business Ct, Kalamazoo, MI 49008', 42.2844032, -85.61882600000001, '2350 Business Ct, Kalamazoo, MI 49008', NULL, NULL, '1493433000', '1493465400', 0, 0, 0, NULL, 1),
(10, 'live', '32265461865', 13, 0, 4, 'STAR Awards 2017', 'STAR Awards (Sharing Time And Resources) celebrates volunteerism by recognizing and awarding individuals and groups who volunteer their time, energy, and talents in service to others throughout our greater Kalamazoo Community.Â  Nonprofit staff, volunteers, and community members come together to recognize STAR Award nominees and winners, hear their stories, and celebrate volunteering.Â \nÂ \n7:15am-8am Coffee, Light Breakfast, & Social 8am-9am Awards Ceremony\nThe Radisson Plaza Hotel - Kalamazoo\nÂ \nWe look forward to seeing you there!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28557847%2F141253028917%2F1%2Foriginal.jpg?s=55808ccda514816fa1d4e5b1c99cd566', 'https://www.eventbrite.com/e/star-awards-2017-tickets-32265461865?aff=ebapi', '100 West Michigan Avenue, Kalamazoo, MI 49007', 42.29220900000001, -85.58378900000002, '100 West Michigan Avenue, Kalamazoo, MI 49007', NULL, NULL, '1492479900', '1492486200', 0, 0, 0, NULL, 1),
(11, 'live', '31968846681', 13, 0, 4, 'Build IT Together Kalamazoo 2017', 'On May 31st, the Build IT Together Kalamazoo will bring together executives and IT leaders to explore the holistic role of technology in improving business. The afternoon event will be held at the Radisson Plaza Hotel and attendees will take away actionable insights to enliven culture and foster innovation through the use of technology.\n\nThe event agenda includes a mix of speakers, panel discussions, and networking sessions. Topics will vary, and are based on survey results sent to over 500 Michigan based Build IT Togehter community members. Important topics highlighted in this year''s survey include:Â \n\nGoal setting, KPIs and cultural alignment\nPractical Security strategies\nBig Data analysis & data driven decision making\nBuilding and engaging a remote workforce\n\nEach ticket also includes a catered lunch and dinner hors d''ouerves.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28687033%2F142978928231%2F1%2Foriginal.jpg?s=a5ad11384538065511b87d9ba1f3c030', 'https://www.eventbrite.com/e/build-it-together-kalamazoo-2017-tickets-31968846681?aff=ebapi', '100 West Michigan Avenue, Kalamazoo, MI 49007', 42.29220900000001, -85.58378900000002, '100 West Michigan Avenue, Kalamazoo, MI 49007', NULL, NULL, '1496212200', '1496237400', 0, 0, 0, NULL, 1),
(12, 'live', '30730401458', 13, 0, 4, 'Just Between Friends Kalamazoo Children & Maternity Consignment Sales Event-1st Time Parents/Grandparents/Foster Parents', 'The Nation''s Leading Children''s Consignment Sales Event happens twice a year.Â  This is the place to find everything for your family from infant to teen, maternity, baby equipment, toys, books, and more at up to 50 -90% off retail.Â  Event opens to the public Thursday, May 4th at 4pm and goes through Saturday, May 6, 2017.Â  Presale is FREE for Volunteers, Consignors, First Time Parents/Grandparents and Foster Parents plus 1 guest.Â  If you fall into one of these categories and would like to shop the best deals first, register here.Â  This will allow you to shop, Thursday, May 4, 2016 from 2:00pm-8:00pm.\nJoin us for an amazing and very organized event, all clothing organized by size and gender.Â  Visa, MC, Discover and Cash accepted at the event.\nBoutique clothing at Bargain prices.Â  Tons of baby equipment such as strollers, cribs, floor toys, bassinets, outdoor toys and more.\nFor more details visit www.kalamazoo.jbfsale.com\nOnce purchased, tickets are non-refundable however are transferable should the original purchaser wish to give their ticket to someone else!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26932724%2F180165696121%2F1%2Foriginal.jpg?s=916cf97f6162c0789661f76e0a96d054', 'https://www.eventbrite.com/e/just-between-friends-kalamazoo-children-maternity-consignment-sales-event-1st-time-tickets-30730401458?aff=ebapi', '2900 Lake Street, Kalamazoo, MI 49048', 42.2777376, -85.54365439999998, '2900 Lake Street, Kalamazoo, MI 49048', NULL, NULL, '1493886600', '1493908200', 0, 0, 0, NULL, 1),
(13, 'live', '30525175622', 13, 0, 4, 'SCRABBLE Fest 2017', 'The Kalamazoo Literacy Council''s 7th Annual SCRABBLE Fest is a great way to have fun while supporting the community of Kalamazoo. Register as a single player or on a team and compete with over 100 other players. Enjoy food and drink provided by Bell''s and participate in literacy!Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26822533%2F110597838245%2F1%2Foriginal.jpg?s=2d956775ffb76fb383868ae82019a4fe', 'https://www.eventbrite.com/e/scrabble-fest-2017-registration-30525175622?aff=ebapi', '355 East Kalamazoo Avenue, Kalamazoo, MI 49007', 42.29510579999999, -85.57886389999999, '355 East Kalamazoo Avenue, Kalamazoo, MI 49007', NULL, NULL, '1491633000', '1491645600', 0, 0, 0, NULL, 1),
(14, 'live', '32263945329', 13, 0, 4, 'MIX | 2017 Launch', 'MIX is all about bringing Southwest Michigan''s creatives together to celebrate the great innovation happening throughout our region. This is the place to connect if you''re passionate about creativity, from graphic design to architecture to music to landscaping - you name it. Whether you''re checking us out for the first time or have been with us from the start, join us for a drink (or two) as we kick off our 2017 series of events!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28556190%2F53047126646%2F1%2Foriginal.jpg?s=9616fffafd613b0ee1164c24c4c3d40f', 'https://www.eventbrite.com/e/mix-2017-launch-tickets-32263945329?aff=ebapi', '701 E Michigan Avenue, Kalamazoo , MI 49007', 42.2947551, -85.57252249999999, '701 E Michigan Avenue, Kalamazoo , MI 49007', NULL, NULL, '1493206200', '1493213400', 0, 0, 0, NULL, 1),
(15, 'live', '30614791666', 13, 0, 4, 'Exhibitor Booth Registration for Empowered Conference 2017', 'Thank you so much for your interest in showcasing your product at the Valley Girls Empowered Conference on May 5-6, 2017! This is going to be an amazing event, with an expected attendance of over 1,200 ladies! Â We are so excited to have you join us. Â Your $50 registration will reserve one 8ft x 6ft booth space for you, which can fit your 8ft product table. Â Please click â€œTicketsâ€ to complete your registration today! Â After registering, you''ll receive an email to the email address you provide, which will include all of the details you''ll need to have a fantastic experience as an Exhibitor!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27876672%2F146866069071%2F1%2Foriginal.jpg?s=1889a6bfa17b87d659f98ff8b358a852', 'https://www.eventbrite.com/e/exhibitor-booth-registration-for-empowered-conference-2017-tickets-30614791666?aff=ebapi', '2500 Vincent Ave, Kalamazoo, MI 49024', 42.2395674, -85.62112339999999, '2500 Vincent Ave, Kalamazoo, MI 49024', NULL, NULL, '1493985600', '1494088200', 0, 0, 0, NULL, 1),
(16, 'live', '32055160849', 13, 0, 4, 'Kidamazoo Splash 2017', 'Start your kid''s summer off with aÂ SPLASH!Â It will be 4 fun packed days that your child won''t forget! Some of the activities will include: A Water Park with inflatable water slides and even a foam pit to jump into, an inflatable park with a 70 ft. inflatable tropical obstacle course to run through and a zip line to zip down, a Sports Corner, Crafts, Dramas, Mobile Zoo, Sno-Cones, Cotton candy and so much more! Â All of this for only $99 if you sign up before May 28th. After May 28th the price will increase to $139. This event is open to all so now is a perfect time to grab your friends and sign up as a group! Spots are limited so sign up online at valleyfamilychurch.org Â or at the info center!\nParent Questions:\nÂ After Iâ€™ve registered my child, whatâ€™s next?\n\nPrint your child confirmation receipt and bring it with you on the first day of Splash.\n\nÂ How does daily Check-In work?\n\nCheck-In is open between 8:00-8:45am\nYou will need to park and escort your child inside each day.\n\nHow does Check-Out work?\n\nSplash ends at 3:30pm. Park your car and walk to the pick up area in front of the building. Your child can be picked up between 3:15 and 3:30 pm.\nLook for your childâ€™s color group, they will be in the same location each day. Â Once you find your childâ€™s group, you will be checked out by your childâ€™s group lead teacher.\nChildren will NOT be in their check-out locations before 3:15pm. Parents who arrive earlier than 3:15pm will be asked to wait in their car.\nYou will be receiving a check-out card with your childâ€™s name and grade on it, on Monday morning. Bring your check-out card with you everyday for pick-up. If someone else is picking up your child, be sure to give that person one of your childâ€™s check-out cards with a parental permission note stating who will be picking up your child.Â \n\nWhat should I do with my childâ€™s medications?\n\nBring medications in their original labeled containers on the first day of Splash and drop them off at the First Aid table located outside of the Kidamazoo game room. Please pick up your childâ€™s medication at the end of the day on Thursday.Â \n\nWhat provision is made for children with nut or dairy allergies?\n\nA separate area is provided in the lunch area for children with nut/dairy allergies. Group leaders are also made aware of children who have food allergies and these children are given an additional wristband to wear.\n\nWhat should my child bring to Splash?\n\nYour printed confirmation receipt on the first day only.\nYou child will be receiving a colored wristband on the first day. They will beÂ REQUIREDto wear this daily. This wristband will be their admission for the remainder of the days.\nEach day, bring a sack lunch and a drink in a labeled backpack. We also provide snacks like sno-cones, cotton candy, popcorn, water and Gatorade throughout the day.\nPre-apply sunscreen daily.\nWear a swimsuit under clothes and bring a towel. (All belongings should be clearly marked with your childâ€™s name and grade!)\n\nWhat items are not allowed at Splash?\n\nCell phones\nIPods\nElectronic gaming devices', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28291200%2F138192419579%2F1%2Foriginal.jpg?s=780f50541281bac94b0a021c4396a878', 'https://www.eventbrite.com/e/kidamazoo-splash-2017-tickets-32055160849?aff=ebapi', '2500 Vincent Avenue, Portage, MI 49024', 42.238431, -85.620521, '2500 Vincent Avenue, Portage, MI 49024', NULL, NULL, '1498446000', '1498730400', 0, 0, 0, NULL, 1),
(17, 'live', '32846841788', 13, 0, 4, 'InterCom 2nd Friday Event: Kzoo Nonprofit Communications Survey', 'Nonprofit Communications: What''s Happening in the Kalamazoo Region?\n\nWhat marketing and communication issues are keeping nonprofit leaders up at night? What do they see in the coming year regarding staffing and budgets? How do local organizations compare to nonprofits nationally?\n\nThese are a few of the questions InterCom sought to answer with a Kalamazoo Area Nonprofit Marketing/Communications Survey conducted with the help of ONEplace and completed in February.Â \n\nWeâ€™ll discuss what we learned and possible implications for both the nonprofit and communication industry sectors at InterComâ€™s 2nd Friday Speakersâ€™ Series on April 14. This event is FREE and open to the public â€“ we''re waiving the usual $10 charge for nonmembers!\n\nThrough small-group dialogue, communications professionals will have the opportunity to hear from nonprofit leaders about vital needs for their organizations -- while nonprofit pros can pick up marketing tips and best practices from area communications experts. Join us!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29406137%2F147249508489%2F1%2Foriginal.jpg?s=000dc6c6fb86f80e45a8ea7080683fd9', 'https://www.eventbrite.com/e/intercom-2nd-friday-event-kzoo-nonprofit-communications-survey-tickets-32846841788?aff=ebapi', '202 North Rose Street, Kalamazoo, MI 49007', 42.2929161, -85.58368730000001, '202 North Rose Street, Kalamazoo, MI 49007', NULL, NULL, '1492149600', '1492155000', 0, 0, 0, NULL, 1),
(18, 'live', '26781108015', 13, 0, 4, 'Dokidokon 2017!', 'Come join us for year one of Dokidokon! A brand new anime & gaming convention taking place in beautiful Kalamazoo Michigan!\n3 days of panels and events including: Anime Idol, Cosplay Foam Fighting, Karaoke, Team events, Tabletop gaming and video game room, and more!\nWe appreciate your support and hope to see you at Dokidokon!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26963786%2F167842886071%2F1%2Foriginal.jpg?s=97a0e32d1c25d87fcf1ae12f5eceed98', 'https://www.eventbrite.com/e/dokidokon-2017-tickets-26781108015?aff=ebapi', '3600 East Cork Street Court, Kalamazoo, MI 49001', 42.25846909999999, -85.53505129999996, '3600 East Cork Street Court, Kalamazoo, MI 49001', NULL, NULL, '1501223400', '1501410600', 0, 0, 0, NULL, 1),
(19, 'live', '31851593975', 13, 0, 4, 'Kalamazoo Social Media Week', 'Kalamazoo Social Media week features a variety of speakers both local and regionally focused on social media marketing and trends. The purpose of this conference is to provide affordable education on social media marketing for professionals seeking continuing development in this area. \nFor conference agenda and speaker line, please visit http://www.kalamazoosocialmedia.com', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29112748%2F3993896938%2F1%2Foriginal.jpg?s=3e513621a4cf859a8ec0d5665485856e', 'https://www.eventbrite.com/e/kalamazoo-social-media-week-tickets-31851593975?aff=ebapi', '100 West Michigan Avenue, Kalamazoo, MI 49007', 42.29220900000001, -85.58378900000002, '100 West Michigan Avenue, Kalamazoo, MI 49007', NULL, NULL, '1492601400', '1492781400', 1, 0, 1, NULL, 1),
(20, 'live', '33289918041', 13, 0, 4, 'Region 8 VCAT Quarterly Face to Face Meeting', 'We will be meeting at the Anna Whitten Hall of Kalamazoo Valley Community College Arcadia Campus.Â  Parking will be in the parking garage north of Eleanor St.Â  Parking Ramp 4.Â  Parking will be validated.Â  An email reminder will go out prior to the event with a detailed map.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29857330%2F147328754354%2F1%2Foriginal.jpg?s=71b23ec1f945b99837d1b0511dd7f928', 'https://www.eventbrite.com/e/region-8-vcat-quarterly-face-to-face-meeting-tickets-33289918041?aff=ebapi', '202 North Rose Street Anna Whitten Hall, Kalamazoo, MI 49007', 42.3042239, -85.58693519999997, '202 North Rose Street Anna Whitten Hall, Kalamazoo, MI 49007', NULL, NULL, '1492489800', '1492497000', 0, 0, 0, NULL, 1),
(21, 'live', '33017984681', 13, 0, 4, 'AIA SWM Community Outreach/ Public Awareness - Imagine Kalamazoo 2025', 'The AIA Southwest Michigan Chapter, through the Community Outreach/Public Awareness Committee invites and encourages our membership, associates and studentsÂ to support and become involved in a two day, open charrette initiative in support of the efforts of the City of Kalamazoo, Downtown Kalamazoo Inc.Â Imagine Kalamazoo 2025Â and the Urban Growth Initiative.Â  We encourage AIA SWM membership involvement for the full two days if at all possible or in whatever blocks of time that are available.Â \r\nThe timeline and detailsÂ for the two day event is:\r\nApril 11th, 20178 am - 1 pm - Breakfast Presentation and Walking Audit/Visioning Discussion (walking audit instructions/dividing into groups will occur about 9:15/30)1 - 4 pm -Â Open Work time - space provided within the meeting site, basic drawings materials, wifi, and power for those working on a laptop.4-7 pm - Community MeetingApril 12th, 2017Â 9 - 1 pm Open Work time - space provided within the meeting site, basic drawings materials, wifi, and power for those working on a laptop.Â ***Work needs to be wrapped up by 1 pm on the 12th in order to prepare for the reveal meeting that evening.***We will be specifically addressing the urban core area of the City of Kalamazoo and will split the downtown area up into four quadrants. Â Â The City Planning Department and DKI will provide overall leadership, as well as group/team leadership facilitators for the four separate quadrants.Â  Our membership should have a number of people who can commit to the full two days to provide continuity over the two days and from one quadrant to the others.Â  Our membership might be joined by landscape architects and urban planners, City engineering and planning staff and the interested and engaged community.\r\nThe AIA SWM City of Kalamazoo/DKI Urban Core Charrette will be held on Tuesday April 11 from 8am to 7pm and Wednesday April 12 from 9am to 7pm at the Rose Street Market, firstÂ floor.Â  Basic back grounds, trace paper, scales, pens and markers will be provided but you are encouraged to bring your own too.Â  Most of the planning and design during the charrette will be in 2-D.Â  The finished deliverables to be synthesized after the charrette may have components that are in 3-D, (Sketchup, most likely) along with the 2-D planning, design, elevations and sections and of course descriptive narratives. There will be WIFI, projectors, food and refreshments provided. Â Â \r\nAdditional information and links to background information created by theÂ Imagine Kalamazoo 2025Â and the Urban Growth Initiative will be provided to participants prior to the charrette.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29513736%2F93556985473%2F1%2Foriginal.jpg?s=f962c8d38432672ea8b3d3204932ba0f', 'https://www.eventbrite.com/e/aia-swm-community-outreach-public-awareness-imagine-kalamazoo-2025-tickets-33017984681?aff=ebapi', '303 North Rose Street, Kalamazoo, MI 49007', 42.2937916, -85.58519009999998, '303 North Rose Street, Kalamazoo, MI 49007', NULL, NULL, '1491877800', '1491985800', 0, 0, 0, NULL, 1),
(22, 'live', '33052883063', 13, 0, 4, 'UrbanZone''s Grand Opening', 'You''re invited to the UrbanZone''s Grand Opening Thursday April 20th from 3pm-7pm!Â \nFeaturing: Music Performances, Food Samples, Viewing of the Recording Studio & Education Center\nUrbanZone is a culturally sensitive community center providing a youth-driven space empowering teens in education and entrepreneurial opportunities while simultaneously housing GFM The Synergy Center counseling programs for mental health, substance abuse and support services.Â  During our Grand Opening you can meet the Youth Advisory Council, listen to clients sharing their stories, and meet the team of therapists.Â  GFM The Synergy Center has been a place for healing and restoration, helping individuals and families regain hope and dreams for their future.Â  We are excited at this expansion of the UrbanZone to better serve our community!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29557703%2F206951773267%2F1%2Foriginal.jpg?s=2c82e5fe563857c67b27e1541150c8dc', 'https://www.eventbrite.com/e/urbanzones-grand-opening-tickets-33052883063?aff=ebapi', '625 Harrison Street, Kalamazoo, MI 49007', 42.2979101, -85.57498629999998, '625 Harrison Street, Kalamazoo, MI 49007', NULL, NULL, '1492680600', '1492695000', 0, 0, 0, NULL, 1),
(23, 'live', '30541462336', 13, 0, 4, 'USA Tae Kwon Do Championships 2017', 'OPEN MARTIAL ARTS TOURNAMENT\nJoin us at Parchment High School in Parchment, MI on April 29 for the 2017 USA Tae Kwon Do Championships!Â All ages and ranks welcome. Doors open at 9am, competition begins at 11am.\nPre-registration only!\nCompetitors may register online through April 25. Registrations may also be mailed (no personal checks; money order or certified check must be postmarked by April 17) to USA Tae Kwon Do, 125 Peekstock Rd, Kalamazoo, MI 49001.\nSparring and poomse included in competitor registration!\nMust have mouthguard, headgear, groin cup, and pads to spar. All divisions will use the Daedo electronic scoring system. Daedo equipment may be rented for $10 at the event. Non-stop sparring for all ages. Double-elimination black belt sparring for ages 12 and up.\nAge Groups\n\n6 and Under\n7â€“8 Years Old\n9â€“10 Years Old\n11â€“12 Years Old\n13â€“14 Years Old\n15â€“16 Years Old\n17â€“34 Years Old\n35 and Over\n\nDivisions\n\nBlack Beltâ€”1st Dan & up\nBrown Beltâ€”2nd & 1st Gup\nBlue Beltâ€”4th & 3rd Gup\nGreen Beltâ€”6th & 5th Gup\nWhite-Yellowâ€”10thâ€“7th Gup\n\nDivisions are broken down by gup â€“ not belt color â€“ and may be combined or expanded.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26840351%2F129267700819%2F1%2Foriginal.jpg?s=8e28c5c4d5b0844972d6caeaed87f684', 'https://www.eventbrite.com/e/usa-tae-kwon-do-championships-2017-registration-30541462336?aff=ebapi', '1916 East G Avenue, Parchment, MI 49004', 42.3312494, -85.55626619999998, '1916 East G Avenue, Parchment, MI 49004', NULL, NULL, '1493436600', '1493479800', 0, 0, 0, NULL, 1),
(24, 'live', '32272317370', 13, 0, 4, 'Tasting on the Town 2017', 'Please join us for Tasting on the Town, a wine-tasting event to benefit Hospital Hospitality House of Southwest Michigan. Must be 21 to attend. Tickets are $75 per person. Sponsorship opportunities are available. For questions, please contact us at 269-341-8111 or email office@hhkz.org.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28567801%2F139422134748%2F1%2Foriginal.jpg?s=b6e55ef67e46eae7e34676b46869587c', 'https://www.eventbrite.com/e/tasting-on-the-town-2017-tickets-32272317370?aff=ebapi', '2350 Business Court, Kalamazoo, Michigan 49008', 42.2844032, -85.61882600000001, '2350 Business Court, Kalamazoo, Michigan 49008', NULL, NULL, '1492777800', '1492788600', 0, 0, 0, NULL, 1),
(25, 'live', '32532218742', 13, 0, 4, 'Strike Out Hunger - WMU', 'The Invisible Need Project is a multi-faceted initiative intended to serve students with unmet needs, while strengthening the culture of giving at Western Michigan University. The Project engages the entire campus community, encouraging all faculty, staff, administrators, and fellow students to come together to help students in need. Below is the directory to the different initiatives and student resources.\nCome support this great cause with a fun, and competative, bowling event! Price includes two games and shoe rental for a team of 4. There will be a 50/50 drawing, best ball prize givaways and prizes for high scores (kids under 12, 13-18 and 18+).\nBring 3 non perishable food items and get a ticket to win fabulous door prizes from our sponsors.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28932907%2F204738529254%2F1%2Foriginal.jpg?s=52b58a3797d767054266082ed563d9d4', 'https://www.eventbrite.com/e/strike-out-hunger-wmu-tickets-32532218742?aff=ebapi', '4500 Stadium Drive, Kalamazoo, MI 49008', 42.2714631, -85.64505580000002, '4500 Stadium Drive, Kalamazoo, MI 49008', NULL, NULL, '1491723000', '1491730200', 0, 0, 0, NULL, 1),
(26, 'live', '33242454075', 13, 0, 4, 'Fair Housing: Back to Basics', 'Please join the Fair Housing Center of Southwest Michigan at our annual Fair Housing Conference. Your presence helps support our mission to eliminate housing discrimination and promote integration.\nRegistration opens at 8:00 a.m.\n\nSponsored By\nSouthwestern Michigan Association of Realtors\nHuntington Bank\nCity of Battle Creek\nCity of Kalamazoo\nCity of Portage\nKalamazoo Community Foundation\nMichigan Department of Civil Rights\nDepartment of Housing and Urban DevelopmentÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29789945%2F156350291129%2F1%2Foriginal.jpg?s=580cafd603cb8020bab5cbe6ef66c1c6', 'https://www.eventbrite.com/e/fair-housing-back-to-basics-tickets-33242454075?aff=ebapi', '2350 Business Court, Kalamazoo, MI 49008', 42.2844027, -85.61882709999998, '2350 Business Court, Kalamazoo, MI 49008', NULL, NULL, '1493173800', '1493193600', 0, 0, 0, NULL, 1),
(27, 'live', '32129994679', 13, 0, 4, 'Annual Spring Client Meeting - Kalamazoo, MI', 'Annual Spring Client Meeting - Kalamazoo, MI\nTopics to include:\n\nEconomic and investment updates\nManaging risk in your portfolio\nRequired Minimum Distributions\nRetirement account beneficiaries\nOther financial planning topics\n\nMeeting begins at 11:00 a.m.; lunch to follow', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28381606%2F144854064945%2F1%2Foriginal.jpg?s=2a8d1ed8f7c0133e154c4b634bab3f1d', 'https://www.eventbrite.com/e/annual-spring-client-meeting-kalamazoo-mi-registration-32129994679?aff=ebapi', '2747 South 11th Street, Kalamazoo, MI 49009', 42.26457169999999, -85.65805890000001, '2747 South 11th Street, Kalamazoo, MI 49009', NULL, NULL, '1493271000', '1493281800', 0, 0, 0, NULL, 1),
(28, 'live', '33065260083', 13, 0, 4, 'Mommy and Me Painting Class', 'Join us April 23rd at North Eleven Bistro in Kalamazoo for a mother and child painting extravaganza! Both of you will work together to create one unified masterpiece. This session''s epic theme: OWLS!\n$35 includes canvas, brushes, paint and all other supplies.\nStep by step instruction provided. All skill levels welcome :)\nAdvance registration required.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29574405%2F205741619073%2F1%2Foriginal.jpg?s=7862c6e363347a7d68c86b5c6f13eb0e', 'https://www.eventbrite.com/e/mommy-and-me-painting-class-tickets-33065260083?aff=ebapi', '5585 Gull Rd, Kalamazoo, MI 49048', 42.32533859999999, -85.52011010000001, '5585 Gull Rd, Kalamazoo, MI 49048', NULL, NULL, '1492932600', '1492939800', 0, 0, 0, NULL, 1),
(29, 'live', '33433319960', 13, 0, 4, 'IAAP Kalamazoo Area LAN - APW Connections & Cocktails', 'Join us at an IAAP Connections & Cocktails for local office and administrative professionals. We look forward to connecting with IAAP members and guests. Meet up with administrative colleagues, network, make new contacts, make new friends, meet up with old friends!Â Connect locally, enjoy a night out & celebrate APW!\nAttendees are responsible to pay for their own food & beverage.\nPlease pass on this invitation to others!Â \nHostess:Â Marie Ouzoonian (mouzoonian@att.net)\nLAN Director:Â Bonnie Stuut (bonnie.stuut@mpiresearch.com)', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30051357%2F137636664335%2F1%2Foriginal.jpg?s=39573aa7b1b8cbec66b3acb701be3273', 'https://www.eventbrite.com/e/iaap-kalamazoo-area-lan-apw-connections-cocktails-tickets-33433319960?aff=ebapi', '6195 S Westnedge Ave, Portage, MI 49002', 42.2273517, -85.58883980000002, '6195 S Westnedge Ave, Portage, MI 49002', NULL, NULL, '1493208000', '1493215200', 0, 0, 0, NULL, 1),
(30, 'live', '30519975067', 13, 0, 4, 'LOUDtable Discussions', 'Tackle your toughest challenges and develop incredible ideas with like-minded marketers during this intimate, interactive program. The focus of these ideation and problem-solving discussions are more tactical in nature. Hereâ€™s how it works:\n\n\nÂ  - Each LOUDtable has a dedicated, topic and professional expert to facilitate a robust discussion\nÂ  - Visit any 3 LOUDtables you wish\nÂ  - Youâ€™ll rotate LOUDtables every 15-20 minutes\nHot topics include: analytics and research; social media and content marketing; customer journey mapping; generational marketing and consumer behavior; marketing strategy; services marketing; marketing systems and customer relationship management tools; storytelling and more.\nDiscuss the topics that are important to you. This is YOUR session!\n.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29641392%2F5866948155%2F1%2Foriginal.jpg?s=bef125dbc5071ad9b092280c04eb1bda', 'https://www.eventbrite.com/e/loudtable-discussions-tickets-30519975067?aff=ebapi', '2350 Business Court, Kalamazoo, MI 49008', 42.2851252, -85.618, '2350 Business Court, Kalamazoo, MI 49008', NULL, NULL, '1493206200', '1493213400', 0, 0, 0, NULL, 1),
(31, 'live', '32887377030', 13, 0, 4, 'Buy Local After 5 Networking Event at Elina Organics Day Spa', 'Elina Organics Â is hosting the Buy Local After 5 event in April! This is a casual networking event where you can connect with other local business professionals while enjoying drinks in a fun atmosphere and get informed about Buy Local. Stop in, make connections and enjoyÂ discounts and product samplingÂ at the April After 5!\nRSVP Here!\nWhen: Thursday,Â April 20, 2017Where: 4205 S. Westnedge Ave. Kalamazoo 49008\nThank you to our host, Elina Organics\nAbout Our Host: Elina Fedotova,Â the formulator and CEO of Elina Organics, an award winning cosmetic chemist and aesthetician. Â She hand makes her professional skin care line in her laboratory using holistic principles and organic ingredients from around the world.\nElina shares her holistic skin care philosophy with â€œElina Skin Cuisineâ€ segments on Good Morning America LIVE! and on TV shows in Chicago and West Michigan. Her spa on Chicagoâ€™s Magnificent Mile was awarded â€œBest Facialâ€ by Chicago Magazine in 2012.\nIn 2007 she founded the Association of Holistic Skin Care Practitioners (AHSCP), a nonprofit organization that provides ongoing training and education for professionals. Modern Salon called the AHSCPâ€™s annual conference a place for â€œlessons in holistic healing.â€', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29410875%2F55899392719%2F1%2Foriginal.jpg?s=367e158b7c6baf0e8f39159287a637a1', 'https://www.eventbrite.com/e/buy-local-after-5-networking-event-at-elina-organics-day-spa-tickets-32887377030?aff=ebapi', '4205 S. Westnedge, Kalamazoo, MI 49008', 42.2491118, -85.58907449999998, '4205 S. Westnedge, Kalamazoo, MI 49008', NULL, NULL, '1492687800', '1492695000', 0, 0, 0, NULL, 1),
(32, 'live', '31692725796', 13, 0, 4, 'Omni Epic Entertainment presents....Sentimental Soul Sessions w/ Meagan McNeal', 'Graceful, sultry, and blessed with infinite talent, Meagan McNeal is the future of neo-soul and R&B. Born and raised in the Southside of Chicago, she began singing at an early age, and has since honed her talents which have taken her around the world. She is ready to take the world by storm.\nLaunching her solo career in 2008, Meagan McNeal has earned the opportunity to work with some of R and B/ Soulâ€™s most respected artists. Sheâ€™s opened for the likes of Avery Sunshine, Dwele, Jon B, Sunshine Anderson and shared the stage with The Velvelettes of the legendary Motown Records. She has done background vocals for the likes of Eminem to the Oâ€™Jays. Meagan has sang in venues across the country. Â While living in California she worked as an intern for Hidden Beach Recordings, a label that has brought forth great artists like Jill Scott, Al B Sure, and Kindred. She performed in some of LAâ€™s premier music venues to raucous standing ovations.Â Her career has taken her to countries like Spain, Switzerland, Portugal, Italy and Poland to share her music with peopleÂ around the globe.\nMeagan returns to where it all began while a student at WMU, Kalamazoo, MI for ONE NIGHT ONLY Friday April 21 at Shakespeares Lower Level. This will be her first featured showcase and her return to the A Smooth Night of Jazz concert series since 2009. She will be backed by Chitown''s own, The Blaze Band. Trust me, this show will be nothing short of OMNI EPIC!!\nDoors at 7pm, with a curtain of 8pm.\nWe look forward to you joining us!\n@omniepicent', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27921834%2F47226242699%2F1%2Foriginal.jpg?s=fe030f470363bb1f99f2d481554ef1b9', 'https://www.eventbrite.com/e/omni-epic-entertainment-presentssentimental-soul-sessions-w-meagan-mcneal-tickets-31692725796?aff=ebapi', '241 E. Kalamazoo St, Kalamazoo, MI 49008', 42.2949347, -85.58069439999997, '241 E. Kalamazoo St, Kalamazoo, MI 49008', NULL, NULL, '1492781400', '1492792200', 0, 0, 0, NULL, 1),
(33, 'live', '33472164144', 13, 0, 4, 'IAAP Kalamazoo Area LAN - Excel in your Career with the Administrative Edge', 'â€œExcel in your Career with an Administrative Edgeâ€\nCost:Â Â Â Â Â Â Â Â Â Â Â Â Â Â  $55 Members / $65 Non-Members\nWhere:Â Â Â Â Â Â Â Â Â Â  WMU Fetzer Center, 2901 W Michigan Avenue, Kalamazoo, MIÂ  49008\nRecert:Â Â Â Â Â Â Â Â Â Â  7 Recertification Points\n8:00 am Â Â Â Â Â Â Â Â  Registration and Breakfast\n8:45 amÂ Â Â Â Â Â Â Â  Michelle VanderMeer from Humanergy will expand on the 50 DOs for Everyday Leadership teaches practical actions you can take to improve your leadership and get the results you need, like working towards common goals and managing conflict. Communication: Mutual Understanding focuses on how to turn communication into true mutual understanding, with a focus on functional skills that improve listening and speaking.Â  (4 recertification points)\nNoonÂ Â Â Â Â Â Â Â Â Â Â Â Â  Luncheon â€“ South of the Border\n1:15 pmÂ Â Â Â Â Â Â Â  Mary Jane Mapes from the Aligned Leader Institute will lead you to Unlock Your Potential to Engage, Influence and Lead - Have you even known: a team leader who, though competent in other ways, simply cannot command respect in executive meetings? A manager who just cannot motivate her team? Someone who seems to shine, but then crumbles in a crisis? There is an answer for those who struggle to engage, influence, and lead regardless of the situation, and it''s found in those who possess Executive Presence.Â  (3 recertification points)\nTwo breaks throughout the day, providing coffee and water and snacks. Including question and answer sessions with the Speakers, raffles for door prizes, and a book sale.\nLogistically, campus is close to the Kalamazoo Amtrak station and surrounding hotels.Â  Should you require hotel accommodations, please contact Bonnie Stuut via email for additional information and rates,Â \nLAN Director:Â Bonnie Stuut (bonnie.stuut@mpiresearch.com)', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30108369%2F137636664335%2F1%2Foriginal.jpg?s=852109931967af14c47b80677731a9ac', 'https://www.eventbrite.com/e/iaap-kalamazoo-area-lan-excel-in-your-career-with-the-administrative-edge-tickets-33472164144?aff=ebapi', '1903 W Michigan Avenue, Kalamazoo, MI 49008', 42.285144, -85.61224099999998, '1903 W Michigan Avenue, Kalamazoo, MI 49008', NULL, NULL, '1493346600', '1493377200', 0, 0, 0, NULL, 1);
