(34, 'live', '31241270481', 13, 0, 4, 'KBUOC PASTOR''S UNITY ONE CONFERENCE 2017 !', 'KBUOC PASTOR''S UNITY ONE CONFERENCE 2017:\nFAQs\nÂ What''s the refund policy?\nNon Refundable All Fee''s Final!\nHow can I contact the organizer with any questions?\n1-269-366-4564\n\nPastor''s Unity One Conference 2017 Details Below:\nPASTORÂ Dennis TillmanÂ & LADYÂ Rosa Lee TillmanKBUOC CONTACT:Â tillmansglobalgospelradio@gmail.com\n\nFace Book Event Page:https://www.facebook.com/events/328454237554511/\n\nEvent Ticket Registering Page Website Link:https://www.eventbrite.com/e/kbuoc-pastors-unity-one-conferâ€¦\n\nhttps://www.eventbrite.com/e/kbuoc-pastors-unity-one-conference-2017-tickets-31241270481\n\n\n\n\nHosted ByÂ Kbuoc Gods Ministry\n\nFriday June 30, 2017 2:00 P.M Est. through 9:00 P.M Est.Saturday July 1st, 2017 2:00 P.M Est. through 9:00 P.M Est.\n\nMINISTRY LEADERS - PASTOR''S\n\nADMISSION FEE TICKET: $20\n\nDINNER PLATE FEE TICKET: $20\n\nDinner will be served After Conference 07/01/2017!\n\nADMISSION FEE TICKET: $25DINNER PLATE FEE: $25\n\nFOR LOW INCOME FAMILIES - LOW ON FUNDS TO AFFORD REGULAR COSTS LIMITED TO HOW MANY DISCOUNTED FEE TICKETS: Must Have:\n\nMedicaid Card\n\nEBT Foodstamp Card\n\nMedicare Card\n\nEBT Cash Assistants Card\nFree Admission Fee Does Not Include Dinner Plate!\n\nDISCOUNTED ADMISSION FEE: $15DISCOUNTED DINNER PLATE FEE: $15\n\nKID''S UP TO 16 YEAR''S OLD\n\nADMISSION FEE TICKET: $5.00\n\nDINNER PLATE FEE TICKET: $5.00\n\nHOTEL''S RESERVED FOR CONFERENCE ARE DISCOUNTED FOR CHECK IN JUNE 30, 2017 CHECK OUT JULY 01, 2017 INFORMATION BELOW:\n\nDAY''S INN & SUITES HOTEL KALAMAZOO:Â 1-269-903-2433Â $62.99 A NIGHT\n\n\nFREE ADMISSION FEE TICKETS AVAILABLE HERE ONLINE AT EVENTBRITE.COM\nFRIDAY 06/30/2017Â - FROM: 2:00 P.M UNTIL: 9:30 P.M Est.WESTERN MICHIGAN UNIVERSITY BERNHARD CENTER1922 WEST MICHIGAN AVENUE KALAMAZOO, MI 49008\nEPHESIAN''S CHAPTER 4\nSATURDAY 07/01/2017- FROM: 2:00 P.M UNTIL: 6:30 P.M Est.WESTERN MICHIGAN UNIVERSITY BERNHARD CE