(35, 'live', '32022452016', 13, 0, 4, '20 Year Celebration for Bishop Daniel and Elder Valarie Cunningham', 'Join us as we honor and celebrate the Set Gifts of Greater Faith Empowerment Center, Bishop Daniel and Elder Valarie Cunningham. Â A man and women of God who have served the Lord diligently for the past 20 years in ministry. Â They have fulfilled, and continue daily to fulfill their Kingdom purpose as they are obedient to their calling. Let''s come together and celebrate them for they truly have been such a blessing to many!!\nThe celebration kicks off Friday, March 17, 2017 @ 6pm at Kfirst(5550 Oakland Dr). Â Then on Saturday, April 1 from 5-8 pm join us at the Urban Zone (625 Harrison St) for a strollling reception where you can mingle and share some personal time celebrating with Bishop and Elder. Â And last but not least on Sunday April 9 @ 4 pm at Greater Faith Empowerment Center (5805 Oakland Dr) we will have a guest speaker and give honor to our set gifts. Â Please join us in celebrating these two amazing people!!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28256760%2F147112791120%2F1%2Foriginal.jpg?s=feae80626cf234f2b6c81f0c1f51f7ca', 'https://www.eventbrite.com/e/20-year-celebration-for-bishop-daniel-and-elder-valarie-cunningham-tickets-32022452016?aff=ebapi', '5805 Oakland Drive, Portage, MI 49024', 42.23268789999999, -85.61400300000003, '5805 Oakland Drive, Portage, MI 49024', NULL, NULL, '1491733800', '1491744600', 0, 0, 0, NULL, 1),
(36, 'live', '31966439481', 13, 0, 4, 'Seita Scholars Foster Care Awareness Walk', 'The Seita Scholars Program, invitesÂ the publicÂ to join us on May 20th, 2017 for our second annual awareness 5k walk/run on Western Michigan University''s campus! This walk is an effort to spread awareness about foster care andÂ fundraiseÂ for the Seita Scholars Program. We will be passing out information about foster care and the Seita Scholars Program at the event with the hope that you will learn something new and pass on what you have learned to others!\nMay is Foster Care Awareness Month. NationalÂ Foster Care month provides anÂ opportunity for people all across the nation to focus their attention on the needs of youth in foster care.Â According to research by the Casey Family Programs, only aroundÂ two toÂ four percent of youth from the foster care system will earn a college degree as of 2010. The Seita Scholars Program is part of a larger initiative to change the college-going paradigm of youth in the foster care system.\nThe goals of the Seita Scholars Program, are to:\n\nCreate transitions that lead to success in college and career for Western Michigan University students from foster care ages 18 to 25 years old.\nDevelop a community of scholars among WMU students who have aged out of foster care, and create a safe community to deconstruct and reconstruct identity.\nEducate WMU students from foster care and their support network to enhance their professional skill set.\nTransform WMU students from foster care by integrating experiences from studentsâ€™ past to build opportunities for their future.\n\nParticipants are asked to register online prior to April 30th, 2017.Â  Registration begins at 9am and the walk will begin at 9:30AM at WMU''s Kanley track, located across from the recreation center on campus. Registration is $25 for adults and $15 for children 12 and under and includes a t-shirt, music, food and more. Once registered, a pledge form will be emailed to participants to seek donors to sponsor their lap(s) and fundraise for the Seita Scholars Program. If you are an agency looking to bring awareness to your services and/or programs, you can purchase a ticket for $50 and a table will be provided for you to set up your information.\nIf you can''t attend the walk and/or would like to attend and help a student attend, please feel free to sponsor a student for $25. For sponsorship levels and information, please contact Rachel Johnson at the email provided.\n Please join us in spreading awareness and showingÂ support for youth who experienced foster care on our campus and in the state.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29186931%2F165469082957%2F1%2Foriginal.jpg?s=44d9d36f6dc35606222b94d6e3f8dfc5', 'https://www.eventbrite.com/e/seita-scholars-foster-care-awareness-walk-tickets-31966439481?aff=ebapi', '1903 W. Michigan Ave., Kalamazoo, MI 49008', 42.285144, -85.61224099999998, '1903 W. Michigan Ave., Kalamazoo, MI 49008', NULL, NULL, '1495251000', '1495263600', 0, 0, 0, NULL, 1),
(37, 'live', '32191465540', 13, 0, 4, 'MIACCA 2015 MMC Update - KALAMAZOO', 'MIACCA is bringing 2015 MMC Update training to Kalamazoo Valley Community College, Kalamazoo, MI on Friday, May 5th, 2017.\nThe new 2015 Michigan Mechanical Code (MMC) goes into effect on April 12th, 2017. With the pace and scope of changes to Michiganâ€™s building codes, HVACR contractors, technicians, suppliers, and building officials are struggling to keep up. Â \nStriving to support excellence and success of Michiganâ€™s licensed mechanical contractors, the Michigan Air Conditioning Contractors Association (MIACCA) has designed and is offering a 2015 MMC Update Course to help position our current and future members to be successful in a new era for Michiganâ€™s HVACR industry. Â  Â Â \nCOURSE FEES: Â Members: Â $69 Â I Â Non-Members: Â $99 Â I Â Inspector/Instructor: Â $69 Â I Â Student $59(Soft cover code book available at additional cost. Code book order cut off one week before event.)\nMIACCA is utilizing three of Michiganâ€™s most respected licensed mechanical contractors to develop and offer this 3-hour 2015 MMC Update Course covering the many changes between the 2012 MMC and 2015 MMC, as well as changes between the 2012 International Fuel Gas Code (IFGC) and 2015 IFGC going into effect on April 20th, 2017.Â \nThis program focuses on commercial building mechanical and fuel gas code provisions.\nCourse Goals:\nMIACCA has assembled subject matter experts in Michigan''s building code regulations providing code change information for those seeking to understand three basic questions about new codes from a mechanical contractorâ€™s perspective:\n\nWhat do I need to do differently from the 2012 MMC & 2012 IFGC to the 2015 MMC & 2015 IFGC?\nWhat do I have to do to pass inspection?\nHow will this new code impact how I have to price projects?\n\nCourse Timeline:\n\n\n7:00AM: Registration Opens\n\n\n7:30AM: Â Course Begins\n\n\n10:30AM: Â Course Ends\n\n\n11:00AM: Â Lunch with Industry Stakeholders (included in pricing)Â \n\n\nAttendance is open to any HVACR contractor, technician, supplier representative, inspector, or instructor or student with a stake in Michigan''s mechanical industry. Â \nNew Member Discount:\nNew MIACCA Contractor Members receive one (1) free Training admission. \nÂ Â Click Here to Join!Â Â \n(Discounted $400 Dual Contractor Membership with Southeast Michigan ACCA available.)', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28459476%2F127101871401%2F1%2Foriginal.jpg?s=92dae493c45e4e0adfe9dd84aa0414e3', 'https://www.eventbrite.com/e/miacca-2015-mmc-update-kalamazoo-tickets-32191465540?aff=ebapi', '6767 W O Ave Texas Township Campus - 5830  , Kalamazoo, MI 49009', 42.29561090000001, -85.66391679999998, '6767 W O Ave Texas Township Campus - 5830  , Kalamazoo, MI 49009', NULL, NULL, '1493949600', '1493960400', 0, 0, 0, NULL, 1),
(38, 'live', '33224210508', 13, 0, 4, 'Flattering Light Anytime/Anywhere with J. Peter Fox', 'Westcott Representative, Pete Fox, will reveal simple methods for producing flattering light using off camera flash and reflectors to enhance location and studio portraits.Â  Â  Pete will provide instruction on two lighting patterns that flatter. The second half of the class will stress how to achieve the light you want, where and when you want it.\n\nJ. Peter Fox\nPete is an award winning photographer and the Technical Service Representative at Westcott. He educates clients on lighting and light modifier choices, and offers advice to photographers to aid them in solving lightingÂ \nchallenges.Â  After graduating with a Bachelor of Fine Arts from Bowling Green State University he began his career in photography as a wedding photographer.Â  Before joining Westcott,Â  Pete managed a successful senior portrait studio. He was also a national photography trainer for Prestige Portraits and previously taught studio photography at Owens College.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29762733%2F143752396875%2F1%2Foriginal.jpg?s=f1922ec58e1a9d67117e395260f99a55', 'https://www.eventbrite.com/e/flattering-light-anytimeanywhere-with-j-peter-fox-tickets-33224210508?aff=ebapi', '3602 South Westnedge Avenue, Kalamazoo, MI 49008', 42.2555321, -85.5899344, '3602 South Westnedge Avenue, Kalamazoo, MI 49008', NULL, NULL, '1495193400', '1495200600', 0, 0, 0, NULL, 1),
(39, 'live', '30730561938', 13, 0, 4, 'Just Between Friends Kalamazoo Childrens & Maternity Consignment Sales Event - Teachers, Military and First Responders', 'The Nation''s Leading Children''s Consignment Sales Event happens twice a year.Â  This is the place to find everything for your family from infant to teen, maternity, baby equipment, toys, books, and more at up to 50-90% off retail.Â  Event opens to the public Thursday, May 4th at 4pm and goes through Saturday, May 6, 2017.Â  Presale is FREE for Volunteers, Consignors, First Time Moms, Grandparents, Teachers, Military and First Responders.Â  If you fall into one of these categories and would like to shop the best deals first, register here.Â  This will allow you to shop, Thursday, May 4, 2017 from 3:00p-8:00pm.\nJoin us for an amazing and very organized event, all clothing organized by size and gender.Â  Visa, MC, Discover and cash accepted at the event.\nBoutique clothing at Bargain prices.Â  Tons of baby equipment such as strollers, cribs, floor toys, bassinets, outdoor toys and more.\nFor more details visit www.kalamazoo.jbfsale.com.\nOnce purchased, tickets are non-refundable however are transferable should the original purchaser wish to give their ticket to someone else!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26932794%2F180165696121%2F1%2Foriginal.jpg?s=44bffa49b1016277dc01d0a91af0e7a3', 'https://www.eventbrite.com/e/just-between-friends-kalamazoo-childrens-maternity-consignment-sales-event-teachers-military-and-tickets-30730561938?aff=ebapi', '2900 Lake Street, Kalamazoo, MI 49048', 42.2777376, -85.54365439999998, '2900 Lake Street, Kalamazoo, MI 49048', NULL, NULL, '1493890200', '1493908200', 0, 0, 0, NULL, 1),
(40, 'live', '31770634824', 13, 0, 4, 'SW Michigan of SFSP - April CE Class (Ethics)', 'CFP Board of Ethics - 2017\nThis the 3 hour class that is required for the State of Michigan and the 2 hours for CFP.Â  They are presented simultaneously.\nJim Gasaway, CFP,CLU,ChFC,QPA,QKA will be our presenter again this year.\nThis is the same class that was presented last year and it HAS IT''S OWN NUMBERS so if you took it last year you can do this class again and it counts.\nYou must stay for the whole class to get the credit.Â  Please plan on being in class until at least noon and bring your insurance and CFP numbers with you.\nPlease share this class with anyone you know that needs Ethics credits, this and all our classes are open to everyone, you don''t need to be a member to come.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28006038%2F182606266356%2F1%2Foriginal.jpg?s=bbd2945b5bbcf85448e1fa1c806e6cba', 'https://www.eventbrite.com/e/sw-michigan-of-sfsp-april-ce-class-ethics-tickets-31770634824?aff=ebapi', '5402 Portage Road, Portage, MI 49002', 42.2388663, -85.56079139999997, '5402 Portage Road, Portage, MI 49002', NULL, NULL, '1492570800', '1492583400', 0, 0, 0, NULL, 1),
(41, 'live', '33068840793', 13, 0, 4, 'The Digital Culture of Kids - St. Augustine Catholic School', 'Did you know that 33% of girls age 13-24 search for pornÂ monthly?Â Do you know what Musical.ly is and its risks? What are the 3 attributes of every Internet-safer home?Â \nIn the digital age, parents must be observant, engaged, and informed. We''ll use stats, stories, science, and solutions to enlighten, equip and encourage parents who want to teach their children how to use technology responsibly. This will include specific recommendations for filters and detailed explanations about apps and parental controls.Â \nThe Protect Young Eyes team, led by founder, Chris McKenna, present around the United States to students and adults about how to use technology responsibly. You can visit his website, built with parents in mind, at https://protectyoungeyes.com/blogÂ Â \nDon''t miss this free presentation for any caring adult @ St. Augustine Catholic School on May 10.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29579173%2F184702785978%2F1%2Foriginal.jpg?s=4d8ef3aa798538f597ab92fad300db45', 'https://www.eventbrite.com/e/the-digital-culture-of-kids-st-augustine-catholic-school-tickets-33068840793?aff=ebapi', '600 W. Michigan Ave., Kalamazoo, MI 49007', 42.2914949, -85.59139449999998, '600 W. Michigan Ave., Kalamazoo, MI 49007', NULL, NULL, '1494419400', '1494424800', 0, 0, 0, NULL, 1),
(42, 'live', '33267562174', 13, 0, 4, 'Kappa Alpha Psi - Gamma Beta Chapter 2017 Scholarship Ball', 'This year Gamma Beta celebrates 69 years of achievement, and we would like to cordially invite you to celebrate the chapter, celebrate the undergraduate brothers, and the outstanding students of Western Michigan University.\nThe Scholarship Ball will be held on Saturday, April 15th, 2017 on the campus of Western Michigan University in the Fetzer Center Ballroom. The Ball will start promptly at 6pm and will conclude at 9pm.Â  The chapter will be serving dinner to all guest in attendance, will give a state of the chapter address, will present awards, and have a keynote speaker. The chapter will also be presenting several scholarship to WMU students that have applied and been selected by the undergraduate brothers to receive a scholarship towards books and school supplies.\nPlease RSVP for yourself (and a +1) if applicable, so that we may have an accurate count of dinners to provide. We look forward to you joining and celebrating the successes of the Gamma Beta Chapter.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29827535%2F38356632014%2F1%2Foriginal.jpg?s=c3744e9274522652633f69aeb35933c0', 'https://www.eventbrite.com/e/kappa-alpha-psi-gamma-beta-chapter-2017-scholarship-ball-tickets-33267562174?aff=ebapi', 'Western Michigan University 2350 Business Court, Kalamazoo, MI 49008-5239', 42.2844027, -85.61882709999998, 'Western Michigan University 2350 Business Court, Kalamazoo, MI 49008-5239', NULL, NULL, '1492259400', '1492270200', 0, 0, 0, NULL, 1),
