(44, 'live', '33312660063', 13, 0, 4, 'Mommy and Me Mini Sessions TUESDAY 5-2-17', 'MUST READ...so you know exactly what to expect!!!Â \nDATE: May 2, 2017Â \nTIME: 1pm-6pm. Sessions will be up to 20 minutes long and scheduled every 20 minutes. **Only 15 spots available.**\nPRICE $100 includes two digital files. Additional digital files are available for purchase for $40/each.....or you can purchase the complete set for an additional $125. You will be shown 8-10 images to choose from the session. SESSION FEE IS NON-REFUNDABLE, CAN BE RESCHEDULED AT GREGERSEN PHOTOGRAPHY''S AVAILABILITY ON A TUESDAY OR THURSDAY AS SCHEDULE ALLOWS.Â \nIf you want to do three generational....so grandma, mom and children. We are requiring you to buy TWO spots to ensure we not only have enough time, but make sure you get all the images to choose from with in our parameters.Â \nDETAILS: These sessions will be all done in BLACK and WHITE....our vision is classic, timeless and focus on the relationship between a mother and her children. We will be offering a dark backdrop and recommend you wear black, dark gray or a dark color for this. We also are offering a white backdrop and suggest you wear white, cream or light gray. Please stay away from patterns or prints....our goal is to create clean crisp black and white images that put the focus on the relationship and not the outfits. We will photograph with the intent to show you 8-10 images to choose from. Our goal is always quality over quantity. Images will be put on an online gallery for you to view within one week after the session. It is then that you can decide on your two included digital files, and let us know if you would like more files, the complete set and take advantage of the deal we are offering below for a gallery wrapped canvas.Â \nWe are offering a special promotion for these sessions as well.....$100 off of very popular 16x20inch gallery wrapped canvas...we offer ONLY THE BEST gallery wrapped canvases and would love to make you a gorgeous wall portrait that not only will last a lifetime, but will also be cherished by so many as well. This size is a perfect size to have in your children''s room, play room or even in your master bedroom to remember how special that relationship with our little ones is each day. Â We ask you please order the wall portrait within ONE WEEK after receiving the online gallery to view your images to receive this promotion. The normal valued priced is $295 and the special promotional price is only $195. Remember these are the best canvases we have found in our industry for quality and longevity. (If you would like a larger size, we are happy to accommodate, and will honor the $100 discount at any size above 16x20in.)\nTO BOOK YOUR SESSION, PLEASE PURCHASE A TICKET WITH THE AVAILABLE TIMES LEFT.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29888983%2F163221312942%2F1%2Foriginal.jpg?s=9605e20a684adefc14d23cca7312852f', 'https://www.eventbrite.com/e/mommy-and-me-mini-sessions-tuesday-5-2-17-tickets-33312660063?aff=ebapi', '5100 East Michigan Avenue, Kalamazoo, MI 49048', 42.2890391, -85.52958189999998, '5100 East Michigan Avenue, Kalamazoo, MI 49048', NULL, NULL, '1493710200', '1493728200', 0, 0, 0, NULL, 1),
(45, 'live', '33318808453', 13, 0, 4, 'Haunted Hopkins'' House - Paranormal Investigation (Ghost Hunt)', 'The final details of the fund-raising investigation are here. You are going to have an opportunity to investigate the Haunted Hopkins'' House. Activity is experienced here almost daily and I am sure that day will be no different.The event will begin at 8pm on April 22nd and will end 4am on April 23rd.You are encouraged to bring a camera and any other paranormal tools that you own (Ouija and Tarot excluded) however if you don''t own any there will be some equipment available to borrow for the night.Refreshments will be provided; you are encouraged to bring some of your own if you have a large appetite like I do. (No alcohol please)Arrangements have been made to have world renowned medium with us during the investigation to share what (s)he sees that the rest of us may not.Whether you are a seasoned investigator or if you have just always wanted to investigate the paranormal but didn''t know how or where to do it; we would love to have you out.We will be happy to share our 40+ years of combined experience with investigators of all levels.Tickets are just $45 (plus taxes and fees) and will need to be purchased in advance. Supply is VERY limited so act now to ensure your spot.All proceeds will be put towards the restoration of the B&B.If you would like to sleep at the house after the investigation you are welcomed to do so, but since we are not yet fully renovated and furnished you will need to bring a sleeping bag or blankets.We will hold a raffle for one ( or more) of our guest rooms the night of the event. The room guarenteed to be available in the raffle will be the servant''s room. This room is one of the most active rooms in the entire house. \nThe cost for a ticket will be just 1 dollar.Â Prior registration and payment are required.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29898915%2F206417898119%2F1%2Foriginal.jpg?s=513a067d1ccfbed7a