(46, 'live', '31973479538', 13, 0, 4, 'Healthy and Fit Vendor Registration', 'The 2017 Healthy and Fit Expo is a first-class event that spot-lights over 25,000 square feet of vendors promoting healthy living, whether it be physical, mental or spiritual. Â Vendors that are selected for this event are leaders within their field and will provide information, services and/or products for the patrons. You will not find another Expo that offers such a unique opportunity to promote your business! Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28192046%2F196514569710%2F1%2Foriginal.jpg?s=f3329ed3b68065afb5ecfd5eb2340b50', 'https://www.eventbrite.com/e/healthy-and-fit-vendor-registration-tickets-31973479538?aff=ebapi', '2900 Lake Street, Kalamazoo, MI 49048', 42.2777142, -85.5436823, '2900 Lake Street, Kalamazoo, MI 49048', NULL, NULL, '1503721800', '1503793800', 0, 0, 0, NULL, 0),
(47, 'live', '32291999239', 13, 0, 4, '2017 Do-Dah Parade Application Fee', 'Do-Dah Parade started in 1984, when WKMI organizers designed the parade as a way for companies and organizations to provide unique entertainment through a parody. It was patterned after the Pasadena, California Parade called Doo Dah.Â  The purpose remains the same â€“ create the un-structured, un-proper, and totally goofy parade.Â  Maybe a better word would be a zooy outrageous costume parade.Â  Each year, participants are challenged to reinvigorate the meaning of â€œDo-Dahâ€ (a parody based on a spoof or a satire of a person, place, event or thing). Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28595354%2F28165208961%2F1%2Foriginal.jpg?s=a9c280a12fb5a9b295b30a6ddc761cdc', 'https://www.eventbrite.com/e/2017-do-dah-parade-application-fee-tickets-32291999239?aff=ebapi', '210 FARMERS ALLEY, KALAMAZOO, Michigan 49007', 42.2905488, -85.58244289999999, '210 FARMERS ALLEY, KALAMAZOO, Michigan 49007', NULL, NULL, '1496467800', '1496475000', 0, 0, 0, NULL, 1),
