(49, 'live', '33105316894', 13, 0, 4, 'Prophetic Awakening Hosted By Kingdom Empowerment Institute (KEI)', 'Prophetic Awakening Services are intended to awaken the hearts and minds of God''s people towards His kingdom purpose. Â The Service will heighten our sensitivity to the flow of the Holy Spirit. Â Prophetic words will bring healing, deliverence, clearity and direction. Â Dancing, singing, and workshiping in the spirit will cause us to operate from an atmosphere of heaven to earth. Â Come experence your own Awakening!! Â Prophetic Presbytery is immediately following service. If your interested in receiving a prophetic word please register on eventbrite. Â Prophetic Awakening services are always free, donations are accepted! Â This powerful event is hosted by Bishop Daniel and Elder Valarie Cunningham, the founders of Kingdom Empowerment Institute.\nLocation: Greater Faith Empowerment Center, 5805 Oakland Dr, Portage, MI', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29624446%2F147112791120%2F1%2Foriginal.jpg?s=d1f948d5b37a73bfebf010800557faca', 'https://www.eventbrite.com/e/prophetic-awakening-hosted-by-kingdom-empowerment-institute-kei-tickets-33105316894?aff=ebapi', '5805 Oakland Drive, Portage, MI 49024', 42.2327669, -85.61400429999998, '5805 Oakland Drive, Portage, MI 49024', NULL, NULL, '1492176600', '1492183800', 0, 0, 0, NULL, 1),
(50, 'live', '33120860385', 13, 0, 4, 'Thriving Family Event', 'â€œA thriving family is a place of belonging and becoming, where each person feels safe, cared for and loved, and is supported to develop who they are for the good of the world.â€\nToday''s families face many competing demands and challenges. How can we create a home that honors the best of where we come from and embraces the emerging challenges and opportunities of life in the 21st century?\nItâ€™s easy to get stuck reacting to the unhelpful patterns. Or itâ€™s tempting to mirror the default values of safety, security, self-focus and material success that have characterized our culture. We know that simplistic, rule-based and one-size fits all approaches wonâ€™t work. Now more than ever, we need a vision for family that is creative, intentional, soulful and globally aware.\nFamilies come in all shapes and sizes. Whether you have children, hope to have children, parent solo or with a partner, your household can be a place of BELONGING, where each person feels safe, cared for and loved AND a place of BECOMING, where you help one another develop who you are for the good of the world.\nJoin authors Mark and Lisa Scndrette for this practical workshop based on their latest book, Belonging and Becoming: Creating A Thriving Family Culture. Together we will explore tools and practices that can help your family thrive.\nSpace is limited, register early to assure you get a seat.\nWATCH VIDEO\nPlease note: This is not an overnight event. The first session is Friday evening and the second session is Saturday.\nTentative Schedule:\nFridayÂ \n\n6pm - Registration and Refreshments\n6:30pm - 8:30pm - Session One - Introduction: Belonging and Becoming\n\nSaturday\n\n9:00 - Coffee and Refreshments\n9:15 - Session Two - What Matters Most\n10:15 - Break\n10:30 Â - Session Three - Life Rhythms\n11:45 - Lunch (provided)\n12:30 - Electives AÂ Options: Finding the Right Sized LifeCultivating Spiritual Practices at Home\n1:30 - Electives BÂ Options: Supporting Character Development in Your KidsBeing a Student of Your Child/Spouse\n2:30 - Closing Q&A\n\nRegistration cost includes a complimentary copy of the book, Belonging and Becoming.Â \n\n\n\nEvent Sponsors:', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29688142%2F13066776615%2F1%2Foriginal.jpg?s=876b674004a6e8d639b8fd83a01e8566', 'https://www.eventbrite.com/e/thriving-family-event-tickets-33120860385?aff=ebapi', '2031 East Cork Street, Kalamazoo, MI 49001', 42.2602123, -85.55470409999998, '2031 East Cork Street, Kalamazoo, MI 49001', NULL, NULL, '1494592200', '1494667800', 0, 0, 0, NULL, 1),
(51, 'live', '33439072165', 13, 0, 4, 'Salut Market Presents - Colors & Cocktails: The Mobile Art Party!', 'Enjoy sipping, painting, and socializing with Colors & Cocktails at Salut Market on Thursday, April 27th from 6:00pm-8:00pm! Savor a glass of wine and a delicious spread of food from the Salut Deli as artist Lauren teaches you fabulous techniques to create your very own pair of one-of-a-kind wine glasses! No experience required, really! Tissue and handle bag provided to get your glasses home safely. Cost is $45 per person and includes a tasty spread of food from the Salut Deli (menu coming soon!) and all of your paint materials. Please try to arrive 30 minutes prior to the event to check-in, find your seat, fix a plate of deliciousness, and purchase a glass of wine from the market. Salut Market is located at 3112 S. Westnedge Ave. Kalamazoo, MI 49008\n\n\n\nFor more information and to purchase tickets, please visit: https://salutmarketaprilpaintevent.eventbrite.com', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30060213%2F54259208238%2F1%2Foriginal.jpg?s=bfc1c7ff89f7f859db781ecb104848f9', 'https://www.eventbrite.com/e/salut-market-presents-colors-cocktails-the-mobile-art-party-tickets-33439072165?aff=ebapi', '3112 South Westnedge Avenue, Kalamazoo, MI 49008', 42.2600373, -85.59079839999998, '3112 South Westnedge Avenue, Kalamazoo, MI 49008', NULL, NULL, '1493296200', '1493303400', 0, 0, 0, NULL, 1),
(52, 'live', '30255937323', 13, 0, 4, 'CHILD AND ADULT CARE FOOD PROGRAM FISCAL YEAR 2017 RECORD KEEPING TRAINING', 'Â \r\nMichigan Department of Education\r\nOffice of School Support Services\r\nChild and Adult Care Food Program\r\nFY 2017 RECORD KEEPING TRAINING\r\nYou must go to:Â Â  www.Eventbrite.com to register for this workshop.\r\nÂ \r\nCACFP reserves the right to cancel trainings due to low participation.\r\n(CACFP Instructors start the training day at 9:00am.)\r\nTopics Covered\r\n\r\n\r\nRecord Keeping (Monthly and Annual Forms)\r\n\r\n\r\nHow to Submit a Claim\r\n\r\n\r\nMenus/Nutrition/New Meal Pattern Overview\r\n\r\n\r\nMonitoring/Sponsor Responsibilities (Sponsors only)\r\n\r\n\r\nAt-Risk Afterschool \r\n\r\n\r\nInfant Menus\r\nÂ \r\n9:00am â€“ 12:00pm Record Keeping\r\nÂ \r\nLunch Break â€“ on your own \r\n(12:00pm â€“ 1:00pm) \r\nÂ \r\n1:00pm â€“ 3:00pm Menus/Nutrition/New Meal Pattern Overview\r\n1:00pm - 3:00pm Monitoring (Sponsor of Centers only)*\r\n1:00pm â€“ 3:00pm At-Risk Afterschool\r\n1:00pm â€“ 3:00pm Infant Menus\r\nÂ \r\nNOTE: You must create a log in and password on\r\nwww.Eventbrite.com to register for CACFP trainings.\r\nÂ \r\nPlease save your Log in name and Password information. \r\nCACFP staff will not have access to any log in or password information. \r\nÂ \r\nPLEASE PRINT OUT YOUR REGISTRATION CONFIRMATION!\r\nIt is recommended that you bring your ticket. \r\nHowever, you may still attend the training without the registration ticket.\r\nAttention: Persons with disabilities needing reasonable accommodations for effective participation in the workshop should contact the Child and Adult Care Food Program office at 517-373-7391. Requests for accommodations should be made at least two weeks prior to the training sessions.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26639502%2F109585801231%2F1%2Foriginal.jpg?s=0cbd5d3751f368dbbf77deec68afaa36', 'https://www.eventbrite.com/e/child-and-adult-care-food-program-fiscal