(53, 'live', '30729934060', 13, 0, 4, 'Just Between Friends Kalamazoo Children''s & Maternity Consignment Sales Event - PRIME TIME SHOPPER', 'The Nation''s Leading Children''s Consignment Sales Event happens twice a year.Â  This is the place to find everything for your family from infant to teen, maternity, baby equipment, toys, books, and more at up to 50-90% off retail.Â  Event opens to the public May 4 at 4pm through May 6, 2017.Â  Presale is FREE for Volunteers, Consignors, First Time Parents, Grandparents, Foster Parents, Teachers, Military and First Responders.Â  If you do not fall into one of these categories and would like to shop the best deals first, purchase a Prime Time Shopping Pass.Â  This will allow you to shop, Thursday, May 4, 2017 from 1:00pm-8:00pm.\nThis is a very organized event, all clothing organized by size and gender.Â  Visa, MC, Discover and Cash accepted at the event.\nBoutique clothing at Bargain prices.Â  Tons of baby equipment such as strollers, cribs, floor toys, bassinets, outdoor toys and more.\nFor more details visit www.kalamazoo.jbfsale.com\nOnce purchased, tickets are non-refundable however are transferable should the original purchaser wish to give their ticket to someone else!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26932480%2F180165696121%2F1%2Foriginal.jpg?s=ba1e946e118406c125ea2e8b59167b8e', 'https://www.eventbrite.com/e/just-between-friends-kalamazoo-childrens-maternity-consignment-sales-event-prime-time-shopper-tickets-30729934060?aff=ebapi', '2900 Lake Street, Kalamazoo, MI 49048', 42.2777376, -85.54365439999998, '2900 Lake Street, Kalamazoo, MI 49048', NULL, NULL, '1493883000', '1493908200', 0, 0, 0, NULL, 1),
