(55, 'live', '32164748629', 13, 0, 4, 'MIACCA Regional Membership Meeting - KALAMAZOO', 'MIACCA is assembling key stakeholders in Michiganâ€™s HVACR industry at a series of six (6) Regional Membership Meetings being held at community colleges around the state.Â \nThese meetings offer a place to network, learn and understand some of the many changes, new opportunities and challenges happening in Michiganâ€™s mechanical industry.\nRegister today to attend this MIACCA Regional Membership Meeting happening at Kalamazoo Valley Community College - Texas Township Campus, Kalamazoo, MI.\nMembers: Â $25 Â I Â Non-Members: Â $35 Â I Â Inspector/Instructor $25 Â I Â Student $12Â \nTopics Include:\n\n\n2015 Michigan Mechanical CodeÂ \n\n\n2015 International Fuel Gas Code\n\n\nThe Skilled Trades Act - PA 407 of 2016\n\n\nUtility-based Value Added Programs and ServicesÂ \n\n\nImpending Mechanical Rules Changes\n\n\nMIACCA HVACR Student Outreach Program\n\n\nEvent Timeline:\n\n\n10:30AM: Registration/Networking Â \n\n\n11:00AM: Â Lunch\n\n\n11:30AM: Â MIACCA Program Begins\n\n\n12:30PM: Â Open Forum/Networking\n\n\n1:00PM: Â  Â Closing Remarks\n\n\nAttendance is open to any HVACR contractor, technician, supplier representative, inspector, or instructor with a stake in Michigan''s mechanical industry. Â \nNew Member Discount:\nNew MIACCA Contractor Members get two (2) free Meeting admissions or one (1) free Training admission. \nÂ Â Click Here to Join!Â Â \n(Discounted $400 Dual Contractor Membership with Southeast Michigan ACCA available.)', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28420651%2F127101871401%2F1%2Foriginal.jpg?s=12a6315e8af009b3a3673fe347cf7f3a', 'https://www.eventbrite.com/e/miacca-regional-membership-meeting-kalamazoo-tickets-32164748629?aff=ebapi', '6767 W O Ave Texas Township Campus - 5830  , Kalamazoo, MI 49009', 42.29561090000001, -85.66391679999998, '6767 W O Ave Texas Township Campus - 5830  , Kalamazoo, MI 49009', NULL, NULL, '1493960400