(56, 'live', '33051769733', 13, 0, 4, 'Celebrate Elderhood: Honoring Wisdom and Recognizing Excellence Event', 'You are invited!\nMonths of Celebrate Elderhood activities culminate in the Honoring Wisdom & Recognizing Excellence Event being held at the Radisson Plaza Hotel at Kalamazoo Center on Thursday, May 18, 2017. This dinner and program will give recognition and awards to businesses, faith communities, service providers, direct care workers and others that exhibit standards of excellence, best practices, and innovation in serving elders in Kalamazoo County. Scholarships for county residents interested in geriatrics or becoming certified dementia practitioners will be awarded and Senior Olympians, World War II veterans, and 5th Grade essay contest winners recognized. Hosted by media personality, Lori Moore, this is an event for the entire community.\nDinner and program are included in the ticket price. Every effort will be made to seat guests together who register together. No paper or printable tickets will be issued. Reservations will be confirmed by email (or US Mail) and table number/place cards will be at the check-in table in front of the Arcadia Ballroom from 5:00 to 5:30 p.m. Entertainment, dinner and program will follow until 8:00 p.m.\nYou can pay by check and avoid the Eventbrite service fee. Please call (269)373-5147 for a reservation form, or visit Celebrate Elderhood on the Web atÂ http://www.kalcounty.com/aaa/celebrate_elderhood.htm to print the May 18 Reservation Form.\nPlease R.S.V.P. with your reservation and fee by May 8th.\nThis event is supported by community donors.\nFAQs\nWhat are my transportation/parking options for getting to and from the event?\nComplimentary self-parking in the Radisson parking ramp, N. Rose St., Kalamazoo, MI 49007.Â \nFor convenience, members of your group may be dropped off in the circle drive in front of the Radisson prior to self-parking if you so choose.Â \nValet parking is available at Radisson for a $25 charge.\n\nHow can I contact the organizer with any questions?\nPlease call (269)373-5147 or email jgboni@kalcounty.com.\n\nIs my reservation transferrable?\nYes, if you contact the organizer (269)373-5147 with the person''s name who will be attending in your place no later than May 8th.\n\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29558482%2F64669502741%2F1%2Foriginal.jpg?s=add27b8a3a88f580fadf3c39dac1254a', 'https://www.eventbrite.com/e/celebrate-elderhood-honoring-wisdom-and-recognizing-excellence-event-tickets-33051769733?aff=ebapi', '100 West Michigan Avenue, Kalamazoo, MI 49007', 42.2921734, -85.58394129999999, '100 West Michigan Avenue, Kalamazoo, MI 49007', NULL, NULL, '1495107000', '1495117800', 0, 0, 0, NULL, 1),
(57, 'live', '33266519054', 13, 0, 4, 'Marvin! Music! Memories!', 'Our KSOLeague Spring Gala theme, MARVIN! MUSIC! MEMORIES!, features as our special guest, Marvin Hamlischâ€™s wife of 29 years, Terre Blair-Hamlisch.Â  As an award-winning broadcast journalist, Terre has appeared on ABC, NBC, CPS, and PBS as well as many other networks. We are also very pleased to announce that Ruth and Ron Wiser will be our honorary chairs for this fabulous event\nDon''t miss this opportunity to meet Terre in person, and hear stories about her life with Marvin and his thrilling musical career. Â \nPlease join us for a wonderful evening including a champagne and hors d''oeuvres reception; delicious dinner with wine and desserts; Marvin Hamlisch music provided by a KSO ensemble; and, social time with your League friends.\nYou will also have the opportunity to purchase (at a KSOLeague discount) a beautiful, signed, Coffee Table Book of photos and commentary on Marvin Hamlischâ€™s illustrious career covering Musical Theater, Films, and Pops.\nIf you are unable to attend, we hope you will consider supporting this special event with a monetary contribution.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29824900%2F96268375267%2F1%2Foriginal.jpg?s=9490f9d47c0c69be3c5907e3df722eea', 'https://www.eventbrite.com/e/marvin-music-memories-tickets-33266519054?aff=ebapi', '1609 Whites Road, Kalamazoo, MI 49008', 42.2603227, -85.60676690000003, '1609 Whites Road, Kalamazoo, MI 49008', NULL, NULL, '1493294400', '1493305200', 0, 0, 0, NULL, 1),
(58, 'live', '33364496106', 13, 0, 4, 'Stand Tall Again!  45-Minute Corrective Posture Workshop', 'Flat butt? Rounded shoulders?Â  Neck pain?\nYou weren''t born with poor posture, but your modern lifestyle seems to have given it to you.\nGood news: A well-designed corrective exercise plan can progressively restore ideal length and tension to the muscles which support - and, sometimes, distort - our healthy postures.\nJoin us on Saturday April 22, 2017 at 9am or 3pm for a dynamic, interactive workshop hosted by Laura Sprague, CPT, CES.\nBenefits:\n\nGain an understanding of your unique postural distortion issues through a personalized analysis\nLearn how to care for your overtight musles through guided practice of self-myofascial release techniques and stretches\nStrengthen your underactive muscles by discovering and practicing activated isolation exercises\nAnd more!\n\nWorkshop participants will receive access to discounted personal posture training packages.Â  Limited spots available; don''t miss this opportunity!Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29960077%2F147589930881%2F1%2Foriginal.jpg?s=cabdd9055689ae05b686339d41fbea14', 'https://www.eventbrite.com/e/stand-tall-again-45-minute-corrective-posture-workshop-tickets-33364496106?aff=ebapi', '1104 South Westnedge Avenue, Kalamazoo, MI 49008', 42.2805999, -85.5899159, '1104 South Westnedge Avenue, Kalamazoo, MI 49008', NULL, NULL, '1492831800', '1492835400', 0, 0, 0, NULL, 1),
(59, 'live', '30538758248', 13, 0, 4, '2017 WOMEN''S EXPO TOURâ„¢ MICHIGAN', 'Â Join Us!\r\nÂ Fun and shopping come together atÂ the 2017 Women''s Expo Tour. Located in the finest venues throughout the US. Whether youâ€™re a woman who enjoysÂ Networking, Laughing, Competing,Â Shopping, Eating, Drinking,Â PlayingÂ â€“ or all of the above â€“ the 2017 Women''s Expo Tour Â offers a variety ofÂ fun activities for everyone---Guaranteed!Â \r\nFOR MORE INFORMATION ON TICKETS OR VENDOR AVAILABILITYÂ \r\nText/Call:Â (312) 975-0013\r\nWebsite:Â www.womensexpotour.com\r\nEmail:Â www.womensexpotour@aol.com\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26827716%2F139579526834%2F1%2Foriginal.jpg?s=eb1279f764d5bf760627b8f69f3a1905', 'https://www.eventbrite.com/e/2017-womens-expo-tourtm-michigan-tickets-30538758248?aff=ebapi', '100 West Michigan Avenue, Kalamazoo, Michigan 49007', 42.2921734, -85.58394129999999, '100 West Michigan Avenue, Kalamazoo, Michigan 49007', NULL, NULL, '1492237800', '1492259400', 0, 0, 0, NULL, 1),
(60, 'live', '33078436494', 13, 0, 4, 'SBIR/STTR Granting vs Contracting Agencies: Determining the Best Fit for Your Technology', 'An SBIR/STTR grant provides funding assistance for company-defined R&D projects that, when successful, will lead to commercial opportunities that have been identified by the proposing company. In contrast, a contract is a well-defined procurement mechanism in which the funding agency specifies obligations, responsibilities and deliverables for R&D projects that are expected to result in products or services that address a problem or opportunity at that agency.\nDetermining if your technology is best suited for a granting (i.e., NIH, NSF, DOE) or a contracting (i.e. DOD, NASA, DHS) agency will dictate many aspects of proposal preparation, from your initial planning and interactions with agency personnel to nitty-gritty details. This session will describe the differences between granting and contracting agencies, how to determine the best fit for your technology and how to tailor your proposal for each.\nLunch & Learn: Complimentary admission, but registration is required.\nPresenter: Becky Aistrup, Managing Partner,Â BBC Entrepreneurial Training & Consulting (BBCetc)\nBecky joined BBC Entrepreneurial Training & Consulting (BBCetc) as a Principal Consultant in 2012 and became a Managing Partner and co-owner in October 2016. Â Prior to joining BBC Entrepreneurial Training & Consulting in 2012, Becky was the SBIR/STTR Program Director for the Minnesota Science and Technology Authority. Beckyâ€™s professional background includes over 30 years of experience working within the medical, defense, aerospace, biotech, advanced materials and electronics industries, and consulting with technology companies on SBIR/STTR funding. Becky holds a B.A. degree in Chemistry from the University of Kansas, an M.B.A. in Marketing Management from the University of Minnesota.\nAbout BBCetc BBC Entrepreneurial Training & Consulting manages the Michigan SBIR/STTRÂ Assistance Program, which provides SBIR/STTR training and proposal development services to technology companies with costs covered in whole or in part by the state. BBCetc is nationally recognized for its success inÂ helping emerging companies win SBIR/STTR funding and use it strategically to propel growth.Â Its Michigan clients have been awarded over $194 million in funding since 2002.Â Learn more at www.bbcetc.com / 734.930.9741.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29592379%2F23846158772%2F1%2Foriginal.jpg?s=0738e7eb2486dfda6d9a7542a9aee7d4', 'https://www.eventbrite.com/e/sbirsttr-granting-vs-contracting-agencies-determining-the-best-fit-for-your-technology-registration-33078436494?aff=ebapi', '4717 Campus Dr., Kalamazoo, MI 49008', 42.2557714, -85.6455349, '4717 Campus Dr., Kalamazoo, MI 49008', NULL, NULL, '1494396000', '1494403200', 0, 0, 0, NULL, 1);
