(69, 'live', '32190152613', 13, 0, 4, 'Kalamazoo X Conference 2017 Sponsorship', 'The Kalamazoo X ConferenceÂ is a one-day, single track, conference focused on inspiring technologists to have a fulfilling career. Â While there are many great technical conferences in the region, their focus tends toward new technologies and skills.Â The Kalamazoo X ConferenceÂ intends to uniquely complement those conferences by enabling attendees to improve their soft skills.\r\nPlease review the Sponsorship Prospectus for more information.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28458274%2F1320133699%2F1%2Foriginal.jpg?s=9a0094516bb2d01270ce446e73c25c8b', 'https://www.eventbrite.com/e/kalamazoo-x-conference-2017-sponsorship-tickets-32190152613?aff=ebapi', '2350 Business Court, Kalamazoo, MI 49006', 42.284403, -85.61882579999997, '2350 Business Court, Kalamazoo, MI 49006', NULL, NULL, '1493433000', '1493465400', 0, 0, 0, NULL, 1),
