(71, 'live', '32609165893', 13, 0, 4, 'SOI Family Swing Dance', 'SOI Family Swing Dance 2017Sunday, May 21 6-9pm\nWho: Individuals and Families (minors must attend with responsible adult 21 or over)Where: St. Mary''s Catholic Church, Fr. Bart Hall 939 Charlotte Ave. Kzoo, MIWhat should I bring?: Money (cash or credit) to bid on silent auction items\nCome and enjoy an evening of fun and family. We will have dancing, finger foods and new this year, a silent auction! (Proceeds to support Servants of the Immaculata Homeschool Cooperative) Bring the whole family! Admittance is $35 per household. (The price covers 1 or 15 as long as you all live under the same roof.)\nShow up dressed in your best 50''s Swing attire*. Dress pants and a button up for the gents; Swing Dress (Fit & Flare style, rock-a-billy to give you an idea) for the ladies. Please make sure cleavage is covered and dresses are knee length or longer. Leggings are highly encouraged as dresses might fly up while dancing.Â *50''s attire highly encouraged, but not required.\nWe''ll have the hall decked out to the 9s with floor to ceiling curtains, chandeliers, mood lighting,Â hor d''oeuvres, and more. Don''t worry if you don''t know how to swing dance, we''ll have folks on hand to instruct. So bring the whole family for a night of fun and fellowship and let''s help support SOI in the process!Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29024493%2F105013936643%2F1%2Foriginal.jpg?s=a3f9b62524ee481726c332b5304e44ab', 'https://www.eventbrite.com/e/soi-family-swing-dance-tickets-32609165893?aff=ebapi', '939 Charlotte Avenue, Kalamazoo, MI 49048', 42.3007259, -85.564191, '939 Charlotte Avenue, Kalamazoo, MI 49048', NULL, NULL, '1495369800', '1495380600', 0, 0, 0, NULL, 1),
