(76, 'live', '33078079426', 13, 0, 4, 'Lunch and Learn: ABC''s of SBIR/STTR Funding', 'The governmentâ€™s Small Business Innovation Research (SBIR) and Small Business Technology Transfer (STTR) programs make over $2.6 billion in high-risk, non-dilutive (i.e., free) capital available to innovative small companies annually. The process is complex, but the impact of receiving $millions in non-dilutive funding is worth the effort.\nAttend this Lunch & Learn and find out more about the two programs and how they can provide a source of R&D funding between the initial development of your innovative idea and proof that it has potential in the marketplace. Learn about SBIR/STTR eligibility requirements, which of the 11 participating agencies best fits your technology, the differences between SBIR and STTR and more. Plus, find out about the Michigan SBIR/STTR Assistance Fund and how it can coach you through development of a competitive, compelling proposal.\nComplimentary admission, but registration is required.\nPresenter: Kris Bergman, Managing Partner\nBBC Entrepreneurial Training & Consulting (BBCetc)\nKris is a Managing Partner and co-owner of BBC Entrepreneurial Training & Consulting. Prior purchasing the company in October 2016, Kris was Principal Consultant for Grants and Contracts Management, having joined BBCetc in 2000. In addition to BBCetcâ€™s financial and business management, Kris assists clients in preparing to receive and manage federal grant and contract funds. Kris has 30 years of experience in managing schedules, finances and organizations, and was Global Sales Administrator for a major software developer in Ann Arbor, MI, prior to joining BBCetc.\nAbout BBCetc BBC Entrepreneurial Training & Consulting manages the Michigan SBIR/STTRÂ Assistance Program, which provides SBIR/STTR training and proposal development services to technology companies with costs covered in whole or in part by the state. BBCetc is nationally recognized for its success inÂ helping emerging companies win SBIR/STTR funding and use it strategically to propel growth.Â Its Michigan clients have been awarded over $194 million in funding since 2002.Â Learn more at www.bbcetc.com / 734.930.9741.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29591946%2F23846158772%2F1%2Foriginal.jpg?s=9affc1c9eec397f9ff8536442686d33c', 'https://www.eventbrite.com/e/lunch-and-learn-abcs-of-sbirsttr-funding-registration-33078079426?aff=ebapi', '4717 Campus Dr., Kalamazoo, MI 49008', 42.2557714, -85.6455349, '4717 Campus Dr., Kalamazoo, MI 49008', NULL, NULL, '1496901600', '1496907000', 0, 0, 0, NULL, 1),
(77, 'live', '33078645118', 13, 0, 4, 'How to Manage Your SBIR/STTR Grant or Contract', 'Whether you are anticipating an SBIR/STTR award or have already been funded, understanding the fundamentals necessary to manage your government dollars is key to organizing your business for success and proving your credibility for future funding. This program provides training, tips and guidance on:\n\nHow to prepare a budget\nWhat you should know about government audits\nStrategies for indirect rate development\nUsing QuickBooks to stay in compliance\nSetting up policies and procedures\n\nPresenter: Kris Bergman, Managing Partner,Â BBC Entrepreneurial Training & Consulting (BBCetc)\nKris is a Managing Partner and co-owner of BBC Entrepreneurial Training & Consulting. Prior purchasing the company in October 2016, Kris was Principal Consultant for Grants and Contracts Management, having joined BBCetc in 2000. In addition to BBCetcâ€™s financial and business management, Kris assists clients in preparing to receive and manage federal grant and contract funds. Kris has 30 years of experience in managing schedules, finances and organizations, and was Global Sales Administrator for a major software developer in Ann Arbor, MI, prior to joining BBCetc.\nAbout BBCetc BBC Entrepreneurial Training & Consulting manages the Michigan SBIR/STTRÂ Assistance Program, which provides SBIR/STTR training and proposal development services to technology companies with costs covered in whole or in part by the state. BBCetc is nationally recognized for its success inÂ helping emerging companies win SBIR/STTR funding and use it strategically to propel growth.Â Its Michigan clients have been awarded over $194 million in funding since 2002.Â Learn more at www.bbcetc.com / 734.930.9741.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29592721%2F23846158772%2F1%2Foriginal.jpg?s=277e52804cdb20a0ea00c23be650937b', 'https://www.eventbrite.com/e/how-to-manage-your-sbirsttr-grant-or-contract-registration-33078645118?aff=ebapi', '4717 Campus Dr., Kalamazoo, MI 49008', 42.2557714, -85.6455349, '4717 Campus Dr., Kalamazoo, MI 49008', NULL, NULL, '1507174200', '1507185000', 0, 0, 0, NULL, 0),
(78, 'live', '33083848682', 13, 0, 4, 'First Leaders | Tuesday, June 27, 2017', 'First Leadersfeaturing Mike OdarPresident of Greenleaf TrustSeries powered by Blue Cross Blue Shield of Michigan\nTake time to invest in yourself this summer as Mike Odar, President of Greeleaf Trust, shares his leadership insights at First Leaders in June! The wealth management firm engages its team and clients for maximum success from right here in Kalamazoo, focused on customer centricity and continuously improving best practices. Join us for a big breakfast and event bigger ideas as Mike shares how he leads a team that has set itself apart.\n\nNot sure if you are eligible for our $25 discounted ticket rate? Search for your company on our Council of 100 list here or The Chamber digital directory here.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29600779%2F53047126646%2F1%2Foriginal.jpg?s=412c68ab3218d0f5853df646284009c4', 'https://www.eventbrite.com/e/first-leaders-tuesday-june-27-2017-tickets-33083848682?aff=ebapi', '1609 Whites Road, Kalamazoo, MI 49008', 42.2603837, -85.6070312, '1609 Whites Road, Kalamazoo, MI 49008', NULL, NULL, '1498528800', '1498534200', 0, 0, 0, NULL, 1),
