(80, 'live', '33250634543', 13, 0, 4, 'VBS Hero Central 2017', 'Come Join us Monday through Thursday July 10-13, from 1 to 4pm each day for Hero Central VBS at Portage United Church of Christ!Â \nTake kids on awesome adventures alongside some of their favorite Bible heroes and discover the qualities that make us truly heroic in God.Â VBS Hero CentralÂ uses epic music, spectacular science, crafty crafts, heroic recreation, and fantastic Bible stories to help kids discover their strength in God!\nChildren who have completed their first year ofÂ preschoolÂ (and are potty-trained) through those enteringÂ 5th gradeÂ are invited to join us.Â VBSÂ will be held atÂ Portage United Church of ChristÂ atÂ 2731 West Milham Avenue, Portage, MI.Â VBS is FREE, but pre-registration is required.Â Deadline for registration is Sunday, July 2.\nTo register more than one child, change the quantity of child registrations to indicate your number of children. After you enter the information for your first child, you will be given the option to copy from the first child''s registration for each of your other children. Then you will only need to changeÂ fields such as name,Â gender, birthdate, grade, andÂ medical information.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29802305%2F165624896067%2F1%2Foriginal.jpg?s=036663aedecdcc6fee631d340f38b57f', 'https://www.eventbrite.com/e/vbs-hero-central-2017-tickets-33250634543?aff=ebapi', '2731 West Milham Avenue, Portage, MI 49024', 42.2295763, -85.62199269999996, '2731 West Milham Avenue, Portage, MI 49024', NULL, NULL, '1499671800', '1499941800', 0, 0, 0, NULL, 1),
(81, 'live', '33278327373', 13, 0, 4, 'CLA Estate Planning Workshop', 'Free workshop providing valuable information for seniors on securing one''s estate and retirement planning. You will receive a workbook and gain useful information you can act upon immediately regarding:\n- Pros and cons of wills and trusts\n- How to avoid probate\n- Long term health care concerns\n- Tax reduction planning\nCLA Estate Services is a firm devoted to assisting area residents in protecting their assets and ensuring their money lasts. Our representatives have comprehensive knowledge of estate planning issues that will help you avoid common and sometimes irreversible mistakes.\nSeating is limited. Please call 1-866-252-8721 to confirm your attendance or for more information.\nInformation in this workshop comes from a wide range of sources. For over twenty years, we have been presenting concepts that come from clients, attorneys, financial planners, government agencies, and a wide variety of private and public sources. We hope the information presented will help you have a better understanding of your planning choices.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29841669%2F122717991559%2F1%2Foriginal.jpg?s=9853dd5704313fe4d8ff5782956a973b', 'https://www.eventbrite.com/e/cla-estate-planning-workshop-tickets-33278327373?aff=ebapi', '5402 Portage Road, Portage, MI 49002', 42.238868, -85.56078100000002, '5402 Portage Road, Portage, MI 49002', NULL, NULL, '1493785800', '1493796600', 0, 0, 0, NULL, 1),
