(84, 'live', '33322388160', 13, 0, 4, 'Kindergarten Round Up 2.0--Scavenger Hunt Style', 'Second of a 3-part Kindergarten Round Up series of events. Kindergarten Round Up 2.0 will encompass a fun school-wide scavenger hunt that will allow families to experience our specials and meet our specials teachers. At each stop on the hunt, children will receive a free gift and refreshments. Onsite tours will be given and applications taken.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29904888%2F196470119723%2F1%2Foriginal.jpg?s=188880763d52827e86f1b0e3eff849aa', 'https://www.eventbrite.com/e/kindergarten-round-up-20-scavenger-hunt-style-tickets-33322388160?aff=ebapi', '3624 South Westnedge Avenue, Kalamazoo, MI 49008', 42.255102, -85.59099500000002, '3624 South Westnedge Avenue, Kalamazoo, MI 49008', NULL, NULL, '1492518600', '1492522200', 0, 0, 0, NULL, 1),
