(87, 'live', '30466436933', 13, 0, 2, 'Vet-A-Visit', 'Vet-a-Visit isÂ our annualÂ open house, where everyone is welcome to visitÂ and learn about the world of veterinary medicine. This year registration tickets will be required for entry. There will be specific time slots in which interactive learning tours will be offered for food animal, equine, small animal and wildlife. If you have any questions about the event please contact us at cvm.studentsupport@cvm.msu.edu. Â Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26789080%2F188442506046%2F1%2Foriginal.jpg?s=7690785c26a754f95a662a4b992a6568', 'https://www.eventbrite.com/e/vet-a-visit-tickets-30466436933?aff=ebapi', '784 Wilson Road Room, East Lansing, MI 48824', 42.7216027, -84.46971669999999, '784 Wilson Road Room, East Lansing, MI 48824', NULL, NULL, '1491622200', '1491643800', 0, 0, 0, NULL, 1),
(88, 'live', '32549870539', 13, 0, 2, 'Lansing Family History Seminar 2017', 'A great opportunity to learn and to share,Â the April Family History Seminar has become a local institution within the Mid-Michigan genealogical community. This year''s Seminar is another high water mark. With 44 Classes and Activities, this year''s Seminar is sure to be enjoyable and rewarding - don''t miss it!.\r\nPlease review our website and discover the new classes and some old friends. We are anxious to see you whether you are a long time participant or a new friend. Come join us and learn and share your experiences.\r\nFor more detailed information about classes, presenters and activities of the Seminar go toÂ Lansingfhc.org.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28948011%2F26117359663%2F1%2Foriginal.jpg?s=ef90427668b09d6aca38bc3f371d783d', 'https://www.eventbrite.com/e/lansing-family-history-seminar-2017-registration-32549870539?aff=ebapi', '431 E Saginaw St, East Lansing, MI 48823', 42.747574, -84.478244, '431 E Saginaw St, East Lansing, MI 48823', NULL, NULL, '1492828200', '1492855200', 0, 0, 0, NULL, 1),
(89, 'live', '27153956214', 13, 0, 2, '2017 Spring Clean Up', 'Registration for this event is required. You may register until May 12, 2017 at 4:00 PM. Eaton County residents and GM employees are welcome to participate. The event takes place in Delta Township on May 13, 2017.Â After registration is complete and your address has been verified, a confirmation email will be sent to you with more detailed information regarding where the event is taking place.\nFAQs\nWhat items are accepted at this event?\nFor a full list of accepted items, check out our flyer here: Spring Clean Up Flyer\nAre there any fees associated with any items?\n\n\nTVs and Monitors - $10 strongly suggested donation for each TV and monitor. Please make the donation at the entrance where all donations are accepted.\n\n\nPaint - we accept 10 1-gallon cans for free. Starting with can 11, we charge $1 per can. This is payable via CASH or CHECK at the hazardous waste station.\n\n\nWhere can I contact the organizer with any questions?\n(517) 543-3686 or recycle@eatoncounty.org\nCan I update my registration information?\nAbsolutely! Just log into your EventBrite account, navigate to your registration for Spring Clean Up, and edit your information there.Â \nDo I have to bring my printed ticket to the event?\nNo, we don''t require you to print tickets. At the event, just tell us your name and appointment time. We''ll be able to find your pre-registration that way!Â \nThe name on the registration/ticket doesn''t match the attendee. Is that okay?\nWe understand when things come up. It''s ok if someone else comes in your place. Just have them tell us your name and appointment time at the registration tent!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F23340443%2F172387195111%2F1%2Foriginal.jpg?s=de5bd7bea754352e89abeb48b8e3dd07', 'https://www.eventbrite.com/e/2017-spring-clean-up-registration-27153956214?aff=ebapi', 'Lansing, MI 48917', 42.7287542, -84.63744840000004, 'Lansing, MI 48917', NULL, NULL, '1494646200', '1494667800', 0, 0, 0, NULL, 1),
(90, 'live', '31647978957', 13, 0, 2, '2017 Innovation Celebration', 'The Innovation Celebration at Michigan State University showcases innovative technologies and startups developed in campus labs, classrooms and beyond. We honor MSU researchers and students who reported an invention, licensed a technology or were awarded patents during the academic year, and recognize the winners of awards for innovation and achievement in technology transfer, as well as the Season Two cohort ofÂ Conquer AcceleratorÂ startups.\nNew ideas range from advanced automotive materials to electron microscopy to gene therapies for helping plants grow while simultaneously defending against pests. We''ll review a collection of new startup companies working to transform the worlds of alternative energy, concussion recognition, and even the way we treat addiction.\nMore info:Â DirectionsÂ |Â Validated Parking\n\nFAQsÂ \nAre there ID or minimum age requirements to enter the event?\nThis event is open to all ages, but attendees must be 21+ to drink alcohol.Â \nWhat are my transportation/parking options for getting to and from the event?\nAttendees may park in the Spartan Stadium parking lot, and will receive validation when they depart.Â \nDo I have to bring my printed ticket to the event?\nYou do not. If you registered, we''ll have a nametag waiting for you.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27869396%2F90151996233%2F1%2Foriginal.jpg?s=addfa421cd8fba897af05c17ed8f1f12', 'https://www.eventbrite.com/e/2017-innovation-celebration-tickets-31647978957?aff=ebapi', '325 W Shaw Ln 4th Floor, East Lansing, MI 48824', 42.72571079999999, -84.48362459999998, '325 W Shaw Ln 4th Floor, East Lansing, MI 48824', NULL, NULL, '1491993000', '1492002000', 0, 0, 0, NULL, 1),
