(92, 'live', '32420778421', 13, 0, 2, 'FINAL Riverboat College Night 18+ Event', 'Who''s ready for the FINAL College Night EVER on the Riverboat?! That''s right, we are only doing one more College Night 18+ on the Riverboat. This party won''t be happening again next year, so this last event will be the one to attend! It''s been smooth sailing, but let''s send off this last event the right way!Â That means this is the last chance for you to attend the BIGGEST Riverboat party known to Lansing!Â \nDRINK SPECIALS all night long!Three indoor levels, an outdoor deck, entertainment by the top DJs in Michigan, 4 full bars, and 450 drunk seaman cruising the Grand River. The Riverboat is the #1 spot to rage before the end of the school year, Wednesday, April 19th, 2017.Lets RAGE, TURN UP, and get TWISTED on this crazy riverboat adventure! Good vibes will be in the air all night as we all raise our glasses to being young and making hazy memories that we will remember forever!*Everyone MUST HAVE government issued I.D. to board! This means a driver''s license, passport with photo, etc. College ID is NOT enough to board the boat. You must prove you are at least 18 years old. There are NO exceptions when it comes to this policy.*Doors Open at 10:00pmDON''T BE LEFT ON SHORE!!!!!\nAll sales are final. There are no refunds.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29163118%2F189339573870%2F1%2Foriginal.jpg?s=fe8137715481b85ec0aded6fc0ad492d', 'https://www.eventbrite.com/e/final-riverboat-college-night-18-event-tickets-32420778421?aff=ebapi', 'Grand River Park, Lansing, MI 48917', 42.7220153, -84.588506, 'Grand River Park, Lansing, MI 48917', NULL, NULL, '1492619400', '1492633800', 0, 0, 0, NULL, 1),
(93, 'live', '33336554532', 13, 0, 2, 'Shuto Con 2018', 'Shuto Con is Lansing''s Annual Anime Convention, happening at the Lansing Center and Radisson Hotel on March 23rd-25th, 2018. Our convention is a three day event held in Lansing, MI that is going on its 8th action packed year! While Shuto Con has lots of great programming and panels to offer our attendees, our major focus is on our wonderful Artists and the art of Interactive Cosplaying!\nStarting Friday morning at the Lansing Center and Radisson Hotel Lansing our convention will run from 9AM until 6PM Sunday afternoon. We will have several large rooms for panels, over 50 unique artists as well as several dealers to get your latest anime goodies from, anime viewing rooms, a huge video game room open 24 hours during the entire convention, a table top gaming room, special guests, and much more!\nShuto Con also hopes to give you a truly unique experience by participating in our â€œInteractive Cosplayâ€ experience. We highly encourage ALL our attendees to dress up as their favorite characters and act like them during the convention. A mock battle arena will be staged where you can â€œfightâ€ it out with other cosplayers, or even take â€œbetsâ€ on who will win! Special points will be given out to those that participate the most, and at Closing Ceremonies on Sunday afternoon we will announce the Shuto Con â€œKing and Queen of Cosplayersâ€! If you do not wish to participate, but would still like to capture those fond memories, we ask that your bring your cameras and/or video recorders and witness a viral hit in the making! For more information and rules on this event please visit theÂ Interactive CosplayÂ page.\nAlso, be sure to check out our Facebook and Twitter pages! Our Facebook page is updated almost daily with special events around Lansing, and will occasionally have promo codes to get good deals on your badges!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29925935%2F3215747758%2F1%2Foriginal.jpg?s=4b6f49ba84e9007af7f7e6048c01fb67', 'https://www.eventbrite.com/e/shuto-con-2018-registration-33336554532?aff=ebapi', '333 E. Michigan Avenue, Lansing, MI 48933', 42.734142, -84.547984, '333 E. Michigan Avenue, Lansing, MI 48933', NULL, NULL, '1521795600', '1522000800', 0, 0, 0, NULL, 1),
(94, 'live', '33159203069', 13, 0, 2, 'Fortnight Film Contest 2017 [Screening & Awards]', 'This event will sell out, so purchase your tickets now!\nCCFF presents the Fortnight Film Contest â€“ a competition for teams of amateur, student, and professional filmmakers in Michigan â€“ in conjunction with the 2017 festival!Â All film submissions are judged by a large panel of multimedia professionals and consumers. The top 12 films are shown at this event, and more than $5,000 in cash prizes will be announced!\nPLEASE NOTE: DOORS OPEN AT 10:15AM (no earlier)', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29692207%2F130875817385%2F1%2Foriginal.jpg?s=fa2b1166e660799c607f986c30399365', 'https://www.eventbrite.com/e/fortnight-film-contest-2017-screening-awards-tickets-33159203069?aff=ebapi', '2500 S. Washington Ave, Lansing, MI 48910', 42.707105, -84.55794200000003, '2500 S. Washington Ave, Lansing, MI 48910', NULL, NULL, '1491715800', '1491726600', 0, 0, 0, NULL, 1),
