(96, 'live', '32437475362', 13, 0, 2, 'Michigan Construction Skilled Trades Conference', 'Come learn how tomorrowâ€™s skilled trades workers are being trained today, with interactive displays from Michiganâ€™s premiere construction worker training programs and contractors.Â \n\n\n\n\n\n\n\nInteractive Displays: 10:30 a.m. to 4:00 p.m.\nLunch Program: 11:45 a.m. to 1:00 p.m.\nReception: 4:00 p.m. to 6:00 p.m.\nLansing Center Exhibit Hall C\nSpeakers to be announced soon.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28789494%2F110852113801%2F1%2Foriginal.jpg?s=858f45bdf79a6f7aa1ddde062f7026cc', 'https://www.eventbrite.com/e/michigan-construction-skilled-trades-conference-tickets-32437475362?aff=ebapi', '333 East Michigan Avenue, Lansing, MI 48933', 42.734263, -84.5477343, '333 East Michigan Avenue, Lansing, MI 48933', NULL, NULL, '1494306000', '1494333000', 0, 0, 0, NULL, 1),
(97, 'live', '32627271046', 13, 0, 2, 'Jerrod Niemann Live at Tequila Cowboy', 'Performer: Jerrod Niemann with special guest Brent Lowry & The Drifters \nWhere: Tequila Cowboy - Lansing\nWhen: Saturday, May 13, 2017Â \n\nDoors open @ 5:00 pm\nBrent Lowry & the Drifters takes the stage at 8:00PM\nJerrod Niemann takes the stage at 9:30pmÂ \n(show times are subject to change)\n\nTicket Price:\n\n$25 in advance\n$30 at the door \n\nTickets are limited and while supplies last\n\nPLEASE NOTE: \nYou must be at least 18 years old and have a VALID ID to enter the venue.\nWe ID EVERYONE\nNO reentry is allowed\nThis is a standing only eventÂ \n\nThere are a few seats but it is very limited\nThere is NO reserved seating\nSeating is on a first come first serve basis\nYou are not guaranteed a seat with your ticket purchase. \n\nÂ \nFAQs\nÂ \nAre there ID or minimum age requirements to enter the event?\nYou must be at least 18 years old and have a VALID ID to enter the venue.\nWe ID EVERYONE\nÂ \nWhat can I bring into the event?\nSmall purses and coats. We do have a coat check but have limited space available.\nÂ \nHow can I contact the organizer with any questions?\nEmail Jennifer Taylor at Jennifer.Taylor@TownsquareMedia.Com\nÂ \nWhat''s the refund policy?\nThere are no refunds or exchanges\nÂ \nDo I have to bring my printed ticket to the event?\nYes, you need to bring a printed ticket or be able to show us your ticket on your smart phone. We must scan all tickets.\nÂ \nIs it ok if the name on my ticket or registration doesn''t match the person who attends?\nYes\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29059878%2F162618101816%2F1%2Foriginal.jpg?s=bbdddbe67f1efd826073bf176aee37ef', 'https://www.eventbrite.com/e/jerrod-niemann-live-at-tequila-cowboy-tickets-32627271046?aff=ebapi', '5660 West Saginaw Highway, Lansing, MI 48917', 42.7440639, -84.62898969999998, '5660 West Saginaw Highway, Lansing, MI 48917', NULL, NULL, '1494675000', '1494698400', 0, 0, 0,