(98, 'live', '32426894715', 13, 0, 2, 'Easter Bunny Brunch', 'Skip your usual Sunday breakfast routine in favor of this hoppin'' good time! Â Your family will chow down on a catered brunch with the Easter Bunny and then pose for picturesÂ with the larger-than-life rabbit. The celebration will continue with arts and crafts, tunes with Tim the Music Man, andÂ the most fabulous Easter Egg decoration table you''ve ever seen! Â After decorating eggs to your heart''s content, you''ll follow the bunny path outsideÂ for an egg hunt and games! Â The morning will end with a delightful ''Bunny Hop'' led byÂ Platinum DanceÂ Academy.Â  \r\n{Brunch tickets are required for each adult & child guest.}\r\nÂ April 9th, 2017 Â | Â 11:00am-1pm\r\n$11/ adult$13/ child\r\n...\r\n$10/ member adult$12/ member child\r\nSchedule:\r\n11-11:30am Brunch\r\n11:30am Pictures with Tim the Music Man, Easter Bunny, Crafts, Egg Dying + Open Play\r\n12:00pm Outdoor Games\r\n12:30pm Egg Hunt\r\n12:45pm Bunny Hop at Platinum Dance Academy\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28774058%2F46645260091%2F1%2Foriginal.jpg?s=ed2425149d9e7015a792dcd17da080f2', 'https://www.eventbrite.com/e/easter-bunny-brunch-tickets-32426894715?aff=ebapi', '4972 Northwind Dr, East Lansing, MI 48823', 42.72562600000001, -84.45273700000001, '4972 Northwind Dr, East Lansing, MI 48823', NULL, NULL, '1491715800', '1491723000', 0, 0, 0, NULL, 1),
(99, 'live', '32689241401', 13, 0, 2, 'The Swon Brothers', 'HearÂ The Swon Brothers''Â hitÂ  â€œLater Onâ€ and more live in concert! \nWhere: Tequila Cowboy - Lansing\nWhen: April 8, 2017 - Doors open - 4:00PM\nInfo: The Swon Brothers\nPrice: $15 ADV - $20 at the door', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29192872%2F141977339849%2F1%2Foriginal.jpg?s=b9ce29267aa34f020a5c6e73259e1d50', 'https://www.eventbrite.com/e/the-swon-brothers-tickets-32689241401?aff=ebapi', '5660 West Saginaw Highway, Lansing, MI 48917', 42.7440615, -84.62899379999999, '5660 West Saginaw Highway, Lansing, MI 48917', NULL, NULL, '1491647400', '1491674400', 0, 0, 0, NULL, 1),
