(101, 'live', '32637187707', 13, 0, 2, 'LOVE Lansing - 2017', 'OnÂ May 30th, we invite neighbors to gather at the Lansing Center for the LOVE (Local Organization and Volunteer Excellence) Lansing Celebration.Â This celebration will recognize Neighborhood Leaders and Neighborhood Watch Captains and Coordinators for their amazing efforts in creating excellent communities across Lansing.Â Â Register here for this FREE event. Refreshments, dinner, and dessert will be served. Dinner options include either a chicken selection or a vegan gluten free selection; if you have a food allergy please write it in the comments part of the registration form. Also, parking is complimentary!\nIf you are unable to get a ticket online, you can contact Clara Martinez atÂ Clara.Martinez@lansingmi.govÂ orÂ 517-483-4075.\nPleaseÂ print your ticketÂ and bring it with you for admission! If registering through Clara, she will have your tickets at will call.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29066293%2F163234114933%2F1%2Foriginal.jpg?s=4dffce41c5c076a56fb013276f6806e2', 'https://www.eventbrite.com/e/love-lansing-2017-tickets-32637187707?aff=ebapi', '333 East Michigan Avenue, Lansing, MI 48933', 42.734263, -84.5477343, '333 East Michigan Avenue, Lansing, MI 48933', NULL, NULL, '1496145600', '1496154600', 0, 0, 0, NULL, 1),
(102, 'live', '31891471249', 13, 0, 2, 'Michigan EIBC 5th Annual Member Meeting', 'Please join Michigan EIBC on Wednesday, April 26Â for our 5th Annual Member Meeting at the Kellogg Hotel & Conference Center in East Lansing.\r\nÂ \r\nThis full-day conference provides attendees an opportunity to network, learn about innovations in advanced energy, and get an overview on the latest policy developments. There will be severalÂ break-outÂ panels throughout the day and a keynote speaker(s).Â The eventÂ brings together leaders in Michigan''s advanced energy industry, utility executives, policymakers, regulators, and others.\r\nÂ \r\nWe are pleased to announce that the following speakers are confirmed for this year''s event:\r\nÂ Â \r\n\r\n\r\nMayor Rosalynn BlissÂ (Grand Rapids)\r\n\r\n\r\nValerie Brader, Executive Director, Michigan Agency for Energy\r\n\r\n\r\nMayor Jim CarruthersÂ (Traverse City)\r\n\r\n\r\nCommissioner Rachael Eubanks, MPSC\r\n\r\nRepresentative Gary Glenn (98th District), Chair, House Energy Committee\r\n\r\nTrevor Lauer, President and COO, DTE Electric\r\n\r\n\r\nCommissioner Norm Saari, MPSC\r\n\r\n\r\nChairmanÂ Sally Talberg, MPSC\r\n\r\n\r\nÂ \r\nThis year''s panel topics include:\r\n\r\nBuilding the Market: Corporate Advanced Energy Procurement\r\nCities Driving the Energy Transformation â€“ Confirmed speakers include Mayor Bliss (Grand Rapids) and Mayor Carruthers (Traverse City)\r\nThe Cutting Edge: Building an Energy Innovation Ecosystem\r\nFrom Wholesale to Retail: Building a Plug-and-Play Grid\r\nDriving Innovation and Efficiency through Advanced Lighting\r\nSelling Projects Under the New RPS: New Markets, New Challenges\r\nFrom Energy Optimization to Energy Waste Reduction: The Role of CHP, Demand Response, and Load Management in the New Efficiency Landscape\r\nEnergy, Mobility and the Future of Transportation\r\nWhat''s Ahead in the Next Legislative Session\r\n\r\nÂ Â \r\nPanelists from the following companies/organizations have been confirmed:\r\nÂ \r\n\r\nAmerican Center for Mobility\r\nBratic Enterprises\r\nChargePoint\r\nDTE Energy\r\nEnerNOC\r\nGM\r\nGrowth Capital Network\r\nLincus Inc.\r\nMichigan CAT\r\nMichigan Economic Development Corporation\r\nMichigan Public Power Agency\r\nMichigan Public Service Commission\r\nSustainable Partners\r\ntoggled\r\nTraverse City Chamber\r\n\r\nÂ \r\nSponsorship opportunities are avaiable. Please contact Nicole Forward for sponsor information.\r\nÂ \r\nEvent Sponsors\r\nÂ \r\nMegawatt LevelÂ \r\n\r\n\r\n\r\nÂ \r\nÂ \r\n\r\nÂ \r\nKilowatt Level\r\nÂ \r\nÂ  Â \r\nÂ \r\nÂ \r\nCancellations after April 20, 2017 will not receive a refund.Â Cancellations prior to or on April 20, 2017 will be required to cover all Eventbrite fees.\r\nÂ \r\nInterested in membership with Michigan EIBC? New members receive a first-year introductory rate of $350. Please contact mieibc@mieibc.org to learn more.\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28108854%2F31699084131%2F1%2Foriginal.jpg?s=f65a30564f10548762e722c59bcbacd0', 'https://www.eventbrite.com/e/michigan-eibc-5th-annual-member-meeting-tickets-31891471249?aff=ebapi', '219 S Harrison Road Room: Big Ten A, East Lansing, MI 48824', 42.724305, -84.47960469999998, '219 S Harrison Road Room: Big Ten A, East Lansing, MI 48824', NULL, NULL, '1493175600', '1493206200', 0, 0, 0, NULL, 1),
(103, 'live', '31294273013', 13, 0, 2, 'PACE Awards 2017', 'Mark your calendars for the 2017 PACE Awards Ceremony heldÂ Thursday, April 13, at the Old Town Lansing Marquee. The Gallery of Entries opens at 4:30 p.m. and the ceremony begins at 6 p.m.\nThe PACE Awards are mid-Michigan''s highest honor of public relations activities and are awarded annually to practitioners whoâ€”in the judgment of their national peersâ€”have successfully addressed a contemporary issue with exemplary professional skill, creativity and resourcefulness.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27469190%2F3424017512%2F1%2Foriginal.jpg?s=9e4de07d0113361d178557f6b895e3e1', 'https://www.eventbrite.com/e/pace-awards-2017-tickets-31294273013?aff=ebapi', '319 East Grand River Avenue, Lansing, MI 48906', 42.747578, -84.548496, '319 East Grand River Avenue, Lansing, MI 48906', NULL, NULL, '1492081200', '1492095600', 0, 0, 0, NULL, 1),
