(105, 'live', '32180611074', 13, 0, 2, '2017 Lansing Promise Dinner', 'Join the Lansing Promise Community for our 3rd Annual Lansing Promise Dinner on April 27th from 5:00 PM to 9:00 PM at the Lansing Center.\nThe Lansing Promise has one simple mission: to ensure that every child living and schooling within the Lansing School District boundares has access to college and career training after high school. With support of this entire region we are investing in our kids, strengthening our community, keeping our promise, and building our future. To this we have only one question: Are you in?\nJoin us for another magical evening. Speakers and further details to be announced shortly.\nPlease contact Travis Richarson at TRichardson@LansingChamber.org or call 517-853-6463 for information on Sponsorship Packages.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28442777%2F196066152610%2F1%2Foriginal.jpg?s=e7dc06dd5bccbcdb90a0dad8e00d7d6a', 'https://www.eventbrite.com/e/2017-lansing-promise-dinner-tickets-32180611074?aff=ebapi', '333 East Michigan Avenue, Lansing, MI 48933', 42.734263, -84.5477343, '333 East Michigan Avenue, Lansing, MI 48933', NULL, NULL, '1493292600', '1493307000', 0, 0, 0, NULL, 1),
