(107, 'live', '31582512144', 13, 0, 2, 'MOVE Conference for Women', 'MOVE is a Christian experience to unite and empower diverse women to share God''s love and hope in greater Lansing. We are for women from various churches, racial backgrounds, socio-economic status and age to worship together and learn what it means to be Kingdom Focused.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27793121%2F200996474960%2F1%2Foriginal.jpg?s=32f3d7bb08c2b5ef35de948dbb35b388', 'https://www.eventbrite.com/e/move-conference-for-women-tickets-31582512144?aff=ebapi', '3355 Dunckel Road, Lansing, MI 48911', 42.6777738, -84.51615649999997, '3355 Dunckel Road, Lansing, MI 48911', NULL, NULL, '1493386200', '1493483400', 0, 0, 0, NULL, 1),
(108, 'live', '32416670133', 13, 0, 2, 'Lansing Area Veteran Coalition (MiVCAT Region 7) April 11, 2017 10amâ€“12pm Meeting (9:30am networking)...', 'Upcoming April 11th LAVC meeting...\r\nLAVC continues to strengthenÂ our team in order to support Michigan Veterans in Region 7 (Clinton, Ingham, Eaton Counties).Â  We need you...\r\n\r\nSave the date: Next LAVRC Session April 11th atÂ JFHQ 3411 N. Martin Luther King Blvd. Lansing, MI 48906 (Attendees need to present their driver''s license at the gate. Â Follow the road around until you come to the building with the large Minute Man Statue out front.)Â (free parking available in lot).  Mark your calendar for the upcoming quarterly LAVRC meeting.Â  This meeting will focus on the topic ofÂ VeteranÂ Quality of Life Resources.Â  Together we will learn ofÂ valuable resources for veterans and their families in this and other areas.Â Â Your important participation will help Veterans in Region 7, under the leadership of theÂ Michigan Veterans Community Action Team (MiVCAT), as we will dive further into eliminating system-wide challenges that face veterans in each of theÂ pillars of LAVC.Â  Please join us January 10th, 2017 from (9:30am networking) 10am-12pm to provide your expertise and input.Â Please register by following the link to the left of the page.Â   The next session will include presentations from:\r\n\r\nNetworking opportunitiesÂ from 9:30-10am.\r\nArmed Service Committee Presentation by Griffin Working (Mid-Michigan Regional Representative for U.S. Senator Gary Peters)\r\nCounty Veteran Affairs Resources Presentation by Ken Love with Ingham County Department of Veteran Affairs\r\n(Tentative) LGBT Veteran Care Presentation with presenter to beÂ announced\r\nReports by committee chairsÂ from each of the LAVRC committees (Employment, Quality of Life, Healthcare, and Education)\r\n\r\nTo learn more about LAVC, please call Heather Nystrom (248) 971-4328 orÂ heather.l.nystrom2.mil@mail.mill.  Note: Subcommittees will be meeting between LAVRC quarterly meetings.Â  Please see PODIO for dates and times of those meetings.\r\nGriffin Working (Mid-Michigan Regional Representative for U.S. Senator Gary Peters)', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28759833%2F100018775577%2F1%2Foriginal.jpg?s=02fdd764465d688c2893866836275c8e', 'https://www.eventbrite.com/e/lansing-area-veteran-coalition-mivcat-region-7-april-11-2017-10am12pm-meeting-930am-networking-tickets-32416670133?aff=ebapi', '3411 N Martin Luther King Jr Blvd, Lansing, MI 48906', 42.76760420000001, -84.5708735, '3411 N Martin Luther King Jr Blvd, Lansing, MI 48906', NULL, NULL, '1491883200', '1491894000', 0, 0, 0, NULL, 1),
(109, 'live', '20781171042', 13, 0, 2, 'ChEMS Department Research Forum 2017', 'The 14th Annual ChEMS Research Forum will showcase departmental research advances in the areas of:\n\nEnergy and Sustainability\nNanotechnology and Materials\nBiotechnology and Biomedical Engineering\n\nThe one-day program will feature two invited plenary speakers, oral presentations from faculty and students, and an extended poster session describing the latest department research results.\n\n\nRegistration, lunch, and refreshments are complimentary.\n\n\nKeynote Speakers\n\n\nRose A. Ryntz IAC Vice President Advanced Development & Material Engineering\nPaul E. Krajewski General Motors Global R&D Director Vehicle Systems Research Lab\nYue Qi Associate Professor, Chemical Engineering and Materials Science, Michigan State University\nGanapati D. YadavÂ Vice Chancellor and R.T. Mody Distinguished Professor, Institute of Chemical Technology, Mumbai\n\nTopics\n\nChallenges and Innovations Facing Automotive Interior ManufacturersInterior Automotive requirements continue to evolve as the USA CAFÃ‰ standards drive weight reduction and enhanced powertrains in efforts to achieve 54.4 mpg by 2025. With ride sharing increasing and with an eye on the autonomous vehicle, material selection, connectivity, and interior craftsmanship become important criteria for manufacturers. This talk will discuss the changing landscape in automotive interiors and address the advances being made in light weighting, durable and non-petroleum based materials, and processes utilized to make new constructions.\nMaterials Insertion Challenges in the Automobile IndustryAutomobiles are created using almost every material across the periodic table, literally from Aluminum to Zinc. Many of the future automotive breakthroughs are dependent on new materials which provide improved functionality or performance. The insertion of new materials into automobiles, however, is very challenging due to a number of reasons including global availability, stable pricing, consistent material performance, mathematical models to predict performance, etc. The present talk will explore a few case studies of materials insertion and highlights their challenges and successes. Examples will include high-strength steels, aluminum, magnesium, and shape memory alloys. The talk will conclude by exploring some future materials challenges facing the automobile industry.\nModeling of the Thin Passivation Layer on Aluminum and Lithium MetalsSpontaneously formed passivation layers, such as oxides on an aluminum surface, can enable many important applications by blocking the diffusion of either oxygen or metal. Lithium, as the most active metal, will be covered by a passivation layer in battery applications due to electrolyte reduction reactions. This passivation layer must have â€œselectiveâ€ transport properties: blocking electrons from attacking the electrolytes while allowing Li+ ions to pass through so the electrochemical reactions can continue. Therefore, it is often called â€œsolid electrolyte interphase (SEI)â€. Despite this importance, their structureâ€“property relationship is largely unknown due to the nanometer thickness. Using computational approaches that start from electronic and atomic structures, the transport and mechanical properties can be predicted and the chemical and structural evolution of the passivation layer can be simulated.\n\n\nCatalytic Selectivity Engineering in Sustainable Production of Chemicals, Fuels, and Energy from Biomass and CO2Biomass conversion technologies consist of sugar platform (biochemical/fermentation), extraction and chemical conversion (syn gas) and it provides challenging opportunities. Biorefineries must adopt the Green Chemistry principles. The development of lignocellulose treatments will be key to unlocking a major sugar source for biological conversion into industrial products. Defunctionalization may involve oxidation and hydrogenation apart from other important chemical reactions using acids and bases. Catalysis is the most pivotal principle of Green Chemistry which inherently aims at reduction of waste, both of material and energy. The active sites on the catalyst can be tailored to give desired products from reactants while suppressing, either totally or to the maximum extent, any generation of by-products. Chemical and allied industry is characterized by several processes involving complex (series and/or parallel) reaction networks in which the selectivity of the desired product is influenced by a number of parameters. There are examples of reactions where the same type of catalyst is used in a series of reactions where the intermediate is reacted with the reactant already present in the reactor or a different reagent is added subsequently wherein there is no need for separation of the intermediate. Â Cascade engineered multistep reactions along with complex multifunctional catalyst yields required process intensification at molecular level. In cascade reactions the single event triggers the conversion of a starting material to a product that becomes the intermediate reactant for the next reaction resulting in cascade transformations. These reactions also obliviously reduce workup and save capital costs significantly. The multifunctional catalysts required for such reactions possess multi-functionality such as acid, base and metal sites. Reactions occur on these multiple sites in a concerted or sequential manner. The role of acids, bases, metals and bacteria and enzymes as catalyst is evident. Thus, replacement of polluting acids and bases by benign solid acids as well as bases is one of the keys to achieve the objectives of green and sustainable chemistry. The oxidation of aliphatic and aromatic compounds normally leads to over-oxidation since these are consecutive and/or complex reactions. Replacement of homogeneous catalysts and exotic oxidizing agents by benign heterogeneous catalysts and oxidants such as air or hydrogen peroxide would be most desirable. Use of oxygen/air/hydrogen peroxide as oxidizing agent leads to better atom economy. Â Hydrogenation is a vital operation in chemical process industry and noble metal catalysts are rampantly used. CO2 conversion technologies along with water splitting will be greatly pursued. HMF is considered as a platform molecule which can be valorized using different processes and catalysis. New opportunities for the conversion of glycerol, co-product of biodiesel, into value-added chemicals have emerged in recent years as a result of glycerolâ€™s unique structure, properties, bioavailability, and renewability. Different reaction pathways for selective catalytic conversion of bioglycerol into commodity chemicals include oxidation, hydrogenation (commonly called hydrogenolysis), dehydration, pyrolysis and gasification, steam reforming, thermal reduction into syngas, transesterification, etherification, oligomerization, polymerization, acetalization and carbonylation. The principles of selectivity engineering and cascade engineering in valorization of biomass and biobased products will be the central theme of this lecture.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F24105378%2F162720261966%2F1%2Foriginal.jpg?s=0fee11fe036c5e9456f33f2312aff115', 'https://www.eventbrite.com/e/chems-department-research-forum-2017-registration-20781171042?aff=ebapi', '325 W Shaw Ln, East Lansing, MI 48824', 42.7259801, -84.48499199999998, '325 W Shaw Ln, East Lansing, MI 48824', NULL, NULL, '1494471600', '1494502200', 0, 0, 0, NULL, 1),
