(111, 'live', '33148459936', 13, 0, 2, 'Stop-Motion Workshop @ Science of Cinema', 'PLEASE SELECT ONLY ONE TIME SLOT FOR YOUR CHILD.\nTell your creative story and learn about stop-motion animation! From capturing to editing and showcasing your work, this workshop is for everyone. Limited spots availableÂ (first come, first served). Workshop is about 1 hour long.Â \nScience of Cinema also includes a Foley (sound) and Green Screen activities, AND a pop-up theater showing family-friendly short films all day.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29679689%2F130875817385%2F1%2Foriginal.jpg?s=f216163068c61f98fb7c57c545d52835', 'https://www.eventbrite.com/e/stop-motion-workshop-science-of-cinema-tickets-33148459936?aff=ebapi', '200 Museum Drive, Lansing, MI 48933', 42.73227219999999, -84.54814920000001, '200 Museum Drive, Lansing, MI 48933', NULL, NULL, '1491629400', '1491647400', 0, 0, 0, NULL, 1),
(112, 'live', '32864327087', 13, 0, 2, 'CAMC Executive Meeting', 'Join CAMC Members for a great meeting on April 10th!\n\nOur CAMC Member Spotlight will be Neogen. Â Neogen''s worldwide genomics operations deliver innovative, affordable DNA testing for the discovery and commercial application of genomic advances that enhance the safety and abundance of life. WOW.Â \n\nOur featured speaker isÂ Dr. Tomas Hult, MSU Broad College of Business professor of marketing, Byington Endowed Chair, and director of the Broad Collegeâ€™s International Business Center. Â Dr. Hult will talk about international business/trade, global supply chains, and the role of the International Business Center in MSUâ€™s Eli Broad College of Business in the capital region.\n\nGet your passports ready to travel to Italy in October with LEAP and CAMC! Â ThisÂ Bi-lateral Trade & Cultural Exchange will be open toÂ Lansing area community and business leaders. However, the primary purpose of this trip is to leverage LEAP''s relationships in Italy to identify trade and partner opportunities for CAMC members.Â \n\nLast, but not least, join us for our Networking Hour from 5-6 PM with appetizersÂ and an open bar.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29313087%2F53738613406%2F1%2Foriginal.jpg?s=2276bd29662224033fe6d0e690fecbb8', 'https://www.eventbrite.com/e/camc-executive-meeting-tickets-32864327087?aff=ebapi', 'Corniche Room 219 S Harrison Rd, East Lansing, MI 48823', 42.7317521, -84.49365799999998, 'Corniche Room 219 S Harrison Rd, East Lansing, MI 48823', NULL, NULL, '1491816600', '1491827400', 0, 0, 0, NULL, 1),
