(115, 'live', '31490677464', 13, 0, 2, 'Innovate State with Pat Gillespie', 'Please join us for our final Innovate State event for the 2016-2017 school year, featuring guest speaker Pat Gillespie! Food and beverages free for all who attend!\nPat is known as the chief visionary, founder and president of  Gillespie Group. Gillespie Group has been at the forefront of  development and asset management, and is recognized as a  driving force for progress in Lansing and throughout the State of Michigan. He is a graduate of Michigan State University, holding a Bachelor of Arts in Construction Management. He is also a  respected leader who is known for a creative approach to both new construction and development repurposing. His heartfelt  mission is to motivate and energize Mid-Michigan communities.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27687775%2F46594630145%2F1%2Foriginal.jpg?s=0f3ae5d15190eac82233a4fe4e86e982', 'https://www.eventbrite.com/e/innovate-state-with-pat-gillespie-tickets-31490677464?aff=ebapi', '325 East Grand River Avenue #300, East Lansing, MI 48823', 42.73461229999999, -84.48028720000002, '325 East Grand River Avenue #300, East Lansing, MI 48823', NULL, NULL, '1492518600', '1492525800', 0, 0, 0, NULL, 1),
