(117, 'live', '31584340613', 13, 0, 2, 'Solutions Users Group - Spring 2017', 'Join Maner Costerisan for this great opportunity to participate in our spring users group conference. Â Learn how to leverage your existing business solutions, gain knowledge in new solutions and network with other users.\r\nLunch and break snacks are provided.Â \r\nTo pay by check clickÂ register and choose pay by check under Payment Method.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28889184%2F21809465020%2F1%2Foriginal.jpg?s=9e653f077629917549fa13fad6678629', 'https://www.eventbrite.com/e/solutions-users-group-spring-2017-registration-31584340613?aff=ebapi', '5708 Cornerstone Drive, Lansing , MI 48917', 42.7177472, -84.63007809999999, '5708 Cornerstone Drive, Lansing , MI 48917', NULL, NULL, '1494385200', '1494414600', 0, 0, 0, NULL, 1),
(118, 'live', '31914079872', 13, 0, 2, 'Destroy All Cinema! ft. Comedy Coven', 'Capital City Film Festival presentsÂ DESTROY ALL CINEMA!\nJoin the Comedy Coven as they riff on the goth-chic horror classic THE CRAFT\nQuestions? Contact us at info@capitalcityfilmfest.com or 517.483.4058Capital City Film Festival website: www.ccff.co', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28165273%2F130875817385%2F1%2Foriginal.jpg?s=3e0c04e5d74c86bb1f70b3104ff8d3a0', 'https://www.eventbrite.com/e/destroy-all-cinema-ft-comedy-coven-tickets-31914079872?aff=ebapi', '2500 South Washington Avenue, Lansing, MI 48910', 42.707105, -84.55794200000003, '2500 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1491669000', '1491675900', 0, 0, 0, NULL, 1),
(119, 'live', '32848616095', 13, 0, 2, '#Go Open April 2017', 'Monthly #GoOpen Community Meeting will held in theÂ DMB OttawaÂ 4 conference roomÂ of the Hannah Building, UP Level, 608 W. Allegan Street, Lansing, Michigan.Â Lunch will be provided.Â  Please indicate dietary needs.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29294749%2F70965562799%2F1%2Foriginal.jpg?s=b51a95114b5a6aa0edd4537d06943a98', 'https://www.eventbrite.com/e/go-open-april-2017-tickets-32848616095?aff=ebapi', '608 West Allegan Street DMB-Conference Room Ottawa 4 (UP Level), Lansing, MI 48933', 42.7371075, -84.5562878, '608 West Allegan Street DMB-Conference Room Ottawa 4 (UP Level), Lansing, MI 48933', NULL, NULL, '1493177400', '1493191800', 0, 0, 0, NULL, 1),
(120, 'live', '33047479902', 13, 0, 2, 'How Integrative Learning is in Harmony with How the Brain Learns', 'Almost daily research from neuroscience, biology and cognitive science sheds new light on how the human brain takes in, processes and stores new learning. This research affirms the importance of using an integrative approach to learning. This presentation will help faculty to better understand which learning process the brain uses best reinforce an integrative approach to learning.Â Specific learning processes to be discussed include how the brain uses patterns to recognize how to process new learning, how distributed practice of new learning leads to long term recall, how a multisensory teaching and learning enhances understanding and recall.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29551311%2F198952890307%2F1%2Foriginal.jpg?s=637fcaae395b0a77a095de320540645b', 'https://www.eventbrite.com/e/how-integrative-learning-is-in-harmony-with-how-the-brain-learns-tickets-33047479902?aff=ebapi', 'Room 346 648 N Shaw Ln, East Lansing, MI 48824', 42.7257274, -84.4736115, 'Room 346 648 N Shaw Ln, East Lansing, MI 48824', NULL, NULL, '1492761600', '1492767000', 0, 0, 0, NULL, 1),
(121, 'live', '32588729768', 13, 0, 2, '2017 Midwest Theoretical Chemistry Conference', 'The 49th Annual Midwest Theoretical Chemistry Conference (MWTCC) will be held on the campus of Michigan State University in East Lansing, MI on June 1-3, 2017. Keeping with tradition, MWTCC will be an interactive conference, and participation by students and postdocs is encouraged.Â  This year''s program will feature the following invited speakers:  Keynote Lecturer Donald G. Truhlar, University of Minnesota  Invited Speakers Timothy C. Berkelbach, University of Chicago J. Daniel Gezelter, University of Notre Dame Lisa M. Hall, The Ohio State University Mark R. Hoffmann, University of North Dakota Nancy Makri, University of Illinois Sharani Roy, University of Tennessee  Additionally, the program will include a poster session (with prizes generously donated by The Journal of Physical Chemistry), numerous contributed talks from students and postdocs, a conference banquet, and opportunities for discussion over informal meals.  Additional information can be found at the conference website, http://www.mwtcc.org. Â We look forward to seeing you in East Lansing in June!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28996094%2F205027080069%2F1%2Foriginal.jpg?s=54421c8a1e1f63608da45ab2b3ec5979', 'https://www.eventbrite.com/e/2017-midwest-theoretical-chemistry-conference-tickets-32588729768?aff=ebapi', '219 S Harrison Rd, East Lansing, MI 48824', 42.7317521, -84.49365799999998, '219 S Harrison Rd, East Lansing, MI 48824', NULL, NULL, '1496336400', '1496493000', 0, 0, 0, NULL, 1),
(122, 'live', '32588199181', 13, 0, 2, 'SouthNaz Eggstravaganza', 'Come and join us for a free Eggstravaganza at Lansing South Church of the Nazarene. 401 W. Holmes Rd. Lansing, MI 48910. From 10:30am - 12:00pm. There will be lots of eggs, a free hotdog lunch, and a time to walk through the Easter Story with your whole family. Ages Birth- 6th grade welcome!Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28994418%2F205024970404%2F1%2Foriginal.jpg?s=91ef895dd465d90dd204152b483d3e1a', 'https://www.eventbrite.com/e/southnaz-eggstravaganza-tickets-32588199181?aff=ebapi', '401 West Holmes Road, Lansing, MI 48910', 42.697, -84.55700819999998, '401 West Holmes Road, Lansing, MI 48910', NULL, NULL, '1492232400', '1492237800', 0, 0, 0, NULL, 1),
(123, 'live', '32884378060', 13, 0, 2, 'Perinatal Mood Disorders II', 'This training is the second of a two-part series; and will assist the attendees in understanding, identification, and treatment for women who experience a Perintatal Mood Disorder so they can most effectively and holistically support and assist the affected mother and her family toward wellness. Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29341079%2F90462428151%2F1%2Foriginal.jpg?s=7fc63336b7f8028d8c3cd2a6b90e9034', 'https://www.eventbrite.com/e/perinatal-mood-disorders-ii-tickets-32884378060?aff=ebapi', '1900 Boston Boulevard, Lansing, MI 48910', 42.71166040000001, -84.57647739999999, '1900 Boston Boulevard, Lansing, MI 48910', NULL, NULL, '1491982200', '1491993000', 0, 0, 0, NULL, 1),
(124, 'live', '33053313350', 13, 0, 2, 'IIDA CEU Palooza 2017', 'The IIDA Michigan chapter is offering up 5 CEU''s in one day! Join us on Tuesday, April 25th from 8:30 - 4:00 for the following:\nâ€œUnderstanding the Effect of Surface, Color & Design on the Userâ€™s Physical, Mental & Social Well Beingâ€ sponsored by Wilsonart\nâ€œWhereâ€™s the Big Ideaâ€ sponsored by Herman Miller\nâ€œEngagement & the Global Workplaceâ€ sponsored by Steelcase\nâ€œDesigning Healthy Work Environmentsâ€ sponsored by Humanscale\nâ€œWell Being â€“ Designing with Humans in Mindâ€ sponosred Â by Interface\nA full day of educational units with IDCEC and AIA credits, as well as GBCI credits for the afternoon session, and our vendor fair offered again during the lunch break.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29592187%2F59719509653%2F1%2Foriginal.jpg?s=35c049f87ec4101d74057a38c652d278', 'https://www.eventbrite.com/e/iida-ceu-palooza-2017-tickets-33053313350?aff=ebapi', '219 South Harrison Road, East Lansing, MI 48824', 42.7316308, -84.49321029999999, '219 South Harrison Road, East Lansing, MI 48824', NULL, NULL, '1493089200', '1493116200', 0, 0, 0, NULL, 1),
(125, 'live', '27386990225', 13, 0, 2, 'Annual Shrimp Dinner', 'Dinner served at 6:00 p.m.Come and join your colleagues at this annual event where you will receive a fabulous meal cooked and served by local lawyers and Judges.\r\nICBA Event Cancellation/Refund Policy: for a refund, cancellation must be received in writing at least 72 hours in advance of the event less $10.00 administration fee.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F23680109%2F151254319293%2F1%2Foriginal.jpg?s=43a33c50d11efe08e7e16f39283c53b5', 'https://www.eventbrite.com/e/annual-shrimp-dinner-tickets-27386990225?aff=ebapi', '5828 South Pennsylvania Avenue, Lansing, MI 48911', 42.67239379999999, -84.53885909999997, '5828 South Pennsylvania Avenue, Lansing, MI 48911', NULL, NULL, '1495040400', '1495054800', 0, 0, 0, NULL, 1),
(126, 'live', '33248676687', 13, 0, 2, 'VCAT Information Exchange', 'Mark your calendar for the Second Annual VCAT Information Exchange on Wednesday, May 17.\nMVAA and MyVA have partnered to bring together Michigan''s VCAT/CVEB leaders to share best practices, lessons learned and success stories with one another and CVEBs throughout the Midwest Distract of the Veteran Experience Office, MyVA.Â This event willÂ bring together the key leaders from local, state and federal agencies to collaborate and learn from each other to ensure a no-wrong-door system of care for veteran services isÂ thrivingÂ across the entire state for veterans, their families andÂ community service providers.\n\nRegistration is required due to meeting location. Please complete registration by Friday, April 21.\nThere is a limit to three members of the leadership boards per VCAT/CVEB; this does not include the Regional Coordinators or MyVA Representatives.\n\nPlease send all questions to one of the individuals below:\nEmily Rissman, MVAA - Email: RissmanE@michigan.gov or Phone: (517) 284-5229\nDavid Leonard, MyVA - Email: David.Leonard1@va.gov or Phone: (860) 335-8016\nMary Thompson, MyVA - Mary.Thompson2@va.gov or Phone (989) 306-3685', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29800223%2F97134302623%2F1%2Foriginal.jpg?s=0ecffe1a7e14d4bc762e026836759922', 'https://www.eventbrite.com/e/vcat-information-exchange-tickets-33248676687?aff=ebapi', '3423 North Martin Luther King Junior Boulevard Reserve Forces Support Center, Lansing, MI 48906', 42.7842327, -84.57462429999998, '3423 North Martin Luther King Junior Boulevard Reserve Forces Support Center, Lansing, MI 48906', NULL, NULL, '1494991800', '1495017000', 0, 0, 0, NULL, 1),
(127, 'live', '32692416899', 13, 0, 2, 'Barrier Removal & the ADA', 'LAST DAY TO REGISTER IS FRIDAY, JUNE 9TH.Â  SPACE IS LIMITED.\n\nIn response to recent lawsuits against businesses in Michigan, ADA Michigan in collaboration with the Great Lakes ADA Center and the Downtown Kalamazoo Retail and Restaurant AssociationÂ invites you to attend a training focused on barrier removal and the Americans with Disabilities Act (ADA).Â  Find out about ADA requirments, increase access for customers and learn about the law.\n\nAgenda:\n9:30 - 10:00 AM Â Registration & Refreshments\n10 AM - 12:00 PMÂ  Peter Berg, Great Lakes ADA Center, on ADA requirements for facilities\n12:00 - 1:00 PMÂ  Lunch\n1:00 - 2:00 PMÂ  Stan Skopek & Barb Kunkel, Barrier Free Design Board, on State of Michigan requirements\n2:00 - 3:00 PMÂ Â Mark Finnegan, Attorney, Herberle and Finnegan, on the ADA and the Law\n\nAudience:\nBusiness owners/managers, code officials, architects, contractors, anyone interested in accessibility\n\nParking:\nFREE\n\nAccommodations:\nEvery effort will be made to ensure that participants have full access to the program. Requests for specific accommodations will be asked during the registration process. The deadline for requesting accommodations is June 2, 2017.\nÂ \nFAQs\n\nHow can I contact the organizer with any questions?\nYou can contact Dan Cooper at dcooper@mpas.org or 1-800-288-5923, ext. 669.\nÂ \nWhat''s the refund policy?\nNo refunds will be given.\nÂ \nIs my registration fee or ticket transferrable?\nYes, someone else may go in your place.\nÂ \nIs it ok if the name on my ticket or registration doesn''t match the person who attends?\nYes.\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29147644%2F141989365443%2F1%2Foriginal.jpg?s=d12a873438c28a04775f9f8ff1d7ac7d', 'https://www.eventbrite.com/e/barrier-removal-the-ada-tickets-32692416899?aff=ebapi', '219 South Harrison Road, East Lansing, MI 48824', 42.7316308, -84.49321029999999, '219 South Harrison Road, East Lansing, MI 48824', NULL, NULL, '1497607200', '1497625200', 0, 0, 0, NULL, 1),
(128, 'live', '32702708682', 13, 0, 2, 'Everything About Medical Marijuana in Michigan', 'The State Bar of Michigan Marijuana Law Section and the Michigan Association of OWI Attorneys presents Everything About Medical Marijuana in Michigan.Â  This seminar isÂ being held on Friday, May 12th and Saturday, May 13th at the James B. Henry Conference Center at Michigan State University in East Lansing, MI.\nSince 2008 and the Michigan Medical Marijuana Act, the number of marijuana related criminal prosecutions has significantly increased. Every attorney in Michigan practicing criminal law has seen more marijuana related cases and this is the perfect opportunity to sharpen your skills and get better results for your clients.\nThis seminar will feature nationally known speakers and local marijuana experts. Our keynote speaker will be Retired Judge Mary Celeste of Denver, Colorado.\nWhat You Will Learn*\nJudge Celeste will present on the Marijuana Driving Laws in Michigan and How to Challenge Them, as well as the Effective Use of Marijuana Experts in Criminal Cases\nJudge Mary Celeste is is a designated expert witness on marijuana and drivingÂ with 2 companies: Expert Consulting Services, Inc.( ECS) and the Expert Institute. She is also designated as an expert witness on marijuana and driving in a Court of Law. She is currently a faculty member of theÂ National Center for DWI Courts (NCDC) A Professional Services Division andÂ Adjunct Faculty National Judicial College.Â  Judge Celeste''s extensive CV can be found at:Â  http://judgemaryceleste.com/curriculum-vitae/4698880\nSolid Dose Chemical Marijuana Analysis by Attorney Barton Morris\nDRE and Marijuana and Driving by Attorney Jeffery Crampton\nDriver License Restoration Issues Regarding Marijuana by Attorney Karen Phillips\nBiological Testing of Blood for THC at the Michigan State Police Forensic Science Department by Dr. Andreas Stolz\nSearch and Seizure Issues Related to Patients and Caregivers and the Lawyers that Represent Them by Attorney Matthew Abel\nLitigating Medical Marijuana Section 8 Hearings by Attorney Michael Komorn\nTips for fighting a DUID Marijuana Case in Michigan by Attorney Michael Boyle\n20 Hot Medical Marijuana Criminal Defense Issues Mary Chartier\nWhatâ€™s Included\nÂ Two days of Instruction: 8:30 to 4:00ish\nTwo days of breakfast and lunch\nTwo days of coffee, beverages and snacks\nDinner and entertainment on Friday evening*\nWhat It Costs\nÂ $350 for Members of MIAOWIA or MJ Law Section\n$425 if you represent more than 5 indigent clients in a year\n$500 for standard enrollment \nAccommodations\nCandlewood Suites (located next door to the Henry Center)\nRoom block rates for single:Â  $95 or one bedroom suite $135 before April 12th\n(517) 351-8181 or www.candlewoodsuites.com\n*Further information on itinerary and entertainment will be provided.Â  Stay tuned.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29503588%2F125068686037%2F1%2Foriginal.jpg?s=171eb863dd593f5360615517c6315517', 'https://www.eventbrite.com/e/everything-about-medical-marijuana-in-michigan-tickets-32702708682?aff=ebapi', '3535 Forest Road, Lansing, MI 48910', 42.705469, -84.50139300000001, '3535 Forest Road, Lansing, MI 48910', NULL, NULL, '1494558000', '1494671400', 0, 0, 0, NULL, 1);
