(129, 'live', '32861529720', 13, 0, 2, 'U.S. - Russia Relations: Is this Cold War 2?', 'Ruth K. & Shepard Broad Distinguished Lecture Series\nSteven J. Green School of International and Public Affairs\nÂ \nU.S.â€“Russia Relations: Is This Cold War 2?\nPresentation by Mark Medish and Ralph S. Clem \nModerated by Markus Thiel\nÂ \nMonday, April 17, 2017 | 2:30 PM | FIU MMC | CBC 233\nÂ \nMark Medish is the CEO of The Messina Group International, a strategic consulting firm dedicated to global advisory services and investments. Mr. Medish was special assistant to President Bill Clinton during his presidential term, where he was a senior director on the National Security Council for Russian, Ukrainian and Eurasian affairs. He also served as assistant secretary to the U.S. Treasury, among other senior official posts. During his career, Mr. Medish has held numerous leadership positions, including CEO of Guggenheim International and vice president of the Carnegie Endowment for International Peace. He is also a member of the Council on Foreign Relations and has extensive experience in international finance, economic development and security policy.\nÂ \nRalph S. Clem is professor emeritus of geography and former director of the Center for Transnational and Comparative Studies at FIU, where he was a faculty member from 1974-2009. He is currently a research affiliate at the Russian, East European and Eurasian Center at the University of Illinois at Urbana-Champaign. His research focuses primarily on the electoral geography of states transitioning from authoritarian regimes to pluralist democracies, in particular Russia and Ukraine. He has held several prestigious fellowships, including those at the W. Averell Harriman Institute for Advanced Study of the Soviet Union and the Kennan Institute for Advanced Russian Studies. He has a Ph.D. from Columbia University.Â \nÂ \nMarkus Thiel is associate professor in the Department of Politics & International Relations and director of the European and Eurasian Studies Program and Jean Monnet Center of Excellence. His research interests include political sociology of European Union politics, nationalism and identity politics, and mixed methods research methodology. He has published several articles and book chapters in Transatlantic Monthly, Journal of Human Rights, Perspectives on European Politics & Society and the Journal of European Integration, among others. He authored The Limits of Transnationalism: Collective Identities and EU Integration and co-edited several volumes, including Diversity and the European Union, Identity Politics in the Age of Globalization, and European Identity and Culture: Narratives of Transnational Belonging.\nÂ \nCo-sponsored by\nEuropean and Eurasian Studies Program\nMiami-Florida Jean Monnet Center of Excellence\nDepartment of Politics and International Relations\nÂ \nFor more information, please call 305-348-7266.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29310481%2F24694829169%2F1%2Foriginal.jpg?s=f77084a5db6c595cec88c6979b498f3f', 'https://www.eventbrite.com/e/us-russia-relations-is-this-cold-war-2-tickets-32861529720?aff=ebapi', 'College of Business Complex, Room 233', 42.727, -84.4726, 'College of Business Complex, Room 233', NULL, NULL, '1492419600', '1492426800', 0, 0, 0, NULL, 1),
(130, 'live', '33412248936', 13, 0, 2, 'Election 20XX Teach-In', 'An event in partnership with Michigan Truth, Racial Healing & Transformation Collaborative of Lansing to educate ourselves on why Black political power matters. Uniting in solidarity across issues and communities is one of our most urgent challenges and opportunities. What action will you take toÂ Â transform our neighborhoods, our communities, our schools, our regions, states, and our nation?Â \nPlease limit registration to no more than 5 representatives from your organization. Thanks!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30073137%2F201402982734%2F1%2Foriginal.jpg?s=e664db5aa4d05ce1fdcfb4b048161377', 'https://www.eventbrite.com/e/election-20xx-teach-in-tickets-33412248936?aff=ebapi', '2020 East Mount Hope Avenue, Lansing, MI 48910', 42.7117359, -84.5230598, '2020 East Mount Hope Avenue, Lansing, MI 48910', NULL, NULL, '1493533800', '1493548200', 0, 0, 0, NULL, 1),
(131, 'live', '31449831292', 13, 0, 2, 'Kids'' College 2017', 'The Gifted and Talented Office of Ingham Intermediate School District and Michigan State University are pleased to announce the 31st year of Kidsâ€™ College for talented students. This collaborative venture is designed to improve and expand educational offerings for students who have outstanding abilities and/or potential talent in the content areas of science, technology, engineering and math. The content focus for 2017 is â€œForces.â€\nEligibility CriteriaTo be eligible for participation, a student:\n\nMust currently be in grade 4 or grade 5\nMust attend school in Ingham, Clinton, Eaton or Shiawassee counties with preference being given to students from Ingham County\nShould have an interest in science\nMust have demonstrated high potential for development in the sciences\nMust submit a letter of recommendation from the principal, gifted and talented coordinator or classroom teacher\nMust have parental permission to participate\n\nFacultyThe faculty for Kidsâ€™ College consists of experienced classroom teachers who have completed study in graduate level courses in gifted education and science education.\nScheduleKidsâ€™ College will operate from Monday, July 10 through Friday, July 21, 2017 from 8:30am to 11:30am each weekday in Berkey Hall on the campus of Michigan State University.Â \nTuitionThe tuition for Kidsâ€™ College is $290.00 per student.Â Partial scholarships are available with proof of income. If you are interested in applying, DO NOT COMPLETE REGISTRATION. Exit registration and contact Lonnie Thomas at lthomas@inghamisd.org.\nTransportationTransportation will be available to students who reside within the Lansing School District service area. Contact Ingham ISD, Gifted and Talented Office, lthomas@inghamisd.org for more information. For students who do not reside within the Lansing School District service area, transportation must be provided by the parents/family to and from the program. Parents must have students at MSU by 8:30 AM each day of the program. It is important that parents arrive between 11:30 and 11:45 AM to pick up students.Â The program coordinator and instructors will be available at Berkey Hall from 8:00am to 12:00pm each day.Â Specific instructions about where to drop off and pick up students will be given at the Orientation Meeting.\nAdditional InformationUpon completion of registration, an email will be sent confirming your registration and requesting addtional forms including a Letter of Recommendation.\nAll required documentation must be submitted by June 9, 2017.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27640554%2F128158272807%2F1%2Foriginal.jpg?s=3ce714d79790843030e4f7d9a8bdce7a', 'https://www.eventbrite.com/e/kids-college-2017-tickets-31449831292?aff=ebapi', 'Berkey Hall 220 Trowbridge Road, East Lansing, MI 48824', 42.724305, -84.47960469999998, 'Berkey Hall 220 Trowbridge Road, East Lansing, MI 48824', NULL, NULL, '1499675400', '1500636600', 0, 0, 0, NULL, 1),
(132, 'live', '30957336226', 13, 0, 2, 'Michigan Authorizer Conference 2017', 'The Michigan Council of Charter School Authorizers presents a day of professional development and networking for current and future authorizers across the state of Michigan.Â \nState Superintendent Brian Whiston will give the keynote address.Â \nAbout The Michigan Council of Charter School AuthorizersThe Michigan Council of Charter School Authorizers is a collaborative non-profit, non-partisan professional organization that allows for sharing of issues, ideas, resources and best practices among all public school academy authorizers working in the state.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27113555%2F126853218933%2F1%2Foriginal.jpg?s=b7aa47ca0e389ce737f59fe1e3d6bce5', 'https://www.eventbrite.com/e/michigan-authorizer-conference-2017-tickets-30957336226?aff=ebapi', '3535 Forest Road, Lansing, MI 48910', 42.7053769, -84.50139250000001, '3535 Forest Road, Lansing, MI 48910', NULL, NULL, '1493694000', '1493717400', 0, 0, 0, NULL, 1),
(133, 'live', '31157271237', 13, 0, 2, 'Skeletons, Jaws, and Jars: A Tour of the MSU Museum Vertebrate Collections', 'Take a guided, behind-the-scenes tour of the vertebrate collections, where over 111,000 specimens of mammals, birds, reptiles, amphibians, fishes, and fossils are housed. Learn how these are used for research and learning at MSU and around the world. Please be aware that the tour area has some steps. The tour is intended for participants ages 7 and up.\nTwo tour times are offered; 2:00PM and 2:45PM. Each tour has a maximum of 15 participants. RSVP is required. Tours depart promptly from the Collections-Connections Gallery located on the first floor.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27326182%2F199187732777%2F1%2Foriginal.jpg?s=ad144469f66c1cf70aa90917683a0744', 'https://www.eventbrite.com/e/skeletons-jaws-and-jars-a-tour-of-the-msu-museum-vertebrate-collections-tickets-31157271237?aff=ebapi', '409 West Circle Drive, East Lansing, MI 48824', 42.7315498, -84.48168429999998, '409 West Circle Drive, East Lansing, MI 48824', NULL, NULL, '1492158600', '1492163100', 0, 0, 0, NULL, 1),
(134, 'live', '32407683253', 13, 0, 2, 'HEALING WITHOUT HARMING: TRANSLATING TRAUMA INFORMATION INTO SKILLS & ACTION-CEU''s available', 'The Adverse Childhood Experiences Study has become widely known in providing a foundation for medical and service providers to better understand the consequences of childhood trauma and how to mitigate their impact. The Adverse Childhood Experiences Study helps move those working with individuals, parents, families, children to a place of being informed. The Good Harbor Institute workshop provides the next step. This workshop provides practical skills for everyone in your organization to implement immediately in their practice. These skills focus on learning a trauma informed/coaching based form of communication.Â \nGoals:\n\nUnderstand how the information from evidenced-based trauma/adversity research can be translated into skills used daily for better outcomes \nPractice and learn the Coaching Model of communication\nUnderstand how self-care is essential to implementing trauma informed service\nUnderstand how team care is essential to implementing trauma informed service\n\nFormat: lecture, discussion, small group activities, individual-reflective activities\nLearning Objectives:\n\nParticipants will gain an overview of the evidenced-based trauma/adversity research\nParticipants will gain an overview of the concept of Resilience and how it forms\nParticipants will understand the Trauma Care Stages\nParticipants will learn the link between self-care and implementing trauma informed service\nParticipants will learn how self-care is different than stress reliefÂ  \nParticipants will learn the importance of personal trauma awareness is and how personal trauma/adversity can impact clients\nParticipants will have an opportunity to begin creating self-care plans\nParticipants will gain an overview and have opportunities to practice the Coaching Model of service to create better outcomes for clients\nParticipants will understand why community care is important and how understanding trauma/adversity can serve to unite\nParticipants will understand how community care sustains the use of trauma informed care in the community\n\nRECOMMENDED FOR: Foster & Adoptive Parents, CASA and other high risk youth volunteers, Social Workers, Teachers, Court Employees (Staff), Attorneys, Judges, Board Members of Non Profits, Physcians, Physcian Assistants, Nurses, HR Manager and all those who work with those impacted by trauma.Â \nSCHEDULE:Â \nREGISTRATION: Â 8:00 a.m.-8:30 a.m. (Continential Breakfast)\nINTERACTIVE PROGRAM, MODULE 1: 8:30-12:00 p.m.Â \nWORKING LUNCH: 12:00 P.M.-1:00 P.M. (Buffett Lunch Provided)\nINTERACTIVE PROGRAM, MODULE 2: 1:00 p.m.-4:30 p.m.Â \nCEU''S AVAILABLE:\n8 contact hours for Certified Family Life educator (CFLE) by the National COuncil on Family Relations\n\nPRESENTERS:Â \nShenandoah Chefalo\n\nShenandoah Chefalo is a graduate of Michigan State University, holding a Bachelor of Arts with a Major in Interdisciplinary Studies in Social Science, a Core Essentials Graduate from Coach U, and a member of the Foster Leaders Movement. She is a sought after speaker on topics surrounding youth in foster care, and has been featured as a guest locally, nationally and internationally.\nA survivor and alumni of the foster care system, Shenandoah Chefalo is also the co-founder of the Good Harbor Institute, which translates evidence-based research on trauma into skills that can be used immediately and everyday.\nIn additional to her book, Garbage Bag Suitcase, she also wrote an e-book entitled Setting Your Vision and Defining Your Goals, and is also working on her next manuscript, Hiking for Stillness.\nDr. Cathy Fialon\n\nDr. Cathy Fialon holds a PhD in criminal justice, a Masters of Liberal Studies with concentrations in educational leadership and emergency management, and a Bachelor of Science in journalism and a Bachelor of Arts in philosophy. Her professional background includes working 20 years in higher education law enforcement, where she served as Indianaâ€™s first female president of the Indiana Campus Law Enforcement Administrators Association and serving as the Director of Emergency Management for Miami Dade Collegeâ€™s 174,000 students.\nAfter receiving her PhD in criminal justice she made the decision to change her career trajectory, first working as a court advocate for survivors of domestic and sexual violence. She then worked as Program Manager for 13 th Circuit Court, Family Division in Michigan. In her work as Program Manager she supervised juvenile probation, truancy intervention and the Court Appointed Special AdvocatesÂ program. She has now joined forces with community advocate and author, Shenandoah Chefalo to create Good Harbor Institute where they create programs translating evidenced-based research on trauma into skills which can be used immediately.\n\nAny and all questions can be directed to drfialon@goodharborinst.com or (765) 977-5977', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28746213%2F24324155490%2F1%2Foriginal.jpg?s=294ab5e688b374ff2b617fbfbecfc77b', 'https://www.eventbrite.com/e/healing-without-harming-translating-trauma-information-into-skills-action-ceus-available-tickets-32407683253?aff=ebapi', '3535 Forest Road, Lansing, MI 48910', 42.70547209999999, -84.50141780000001, '3535 Forest Road, Lansing, MI 48910', NULL, NULL, '1503390600', '1503419400', 0, 0, 0, NULL, 0),
(135, 'live', '32655633880', 13, 0, 2, '2020 Girls Annual Field Trip to Dewpoint', 'You are cordially invited to join the 2020 Girls on their second annual field trip to Dewpoint! OnÂ Wednesday, April 20th at 4:45 p.m, our 2020 Girls will tour Dewpoint''s facilities, learn about careers in the IT field and compete in new STEM-based challenges! We ask that you arrive at 5:30pm to see our 2020 Girls in action and join in the fun. Â After the trip, we invite our Giving Society members and their guests to stay for a cocktail hour.\nSchedule:\n5:15 - 5:30 - Arrival and HorsÂ D''oeuvres5:30 - 5:45 - Tours of the Building and Activities5:45 - 6:05 - STEM-based competitions, feel free to join in!6:05 - 7:30 - Giving Society Happy Hour\nWe hope to see you there!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29109192%2F126368273915%2F1%2Foriginal.jpg?s=8b173be6a055f237d170bd9a2d9a4c54', 'https://www.eventbrite.com/e/2020-girls-annual-field-trip-to-dewpoint-tickets-32655633880?aff=ebapi', '300 South Washington Square #200, Lansing, MI 48933', 42.7309409, -84.5528516, '300 South Washington Square #200, Lansing, MI 48933', NULL, NULL, '1492689600', '1492696800', 0, 0, 0, NULL, 1),
(136, 'live', '33281460745', 13, 0, 2, 'NSX Fundamentals Live - Lansing', 'Your Path to the Software-Defined Data Center: Virtualize the Network with VMware NSX\nDigital business transformation is creating new opportunities and risks for businesses across every industry.\nTo help you overcome challenges such as increased risk of data breaches and meet business demands on IT to deliver applications and services faster, VMwareÂ® NSXâ„¢ moves the data center network model to software, enabling any network topology to be created in minutes and bringing with it an inherently more secure architecture.\nJoin us in a city near you for this three-hour seminar where you will discover how to bring the operational model of a virtual machine to your data center network, so you can transform the economics of network and security operations.\nThis seminar will include:\n\nBusiness overview of use cases and IT outcomes\nTechnical overview of VMware NSX\nAn opportunity to connect with VMware NSX expert\nAnd lunch!\n\n____________________________________________________________________________\nBuild a fundamentally more agile, efficient and secure application environment with VMware NSX network virtualization on powerful industry standard infrastructure featuring IntelÂ® XeonÂ® processors and IntelÂ® Ethernet 10GB/40GB Converged Network Adapters', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29846514%2F163365714728%2F1%2Foriginal.jpg?s=9f2f73123fc689d4956ac673398100dd', 'https://www.eventbrite.com/e/nsx-fundamentals-live-lansing-tickets-33281460745?aff=ebapi', '2324 Showtime Drive, Lansing, MI 48912', 42.7666903, -84.51727699999998, '2324 Showtime Drive, Lansing, MI 48912', NULL, NULL, '1492669800', '1492680600', 0, 0, 0, NULL, 1),
