(138, 'live', '33378981432', 13, 0, 2, 'Draught Horse Beer and Reuben Pairing at REO Town Pub', 'We have one beer/food pairing event for April. This month''s pairing will take placeÂ April 17thÂ atÂ REO Town PubÂ where we will sample 5 different reuben sandwiches made fromÂ Good Truckin DinerÂ and paired with beers fromÂ Draught Horse Brewery.\r\nÂ \r\n\r\n\r\nÂ As always, the event will be run in the style of a beer dinner to be served in order starting around 7:00. We strongly urge everyone to buy tickets online ahead of time, as these events tend to sell out quickly.\r\nÂ \r\n\r\nWhere: Reo Town Pub\r\nWhen: April 17th starting at 7pm\r\nThe Pairings: (5 - 4oz Draught Horse Beers paired with 5 Good Truckin Diner Reubens)\r\n\r\nLoko Sol Cream AleÂ - Rachel (Turkey Reuben)\r\nTotally BlondeÂ - Cuban ReubenÂ \r\nPelham PaleÂ - Pastrami Reuben\r\nTax Man IPAÂ -Â Classic Reuben (Corned Beef)\r\nFoundation IPAÂ - Pittsburgh Reuben', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29973587%2F15662373493%2F1%2Foriginal.jpg?s=3a0379f63bbbb4d5e0f86f72995926f0', 'https://www.eventbrite.com/e/draught-horse-beer-and-reuben-pairing-at-reo-town-pub-tickets-33378981432?aff=ebapi', '1147 S Washington Ave, Lansing, MI 48910', 42.720377, -84.55201899999997, '1147 S Washington Ave, Lansing, MI 48910', NULL, NULL, '1492435800', '1492446600', 0, 0, 0, NULL, 1),
(139, 'live', '30246976521', 13, 0, 2, 'CHILD AND ADULT CARE FOOD PROGRAM FISCAL YEAR 2017 RECORD KEEPING TRAINING', 'Â \r\nMichigan Department of Education\r\nOffice of School Support Services\r\nChild and Adult Care Food Program\r\nFY 2017 RECORD KEEPING TRAINING\r\nYou must go to:Â Â  www.Eventbrite.com to register for this workshop.\r\nÂ \r\nCACFP reserves the right to cancel trainings due to low participation.\r\n(CACFP Instructors start the training day at 9:00am.)\r\nTopics Covered\r\n\r\n\r\nRecord Keeping (Monthly and Annual Forms)\r\n\r\n\r\nHow to Submit a Claim\r\n\r\n\r\nMenus/Nutrition/New Meal Pattern Overview\r\n\r\n\r\nMonitoring/Sponsor Responsibilities (Sponsors only)\r\n\r\n\r\nAt-Risk Afterschool \r\n\r\n\r\nInfant Menus\r\nÂ \r\n9:00am â€“ 12:00pm Record Keeping\r\nÂ \r\nLunch Break â€“ on your own \r\n(12:00pm â€“ 1:00pm) \r\nÂ \r\n1:00pm â€“ 3:00pm Menus/Nutrition/New Meal Pattern Overview\r\n1:00pm - 3:00pm Monitoring (Sponsor of Centers only)*\r\n1:00pm â€“ 3:00pm At-Risk Afterschool\r\n1:00pm â€“ 3:00pm Infant Menus\r\nÂ \r\nNOTE: You must create a log in and password on\r\nwww.Eventbrite.com to register for CACFP trainings.\r\nÂ \r\nPlease save your Log in name and Password information. \r\nCACFP staff will not have access to any log in or password information. \r\nÂ \r\nPLEASE PRINT OUT YOUR REGISTRATION CONFIRMATION!\r\nIt is recommended that you bring your ticket. \r\nHowever, you may still attend the training without the registration ticket.\r\nAttention: Persons with disabilities needing reasonable accommodations for effective participation in the workshop should contact the Child and Adult Care Food Program office at 517-373-7391. Requests for accommodations should be made at least two weeks prior to the training sessions.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26635496%2F109585801231%2F1%2Foriginal.jpg?s=ff365ad334aad134b4fe515b18c5060f', 'https://www.eventbrite.com/e/child-and-adult-care-food-program-fisca