(140, 'live', '28367784808', 13, 0, 2, 'Michigan Equal Pay Legislative Day', 'Michigan Equal Pay Legislative Day is April 25, 2017.\nRegistration and Breakfast - 8:30 am to 9:30 am\nIssues briefing - 9:30 am to 11:30 pm. Â The issues briefing requires registration and is due April 17, 2017, but the rally is open to the public.\nRally follows at 12:30 pm on the Capitol steps in Lansing, MI. Â \nThe Michigan Equal Pay Day Coalition invites the public to recognize Equal Pay Day, a national day of recognition that, even after more than 53 years of federal law banning sex-based wage discrimination, there is still a significant pay gap between womenâ€™s and menâ€™s wages. The Michigan Equal Pay Day event will occur on the Capitol steps in Lansing. Similar events are occurring across the nation.\nEqual Pay Day symbolizes how far into the year women must work to earn what men earned the previous year. Tuesday is the day of the week on which womenâ€™s wages catch up to menâ€™s wages from the previous week. Â Visit the MI Equal Pay Coalition webpage to learn more: Â https://miequalpay.wordpress.com/\nFollow us on Facebook: Â https://www.facebook.com/MIequalpay/\nTwitter: Â @MIequalpay #miequalpay\n\nÂ \nFAQs\nÂ \nAre there ID requirements or an age limit to enter the event?\nNo.\nÂ \nWhat are my transport/parking options getting to the event?\n1) Public parking ramp garage is available on Shiawassee and Capitol.\n(2) Street parking is also possible. Most street meters have limited time allotments.\nBring $2â€”$3 of quarters for street meter parking.\nÂ \nWhere can I contact the organizer with any questions?\nMickey Edell - Â (734) 716-1833\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F24746565%2F167632388833%2F1%2Foriginal.jpg?s=3509c4c72e2ad8fe117f41628f251fbf', 'https://www.eventbrite.com/e/michigan-equal-pay-legislative-day-tickets-28367784808?aff=ebapi', '215 N. Capitol Avenue, Lansing, Michigan 48933', 42.73500689999999, -84.55432910000002, '215 N. Capitol Avenue, Lansing, Michigan 48933', NULL, NULL, '1493089200', '1493107200', 0, 0, 0, NULL, 1),
(141, 'live', '32758667055', 13, 0, 2, 'AirFive AfterFive Lansing', 'You wont want to miss this event. Come meet new friends and connections. Exchange contact info and buy drinks with the new AirFive mobile app (in the App Store and Google Play). Our mission is to create a community of genuine people on a localized level.\nA localized meetup built around an app. Come and see what it''s all about!Â \nOh - yeah - get a free drink on AirFive!Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29206764%2F142468373189%2F1%2Foriginal.jpg?s=69e365bd5c8d08001e233a80fa68a692', 'https://www.eventbrite.com/e/airfive-afterfive-lansing-tickets-32758667055?aff=ebapi', '518 E Shiawassee St, Lansing, MI', 42.73671, -84.54577599999999, '518 E Shiawassee St, Lansing, MI', NULL, NULL, '1493209800', '1493217000', 0, 0, 0, NULL, 1),
(142, 'live', '29799926382', 13, 0, 2, 'Container Gardening', 'Container gardening has become a popular form of flower, veggie and herb gardening and is ideal for people with little outdoors space or living in an urban setting. Workshop led by Leah Kate McKenney of Hunter Park GardenHouse.\nIn effort to offer exceptional gardening workshops to our community, we try to price the workshops to cover our costs of hosting them, while keeping the registration affordable for our neighbors. This application is for a workshop registration waiver which is intended for neighbors who cannot afford the $12 registration for our GardenHouse workshops. Please click the following link:Â Hunter Park GardenHouse Workshop Registration Waiver Application.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26307831%2F129040189309%2F1%2Foriginal.jpg?s=54674d4d857debedb0e12d3a5893fd04', 'https://www.eventbrite.com/e/container-gardening-tickets-29799926382?aff=ebapi', '1400 East Kalamazoo Street, Lansing, MI 48912', 42.728762, -84.53042800000003, '1400 East Kalamazoo Street, Lansing, MI 48912', NULL, NULL, '1493449200', '1493454600', 0, 0, 0, NULL, 1),
(143, 'live', '32962402433', 13, 0, 2, 'Michigan Scholars Strategy Network Happy Hour', 'Do you want to find direct, effective ways for your scholarship to contribute to public policy? Then join us for a gathering to help kick-off the Michigan chapter of the Scholars Strategy Network at HopCat East Lansing on April 19.\nWe hope you can attend to learn more about the Scholars Strategy Network and how your research and expertiseÂ can directly contribute to local, regional and national public debates.\nPlease join usÂ for food, drinks, networking, and planning - your input and engagement are needed!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29442780%2F93918548823%2F1%2Foriginal.jpg?s=18c420b94c6ab7f87ff7883d15c930d6', 'https://www.eventbrite.com/e/michigan-scholars-strategy-network-happy-hour-tickets-32962402433?aff=ebapi', '300 Grove Street, East Lansing, MI 48823', 42.7359295, -84.48187000000001, '300 Grove Street, East Lansing, MI 48823', NULL, NULL, '1492601400', '1492610400', 0, 0, 0, NULL, 1),
(144, 'live', '30096880580', 13, 0, 2, 'April 7, 2017 MSUFCU Financial Workshop', 'MSUFCU will now be holding bi-weekly financial workshops in The Hatch during lunch time, during which pizza will be provided.\nTopics include: Â \n1.Credit reports and scores â€“ how to read them, why do they matter, how to build or fix credit\n2. Business entity â€“ Sole prop, DBA, LLC, Corp, etcâ€¦ - what are the differences and how do I file? What paperwork do I need?\n3. Applying for a loan â€“ how to prepare, what you need to submit, how does MSUFCU make the decision to approve or deny\n4/7, &Â 4/21', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26519987%2F46594630145%2F1%2Foriginal.jpg?s=395c5c2a45e2e38062ce740ab00d17c4', 'https://www.eventbrite.com/e/april-7-2017-msufcu-financial-workshop-tickets-30096880580?aff=ebapi', '325 East Grand River Avenue #345, East Lansing, MI 48823', 42.7347227, -84.48057069999999, '325 East Grand River Avenue #345, East Lansing, MI 48823', NULL, NULL, '1491546600', '1491550200', 0, 0, 0, NULL, 1),
(145, 'live', '31597748717', 13, 0, 2, 'Pizza with the Provost, Dr. Richard Prystowsky', 'Lunch is on Dr. Prystowsky. Students are invited to join Dr. Prystowsky for pizza, light beverages and edifying conversation about student success and operation 100%.\nÂ \nFacilitatorDr. Richard Prystowsky, Provost& Franchesca Cifuentes, Centre CoordinatorÂ \nLocationMain CampusThe Centre for Engaged InclusionGannon GB 252.02', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29855128%2F186273936581%2F1%2Foriginal.jpg?s=b2e1e1e549def64ceb7d5b6ae4996978', 'https://www.eventbrite.com/e/pizza-with-the-provost-dr-richard-prystowsky-tickets-31597748717?aff=ebapi', 'Lansing Community College (Gannon Room 252.02) 422 North Washington Square, Lansing, MI 48933', 42.73834979999999, -84.55139409999998, 'Lansing Community College (Gannon Room 252.02) 422 North Washington Square, Lansing, MI 48933', NULL, NULL, '1491804000', '1491809400', 0, 0, 0, NULL, 1),
(146, 'live', '32412092441', 13, 0, 2, 'Wine & Stein', 'Bring your friends to this casual after hours event at the zoo featuring beer and wine sampling, live music and free tasty treats from local food vendors.  Eat, drink and celebrate spring while you support a great cause - Potter Park Zoo! Must be 21 or over to attend. ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28837490%2F98292064621%2F1%2Foriginal.jpg?s=ec4cb76e88ea3a7a1814ecce797e2479', 'https://www.eventbrite.com/e/wine-stein-tickets-32412092441?aff=ebapi', '1301 South Pennsylvania Avenue, Lansing, MI 48912', 42.718292, -84.53204800000003, '1301 South Pennsylvania Avenue, Lansing, MI 48912', NULL, NULL, '1495128600', '1495144800', 0, 0, 0, NULL, 1),
(147, 'live', '33020260488', 13, 0, 2, 'Lansing MI - MILegalize Fundraiser 4/23/17', 'Support MILegalize and help us get marijuana legalization up for vote in 2018!\nYour $20 donation gets you a:\n\nPARTY with other supporters! Current MMMP patients can byo or buy meds from on-site vendors. :)\nChance to win cash in our 50/50 fundraiser (for each donation, $5 to MILegalize, $5 to the winner)\nFirst 40 attendees get a cool goodie bag with nice stuff provided by ACT Laboratories\nDrawings for prizes\nSlices of yummy, Michigan-owned Little Caesars pizza\nDetroit-made Faygo soda or bottled water\n\nHelp legalize Michigan! Keep friends and family out of jail and grow Michigan''s economy! For more information about MILegalize, or to volunteer to help with the upcoming ballot petition signing drive, check out www.milegalize.com!\nÂ FAQs\nÂ Are there ID or minimum age requirements to enter the event?\nCurrent MMMP patients - The host is an active marijuana dispensary\nÂ What are my transportation/parking options for getting to and from the event?\nFree parking in the lot and on the street. The Lansing Market is between Washington Ave and Martin Luther King Jr Blvd. If taking the bus, it''s closer to MLK.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29516997%2F202519322794%2F1%2Foriginal.jpg?s=9925bf6bbcbacca45267e09679cb6131', 'https://www.eventbrite.com/e/lansing-mi-milegalize-fundraiser-42317-tickets-33020260488?aff=ebapi', '918 Southland Ave, Lansing, MI 48910', 42.6999091, -84.5656419, '918 Southland Ave, Lansing, MI 48910', NULL, NULL, '1492939800', '1492950600', 0, 0, 0, NULL, 1),
(148, 'live', '33038683592', 13, 0, 2, 'FrogWatch USA Training â€“ Session 3', 'Spring is right around the corner and Potter Park Zoo is excited to announce this yearâ€™s Mid-Michigan FrogWatch USA Chapter training dates for aspiring frog watchers.Â Volunteers with FrogWatch USA are trained to learn when, where and how to collect data. They listen for and identify frog and toad calls at specific breeding sites around mid-Michigan, and then report their findings back to Potter Park Zoo. The information is then entered into a national database where it is used for monitoring the local amphibian population. Volunteers are asked to commit to a minimum of four listening sessions over the course of the frog/toad breeding season (April â€“ September). For those who donâ€™t live near a wetland or pond, there are several opportunities to listen in public places. Zoo staff can counsel participants on this.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29541346%2F95178946275%2F1%2Foriginal.jpg?s=50125d15ec1b6f6dc34fe5376233eb11', 'https://www.eventbrite.com/e/frogwatch-usa-training-session-3-tickets-33038683592?aff=ebapi', '1301 South Pennsylvania Avenue, Lansing, MI 48912', 42.718292, -84.53204800000003, '1301 South Pennsylvania Avenue, Lansing, MI 48912', NULL, NULL, '1492084800', '1492095600', 0, 0, 0, NULL, 1),
(149, 'live', '20709814613', 13, 0, 2, 'Scott DuBose', 'Where: Tequila Cowboy - Lansing\nWhen:Â April 7, 2017Â - Doors Open @ 4:00PM\nInfo: Scott DuBose\nPrice: Free! *$5 cover charge after 9PM*', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F17838752%2F141977339849%2F1%2Foriginal.jpg?s=9a2de6e3b2d3b4d9bae8bf66cbcbbf2b', 'https://www.eventbrite.com/e/scott-dubose-tickets-20709814613?aff=ebapi', '5660 West Saginaw Highway, Lansing, MI 48917', 42.7440615, -84.62899379999999, '5660 West Saginaw Highway, Lansing, MI 48917', NULL, NULL, '1491561000', '1491588000', 0, 0, 0, NULL, 1),
(150, 'live', '31893768119', 13, 0, 2, 'Clinton Global Initiative Info Session & Mini-Workshop: 4/10/17', 'Undergraduate Entrepreneurship and Innovation is hosting an information session and mini-workshop for students interested in applying to CGI U 2017.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28112233%2F75650767251%2F1%2Foriginal.jpg?s=541af4056be52891e92462e2a0304bf1', 'https://www.eventbrite.com/e/clinton-global-initiative-info-session-mini-workshop-41017-tickets-31893768119?aff=ebapi', 'East Lansing, MI 48824', 42.72663, -84.47361000000001, 'East Lansing, MI 48824', NULL, NULL, '1491822000', '1491825600', 0, 0, 0, NULL, 1),
(151, 'live', '30696332557', 13, 0, 2, 'Mom & Me Tea', 'Mom and Me Tea hosted by CAWLM will be held on May 13, 2017 at the Marquee from 11:30-1:30 pm', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26908974%2F65350359609%2F1%2Foriginal.jpg?s=bf3fd4dc4d6d88e567068fe8ad6ff604', 'https://www.eventbrite.com/e/mom-me-tea-tickets-30696332557?aff=ebapi', '319 East Grand River Avenue, Lansing, MI 48906', 42.747587, -84.54850900000002, '319 East Grand River Avenue, Lansing, MI 48906', NULL, NULL, '1494655200', '1494662400', 0, 0, 0, NULL, 1),
(152, 'live', '31602664420', 13, 0, 2, 'Roundtable Discussions: Uncovering our Aspirations for LCC', 'Community LAB: Roundtable Discussions | Uncovering our Aspirations for LCC\nThe Centre will be hosting three small roundtable discussions across the college to help us uncover our collective aspirations for the LCC community.Each roundtable discussion is a chance for us to better understand our aspirations, concerns, and the things we believe might make a difference in strengthening the LCC community. Findings from these conversations will inform the work of the Centre for Engaged InclusionÂ and the LCC Library.Please join us. Light refreshments will be served. RSVP is required. For more information donâ€™t hesitate to contact Franchesca Cifuentes, Centre Coordinator, at 517-483-1287.\n\nDATES & LOCATIONSWednesday, February 15 |Â 2:00pm - 4:00pm | MAIN CAMPUS (Room TBD)Monday, March 20 |Â 10:00am â€“ 12:00pm | The Centre for Engaged Inclusion (GB 252.02)Tuesday, April 18 |Â 10:00am â€“ 12:00pm | TBD\n\nFacilitatorsFranchesca CifuentesCentre CoordinatorThe Centre for Engaged InclusionSusan MurphyInstructional Services LibrarianTimothyÂ DeinesFaculty Member & Representative of the Center for Teaching ExcellenceVictoria MeadowsÂ Marketing, Communications, and Talent Director at the Lansing Economic Area Partnership (LEAP)\nLocationMultiple Locations', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28076128%2F186273936581%2F1%2Foriginal.jpg?s=b793becce27d7a065a203f29c42af486', 'https://www.eventbrite.com/e/roundtable-discussions-uncovering-our-aspirations-for-lcc-tickets-31602664420?aff=ebapi', 'The Centre for Engaged Inclusion (Gannon Building Room 252.02) 422 North Washington Square, Lansing, MI 48933', 42.73834979999999, -84.55139409999998, 'The Centre for Engaged Inclusion (Gannon Building Room 252.02) 422 North Washington Square, Lansing, MI 48933', NULL, NULL, '1492489800', '1492497000', 0, 0, 0, NULL, 1),
(153, 'live', '32833953238', 13, 0, 2, 'REO Brew School, Beer or Wine Class May 6th', 'Getting started with home brewing or wine making can be daunting with the amount of equipment and technical knowledge needed, we''ll make it easy for you! Â Sign up today if you are a beginner, are interested in brewing or you just like good craft beer and wine. Either way, this class will make it fun to learn. Â Nothing needed, just show up and enjoy brewing your own beerÂ or wine. Â Come on your own or bring up to 6 friends at a discounted rate. Â This is the only class around where you will getÂ hands-onÂ experience all the way through theÂ finished product, which you will then take home. Â You will have a complete set up dedicated to you and your guests. After the process is complete you''ll get to take home 2 cases of your own brewed delicious craft beer or 25 bottles of wine.\n1 student = $125, additional students $25. (Includes ingredients, equipment usage, fermentation temperature, up to 50 full bottles of beer or 25 bottles of wine to take home when it''s ready, and you can re-use these bottles for your next batch (a $25 value). Please note thatÂ beer takes two weeks to ferment, and two weeks to carbonate in bottles. You are welcome to learn how to bottle for free after two weeks, or we will bottle for you. Additonally, wine should ferment for one month minimially, however the longer you can wait the better!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29276157%2F170278589475%2F1%2Foriginal.jpg?s=f575c7fb66a986e5b642e1eb5377a03a', 'https://www.eventbrite.com/e/reo-brew-school-beer-or-wine-class-may-6th-tickets-32833953238?aff=ebapi', '2021 East Michigan Avenue, Lansing, MI 48912', 42.7335973, -84.52140969999999, '2021 East Michigan Avenue, Lansing, MI 48912', NULL, NULL, '1494045000', '1494054000', 0, 0, 0, NULL, 1),
(154, 'live', '32599937290', 13, 0, 2, 'Green Mile Pot Crawl', 'On April 20th, First Cannabis Church of Logic and Reason will be holding it''s inaugural Green Mile Pot Crawl event. This event is open to all valid medical card holders, free of charge!!!\n\nStarting at 10am you can pick up your passport at the Lansing Market and then travel around Lansing visiting each of the 10 participating locations. Each location will stamp your card showing you stopped by and then it''s back to the market to turn in your completed passport for a free pre-roll provided by the church. Each completed passport will also give you one entry into our 4/20 give away with prizes that include a brand new, multi-chamber, glass dab rig, cannabis gift bag valued at $100 and more!!\n\nWe will have a very limited number of VIP tickets available at $50 a piece. VIP ticket holders will get a free pre-roll or medible at each of the 10 participating locations, an event t-shirt, a bag to hold all your goodies, plus two additional entries into the drawing.\n\nLastly, if you want to crawl in style, we have partnered with Michigan Green Tours to offer a Cannabis friendly limo ride to each location. Tour the cities finest dispensaries in a luxurious setting with great music, a fully stocked non-alcoholic cooler, all while enjoying your favorite meds. We will have two departure times, 11am and 3pm, with a limited number of seats available for each so grab them while you can.\n\n*First Cannabis Church of Logic and Reason does not promote or condone driving while intoxicated. Please drive responsibly. We have partnered with Lyft for this event in case participants need safe transportation. Use code CANNARIDE for a discount on your trip!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29017610%2F205069594602%2F1%2Foriginal.jpg?s=262112745c30d465ae8ee69b297fc612', 'https://www.eventbrite.com/e/green-mile-pot-crawl-tickets-32599937290?aff=ebapi', '918 Southland Avenue, Lansing, MI 48910', 42.6999083, -84.56555889999998, '918 Southland Avenue, Lansing, MI 48910', NULL, NULL, '1492662600', '1492695000', 0, 0, 0, NULL, 1),
(155, 'live', '32815615389', 13, 0, 2, 'Coordinating the Care Coordinators Kick-Off Workshop', 'This workshop and conference call series will convene a broad community of multi-stakeholder constituents to frame a statewide approach to making care coordination more transparent. Right now, fragmentation and silos inhibit optimal care coordination throughout Michigan. This work seeks to help care teams know who is working with their patients, communicate with them, and reduce unnecessary provider burdens by avoiding duplication. Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29555000%2F137038342194%2F1%2Foriginal.jpg?s=2718eda20b46add169e0fd4f9f84e93a', 'https://www.eventbrite.com/e/coordinating-the-care-coordinators-kick-off-workshop-tickets-32815615389?aff=ebapi', '1115 South Washington Avenue, Lansing, MI 48910', 42.72133189999999, -84.551893, '1115 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1494475200', '1494496800', 0, 0, 0, NULL, 1),
(156, 'live', '33154807923', 13, 0, 2, 'Chasing the Moment [WORLD PREMIERE]', 'The intensity of experiences reported by athletes, musicians, chefs, and even the rest of us at the peak moments in our lives. Chasing the Moment uses the tools of documentary filmmaking to look deeply into the experience, to describe and measure its impact, and to try to explain the training, preparation, and discipline that make it possible. We will observe as people from many backgrounds and occupations chase the moment, hear them explain their experiences, as we try to unravel the mystery of this phenomenon.\nBob Albers / 2017 / 55 minutes / English / USA', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29687367%2F130875817385%2F1%2Foriginal.jpg?s=f63b47ee2c70476d3527d9d82c4689bb', 'https://www.eventbrite.com/e/chasing-the-moment-world-premiere-tickets-33154807923?aff=ebapi', '2500 South Washington Avenue, Lansing, MI 48910', 42.707105, -84.55794200000003, '2500 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1491633000', '1491640200', 0, 0, 0, NULL, 1),
(157, 'live', '33161935241', 13, 0, 2, 'College and Career Workshop', 'Come learn about different college/career options for students with disabilities, interact with college representatives, tour the campus of LCC (9:30 & 10:30am), and participate in interview building skills and mock interviews.\n\nColleges represented: Calvin College, Davenport University, Hope College, Lansing Community College (LCC), Michigan State University and Noorthoek Academy\nCommunity Partners represented: Capital Area College Access Network (CapCAN), Michigan Rehabilitation Services (MRS), Peckham, Resolution Services Center and Resource Center for Persons with Disabilities (RCPD)\nThis event is designed for students, grades 9-12, and parents/adult mentors.\nThe workshops will feature a track for students/parents interested in a career path, a track for students/parents interested in two- and four-year colleges, and a track for students/parents interested in colleges for students with disabilities.\n\nFREE parking is available at the LCC Gannon Ramp, 600 block of North Grand River.\nThis event is sponsored by Capital Area College Access Network, Ingham Intermediate School District Parent Advisory Committee, Lansing Community College, and Dean Transportation.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29695483%2F128158272807%2F1%2Foriginal.jpg?s=cc34a0e490b46e2c3a37ce5e623e57e9', 'https://www.eventbrite.com/e/college-and-career-workshop-tickets-33161935241?aff=ebapi', 'Main Campus, Gannon Building 422 North Washington Square, Lansing, MI 48933', 42.7382436, -84.55144860000001, 'Main Campus, Gannon Building 422 North Washington Square, Lansing, MI 48933', NULL, NULL, '1493440200', '1493456400', 0, 0, 0, NULL, 1),
(158, 'live', '32121125150', 13, 0, 2, 'Six:10 Clothing Brand 2017 Fashion Show', 'Six:10â„¢ Clothing Brand will be displaying their first Spring/Summer Collection of 2017. With bright and upbeat colors to earthly tones, Six:10 has captured them all. Showcasing the hottest new fashions for male and female with 2 great performances from Hezekiah and Revived Mime Ministry,Â you donâ€™tÂ want to miss this debut.Â It doesn''t matter what age you are. If you need a dose of youth, be there!\n\nSeating is limited, get your tickets early\nDoors open @6pm', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28374855%2F201720915795%2F1%2Foriginal.jpg?s=c1d8606c35f5475f079d865e4e2bade0', 'https://www.eventbrite.com/e/six10-clothing-brand-2017-fashion-show-tickets-32121125150?aff=ebapi', '300 S. Washington Square Lansing, Mi, Lansing, Mi 48933', 42.7309409, -84.5528516, '300 S. Washington Square Lansing, Mi, Lansing, Mi 48933', NULL, NULL, '1492173000', '1492180200', 0, 0, 0, NULL, 1),
(159, 'live', '32446335864', 13, 0, 2, 'RCAH Parents College 2017', 'This year Parents College will be held for one full day (8 AM until 8 PM) on Saturday, July 29 rather than three days.Â Â This will allow us to accommodate more participants. There will be a short set of readings and we will have special guests as we have in the past.Â Â \nThe emphasis will be on democratic dialogue and deliberation.Â Â We will not only learn about the challenges our democracy faces today and similar challenges faced worldwide, but we will also sharpen our own democratic skills and sensibilities.\nTo do this we will convene the first RCAH Peace Game.Â Â RCAH has held several peace games over the past three years, most recently in post-conflict Mali, in the Lansing area with high school students at the Lansing Refugee Development center, and with the 80-person leadership team of the MSU Federal Credit Union. One thing that democracies have been well known for has been their commitment to peace. Yet, we also know that not all self-proclaimed democracies are free of violence and not all democracies have avoided going to war.Â Â The relationship between democracy and peace has become more, not less complex over the past century.Â Â The RCAH Peace Game will allow us to engage in a simulation in which the connections between democracy and peace building will be carefully discussed and better understood. In the current context, maintaining our democratic institutions and practices alongside a commitment to non-violent peace building is a responsibility that we all share. The RCAH Peace Game is designed to prepare us for this road ahead.\nPlease Note: This program will be held in Snyder Hall from 8:00 am to 8:00 pm, on campus at Michigan State University, East Lansing Michigan. The $60.00 fee covers three meals and the course pack.\nPlease contact Dawn Janetzke at janetzk7@msu.edu or (517) 884-0383 with questions.\nFor more information on Peace Game please see:Â  http://rcah.msu.edu/news-events/events/rcah-parents-college-2017-democracy-peace.\n\n\n\n\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28825773%2F201624288103%2F1%2Foriginal.jpg?s=67c841ee2810859df72c90e467e13d1e', 'https://www.eventbrite.com/e/rcah-parents-college-2017-tickets-32446335864?aff=ebapi', '362 Bogue St., East Lansing, MI 48825', 42.72993899999999, -84.47306200000003, '362 Bogue St., East Lansing, MI 48825', NULL, NULL, '1501315200', '1501358400', 0, 0, 0, NULL, 1),
(160, 'live', '32702559235', 13, 0, 2, 'American Fifth Spirits Gin Class - Calling All Ginthusiasts', 'American Fifth Spirits presents our second Gin Class. The first was a huge hit so get your ticket today!\nLearn:\n\nThe history of gin\nHow to make gin\nWhat a fraction is\n\nDo:\n\nTaste botanical fractions\nCreate your own gin blend with 14 different fractions to choose from\nReceive a 375 ml bottle of Capital Gin as well as a 375 ml bottle of your blend to take home with you.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29157127%2F192380736024%2F1%2Foriginal.jpg?s=97ce9ba2f824b4d057a03e50c1f79505', 'https://www.eventbrite.com/e/american-fifth-spirits-gin-class-calling-all-ginthusiasts-tickets-32702559235?aff=ebapi', '112 N. Larch St., Lansing, MI 48912', 42.734056, -84.5442888, '112 N. Larch St., Lansing, MI 48912', NULL, NULL, '1492934400', '1492941600', 0, 0, 0, NULL, 1);
