(161, 'live', '32851911953', 13, 0, 2, 'Breakfast of Champions', 'The Michigan Coalition Against Homelessness invites you to the fourth annual Breakfast of Champions on Wednesday, May 17.\nPlease join us, along with our members and allies, in celebrating achievements in the fight against homelessness by recognizing individuals, agencies, and programs that are championing the cause.\nThis year MCAH is proud to host our special guest speaker, Mike Horvath of Invisible People!\n\n\nEveryone talks about social media''s potential to democratize andÂ empower those less fortunate. Mark actually makes that happen. Mark,or @hardlynormal as the Internet knows him, is an internationallyÂ recognized activist who tells the story of the countless individualsÂ without a voice-- those living in shelters, motels, tents, alongsideÂ streets and under highway bridges. His platform InvisiblePeople.tv isÂ one of the most revolutionary and poignant storytelling destinationsÂ we''ve ever seen on the web. Mark''s work is extraordinary because heÂ not only helps solve the systemic, scaled problems of homelessness byÂ destroying stereotypes, but he also helps singular individuals, everyÂ day.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29298263%2F206050858703%2F1%2Foriginal.jpg?s=6cab26167374ed14ed1780289a0def4e', 'https://www.eventbrite.com/e/breakfast-of-champions-tickets-32851911953?aff=ebapi', '111 North Grand Avenue, Lansing, MI 48933', 42.7341643, -84.55084679999999, '111 North Grand Avenue, Lansing, MI 48933', NULL, NULL, '1494990000', '1494999000', 0, 0, 0, NULL, 1),
(162, 'live', '33314151524', 13, 0, 2, 'Council of Authorizers 2017 Charter School Program Grant Meeting', 'The USED has released the 2017 charter school program grant application. The Michigan Department of Education will be applying for this grant to aid and facilitate start-ups of new charter schools in the state.Â  The MDE team is inviting youÂ and/or a representativeÂ to provide your thoughts and insight up front as we complete the application. \nPlease understand that we are on a compressed timeline for submission of the grant. We hope to see you at theÂ  meeting.\nIf you have any questions, feel free to contact Tammy Hatfield at 517-335-2797.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29891216%2F70965562799%2F1%2Foriginal.jpg?s=882e6b4c4bace9f4a19322f558b867c5', 'https://www.eventbrite.com/e/council-of-authorizers-2017-charter-school-program-grant-meeting-tickets-33314151524?aff=ebapi', '608 West Allegan Street (Ottawa 3), Lansing, MI 48933', 42.7371075, -84.5562878, '608 West Allegan Street (Ottawa 3), Lansing, MI 48933', NULL, NULL, '1491987600', '1491994800', 0, 0, 0, NULL, 1),
(163, 'live', '33408703331', 13, 0, 2, '2017 James Madison College Senior Research Showcase', '2017 Madison Research ShowcaseÂ \r\n4/28/2017, 8:30am - 7:00pm\r\nCome join us! - Registration requested, but no ticket will be required\r\nJames Madison seniors and award-winning scholars will present their cutting-edge research\r\nWe are inviting all James Madison students and faculty, alumni, public servants and adminstrators, and friends and family members to attend. Come to one or all events!\r\nSchedule\r\n8:30-8:45 Â Â Â Â Â Â Â Â Â Â Â  Arrival and Registration\r\n9:00Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  Welcome\r\n9:15-10:30Â Â Â Â Â Â Â Â Â Â  Panels and Honors Thesis Presentations\r\n10:45-noonÂ Â Â Â Â Â Â Â  Panels and Honors Thesis Presentations\r\n12:15-1:15Â Â Â Â Â Â Â Â Â Â  Lunch with Keynote Speaker, Jennifer Sykes, JMC\r\n1:30-2:45Â Â Â Â Â Â Â Â Â Â Â Â Â  Panels and Honors Thesis Presentations\r\n3:00-4:15Â Â Â Â Â Â Â Â Â Â Â Â Â  Panels and Honors Thesis Presentations\r\n4:30-7Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  Reception at Dublin Square Pub\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30014244%2F5328578766%2F1%2Foriginal.jpg?s=8297b1611f557cec60e9fd0e01d19d0a', 'https://www.eventbrite.com/e/2017-james-madison-college-senior-research-showcase-tickets-33408703331?aff=ebapi', '842 Chestnut Rd, East Lansing, MI 48823', 42.7212626, -84.48705689999997, '842 Chestnut Rd, East Lansing, MI 48823', NULL, NULL, '1493348400', '1493386200', 0, 0, 0, NULL, 1),
(164, 'live', '32125260519', 13, 0, 2, 'Heart Smart with Dr. Jean-Guy', 'Are you concerned about your heart health? Would you like to be off your cholesterol and blood pressure meds?\n\n\nHeart disease is the leading cause of death for men and women in the United States. \nJoin Dr. Jean-Guy Daigneault and learn 5 steps to a healthier heart and prevent/reverse the disease.\n\n\n\nDr. Jean-Guy is a Chiropractor, Nutritionist, Wellness Expert & Public Speaker', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28375517%2F129191537381%2F1%2Foriginal.jpg?s=4e928ce1f8de15a28c3080ad7f4cb8d0', 'https://www.eventbrite.com/e/heart-smart-with-dr-jean-guy-tickets-32125260519?aff=ebapi', '537 N Clippert St., Lansing, MI 48912', 42.7396351, -84.50862519999998, '537 N Clippert St., Lansing, MI 48912', NULL, NULL, '1492001100', '1492005600', 0, 0, 0, NULL, 1),
(165, 'live', '32324698042', 13, 0, 2, 'Tap & Ballet (3-5 years old)', 'Ballet/Tap\r\nages 3-5\r\nWenesday''s Â | Â 5:45pm-6:25pm\r\nJune 7th, 2017 - August 23rd, 2017\r\nRegistration includes 3 months of tuition. No class July 5th, 2017.\r\nAbsencesTuition for Dance Classes cannot be refunded or pro-rated if your child is absent. Â Make-up classes are not offered. We have reserved space for each child exclusively during the designated weeks and maintain a waiting list for those who register after the space is full. Â This session is a 3 month commitment, June 7th-August 23rd.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28640356%2F70074677955%2F1%2Foriginal.jpg?s=11d88ffe3e05f6e8a988e8f461bcdb39', 'https://www.eventbrite.com/e/tap-ballet-3-5-years-old-tickets-32324698042?aff=ebapi', '4976 1/2 Northwind Dr, East Lansing, MI 48823', 42.7257669, -84.45252690000001, '4976 1/2 Northwind Dr, East Lansing, MI 48823', NULL, NULL, '1496857500', '1503512700', 0, 0, 0, NULL, 1),
(166, 'live', '32969972074', 13, 0, 2, 'LifeVantage Academy, Lansing, MI - MAY 2017', 'LifeVantage Academy’s unified message will be taught by each presenter but with their own personalities, stories and examples. This will allow each training to be a unique experience. Please attend each month’s training to ensure the most full and well-rounded training for you and your team.\nEveryone needs a ticket, including guests. Get tickets now online to ensure a seat. Tickets at the door at the day of the event will cost $35.00, if seats are available. Credit or debit cards only. No cash or checks please. Tickets are non-refundable.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29453376%2F147913231252%2F1%2Foriginal.jpg?s=178db92418c317934bad9c8eb764e3d0', 'https://www.eventbrite.com/e/lifevantage-academy-lansing-mi-may-2017-tickets-32969972074?aff=ebapi', '3435 Forest Rd, Lansing, MI 48909', 42.7051805, -84.50244299999997, '3435 Forest Rd, Lansing, MI 48909', NULL, NULL, '1495270800', '1495285200', 0, 0, 0, NULL, 1),
(167, 'live', '33319446361', 13, 0, 2, '2017 Michigan China Forum', 'The Eli Broad College of Business is regarded as one of the worldâ€™s premier college of business. The Broad China Business Society (BCBS), a student organization affiliated with the Broad College, is committed to bringing in the research expertise of MSU faculties and the practical experience of business professionals together to deliver strategic insights into the U.S.- China economic relationship. BCBSâ€™s Greater China Supply Chain Forum was first held in 2003. Its aim is to promote global business with a focus on China among students and scholars at Michigan State University. The Supply Chain Forum is entirely student-organized and has proven to be a fantastic success as well as a benefit for students, business professionals, and the local community. â€‹Â Â Â Â Â Â Â Â Â Â Â  Driven by the rapid development of the Chinese Internet and technology startups, in 2015 the BCBS decided to broaden the focus of the conference beyond supply chain issues and changed the name of the program to the Michigan China Forum.Â  The topics discussed in 2015 were entrepreneurship, innovation, technology and big data.Â  In 2016 the conference explored finance and investment issues.\nThis year we will deepen our awareness of business innovation.Â  With constant changes in technology and economic globalization, organizations need to constantly innovate to keep their business relevant in this environment.Â  Understanding how organizations do this in their products, services, and processes will be the focus of this yearâ€™s forum.Â \nAgenda: \nMCF Presentation session 2:00-6:00pm FREE\nVIP Networking dinner 6:00-8:00pm $30 per person', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29899852%2F140978709026%2F1%2Foriginal.jpg?s=5396773ebdf560721470394b3fa6d9cb', 'https://www.eventbrite.com/e/2017-michigan-china-forum-tickets-33319446361?aff=ebapi', '49 Abbott Rd, EAST LANSING, MI 48824', 42.7341101, -84.48288309999998, '49 Abbott Rd, EAST LANSING, MI 48824', NULL, NULL, '1492158600', '1492173000', 0, 0, 0, NULL, 1),
(168, 'live', '33384997426', 13, 0, 2, 'Michigan''s Parental Alienation Awareness Rally', 'Please join Hostile Aggressive Parenting Awareness in Lansing onÂ April 25thÂ where we will help coordinate meetings for you with your local representative to discuss personally your concerns around family law. Following meetings from 9-1pm, lunch will be provided prior to a rally and press concerence at 3:30pm on the Lansing Capitol Steps with Representatives Jim Runestand and Tim Greimel. More to be confirmed! There will will acknowledge April 25th as Parental Alienation Awareness Day in Michigan as our representatives read the signed proclamation from Michigan Governor, Rick Snyder. Upon signing up for this event, we will contact you with next steps for coordinating your meetings. Together, we can impact change by asking our representatives to hear our concerns. We look forward to seeing you in Lansing!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29981093%2F140391252415%2F1%2Foriginal.jpg?s=85c082ffc30a5967432f90fe853208a8', 'https://www.eventbrite.com/e/michigans-parental-alienation-awareness-rally-tickets-33384997426?aff=ebapi', 'Lansing, MI', 42.7325, -84.5555, 'Lansing, MI', NULL, NULL, '1493091000', '1493116200', 0, 0, 0, NULL, 1),
