(172, 'live', '33169301273', 13, 0, 2, 'Realtor Match Mixer', 'Come on over to drink and mingle with several of the top real estate agents in the Greater Lansing Area! We invite you to this free event at the Lansing Brewing Company Thursday, May 11th. We will provide one drink ticket and appetizers to each person who RSVPs and attends. If you plan on buying or selling a house in the next year, this is an opportunity for you! You will meet around 10 local realtors and find the best match for you!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29702982%2F143687995197%2F1%2Foriginal.jpg?s=b0f53c3bf54c33091f7ee159a02775c2', 'https://www.eventbrite.com/e/realtor-match-mixer-tickets-33169301273?aff=ebapi', '518 East Shiawassee Street, Lansing, MI 48912', 42.7369821, -84.54555519999997, '518 East Shiawassee Street, Lansing, MI 48912', NULL, NULL, '1494504000', '1494511200', 0, 0, 0, NULL, 1),
(173, 'live', '33284627216', 13, 0, 2, 'Cybersecurity and Shooting Competition', 'Don''t let your organization become a target.\n76% of businesses surveyed in a recent CyberEdge report were breached by a cyberattack in 2015. Today''s cyber criminals are prolific, motivated, and most importantly, constantly evolving. It''s no longer a question ofÂ ifÂ you will be breached, butÂ when. Is your organization prepared?Â Join us as we dive into the evolving threat landscape and discuss how your organization can be prepared to stop even the most advanced threats. During this event, we will discuss how the LogRhythm Threat Lifecycle Management (TLM) platform can keep you a step ahead of your attackers by providing an end-to-end security workflow.Â You will learn:\n\nHow the approach to security is moving away from a traditional prevention-centric strategy\nThe capabilities and processes that allow you to sort through the noise to highlight and investigate concerning incidents\nHow to drastically reduce Mean-Time-to-Detect (MTTD) and Mean-Time-to-Respond (MTTR)\nHow to overcome resource constraints to develop a capable and formidable security operation that maximizes your ROI on security technology and personnel\n\nAfter youâ€™ve learned how to efficiently detect and respond to cyber threats, we invite you to join us out on the range for a competition shoot.Â Date:Â Thursday, April 27, 2017.Time:Â Noon to 2:30 p.m.Location:Â Demmer Center, 4830 E. Jolly Rd., Lansing, Michigan 48910Â Lunch will be provided byÂ Saddleback BBQÂ and all guns and ammo are provided by Demmer Center.Â Reserve your spot today â€“ space is limited!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29850643%2F195709432930%2F1%2Foriginal.jpg?s=d8550305c5f4fc3816ab02ebfcaaf1d4', 'https://www.eventbrite.com/e/cybersecurity-and-shooting-competition-tickets-33284627216?aff=ebapi', '4830 East Jolly Road, Lansing, MI 48910', 42.68200950000001, -84.47831869999999, '4830 East Jolly Road, Lansing, MI 48910', NULL, NULL, '1493274600', '1493283600', 0, 0, 0, NULL, 1),
