(175, 'live', '20021358422', 13, 0, 2, 'Lansing Public Media Center Production 101', 'This is the sign up and pre-pay for the Lansing Public Media Center Production 101 class. The class takes place from 10am-5pm. At the conclusion of the class you will receive a 1 year membership at the media center. Tuition is $50 for Lansing residents and $100 for non-residents.\nTo register at the Lansing resident price you must bring a valid driver''s license, state ID, or passport to the class.\nÂ \nClass size is limited to 15 people so register early!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F17370312%2F21719987028%2F1%2Foriginal.jpg?s=70526502b7a4f1b1a1f161adc90df3ce', 'https://www.eventbrite.com/e/lansing-public-media-center-production-101-tickets-20021358422?aff=ebapi', '2500 South Washington Avenue, Lansing, MI 48910', 42.707105, -84.55794200000003, '2500 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1492835400', '1492860600', 0, 0, 0, NULL, 1),
(176, 'live', '29765156384', 13, 0, 2, 'Gardening 101', 'Are you new to gardening? Learn the basics and skills to become a successful gardener. Workshop led by mom and daughter pair, Cindi McKenney and Leah Kate McKenney of Hunter Park GardenHouse.Â \nIn effort to offer exceptional gardening workshops to our community, we try to price the workshops to cover our costs of hosting them, while keeping the registration affordable for our neighbors. This application is for a workshop registration waiver which is intended for neighbors who cannot afford the $12 registration for our GardenHouse workshops. Please click the following link:Â Hunter Park GardenHouse Workshop Registration Waiver Application.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26456011%2F129040189309%2F1%2Foriginal.jpg?s=9bfed808b74b9b4861b02c2f9e87ae3c', 'https://www.eventbrite.com/e/gardening-101-tickets-29765156384?aff=ebapi', '1400 East Kalamazoo Street, Lansing, MI 48912', 42.728762, -84.53042800000003, '1400 East Kalamazoo Street, Lansing, MI 48912', NULL, NULL, '1492239600', '1492245000', 0, 0, 0, NULL, 1),
(177, 'live', '30097005955', 13, 0, 2, 'April 21, 2017 MSUFCU Financial Workshop', 'MSUFCU will now be holding bi-weekly financial workshops in The Hatch during lunch time, during which pizza will be provided.\nTopics include: Â \n1.Credit reports and scores â€“ how to read them, why do they matter, how to build or fix credit\n2. Business entity â€“ Sole prop, DBA, LLC, Corp, etcâ€¦ - what are the differences and how do I file? What paperwork do I need?\n3. Applying for a loan â€“ how to prepare, what you need to submit, how does MSUFCU make the decision to approve or deny', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26520045%2F46594630145%2F1%2Foriginal.jpg?s=9ecd343cc21ff3c7f435cf5e4e609735', 'https://www.eventbrite.com/e/april-21-2017-msufcu-financial-workshop-tickets-30097005955?aff=ebapi', '325 East Grand River Avenue #345, East Lansing, MI 48823', 42.7347227, -84.48057069999999, '325 East Grand River Avenue #345, East Lansing, MI 48823', NULL, NULL, '1492756200', '1492759800', 0, 0, 0, NULL, 1),
(178, 'live', '30850643104', 13, 0, 2, 'Lansing APA  - April 8', 'These labs focus on APA, thesis writing and organization; revising and editing papers, and a brief introduction to Miller Library. You will also have the opportunity work with an APA template for setting up papers.\r\nYou will want to bring your own laptop if you have one.Â \r\nThe labs take place at the Lansing Campus.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26999792%2F39009880970%2F1%2Foriginal.jpg?s=4b05f32e12d80ddb74829ecdb39e3a73', 'https://www.eventbrite.com/e/lansing-apa-april-8-tickets-30850643104?aff=ebapi', '6452 Millennium Drive Suite #180, Lansing, Mi 48917', 42.72534659999999, -84.64304149999998, '6452 Millennium Drive Suite #180, Lansing, Mi 48917', NULL, NULL, '1491622200', '1491633000', 0, 0, 0, NULL, 1),
(179, 'live', '30851452525', 13, 0, 2, 'Lansing Basic Excel - May 13', 'These labs are designed for those just beginning in Excel or wanting a refresher before taking a PGS course. The labs will give instruction and practice in Formulas, Sorting, Formatting, Graphs, Charts and Pivot tables. Instructors do not have specific training in using Macs.\r\nDepending on the needs of the students, there may be an opportunity to explore more advanced excel functions.\r\nYou will want to bring your own laptop if you have one.Â \r\nThe labs take place at the Lansing Campus.Â \r\nPlease email if you are not able to attend.Â \r\n* These labs are for Cornerstone students only.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27000278%2F39009880970%2F1%2Foriginal.jpg?s=4b9abca44d4f1a9370062910c9bf3370', 'https://www.eventbrite.com/e/lansing-basic-excel-may-13-tickets-30851452525?aff=ebapi', '6452 Millennium Drive Suite #180, Lansing, MI 48917', 42.72534659999999, -84.64304149999998, '6452 Millennium Drive Suite #180, Lansing, MI 48917', NULL, NULL, '1494646200', '1494657000', 0, 0, 0, NULL, 1),
(180, 'live', '31038103804', 13, 0, 2, 'Social Security, Medicare & Obamacare Myths Debunked | Critical Imperatives Facing the U.S.', 'Critical Imperatives Facing the U.S.:\nTalks and presentation facilitated by key LCC faculty that cover the critical issues that our country is facing.TOPIC: Social Security, Medicare & Obamacare Myths Debunked\nWe are regularly bombarded by politicians and pundits with claims that â€œSocial security and Medicare are going brokeâ€ and that we Obamacare has failed. Some attempt to pit the generations against each other by claiming â€œthe older generationâ€ is stealing from younger generation in these social insurance programs. Â The reality and truth is very different. Learn the facts, the truth, and learn the logic of how these programs really work and how they affect your present and future. Â FacilitatorJames Luke, Assistant ProfessorEconomics DepartmentLocationMain CampusThe Centre for Engaged InclusionGannon GB 252.02', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28077572%2F186273936581%2F1%2Foriginal.jpg?s=c26790d2d935df0ae2e016e8021a0708', 'https://www.eventbrite.com/e/social-security-medicare-obamacare-myths-debunked-critical-imperatives-facing-the-us-tickets-31038103804?aff=ebapi', 'Lansing Community College - Gannon Room 252.02 422 North Washington Square, Lansing, MI 48933', 42.7383499, -84.55139409999998, 'Lansing Community College - Gannon Room 252.02 422 North Washington Square, Lansing, MI 48933', NULL, NULL, '1493101800', '1493107200', 0, 0, 0, NULL, 1),
(181, 'live', '31595953347', 13, 0, 2, 'Seeking Safety 2017 Thursdays: 6-7:30 March 2 - April 27', 'This FREE pre-registered class will teach new skills to cope with strong emotions. Practice ways to be an advocate for yourself. Â Leave the past behind. Â The focus is on Safety and learning new skills to cope.Â \nThis course is for YOU if you have a history of: PTSD, trauma, substance use or want to cope better.\nLessons may include:\n\nGrounding\nSetting Boundaries in Relationships\nHealing from Anger\nCoping with Triggers\nRespecting Yourself\nSelf-Nurturing Â  Â  Â  Â  Â  Â  Â  Â  Â \n\nQuestions about content?\nContact: Amy Ann Moore, ICHD, Certified Prevention Specialist- 517.887.4586 amoore@ingham.org\n\nQuestions about your registration or accommodations?\nContact ICHD Registration and Enrollment Services: 517.887.4306\n\n\nTHE SIX WEEK COURSE\nThese are 6-week sessions:\n\n\nInfo Sessions : March 2 & 9Â \n\n\nLessons : March 16, 23, & 30 and April 13, 20, & 27Â \n\n\nTHERE IS NO COST TO ATTEND THIS PROGRAM', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27811105%2F165326206776%2F1%2Foriginal.jpg?s=1a9394becff70335c430eb1bc68f30e4', 'https://www.eventbrite.com/e/seeking-safety-2017-thursdays-6-730-march-2-april-27-tickets-31595953347?aff=ebapi', '913 W. Holmes Rd Building C: Lifeboat, Lansing, MI 48910', 42.7043124, -84.53270379999998, '913 W. Holmes Rd Building C: Lifeboat, Lansing, MI 48910', NULL, NULL, '1492086600', '1492092000', 0, 0, 0, NULL, 1),
(182, 'live', '32076613013', 13, 0, 2, 'Capital Tour 2017 - Lansing, MI', 'Start point to be announced soon - we will do a quick WOD to rack up some reps for a Charity Challenge, then ruck approx 20 miles to the statehouse. Carry 20 lbs or 20 kgs, your choice. Make sure you have a reflective belt on your ruck, and a headlamp or flashlight. We will move as a group, at a 16-18min per mile pace, and take breaks as necessary. There will be a seven hour time cap. Upon reaching the capitol, we will hear a brief presentation highlighting the life of a virtuous American whose work impacted the State. You''ll get a cool patch for completing the event. Merchandise from the Tour sponsors will be on hand, and of course T-shirts. Expect to have a good time, and see some great organizations representing such as F3, Team RWB, and FiA. Some Tour stops will have representatives from Operation enduring Warrior present to share their story.\nRx Ruck = Complete 20 mile ruck in the allotted 7 hr time with Danny. \nScaled Ruck = Meet Danny at the 15 mile point Â at 2230 (10:30pm) and finish the last 5 miles with the team. Details on the 15 mile rally point will be distributed when the route is published.\nOther Requirements:\nâ€“ $30 per participant (half will be donated to OEW) â€“ 20 lbs per ruck (or 20kgs for the big boys and big girls) â€“ Ruck must have reflective belt or lights attached, for vehicle safety â€“ Each event will start at exactly 1700hrs (5pm) for Rx and 2230 (10:30pm) for Scaled â€“ Time cap of 7 hours to complete with patch ceremony at the end â€“ 50% of the proceeds from the event go to Operation Enduring Warrior (check out their awesome work below)\nAbout Operation Enduring Warrior: OEW offers wounded veterans the opportunity to challenge themselves through various physically challenging events. OEW is made up of OEW Team Athletes, Community Ambassadors and Veteran supporters who join alongside our Adaptive Athletes in these challenging events. To find out more click here: http://enduringwarrior.org/about/', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28314927%2F201782993317%2F1%2Foriginal.jpg?s=1e036a064c3a1a905868fbd6d92b6e63', 'https://www.eventbrite.com/e/capital-tour-2017-lansing-mi-tickets-32076613013?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1504112400', '1504137300', 0, 0, 0, NULL, 0),
(183, 'live', '32413142582', 13, 0, 2, 'Day Camp 2017', 'Spend time examining how technology can help us reach the students who need us the most!\nThis exciting professional development opportunity will be filled with rich discussions about blended learning and intentionally utilizing technology to personalize learning.The day will focus how we teach and engage all our students. Whether you have a single device in the classroom or one for each student, we are at an unprecedented moment in time to utilize technology to enable truly personalized learning opportunities for all of our students.\nHighlights of the day include:\n\n\nKeynote Speaker:Â Pernille Ripp,Â creator of â€œThe Global Read Aloud,â€Â 7th-gradeÂ teacher, authorÂ and blogger.Â \n\n\nLightning Bug Talks: Teachers share their passion for teaching in five-minute speeches!\n\n\nSmall Group Discussion: Facilitator-led lunchtime discussions about your classrooms, challenges, and hopes for the new school year.\n\n\nOpen Poster Session: Your colleagues from around the state, spanning all grade levels, sharing photos, lesson plans and stories about their blended classrooms.\n\n\nCost includes breakfast, lunch and an awesome experience with educators who make a difference â€” just like YOU!\nHave a team of four or more? Email Erin atÂ eluckhardt@mivu.org for the teacher team promo code, or any other Day Camp questions you might have.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31071802%2F144894774934%2F1%2Foriginal.jpg?s=de590f189cab89c7abfffd6d717f352e', 'https://www.eventbrite.com/e/day-camp-2017-tickets-32413142582?aff=ebapi', '111 North Grand Avenue, Lansing, MI 48933', 42.73406, -84.55110300000001, '111 North Grand Avenue, Lansing, MI 48933', NULL, NULL, '1500971400', '1500996600', 0, 0, 0, NULL, 1),
(184, 'live', '33242936518', 13, 0, 2, 'ITEC''s Teacher Advisory Committee Meeting', 'Are you interested in helping Lansing students become invested in STEM? The Information Technology Empowerment Center is looking for educators in the Lansing area to join our Teacher Advisory Committee. Meeting bi-monthly, the TAC will review curricular units and assessment, provide insight into trends they see in theirÂ classroom,Â and advise on programmatic practices.Â Dinner will be provided as well as childcare for ages 5 and up. Teachers who participate in the TAC for at least six meetings will receive a visit for their classroom from ITEC''s TechTransport.\nCan''t make the meeting in person? A ZoomÂ meeting will be set-up for those interested in participating virtually.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29790591%2F126368273915%2F1%2Foriginal.jpg?s=88bdfc1cbd4344525ed83bc2c4c1904d', 'https://www.eventbrite.com/e/itecs-teacher-advisory-committee-meeting-tickets-33242936518?aff=ebapi', '200 North Foster Avenue, Lansing, MI 48912', 42.7348338, -84.51720219999999, '200 North Foster Avenue, Lansing, MI 48912', NULL, NULL, '1496338200', '1496343600', 0, 0, 0, NULL, 1),
(185, 'live', '33310780441', 13, 0, 2, 'Local Educational Agency (LEA) Authorizers 2017 Charter School Program Grant Meeting', 'The USED has released the 2017 charter school program grant application. The Michigan Department of Education will be applying for this grant to aid and facilitate start-ups of new charter schools in the state.Â  The MDE team is inviting you or a representativeÂ to provide your thoughts and insight up front as we complete the application. \nPlease understand that we are on a compressed timeline for submission of the grant. We hope to see you at theÂ  meeting.\nIf you have any questions, feel free to contact Tammy Hatfield at 517-335-2797.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29886539%2F70965562799%2F1%2Foriginal.jpg?s=522de39b01f8ceeae176f1b6e6afbd41', 'https://www.eventbrite.com/e/local-educational-agency-lea-authorizers-2017-charter-school-program-grant-meeting-tickets-33310780441?aff=ebapi', '608 West Allegan Street (Ottawa 3), Lansing, MI 48933', 42.7371075, -84.5562878, '608 West Allegan Street (Ottawa 3), Lansing, MI 48933', NULL, NULL, '1491883200', '1491890400', 0, 0, 0, NULL, 1),
(186, 'live', '33334374010', 13, 0, 2, '10th Annual Arts Advocacy Breakfast', 'Join us for an update on arts integration work happening in our mid-Michigan schools and the policy supporting arts education. Learn, about the resources and tools commissioned by the MDE to support arts education and experience from a studentsâ€™ and teacherâ€™s perspective, a world-class arts experience provided by a brilliant choreographer.\nOur featured guest artist, Aparna Ramaswamy, is co- Artistic Director, Choreographer and Principal Dancer with the award winning Ragamala Dance Company. Ramaswamy focuses on the arts of India while inspiring students and teachers to explore innovation within tradition. Ramaswamy will dazzle you with her dancing and perspectives on using Indian dance to educate.\nWe are joined by Sarah Triplett, Director Public Policy Creative Many Michigan, and Megan Schrauben Integrated Instruction Consultant, MDE, for an update about Michiganâ€™s commitment to strengthen quality and access to arts education for our students.\nThis event is sponsored by the Ingham Intermediate School District and MSU Federal Credit Union Institute for Arts & Creativity at Wharton Center â€“ partner institutions in the John F. Kennedy Center for the Performing Arts Partners in Education program. The Institute and Ingham Intermediate School District provide arts-integrated professional learning for educators in mid-Michigan. Â \nParking is available in the Shaw Ramp adjacent to theÂ Wharton Center for 90 cents per half hour.\nPresentations will begin promptly at 8:00 am and the event ends at 9:15 am.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29922770%2F15348962869%2F1%2Foriginal.jpg?s=a33125dd4362b607f30e2c31315756d6', 'https://www.eventbrite.com/e/10th-annual-arts-advocacy-breakfast-tickets-33334374010?aff=ebapi', 'Jackson Lounge 750 E Shaw Ln, East Lansing, MI 48824', 42.72575579999999, -84.47057699999999, 'Jackson Lounge 750 E Shaw Ln, East Lansing, MI 48824', NULL, NULL, '1494381600', '1494388800', 0, 0, 0, NULL, 1),
(187, 'live', '33344267602', 13, 0, 2, 'Resilience Screening', 'The Lansing Exchange Club and the Michigan ACE Initiative invite you to view the award-winning documentary Resilience.\nRESILIENCE: THE BIOLOGY OF STRESS & THE SCIENCE OF HOPE chronicles the birth of a new movement among pediatricians, therapists, educators and communities, who are using cutÂ­ting-edge brain science to disrupt cycles of violence, addiction and disease.\nDonâ€™t miss this unique opportunity to see Resilience â€“ a movie that clearly and succinctly describes Adverse Childhood Experiences (ACEs) and chronicles cutting edge examples of ways the research is being used to both prevent ACES and mitigate their impact.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30090300%2F149967645183%2F1%2Foriginal.jpg?s=2b002365df7d763c1e84a3d78496e435', 'https://www.eventbrite.com/e/resilience-screening-tickets-33344267602?aff=ebapi', '200 East Edgewood Boulevard, Lansing, MI 48911', 42.659708, -84.54990199999997, '200 East Edgewood Boulevard, Lansing, MI 48911', NULL, NULL, '1492675200', '1492682400', 0, 0, 0, NULL, 1),
(188, 'live', '29829715482', 13, 0, 2, 'Plants and Their Pollinators', 'Need more productivity out of your garden? Learn more about which plants attract pollinators. Workshop led by former MSU perennial garden manager, Renata Reibitz.\nIn effort to offer exceptional gardening workshops to our community, we try to price the workshops to cover our costs of hosting them, while keeping the registration affordable for our neighbors. This application is for a workshop registration waiver which is intended for neighbors who cannot afford the $12 registration for our GardenHouse workshops. Please click the following link:Â Hunter Park GardenHouse Workshop Registration Waiver Application.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26457943%2F129040189309%2F1%2Foriginal.jpg?s=7e0c638de75c3b3e1f920538330ae53e', 'https://www.eventbrite.com/e/plants-and-their-pollinators-tickets-29829715482?aff=ebapi', '1400 East Kalamazoo Street, Lansing, MI 48912', 42.728762, -84.53042800000003, '1400 East Kalamazoo Street, Lansing, MI 48912', NULL, NULL, '1494658800', '1494664200', 0, 0, 0, NULL, 1),
