(190, 'live', '29904361751', 13, 0, 2, 'Organic Pest Management', 'Learn how to identify, prevent, and treat vegetable plant damage by common pests. Workshop led by Adam Ingrao of MSU Vegetable Entomology Lab.\nIn effort to offer exceptional gardening workshops to our community, we try to price the workshops to cover our costs of hosting them, while keeping the registration affordable for our neighbors. This application is for a workshop registration waiver which is intended for neighbors who cannot afford the $12 registration for our GardenHouse workshops. Please click the following link:Â Hunter Park GardenHouse Workshop Registration Waiver Application.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26403608%2F129040189309%2F1%2Foriginal.jpg?s=9f61994f3d0a9d6c2c8a117d1902434b', 'https://www.eventbrite.com/e/organic-pest-management-tickets-29904361751?aff=ebapi', '1400 East Kalamazoo Street, Lansing, MI 48912', 42.728762, -84.53042800000003, '1400 East Kalamazoo Street, Lansing, MI 48912', NULL, NULL, '1497097800', '1497103200', 0, 0, 0, NULL, 1),
(191, 'live', '29904481108', 13, 0, 2, 'Flower Arranging', 'Learn how to create a beautiful, cut-flower garden, and which flower varieties work best for bouquets. Make and take home your own bouquet. Workshop led by MSU perennial garden manager, Bethany Troy.\nIn effort to offer exceptional gardening workshops to our community, we try to price the workshops to cover our costs of hosting them, while keeping the registration affordable for our neighbors. This application is for a workshop registration waiver which is intended for neighbors who cannot afford the $12 registration for our GardenHouse workshops. Please click the following link:Â Hunter Park GardenHouse Workshop Registration Waiver Application.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26458504%2F129040189309%2F1%2Foriginal.jpg?s=8359a6cf2147fe8e9625ecd00c45b9e6', 'https://www.eventbrite.com/e/flower-arranging-tickets-29904481108?aff=ebapi', '1400 East Kalamazoo Street, Lansing, MI 48912', 42.728762, -84.53042800000003, '1400 East Kalamazoo Street, Lansing, MI 48912', NULL, NULL, '1499517000', '1499522400', 0, 0, 0, NULL, 1),
(192, 'live', '30108711968', 13, 0, 2, 'Certified ScrumMaster (CSM) - East Lansing, MI', 'Â \r\nWhy takeÂ thisÂ CSM course?Â \r\nThatâ€™s easy:Â The Scrum Alliance provides a list of core concepts that must be covered in the class, but the quality of the training depends on your instructor. Agile For All trainers are top-rated instructors and expert coaches. Since 2008, 99% of all attendees recommend Agile For All trainers. (Guess we canâ€™t please everyone.)\r\nBeyond learning the Scrum framework our trainers will inspire, challenge, and motivate you.\r\n\r\nLearn the underlying Agile principles, practices, techniques to succeed as a ScrumMasterÂ®.\r\nGain insights on how to facilitate, coach, resolve conflict and lead a team.\r\nBenefit from real world industry experiences so the course material remains relevant to your needs.\r\n\r\nÂ After completing this course you can opt-in to become a Certified ScrumMasterÂ® by passing a short exam on the Scrum Alliance website.\r\nÂ \r\nCourse Length: 2 daysÂ Â \r\nWe guarantee our CSM workshop will be a one-of-a-kind experience, instilling confidence to engage successful Agile practices right away.\r\nÂ \r\nOUR CSM WORKSHOP INCLUDES\r\n\r\nContinental breakfast, lunch and beverages\r\nTwo-year membership in the Scrum Alliance,Â a $50 value\r\nBound copy of the course materials\r\nCSM Exam Prep Review booklet\r\nAccess to free Scrum and Agile resources\r\n\r\nÂ \r\n\r\nÂ \r\nLearning ObjectivesÂ \r\nBy the end of the workshop you will be able to:\r\n\r\nDescribe the Scrum framework to others\r\nExplain the difference between the Scrum framework and other processes and systemsÂ \r\nBe a successful ScrumMaster for a Scrum team\r\nHelp a Scrum team plan successfully\r\nCreate a personal plan for the future\r\n\r\nÂ \r\nÂ Â Â DOWNLOAD COURSE DETAILS\r\nÂ \r\nÂ \r\nÂ \r\nWhat Participants Say\r\nÂ Â \r\nâ€œI expected to get a â€˜pre-recordedâ€™ and â€˜scriptedâ€™ class. Instead, I got a collaborative experience, which was worlds better than the typical trainings Iâ€™ve sat through.â€Â \r\nâ€œVery practical and helpful information. It actually applies to more than just in the workforce. This class was very interactive, which helped our team significantly in learning and applying the material.â€\r\nÂ \r\n\r\nÂ \r\nOther AdvantagesÂ \r\nHIGH RETENTION: Agile For All trainers use accelerated learning techniques like Training From The Back Of The Room to present the course material in brain-friendly ways that help you maximize learning and retention.Â \r\nNO BOREDOM: Rather than death by PowerPoint and long lectures, Agile For All courses are designed to be highly interactive.\r\nFUN: Every part of this course is designed to keep you engaged and having fun while learning the material.\r\nWHYS BEFORE HOWS: Beyond the basic Scrum framework, youâ€™ll learn the underlying principles and values that drive success before getting into successful practices, allowing you to understand the practices at a much deeper level.\r\nLEARN BY DOING: Multiple creative exercises and simulations give you the opportunity to practice core skills necessary to be a successful Certified ScrumMasterÂ® â€” skills like facilitation, coaching, conflict resolution and leadership.\r\nÂ Â Â Â Â \r\nAbout the Course Facilitator\r\n\r\nTricia Broderick\r\nÂ \r\nPassionately focused on the facilitation of high-performance software development environments, Tricia Broderick brings seventeen years of experience including the last seven years of focus with an Agile mindset. Â Prior to joining Agile For All as a Coach, she served as Director of Development, Agile Coach and Manager of Project Management for numerous companies, laying the groundwork to shift teams from one-year product cycles to daily delivery of high-quality software and services. She leverages and openly shares her work experience stories and examples to inspire people, especially managers and leaders to reach new heights through continuous reflection, both as individuals and as members of innovative teams. Tricia is a highly experienced leader, coach, mentor, presenter, trainer, and speaker motivated towards humanizing the workplace.\r\nÂ \r\nOnsite Courses\r\nÂ Want the training to come to you?Â Agile For All does onsite training workshops at reasonable prices with some of the top Scrum Alliance Certified ScrumMasterÂ® Coaches and Trainers.Â \r\nContact usÂ for information on private workshops, group discounts or questions. Â 303.766.0917\r\nÂ \r\n\r\nÂ Â \r\nÂ \r\nÂ Professional Development Units (PDUs)\r\nÂ PMPs: You can receiveÂ 14 PDUsÂ for this course.Need to convince someone else?DownloadÂ a PDF brochure you can send to others.\r\nÂ \r\nÂ \r\nAll CSM courses are taught by Certified Scrum Trainers. Taking a CSM course, passing the CSM test, and accepting the license agreement designates you as a Certified ScrumMaster, which indicates that you have been introduced to and understand the basic concepts you need to perform as a ScrumMaster or team member on a Scrum team. This course also satisfies two elements of the CSD track: Scrum Introduction and Elective.\r\nÂ \r\n\r\nÂ \r\nWho This Course is Designed For\r\nIf you work in an organization that creates any sort of product, then you are an ideal CSM candidate. Â While the course is primarily designed for people filling the role of ScumMaster, anyone who wants to help their organization be more successful is encouraged to attend.Â \r\nIf you are already on a Scrum team you will learn how to become a change agent to help your team achieve a higher level of success.\r\n\r\nArchitects\r\nBusiness Analysts\r\nDBAs\r\nDevelopers\r\nDirectors\r\nDocumentation Specialists\r\nExecutives\r\nManagers\r\nMarketing People\r\nProduct Managers\r\nProject Managers\r\nTesters\r\nTeam Members\r\nSales People\r\nOperations and Support\r\nTechnical Writers\r\nTrainers\r\n\r\nÂ Â \r\nÂ DOWNLOAD COURSE DETAILS\r\nÂ \r\nÂ \r\nÂ \r\nCourse Topics\r\nWe go into detail on how to facilitate, coach, resolve conflict and lead a team, as well as share our industry experiences so our course material remains relevant. Some of the material covered during the 2-day workshop:Â \r\nSCRUM THEORYThe three legs of Scrum theory: transparency, inspection and adaptation are examined in detail.Â \r\nSCRUM FRAMEWORK BASICSThe meetings, artifacts and roles which make up the Scrum process.Â \r\nSCRUM PRACTICESEstimation, planning and other practices which are commonly used in Scrum.Â \r\nSCRUM LEADERSHIPWhat is it and why is it important for a ScrumMaster?Â Â \r\nCOACHING AND FACILITATIONCoaching scenarios and facilitation techniques commonly used by ScrumMasters.Â \r\nCONFLICT RESOLUTION AND BUILDING TRUSTHelpful hints and techniques for building strong teams even if conflict exists.Â \r\nÂ DOWNLOAD COURSE DETAILS\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26527825%2F56489335613%2F1%2Foriginal.jpg?s=e1ede0fb6b13e831f3b982b1ec2a5257', 'https://www.eventbrite.com/e/certified-scrummaster-csm-east-lansing-mi-tickets-30108711968?aff=ebapi', 'East Lansing, MI 48912', 42.7675547, -84.51602220000001, '2401 Showtime Drive, Lansing, MI 48912', NULL, NULL, '1499331600', '1499446800', 0, 0, 0, NULL, 1),
(193, 'live', '30519061334', 13, 0, 2, 'Solutions Conference - 2017', 'Join Maner Costerisan for this great opportunity to learn how to leverage your existing business solutions and network with your peers.\r\nLunch and break snacks are provided.Â \r\nTo pay by check clickÂ â€œShow other payment optionsâ€ to register.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F26815017%2F21809465020%2F1%2Foriginal.jpg?s=d304405305587ae4107df67e9b529c15', 'https://www.eventbrite.com/e/solutions-conference-2017-registration-30519061334?aff=ebapi', '333 E Michigan, Lansing , MI 48933', 42.734142, -84.54798399999999, '333 E Michigan, Lansing , MI 48933', NULL, NULL, '1510648200', '1510678800', 0, 0, 0, NULL, 0),
(194, 'live', '30850708299', 13, 0, 2, 'Lansing APA Workshop - June 10', 'These labs focus on APA, thesis writing and organization; revising and editing papers, and a brief introduction to Miller Library. You will also have the opportunity work with an APA template for setting up papers.\r\nYou will want to bring your own laptop if you have one.Â \r\nThe labs take place at the Lansing Campus.\r\n* These labs are for Cornerstone students only.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31786972%2F39009880970%2F1%2Foriginal.jpg?s=4e041eb831054c08a9407aeccb34630a', 'https://www.eventbrite.com/e/lansing-apa-workshop-june-10-tickets-30850708299?aff=ebapi', '6452 Millennium Drive Suite #180, Lansing, MI 48917', 42.72534659999999, -84.64304149999998, '6452 Millennium Drive Suite #180, Lansing, MI 48917', NULL, NULL, '1497085200', '1497096000', 0, 0, 0, NULL, 1);
