(195, 'live', '31037973414', 13, 0, 2, 'Crony Capitalism | Critical Imperatives Facing the U.S.', 'Critical Imperatives Facing the U.S.:Â Talks and presentation facilitated by key LCC faculty that cover the critical issues that our country is facing.TOPIC: Crony Capitalism\nEconomists call it â€œcrony capitalismâ€ when wealthy capitalists, bankers, and CEOâ€™s form close ties with politicians that enrich their pockets at the expense of the public. Crony capitalism is an old phenomenon. Even Adam Smith described it over 240 years ago. But some economists believe that the combination of technology advancements and the political triumph of Donald Trump and others is leading us into a new era of crony capitalism. Learn what crony capitalism involves, how to spot it, and what its effects are for you. \nÂ \nFacilitator\nJames LukeAssistant ProfessorEconomics Department\nÂ \nLocationMain CampusThe Centre for Engaged InclusionGannon GB 252.02', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28077414%2F186273936581%2F1%2Foriginal.jpg?s=24d76bd41bd02a7cc599842c857e0a9c', 'https://www.eventbrite.com/e/crony-capitalism-critical-imperatives-facing-the-us-tickets-31037973414?aff=ebapi', 'Lansing Community College (Gannon Room 252.02) 422 North Washington Square, Lansing, MI 48933', 42.73834979999999, -84.55139409999998, 'Lansing Community College (Gannon Room 252.02) 422 North Washington Square, Lansing, MI 48933', NULL, NULL, '1491885000', '1491890400', 0, 0, 0, NULL, 1),
(196, 'live', '31549748146', 13, 0, 2, '9th Women of Vision Luncheon', 'Celebrating 18 years, Against All Odds Foundation, a 501c3 non-profit - presents their 9th Women of Vision Luncheon, in honor of Cancer Survivors, please wear your Hat/Crown. Â There will be a silent auction, live music, vendors and giveaways. Â There is a limited number of survivors tickets, if you''re a survivor claim your FREE ticket today! Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27766646%2F57943369095%2F1%2Foriginal.jpg?s=a99a34a8cf7af56ac6e8277526794ee1', 'https://www.eventbrite.com/e/9th-women-of-vision-luncheon-tickets-31549748146?aff=ebapi', 'Big 10 Room 219 S. Harrison Rd., East Lansing, MI', 42.7317521, -84.49365799999998, 'Big 10 Room 219 S. Harrison Rd., East Lansing, MI', NULL, NULL, '1494653400', '1494667800', 0, 0, 0, NULL, 1),
(197, 'live', '31699505073', 13, 0, 2, 'SEE THE WORLD A DIFFERENT WAY 5K -Minneapolis', '*THIS IS A VIRTUAL RACE\r\nApril is Autism Awareness Month and we are dedicating our April virtual race to it with a See The World A Different Way 5K!\r\nThe medal has Autism 5K, spelled backwards, toÂ help us all see things in a different way.Â We have 500 medals available and they will sell out quick so sign up NOW!Â \r\n\r\nWhen:Â Complete your race any timeÂ during April 2017!\r\nWhere:Â  You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy:Â Â Because we want as many people as we can get to virtually run (or walk) a 5K and to help raise awareness for Austin Awareness. Â We will be donating a portion of each registration fee (at least 15% of each registration) toÂ Organization for Autism Research. Â OAR set out to use applied science to answer questions that parents, families, individuals with autism, teachers and caregivers confront daily. No other autism organization has this singular focus.\r\nCost:Â $17. Â Includes custom medal and bib that will be shipped directly to you. Â Plus, at least 15% of every entry will be donated to Organization for Autism Research. Â *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them.Medals and bibs will start shipping out mid-March!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27930876%2F98886079823%2F1%2Foriginal.jpg?s=291a68f793f216445e6140f847516a80', 'https://www.eventbrite.com/e/see-the-world-a-different-way-5k-minneapolis-registration-31699505073?aff=ebapi', 'YOU CHOOSE, Minneapolis, MN 55401', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Minneapolis, MN 55401', NULL, NULL, '1493451000', '1493544600', 0, 0, 0, NULL, 1),
(198, 'live', '31727188876', 13, 0, 2, 'Networking the new school way - Free Linkedin Masterclass', 'Learn How To Use Linkedin To Transform Your Business\nLearn how to build a massive client base spending 15-20 minutes a day on Linkedin, even if you''ve never used Linkedin before and don''t have an advertising budget.\nReserve Your Seat For The FREE Linkedin Marketing Training here\nLinkedin Is A Goldmine Filled With Business Opportunities\nLinkedin is a Gold Mine of great business. You have the ability to quickly connect with real decision makers. There are over 400,000 Million users on Linkedin and it''s growing everyday.\nLinkedin is where you go to do business. However, most people treat it like a resume or a business Facebook. Learn how to leverage Linkedin to get a massive client base of THE RIGHT CLIENTS with this training. This is business networking done the right way.\nLinkedin Marketing Training Event\nCome to my Linkedin Marketing training/webinar and I''ll show you step by step how to use Linkedin to grow your business.\nConnect With:\n\nClients\nReferral Partners\nPress Connections\nInvestors\n\nOkay, Okay, Reserve My Seat For The FREE Linkedin Marketing Training\nI look forward to seeing you at the training!\n- Tim Dodd\nCEO & Co Founder\nTEV Marketing\nGreat Build a great network for your business using Linkedin for your networking!\nRESERVE YOUR SEAT HERE\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27959703%2F198962458821%2F1%2Foriginal.jpg?s=8b8e473deeb5752a4d4799db67a41691', 'https://www.eventbrite.com/e/networking-the-new-school-way-free-linkedin-masterclass-tickets-31727188876?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1491539400', '1491588000', 0, 0, 0, NULL, 1),
(199, 'live', '31970233830', 13, 0, 2, '40-Hour HAZWOPER OSHA Training Seminar Classes in Lansing, MI', 'Compliance Solutions, the nation''s largest provider of OSHA Hazmat training, is pleased to offer open enrollment for our 40-Hour OSHA HAZWOPER Site Worker trainingÂ in Ten (10)Â different cities every week!\r\nÂ \r\nOur instructor-led seminars meet or exceed OSHAâ€™s suggested training curricula and meet OSHAâ€™s mandated training requirements under 29 CFR 1910.120(e and q) including hands-on training!\r\nÂ \r\n40-Hour HAZWOPER training is mandated for employees who have responsibilities to remediate (clean-up) hazardous materials at controlled and un-controlled sites with hazards or work activities that present some an Immediate Danger to Life or Health (IDLH). This includes clean up operations, emergency response operations, storage, disposal or treatment of hazardous materials and hazardous waste sites. 40-Hour HAZWOPER training is also required prior to OSHA Site-Supervisor training. \r\nÂ \r\nThe 40-Hour HAZWOPER course provides structured classroom training mandated by 29 CFR1910.120 (e and q) including student exercises and a hands-on dress-out to acclimate workers with required Personal Protective Equipment (PPE). Workers attending this instructor-led course will cover 18 different OSHA suggested topics including health and safety procedures, PPE used during work operations at hazardous material sites, medical monitoring and many others.\r\nÂ \r\nInstructors emphasize a practical approach to worksite health and safety, as such, attendees learn to recognize site hazards and take appropriate steps to prevent illness or injuries while on the jobsite. \r\nÂ \r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\nÂ \r\nRegister Early! Pre-registration for all classes is required (no walk-inâ€™s) and classes do fill up quickly.\r\nÂ \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\nÂ \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\nÂ Â  5 to 9 students= 10% Â Â Â 10 or more = 15%\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28186551%2F51654302652%2F1%2Foriginal.jpg?s=21b8950dcf7cdbd716d62c79c696691a', 'https://www.eventbrite.com/e/40-hour-hazwoper-osha-training-seminar-classes-in-lansing-mi-tickets-31970233830?aff=ebapi', '3121 East Grand River Ave, Lansing, MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing, MI 48912', NULL, NULL, '1491877800', '1492173000', 0, 0, 0, NULL, 1),
(200, 'live', '32003633730', 13, 0, 2, 'WHO Wants to Race 5K & 10K for Autism Awareness - Minneapolis', '*THIS IS A VIRTUAL RACE\r\nOkay People! Itâ€™s time to sign up for our second annual WHOâ€™s Ready To Race 5K & 10K! Â April is Autism Awareness month and we want to help raise awareness and help families that are affected by Autism.\r\nParticipate in our raceÂ and help us raise awareness for Autism!Â (at least 15% of every registration to theÂ Doug Flutie. Jr Foundation for Autism Inc.)Â Last year we donated $16,907, in 2017 our goal is at least $20,000!\r\n*For a limited time you can get order an official t-shirt to go along with your medalÂ HERE.\r\nWhat:Â  This is a virtual race. You choose to complete a 5KÂ or 10K. Â You complete your race on your own and submit your time to us. Â Then we ship your medal directly to you.\r\nWhen:Â Complete your race any time during the month of April.Â Â April is Autism Awareness Month.*Medals will beginning shipping out mid-March 2017.\r\nWhere:Â Â You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy: Â To raise awareness forÂ Autism!COST:Â Â $17, which includes your medal, officialÂ bib and shipping. Â Plus, at least 15%Â of every entry will be donated to the Doug Flutie Jr Foundation for Autism Inc. Last year we donated $16,907, in 2017 our goal is at least $20,000! Â *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them.Â \r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28234325%2F98886079823%2F1%2Foriginal.jpg?s=2f3ac5804c358b05769bf28fbcf54eda', 'https://www.eventbrite.com/e/who-wants-to-race-5k-10k-for-autism-awareness-minneapolis-registration-32003633730?aff=ebapi', 'YOU CHOOSE, Minneapolis, MN 55401', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Minneapolis, MN 55401', NULL, NULL, '1493451000', '1493548200', 0, 0, 0, NULL, 1),
(201, 'live', '32051254164', 13, 0, 2, 'Earth Day 5K & 10K - Minneapolis', '*THIS IS A VIRTUAL RACE\r\nOkay People!Â Did you know that Earth Day is April 22nd? Â We are celebrating with an Earth Day 5K & 10K and participants will get a beautiful earth medal.\r\nPlus,Â at least 15% of every registration toÂ Wild Earth Allies. TheirÂ mission is to protect vital areas of our natural world for the benefit of wildlife, habitats, and people by inspiring collaborative action.\r\nWhat:Â  This is a virtual race. You choose to complete a 5KÂ or 10K. Â You complete your race on your own and submit your time to us. Â Then we ship your medal directly to you.\r\nWhen:Â Complete your race any time during the month of April, even better if you can do it on Earth Day, April 22.Â *Medals will beginning shipping out mid-March 2017.\r\nWhere:Â Â You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy: Â To celebrate our beautiful earth!COST:Â Â $17, which includes your medal, officialÂ bib and shipping. Â Plus, at least 15%Â of every entry will be donated toÂ Wild Earth Allies.Â  *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28285931%2F98886079823%2F1%2Foriginal.jpg?s=43a33ef880aab34280869f03e3defd80', 'https://www.eventbrite.com/e/earth-day-5k-10k-minneapolis-registration-32051254164?aff=ebapi', 'YOU CHOOSE, Minneapolis, MN 55401', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Minneapolis, MN 55401', NULL, NULL, '1492846200', '1493548200', 0, 0, 0, NULL, 1),
(202, 'live', '32056846892', 13, 0, 2, '8-Hour HAZWOPER OSHA refresher training in Lansinsg, MI', 'Compliance Solutions, the nation''s largest provider of OSHA Hazmat training is pleased to offer open enrollment for the 8-Hour OSHA HAZWOPER Annual Refresher trainingin twelve different cities every week!\r\nÂ \r\nOur instructor-led seminars meet or exceed OSHAâ€™s suggested training curricula and meet OSHAâ€™s mandated training requirements under 29 CFR 1910.120(e and q).\r\nÂ \r\nThe 8-Hour HAZWOPER course meets OSHAâ€™s annual refresher requirements for employees who have completed their initial 24-Houror 40-Hour HAZWOPER certification. Mandatedtraining can be found in 29 CFR1910.120. Students attending the 8-Hour HAZWOPER are updated on changes in related regulations, participate in multiple class safety activities, complete a mock dress-out and receive instruction in health and safety procedures, and personnel protection during work operations at hazardous material sites. Unlike our competitors, our training content and exercises are updated annually so your employees donâ€™t take the same class over and over again every year!\r\nÂ \r\nPrerequisites:Students must have completed an initial 24-Hour or 40-Hour HAZWOPER course and have maintained certification through annual refresher training. If certification has not been refreshed under OSHA guidelines, the 24-Hour or 40 Hour HAZWOPER should be re-taken to maintain certification.\r\nRegister Early! Pre-registration for all classes is required (no walk-inâ€™s) and classes do fill up quickly.\r\nÂ \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\nÂ \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\nÂ  5 to 9 students= 10%Â Â Â Â  10 or more = 15%\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28293560%2F51654302652%2F1%2Foriginal.jpg?s=96c229bd686ba8e295d327302c278144', 'https://www.eventbrite.com/e/8-hour-hazwoper-osha-refresher-training-in-lansinsg-mi-tickets-32056846892?aff=ebapi', '3121 East Grand River Ave, Lansing , MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing , MI 48912', NULL, NULL, '1492137000', '1492173000', 0, 0, 0, NULL, 1),
(203, 'live', '32085181642', 13, 0, 2, '5th Annual Michigan Inventors Expo', 'Register for your Expo Booth before July 31st at a discounted rate of $50!!\nOur Expo is expanding due to our record-setting event last year! This year''s Expo will be taking place on Friday, September 15th and Saturday, September 16th, 2017!\nJoin us for a day and a half of networking, pitches and education! The 5th Annual Michigan Inventors Expo will allow you to showcase your product, participate in the Spin, Pitch & Sell contest and takeaway helpful tips for further developing your invention.\nNew this year, join us September 15th, 2017 from 2:00 PM - 6:00 PM for an expert round table!!\nWe will have 11 of the most in-demand experts sitting at different tables answering questions from local inventors. If you are not comfortable asking the questions you still can sit in at any table and listen to what other problems inventors are running into.\n1. Engineering, Prototypes\n2. Strategic Planning & Financial Organization\n3. Team Building, Hiring Talent\n4. Marketing Strategies\n5. Productivity Tools\n6. Patents, Legal Services\n7. Free Resources\n8. SBDC, Grants/Funding, Business Plan Assistance\n9. SCORE\n10. Packaging, Direct Sales\n11. eBay, Amazon, Helpful Internet Websites\nDon''t miss out on this great opportunity for exposure. Space is limited - register today!\nTake a look at highlights from our 2016 Expo here!\n\nThe Michigan Inventors Coalition was featured on Buy Local Michigan.\nCorporate sponsorship opportunities are available as well. To obtain information, please contact Leandra Williams at leandra@stingrayadvisorygroup.com to see how your company can support this event and be showcased.\nStay tuned to our Facebook page for event updates!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28324795%2F130690249439%2F1%2Foriginal.jpg?s=7fa6f9c26c83a407794885dda4e61114', 'https://www.eventbrite.com/e/5th-annual-michigan-inventors-expo-tickets-32085181642?aff=ebapi', '219 South Harrison Road, East Lansing, MI 48824', 42.7316308, -84.49321029999999, '219 South Harrison Road, East Lansing, MI 48824', NULL, NULL, '1505484000', '1505498400', 0, 0, 0, NULL, 0),
(204, 'live', '32089689124', 13, 0, 2, 'Emergency Response Technician Level III Initial Training in Lansing, MI', 'The Emergency Response Technician Level III Initial Training Seminar from Compliance Solutions provides training mandated under OSHA 29 CFR1910.120(q). This course is conducted in conjunction with our 40-Hour HAZWOPER course. Workers attending this instructor-lead course will cover 18 different OSHA suggested topics including Health and Safety Procedures, PPE used during work operations, Medical Monitoring and many others. The course is held over four days, 10-hours each day.\r\nPersonnel who are involved in the cleanup of spills in manufacturing environments as well as those individuals who are responsible for control or containment of hazardous or potentially hazardous materials are required to receive Emergency Response training. This initial training course focuses on the identification and safe handling of hazardous materials. Individuals who are members of a response team should always have site specific training and drills tailored to their specific hazards before attempting cleanup or containment. In order to stay in compliance with OSHA regulations and maintain certification, a refresher course is required to be completed annually.\r\nAct now and get your ticket today. Classes do fill quickly.\r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\nÂ \r\nRegister Early! Pre-registration for all classes is required (no walk-inâ€™s) and classes do fill up quickly.\r\nÂ \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\nÂ \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\nÂ  5 to 9 students= 10% Â Â Â 10 or more = 15%\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28332379%2F51654302652%2F1%2Foriginal.jpg?s=3d9ba5ab22f303ee4994dccc347c0369', 'https://www.eventbrite.com/e/emergency-response-technician-level-iii-initial-training-in-lansing-mi-tickets-32089689124?aff=ebapi', '3121 East Grand River Ave, Lansing, MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing, MI 48912', NULL, NULL, '1491877800', '1492173000', 0, 0, 0, NULL, 1),
(205, 'live', '32090140474', 13, 0, 2, 'Emergency Response Technician Level III Annual Refresher Training in Lansing, MI', 'Emergency Responder Technician Level III Annual Refresher Training. According to OSHA regulations, each level of emergency responder must take an 8 hour annual refresher course to stay current on the techniques used in a hazardous materials incident. The 8-hour refresher course helps to meet the requirements of OSHA in an informative and interactive manner. Included in the course are numerous techniques used in keeping the responder safe while containing and mitigating a hazardous materials spill. In order to fully comply with OSHA standards, students must review their company Emergency Response Plan as a part of their annual refresher training.\r\nPREREQUISITES:Â  Emergency Response Technician Level III Training\r\nAct now and buy your ticket today. Classes do fill up quickly.\r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\nÂ \r\nRegister Early! Pre-registration for all classes is required (no walk-inâ€™s) and classes do fill up quickly.\r\nÂ \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\nÂ \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\nÂ  5 to 9 students= 10% Â Â Â 10 or more = 15%\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28333070%2F51654302652%2F1%2Foriginal.jpg?s=f22f196657105b18820dc1f15e5f5a0e', 'https://www.eventbrite.com/e/emergency-response-technician-level-iii-annual-refresher-training-in-lansing-mi-tickets-32090140474?aff=ebapi', '3121 East Grand River Ave, Lansing, MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing, MI 48912', NULL, NULL, '1492137000', '1492173000', 0, 0, 0, NULL, 1),
(206, 'live', '32125972649', 13, 0, 2, 'Natural Skin & Beauty Secrets', 'Do you know what your beauty products are made of?\n You will learn:\n\nWhich ingredients to avoid\nNatural remedies for healthy skin\nNon-toxic anti-aging alternatives\nBONUS- Helena will share with you her favorite products she uses\n\nHelena Miller, R.R.T. is a Nutritionist and Wellness Expert at Rassel-Daigneault Family Chiropractic', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28376317%2F129191537381%2F1%2Foriginal.jpg?s=16572fef76d4bc7cbd7df2da34db8e99', 'https://www.eventbrite.com/e/natural-skin-beauty-secrets-tickets-32125972649?aff=ebapi', '537 N Clippert St., Lansing, MI 48912', 42.7396351, -84.50862519999998, '537 N Clippert St., Lansing, MI 48912', NULL, NULL, '1493038800', '1493042400', 0, 0, 0, NULL, 1),
(207, 'live', '32167183913', 13, 0, 2, 'Success Through a Compliant Winning Team #1 of 4 - Intro to Teaming', 'For small government contractors, teaming and joint venturing can be essential components of success. By teaming with other entities, small businesses can enhance their capabilities and offer more comprehensive solutions to the government. But teaming and joint venturing on government set-aside contracts is not without risk– there are many unique rules that must be followed, and many pitfalls for the unwary. In this series, government contracts attorney Steven Koprince explains– in plain English– the essential rules for joint venturing and teaming on federal set-aside contracts. This series also includes Carroll Bernard’s Intro to Teaming webinar, where he explains the value of teaming from the small business perspective.\nClass #1 Intro to Teaming: We will define teaming, help you understand why it is so important, and explain how you can find and secure the right teaming partner to help you win, perform, and gain repeat business in the government marketplace. This lesson will include: Case Study; Importance of Teaming; Benefits of teaming; Types of Teaming; Choosing Teaming Structure; Attracting Partners.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28423607%2F19372336711%2F1%2Foriginal.jpg?s=5f9d0af1d89c0bfaf8d7fb138e11b2b0', 'https://www.eventbrite.com/e/success-through-a-compliant-winning-team-1-of-4-intro-to-teaming-tickets-32167183913?aff=ebapi', '500 East Michigan Avenue Ste. 200, Lansing, MI 48912', 42.7335281, -84.54560129999999, '500 East Michigan Avenue Ste. 200, Lansing, MI 48912', NULL, NULL, '1495612800', '1495623600', 0, 0, 0, NULL, 1),
(208, 'live', '32167273180', 13, 0, 2, 'Success through a Compliant Winning Team Series - Joint Ventures, Teaming & Subcontracting Areements', 'For small government contractors, teaming and joint venturing can be essential components of success. By teaming with other entities, small businesses can enhance their capabilities and offer more comprehensive solutions to the government. But teaming and joint venturing on government set-aside contracts is not without riskâ€“ there are many unique rules that must be followed, and many pitfalls for the unwary. In this series, government contracts attorney Steven Koprince explainsâ€“Â in plain Englishâ€“ the essential rules for joint venturing and teaming on federal set-aside contracts. This seriesÂ also includes Carroll Bernardâ€™s Intro to Teaming webinar, where he explains the value of teaming from the small business perspective.\nLegal Aspects of Teaming â€“ Rules and Regulations: Steven Koprince unpacks the unique rules and regulations governing joint venturing and teaming, and offers strategies to help ensure compliance. We will discuss: Joint Ventures vs. Teaming; Joint Venture Size; 8(a) Joint Ventures; SDVOSB Joint Ventures; HUBZone Joint Ventures; WOSB Joint Ventures; Subcontracting Joint Ventures; Teaming Agreements; Teaming Subcontracts; Teaming Subcontract Limitations; Team- Ostensible Affiliation.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28423706%2F19372336711%2F1%2Foriginal.jpg?s=be39058d02820cb229e97a80e586630b', 'https://www.eventbrite.com/e/success-through-a-compliant-winning-team-series-joint-ventures-teaming-subcontracting-areements-tickets-32167273180?aff=ebapi', '500 East Michigan Avenue Ste. 200, Lansing, MI 48912', 42.7335281, -84.54560129999999, '500 East Michigan Avenue Ste. 200, Lansing, MI 48912', NULL, NULL, '1498636800', '1498647600', 0, 0, 0, NULL, 1),
