(210, 'live', '32167389528', 13, 0, 2, 'Success through a Compliant Winning Team Series - COMBINED WITH #3 â€“ Leveraging the Power of Mentor-ProtÃ©gÃ© Programs', 'THIS CLASS WILL BE COMBINED WITH CLASS #3 - DATE CHANGE JULY 26, 2017 - SORRY FOR THE CONFUSION\nFor small government contractors, teaming and joint venturing can be essential components of success. By teaming with other entities, small businesses can enhance their capabilities and offer more comprehensive solutions to the government. But teaming and joint venturing on government set-aside contracts is not without riskâ€“ there are many unique rules that must be followed, and many pitfalls for the unwary. In this series, government contracts attorney Steven Koprince explainsâ€“Â in plain Englishâ€“ the essential rules for joint venturing and teaming on federal set-aside contracts. \nÂ Class #4.Â Steven Koprince discusses how to leverage the power of federal mentor-protÃ©gÃ© programs (including the SBAâ€™s proposed new â€œuniversalâ€ mentor-protÃ©gÃ© program) while staying on the right side of the law. This lesson includes: Mentor-ProtÃ©gÃ© Programs; Mentor-ProtÃ©gÃ© Benefits; Affiliation & Joint Venturing; Application Process; SBAâ€™s â€œUniversalâ€ Mentor-ProtÃ©gÃ© Program.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28423925%2F19372336711%2F1%2Foriginal.jpg?s=eccfedb71e1f8b0808e4d327f5b5dc03', 'https://www.eventbrite.com/e/success-through-a-compliant-winning-team-series-combined-with-3-leveraging-the-power-of-mentor-tickets-32167389528?aff=ebapi', '500 East Michigan Avenue Ste. 200, Lansing, MI 48912', 42.7335281, -84.54560129999999, '500 East Michigan Avenue Ste. 200, Lansing, MI 48912', NULL, NULL, '1503475200', '1503486000', 0, 0, 0, NULL, 0),
(211, 'live', '32189378297', 13, 0, 2, 'The Plus Size Problem Mix and Meet LANSING, MI', 'The PSP Mix and Meet is a networking mixer andÂ forum event dedicated to the body positive woman, her supporters and those dissatisfied with her. After all, the plus size problem is not hers, it''s yours. Â Join us for great conversation with a great community. Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29190876%2F193935009307%2F1%2Foriginal.jpg?s=49df9577a864a39e1a4bb86f317406a6', 'https://www.eventbrite.com/e/the-plus-size-problem-mix-and-meet-lansing-mi-tickets-32189378297?aff=ebapi', '1133 South Washington Avenue, Lansing, MI 48910', 42.72079230000001, -84.55200960000002, '1133 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1498845600', '1498856400', 0, 0, 0, NULL, 1),
