(213, 'live', '32308570805', 13, 0, 2, 'HR 101, an Introduction to Human Resources, East Lansing, Michigan (2 x $25 gift cards)', 'Overview: This seminar explains all of the basic components of the Human Resources function and what the best practices are in the modern day workplace.\nGain the critical knowledge necessary to help reduce costs, avoid potential lawsuits, and improve your ability to handle challenging HR issues. This program is ideal if you are just starting out in the HR profession, perform HR duties as a part of a non-HR job, or are looking for an effective way to boost your employee management skills.\nÂ \nCourse Objectives\n\nBroad overview the human resource function.\nReview legislation and court cases in the HR field.\nHR investigation processes.\nRecruitment and selection processes to get better candidates and avoid legal pitfalls.\nReview communication strategies.\nCompensation, and benefits information/issues for staff at all levels.\nExplain employee orientation, onboarding, and training strategies.\nPerformance appraisals.\nMany other topics', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29711020%2F201891548924%2F1%2Foriginal.jpg?s=82b3aa08849eded0d6e265243e30927c', 'https://www.eventbrite.com/e/hr-101-an-introduction-to-human-resources-east-lansing-michigan-2-x-25-gift-cards-tickets-32308570805?aff=ebapi', 'East Lansing, MI 48824', 42.724305, -84.47960469999998, 'East Lansing, MI 48824', NULL, NULL, '1502701200', '1502726400', 0, 0, 0, NULL, 0),
