(217, 'live', '32549143364', 13, 0, 2, '2017 Mother''s Day 5K - Lansing', 'MOTHERâ€™S DAY 5K 2017Â \r\n*THIS IS A VIRTUAL RACE\r\nÂ \r\nJoin us for our fourth annualÂ MOTHERâ€™S DAY 5KÂ virtual race! Â  We will again be raising funds forÂ VITAMIN ANGELS, an organization that provides vitamins and minerals to mothers and babies that need them.\r\nWhen:Â Complete your race any time in May. Â Motherâ€™s Day is May 14, 2017!\r\nWhere:Â  You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy:Â Â Because we want as many people as we can get to virtually run (or walk) a 5K in honor of all of the MOMs out there.Â  Â We will be donating a portion of each registration fee (at least 15% of each registration) toÂ VITAMIN ANGELS, an organization that provides vitamins and minerals to mothers and babies that need them.\r\nCost: $17. Â Includes a custom medal and bib that will be shipped directly to you. Â There is also a two medal option when signing up, so you can order an extra medal to give to the favorite mother in your life! Â Plus, at least 15%Â of every entry will be donated to Vitamin Angels. Â *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them.* Medals will begin shipping in April.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28946654%2F98886079823%2F1%2Foriginal.jpg?s=6d7b31d6ad30a8b1aa2d335e57bc2fd0', 'https://www.eventbrite.com/e/2017-mothers-day-5k-lansing-registration-32549143364?aff=ebapi', 'YOU CHOOSE, Lansing, MI 48924', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Lansing, MI 48924', NULL, NULL, '1494747000', '1496223000', 0, 0, 0, NULL, 1),
