 to raise funds for them.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29025175%2F98886079823%2F1%2Foriginal.jpg?s=ac9b3ee879fc48ca09df734e2c0ff40a', 'https://www.eventbrite.com/e/geek-day-dont-panic-5k-minneapolis-registration-32609796780?aff=ebapi', 'YOU CHOOSE, Minneapolis, MN 55401', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Minneapolis, MN 55401', NULL, NULL, '1494055800', '1496226600', 0, 0, 0, NULL, 1),
(222, 'live', '32644454442', 13, 0, 2, 'UWFCR End of the Year Banquet', 'We are honored to invite you to attend our end of the year banquet for the University of West Florida College Republicans.\nPlease join us for a night of welcoming in new officers, saying farewell to this years'' officers, and having a fish fry with our friends from the past year!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29078317%2F187422525816%2F1%2Foriginal.jpg?s=7158ae781c9c13d7fa63a44472da6c7e', 'https://www.eventbrite.com/e/uwfcr-end-of-the-year-banquet-tickets-32644454442?aff=ebapi', 'Commons Auditorium', 42.7293, -84.4766, 'Commons Auditorium', NULL, NULL, '1492261200', '1492268400', 0, 0, 0, NULL, 1);
