(223, 'live', '32678636682', 13, 0, 2, 'REO Brew School, Beer or Wine Class April 22nd', 'Getting started with home brewing or wine making can be daunting with the amount of equipment and technical knowledge needed, we''ll make it easy for you! Â Sign up today if you are a beginner, are interested in brewing or you just like good craft beer and wine. Either way, this class will make it fun to learn. Â Nothing needed, just show up and enjoy brewing your own beerÂ or wine. Â Come on your own or bring up to 6 friends at a discounted rate. Â This is the only class around where you will getÂ hands-onÂ experience all the way through theÂ finished product, which you will then take home. Â You will have a complete set up dedicated to you and your guests. After the process is complete you''ll get to take home 2 cases of your own brewed delicious craft beer or 25 bottles of wine.\n1 student = $125, additional students $25. (Includes ingredients, equipment usage, fermentation temperature, up to 50 full bottles of beer or 25 bottles of wine to take home when it''s ready, and you can re-use these bottles for your next batch (a $25 value). Please note thatÂ beer takes two weeks to ferment, and two weeks to carbonate in bottles. You are welcome to learn how to bottle for free after two weeks, or we will bottle for you. Additonally, wine should ferment for one month minimially, however the longer you can wait the better!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29123473%2F170278589475%2F1%2Foriginal.jpg?s=7f3fe72f605f44e4df7f0f2fdda2ef55', 'https://www.eventbrite.com/e/reo-brew-school-beer-or-wine-class-april-22nd-tickets-32678636682?aff=ebapi', '2021 East Michigan Avenue, Lansing, MI 48912', 42.7335973, -84.52140969999999, '2021 East Michigan Avenue, Lansing, MI 48912', NULL, NULL, '1492835400', '1492844400', 0, 0, 0, NULL, 1),
(224, 'live', '32771539557', 13, 0, 2, 'LEARN WITH OUR TEAM - MAKE 6-FIGURES YOUR FIRST YEAR', 'Interested in getting one step closer to financial freedom? Making more time for yourself and your loved ones?\nJoin us as we invite you to a 15-minute recorded real estate income opportunity webinar. Let us empower you to make moves towards financial freedom and living life on your own terms.\nTOPICS:\n\npaying off a mortgage in as little as 7 years\nfixing and flipping properties\ngetting 10-15% return on investments\npaying 2/3 less in taxes!\nreducing risk and learning multiple exit strategies\nmanaging property the right way\nraising capital without using your own money\nSO MUCH MORE!\n\nWhether you are new to real estate investing or a seasoned investor, there is always something to be learned!\nThis is a complimentary event. Once registered, our team will send you an email with further instructions for viewing the webinar. Thank you for your interest! Connect with us on social media!Â @MakeMovesCorp\nDISCLAIMER: U.S. participants only. We will not share your information with anyone or any 3rd party organization. The information provided is strictly for registration purposes.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29208156%2F199761449880%2F1%2Foriginal.jpg?s=1c4cfa4690bab09cc2fe0f917daa3723', 'https://www.eventbrite.com/e/learn-with-our-team-make-6-figures-your-first-year-tickets-32771539557?aff=ebapi', 'Instructions Emailed After Registration, Lansing, MI', 42.732535, -84.55553470000001, 'Instructions Emailed After Registration, Lansing, MI', NULL, NULL, '1491589800', '1491674400', 0, 0, 0, NULL, 1),
(225, 'live', '32832941211', 13, 0, 2, 'Kollaboration Detroit Presents: 5th Annual Talent Showcase', 'Kollaboration Detroit is back after our last showcase in 2014. We invite you to join us at the Dart Auditorium on Friday, April 14, 2017 for an evening full of inspiration and celebration of emerging AAPI artistry and community. Six of the best new talents in Michigan will take on the stage to compete for a chance to represent Detroit at Kollaboration Star.Doors Open at 6:00PM.Â Meet and Greet for VIP will begin at 5:00PM.\nFinalists:* Hyunna O''Sullivan* Matt Kong* Christ Xiong & Cindy Nguyen* Elise Hsiung* Brandon Martin* LHAB (Quartet)The six finalists will battle for a chance to compete in Kollaboration Star 2017 finale show! The prize will be announced next week!Â Guest Performers:* Angelina Jeong & Gloria Kim (Kollaboration Detroit 4 Winner - 2014)* Lee Soo Jung (Winner of KPOP Star 5)Judges:Â * Angelina Jeong & Gloria Kim (Kollaboration Detroit 4 Winner - 2014)* Lee Soo Jung (Winner of KPOP Star 5)Host:\n*Â TBACommunity Partners & Sponsors:Â Empowerment Through Entertainment!\n\nFAQs\nWhat are my transportation/parking options for getting to and from the event?\nTBA\nWhat can I bring into the event?\nNo food or beverages allowed inside the auditorium. Video and photographs are highly encouraged!\nHow can I contact the organizer with any questions?\nExecutive Director - Adam Lamadam.lam@kollaboration.org', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29724774%2F204648999905%2F1%2Foriginal.jpg?s=cad56a5ad868e7f5da2b7f476f1099f5', 'https://www.eventbrite.com/e/kollaboration-detroit-presents-5th-annual-talent-showcase-tickets-32832941211?aff=ebapi', '500 North Capitol Avenue, Lansing, MI 48933', 42.7387141, -84.5532584, '500 North Capitol Avenue, Lansing, MI 48933', NULL, NULL, '1492173000', '1492182000', 0, 0, 0, NULL, 1),
(226, 'live', '32834102685', 13, 0, 2, 'REO Brew School, Beer or Wine Class May 13th', 'Getting started with home brewing or wine making can be daunting with the amount of equipment and technical knowledge needed, we''ll make it easy for you! Â Sign up today if you are a beginner, are interested in brewing or you just like good craft beer and wine. Either way, this class will make it fun to learn. Â Nothing needed, just show up and enjoy brewing your own beerÂ or wine. Â Come on your own or bring up to 6 friends at a discounted rate. Â This is the only class around where you will getÂ hands-onÂ experience all the way through theÂ finished product, which you will then take home. Â You will have a complete set up dedicated to you and your guests. After the process is complete you''ll get to take home 2 cases of your own brewed delicious craft beer or 25 bottles of wine.\n1 student = $125, additional students $25. (Includes ingredients, equipment usage, fermentation temperature, up to 50 full bottles of beer or 25 bottles of wine to take home when it''s ready, and you can re-use these bottles for your next batch (a $25 value). Please note thatÂ beer takes two weeks to ferment, and two weeks to carbonate in bottles. You are welcome to learn how to bottle for free after two weeks, or we will bottle for you. Additonally, wine should ferment for one month minimially, however the longer you can wait the better!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29276327%2F170278589475%2F1%2Foriginal.jpg?s=74784f8d746587b93bbe8d357bba6d80', 'https://www.eventbrite.com/e/reo-brew-school-beer-or-wine-class-may-13th-tickets-32834102685?aff=ebapi', '2021 East Michigan Avenue, Lansing, MI 48912', 42.7335973, -84.52140969999999, '2021 East Michigan Avenue, Lansing, MI 48912', NULL, NULL, '1494649800', '1494658800', 1, 0, 1, NULL, 1),
(227, 'live', '32846747506', 13, 0, 2, '2017 Backyard Bird Habitat Workshop', 'Join Michigan Audubon and Saving Birds Thru Habitat’s Kay Charter for an all-day workshop focused on the critical relationship between birds and native plants. In this workshop, participants will learn why birds need native plants, which native plants are “powerhouses” for birds, and how you can turn your backyard into a natural bird feeder. This workshop will feature an indoor educational session in the morning followed by an outdoor field trip in the afternoon to visit good examples of bird-friendly landscaping. This workshop includes a trip to Wildtype in Mason, where owner Bill Schneider will tour us around this unique native plant nursery and participants will have the opportunity to shop and explore during one of the few days this great resource is open to the public. Participants will take home a resource bag packed with helpful tips and a native tree to kick start a backyard habitat transformation. Lunch is included. Please dress appropriately for the outdoors as this event will take place rain or shine. \n​If you love watching birds, please join us to learn how you can support our birds by stewarding healthy native habitat around your home, office, school, or neighborhood.\nCost: $25 for Michigan Audubon or Woldumar Nature Center members; $35 for non-memebers of either organization\nCancellation Policy: If you must cancel your participation in a Michigan Audubon sponsored event, fees are refundable (minus a $25 processing fee) up until one month prior to the tour. If the cancellation occurs less than a month before, but more than 2 weeks before the tour, a 50% refund will apply. Cancellations occurring less than 2 weeks prior to the tour will forfeit the entire fee. Membership fees are not refundable. All refund requests must be made in writing and sent via email, or mail to:\nevents@michiganaudubon.orgEventsMichigan Audubon2310 Science Parkway, Suite 200Okemos, MI 48864', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29292706%2F131591039135%2F1%2Foriginal.jpg?s=b0ce06043b6de1ed831ab78eb7c5fe99', 'https://www.eventbrite.com/e/2017-backyard-bird-habitat-workshop-tickets-32846747506?aff=ebapi', '5739 Old Lansing Rd, Lansing, MI 48917', 42.6915321, -84.63161589999999, '5739 Old Lansing Rd, Lansing, MI 48917', NULL, NULL, '1495962000', '1495983600', 0, 0, 0, NULL, 1),
(228, 'live', '32900722948', 13, 0, 2, 'Brewery Vivant Beer Dinner!', 'Beer Dinner with our friends from Brewery Vivant!\nCourses:\n1. Big Red Coq / Pineapple Kebobs\n2. TreeBucket / Cajun Chicken & Sausage Gumbo\n3. Contemplation / MI Honey-Glazed Pork Chops over Sweet Potato Mash\n4. Plein de Vie: Space Queen in Peril / Lemon Meringue Tart', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29360472%2F139428318735%2F1%2Foriginal.jpg?s=ceecace49af06e495b6124dcca71ce2f', 'https://www.eventbrite.com/e/brewery-vivant-beer-dinner-tickets-32900722948?aff=ebapi', '300 Grove Street, East Lansing, MI 48823', 42.7359295, -84.48187000000001, '300 Grove Street, East Lansing, MI 48823', NULL, NULL, '1493125200', '1493136000', 1, 0, 1, NULL, 1),
(229, 'live', '32958100566', 13, 0, 2, '40-Hour HAZWOPER OSHA Training Seminar Classes in Lansing, MI', 'Compliance Solutions, the nation''s largest provider of OSHA Hazmat training, is pleased to offer open enrollment for our 40-Hour OSHA HAZWOPER Site Worker training in Ten (10) different cities every week!\r\n \r\nOur instructor-led seminars meet or exceed OSHA’s suggested training curricula and meet OSHA’s mandated training requirements under 29 CFR 1910.120(e and q) including hands-on training!\r\n \r\n40-Hour HAZWOPER training is mandated for employees who have responsibilities to remediate (clean-up) hazardous materials at controlled and un-controlled sites with hazards or work activities that present some an Immediate Danger to Life or Health (IDLH). This includes clean up operations, emergency response operations, storage, disposal or treatment of hazardous materials and hazardous waste sites. 40-Hour HAZWOPER training is also required prior to OSHA Site-Supervisor training. \r\n \r\nThe 40-Hour HAZWOPER course provides structured classroom training mandated by 29 CFR1910.120 (e and q) including student exercises and a hands-on dress-out to acclimate workers with required Personal Protective Equipment (PPE). Workers attending this instructor-led course will cover 18 different OSHA suggested topics including health and safety procedures, PPE used during work operations at hazardous material sites, medical monitoring and many others.\r\n \r\nInstructors emphasize a practical approach to worksite health and safety, as such, attendees learn to recognize site hazards and take appropriate steps to prevent illness or injuries while on the jobsite. \r\n \r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\n \r\nRegister Early! Pre-registration for all classes is required (no walk-in’s) and classes do fill up quickly.\r\n \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\n \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\n   5 to 9 students= 10%    10 or more = 15%\r\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29437097%2F51654302652%2F1%2Foriginal.jpg?s=17b0dbdcedce85641255d764e1a8cb77', 'https://www.eventbrite.com/e/40-hour-hazwoper-osha-training-seminar-classes-in-lansing-mi-tickets-32958100566?aff=ebapi', '3121 East Grand River Ave, Lansing, MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing, MI 48912', NULL, NULL, '1495526400', '1495821600', 0, 0, 0, NULL, 1),
(230, 'live', '32985010053', 13, 0, 2, 'Lansing Artificial Intelligence Training', 'Attend our Information Session\nRSVP or Register for Information Session here -Â http://bit.ly/2mHXdvmÂ \n\nWhy Artificial Intelligence Training from Omni212?\n1. Omni212 provides Artificial Intelligence Product engineering services2. Two of our most experienced, AI instructors teach this class.3. Employees of Microsoft, Zulily, have been interested in taking our AI classes.4. Class recordings, Training manual for this class will be made available. 5. Post class support6. Appropriate software accessÂ 7. Career advancement and Job placement assistance\n\nNext class starting\nApril 15, 2017\n\nVideo Conference link\nWill be sent upon your registration and payment\n\nTraining Session Details\nThere will be 9 online sessions, each session being of 2 hours. Every session will have presentation about theory, concepts and technology, followed by Hands-on Lab practice exercises.Â  Â  Â  Â  Â  Â  Â  Â \nTraining Dates\n\nBegins April 15, taught over 6 weeks ending on May 20\nApril 15, 16 Sat/Sun\nApril 22 Sat\nApril 29, 30 Sat/Sun\nMay 6 Sat\nMay 13, 14 Sat/Sun\nMay 20 Sat\nTimes: 12:00 PM - 2:00 PM (US Pacific Time) every session\nEach session will be recorded and the recordings will be shared after each session with students.\n\nÂ \nArtificial Intelligence Technology\nArtificial Intelligence (AI) is a field that has a long history but is still constantly and actively growing and changing. Â Artificial Intelligence (AI) technology is increasingly prevalent in our everyday lives. It has uses in a variety of industries from gaming, journalism/media, to finance, as well as in the state-of-the-art research fields from robotics, medical diagnosis, and quantum science.\nÂ \nAbout this course\n\nWhat do self-driving cars, face recognition, web search, industrial robots, missile guidance, and tumor detection have in common?\nThey are all complex real world problems being solved with applications of intelligence (AI).\nThis course will provide a broad understanding of the basic techniques for building intelligent computer systems and an understanding of how AI is applied to problems.\nYou will learn about the history of AI, intelligent agents, state-space problem representations, uninformed and heuristic search, game playing, logical agents, and constraint satisfaction problems.\nHands on experience will be gained by building a basic search agent. Adversarial search will be explored through the creation of a game and an introduction to machine learning includes work on linear regression.\n\nÂ \nWhat you will learn in this course?\n\nIn this course youâ€™ll learn the basics and applications of AI, including: machine learning, probabilistic reasoning, robotics, computer vision, and natural language processing.\nIn this course, youâ€™ll learn the basics of modern AI as well as some of the representative applications of AI. Along the way, we also hope to excite you about the numerous applications and huge possibilities in the field of AI, which continues to expand human capability beyond our imagination.\nLearn the fundamentals of Artificial Intelligence (AI), and apply them. Design intelligent agents to solve real-world problems including, search, games, machine learning, logic, and constraint satisfaction problems.\n\nÂ \nWhat are the pre-requisites?\nSome of the topics in Introduction to Artificial Intelligence will build on probability theory and linear algebra. You should have understanding of probability theory comparable to that covered in our Intro to Statistics course.\nStudents are required to have some basic of Python programming and an understanding of probability. Homework assignments will have a programming component in Python. The course offers an excellent opportunity for students to dive into Python while solving AI problems and learning its applications.\nÂ \nÂ \nCourse Outline\n\n\nIntroduction to AI, history of AI, course logistics\n\n\nIntelligent agents, uninformed search\n\n\nHeuristic search, A* algorithm\n\n\nAdversarial search, games\n\n\nConstraint Satisfaction Problems\n\n\nMachine Learning: Basic concepts, linear models, perceptron, K nearest neighbors\n\n\nMachine Learning: advanced models, neural networks, SVMs, decision trees and unsupervised learning\n\n\nMarkov decision processes and reinforcement learning\n\n\nLogical Agent, propositional logic and first order logic\n\n\nAI applications (NLP)\n\n\nAI applications (Vision/Robotics)\n\n\nReview and ConclusionÂ \n\n\n\nClass Size:Â Maximum 22\n\nPrice:Â $495\n\nPLEASE NOTE:1. Each student gets access to a login account on the cloud, Microsoft Azure, where they install Hadoop on a cloud virtual machine and perform hands-on lab exercises with instructor guidance. There will be 2 experienced big data, hadoop instructors supporting the students throughout the class.\n\nADVANTAGES OF TAKING THIS COURSE WITH OMNI212:1. Class recordings will be made available. 2. Post class support3. Course material available. 4. Cloud account on Microsoft Azure with Hands-on lab exercises under the guidance of two experienced big data, hadoop instructors.5. Career advancement and Job placement assistance\n\n\nREFUND POLICY\n1. 100% refund will be provided under the following circumstances:\n\nIn case Omni212 cancels or reschedules the class.\nIf the student cancels or raises a refund up to 48 hoursÂ beforeÂ the start of course.\nNo negative review is given without giving Omni212 the chance to remedy the situation within 15 days after the complaint was registered by the student.\n\n2. 50% refund will be issued under the circumstance that:\n\nStudent raises a refund request within 3 days after the first training session.\n\n3. No refund will be provided under the following circumstances:\n\nStudent raises a request more than 3 days after start of the course.\nStudent registers for the course and does not attend the course for whatever reason.\n\n4. Refunds will be issued within 15 days once the request has been approved.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29472149%2F59307985005%2F1%2Foriginal.jpg?s=b545f08466e1f4149619ab82ef061691', 'https://www.eventbrite.com/e/lansing-artificial-intelligence-training-tickets-32985010053?aff=ebapi', 'Online - please disregard address & map locations., Lansing, MI', 42.732535, -84.55553470000001, 'Online - please disregard address & map locations., Lansing, MI', NULL, NULL, '1492248600', '1495279800', 0, 0, 0, NULL, 1),
(231, 'live', '33028157107', 13, 0, 2, 'Taste & Sounds of Sigma XII', 'Phi Beta Sigma Fraternity, Inc., Epsilon Tau Chapter Wine tasting fundraiser.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29526232%2F205038852906%2F1%2Foriginal.jpg?s=9a32c373ef044e1e3b6637479463b0fd', 'https://www.eventbrite.com/e/taste-sounds-of-sigma-xii-tickets-33028157107?aff=ebapi', 'Lansing, MI 48906', 42.747587, -84.54850909999999, 'Lansing, MI 48906', NULL, NULL, '1494149400', '1494160200', 0, 0, 0, NULL, 1),
(232, 'live', '33036214206', 13, 0, 2, '2017 Bobbleheads in Space 5K - Lansing', 'Â  *NOW ONLY $14.00! Â We are celebrating National Bobblehead Day (January 7th) with our Bobbleheads in Space 5K, for all of you space lovers out there! This year''s medal has an astronaut running in space and guess what...his head moves up and down, like a bobblehead!Â  We are really excited with how they''ve turned out! Don''t miss out on these awesome medals! We have 500 medals available and they will sell out quick so sign up NOW!Â  You have from January 1st to April 30th to complete your race!\r\n\r\nWhen:Â Complete your race any timeÂ during January thru April 2017! Where:Â  You choose the course and you time yourself (youâ€™ll report your finishing time to us). Why:Â Â Because we want as many people as we can get to virtually run (or walk) a 5K and to help raise awareness for Human Trafficking. Â January is Human Trafficking Awareness month and we will be donating a portion of each registration fee (at least 15% of each registration) toÂ O.U.R. - Operation Underground Railroad. Their mission is to rescue kidnapped children from slavery. Â Be sure to check out their site and see what they''re doing to help these kids! \r\nÂ \r\nCost: $17. Â Includes custom medal and bib that will be shipped directly to you. Â Plus, at least 15% of every entry will be donated to O.U.R. Â *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them. Medals and bibs will start shipping out mid-December!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29538183%2F98886079823%2F1%2Foriginal.jpg?s=c06f928cc9b16f9f6282feba963418bb', 'https://www.eventbrite.com/e/2017-bobbleheads-in-space-5k-lansing-registration-33036214206?aff=ebapi', 'Lansing, Michigan 48924', 42.7338157, -84.60697089999996, 'Lansing, Michigan 48924', NULL, NULL, '1492241400', '1493548200', 0, 0, 0, NULL, 1),
(233, 'live', '33038753802', 13, 0, 2, 'FrogWatch USA Training â€“ Session 4', 'Spring is right around the corner and Potter Park Zoo is excited to announce this yearâ€™s Mid-Michigan FrogWatch USA Chapter training dates for aspiring frog watchers.Â Volunteers with FrogWatch USA are trained to learn when, where and how to collect data. They listen for and identify frog and toad calls at specific breeding sites around mid-Michigan, and then report their findings back to Potter Park Zoo. The information is then entered into a national database where it is used for monitoring the local amphibian population. Volunteers are asked to commit to a minimum of four listening sessions over the course of the frog/toad breeding season (April â€“ September). For those who donâ€™t live near a wetland or pond, there are several opportunities to listen in public places. Zoo staff can counsel participants on this.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29541466%2F95178946275%2F1%2Foriginal.jpg?s=bf365935a64d4ceb1f96cf356e11c160', 'https://www.eventbrite.com/e/frogwatch-usa-training-session-4-tickets-33038753802?aff=ebapi', '1301 South Pennsylvania Avenue, Lansing, MI 48912', 42.718292, -84.53204800000003, '1301 South Pennsylvania Avenue, Lansing, MI 48912', NULL, NULL, '1492227000', '1492237800', 0, 0, 0, NULL, 1),
(234, 'live', '33050999429', 13, 0, 2, '8-Hour HAZWOPER OSHA refresher training in Lansinsg, MI', 'Compliance Solutions, the nation''s largest provider of OSHA Hazmat training is pleased to offer open enrollment for the 8-Hour OSHA HAZWOPER Annual Refresher trainingin twelve different cities every week!\r\n \r\nOur instructor-led seminars meet or exceed OSHA’s suggested training curricula and meet OSHA’s mandated training requirements under 29 CFR 1910.120(e and q).\r\n \r\nThe 8-Hour HAZWOPER course meets OSHA’s annual refresher requirements for employees who have completed their initial 24-Houror 40-Hour HAZWOPER certification. Mandatedtraining can be found in 29 CFR1910.120. Students attending the 8-Hour HAZWOPER are updated on changes in related regulations, participate in multiple class safety activities, complete a mock dress-out and receive instruction in health and safety procedures, and personnel protection during work operations at hazardous material sites. Unlike our competitors, our training content and exercises are updated annually so your employees don’t take the same class over and over again every year!\r\n \r\nPrerequisites:Students must have completed an initial 24-Hour or 40-Hour HAZWOPER course and have maintained certification through annual refresher training. If certification has not been refreshed under OSHA guidelines, the 24-Hour or 40 Hour HAZWOPER should be re-taken to maintain certification.\r\nRegister Early! Pre-registration for all classes is required (no walk-in’s) and classes do fill up quickly.\r\n \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\n \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\n  5 to 9 students= 10%     10 or more = 15%\r\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29555082%2F51654302652%2F1%2Foriginal.jpg?s=1a20bdfe39b7b80617f87baa1d3f5f72', 'https://www.eventbrite.com/e/8-hour-hazwoper-osha-refresher-training-in-lansinsg-mi-tickets-33050999429?aff=ebapi', '3121 East Grand River Ave, Lansing , MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing , MI 48912', NULL, NULL, '1495785600', '1495821600', 0, 0, 0, NULL, 1),
(235, 'live', '33051876051', 13, 0, 2, 'Emergency Response Technician Level III Initial Training in Lansing, MI', 'The Emergency Response Technician Level III Initial Training Seminar from Compliance Solutions provides training mandated under OSHA 29 CFR1910.120(q). This course is conducted in conjunction with our 40-Hour HAZWOPER course. Workers attending this instructor-lead course will cover 18 different OSHA suggested topics including Health and Safety Procedures, PPE used during work operations, Medical Monitoring and many others. The course is held over four days, 10-hours each day.\r\nPersonnel who are involved in the cleanup of spills in manufacturing environments as well as those individuals who are responsible for control or containment of hazardous or potentially hazardous materials are required to receive Emergency Response training. This initial training course focuses on the identification and safe handling of hazardous materials. Individuals who are members of a response team should always have site specific training and drills tailored to their specific hazards before attempting cleanup or containment. In order to stay in compliance with OSHA regulations and maintain certification, a refresher course is required to be completed annually.\r\nAct now and get your ticket today. Classes do fill quickly.\r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\n \r\nRegister Early! Pre-registration for all classes is required (no walk-in’s) and classes do fill up quickly.\r\n \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\n \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\n  5 to 9 students= 10%    10 or more = 15%\r\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29556155%2F51654302652%2F1%2Foriginal.jpg?s=f5f877b69d7bd8a91a8d2438cc25d1c8', 'https://www.eventbrite.com/e/emergency-response-technician-level-iii-initial-training-in-lansing-mi-tickets-33051876051?aff=ebapi', '3121 East Grand River Ave, Lansing, MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing, MI 48912', NULL, NULL, '1495526400', '1495821600', 0, 0, 0, NULL, 1),
(236, 'live', '33053680448', 13, 0, 2, 'Stress & Time Management', 'Would you like to manage your time effectively between work and family? Learn how stress affects your life, how it can relate to nutrition, and how to lead a â€œbalanced lifeâ€. You''ll take away tips to structure your life and feel like you''ve added hours to the day.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29558964%2F129191537381%2F1%2Foriginal.jpg?s=2a90840419fa56490925428fdd4c356f', 'https://www.eventbrite.com/e/stress-time-management-tickets-33053680448?aff=ebapi', '537 North Clippert Street, Lansing, MI 48912', 42.739621, -84.50869599999999, '537 North Clippert Street, Lansing, MI 48912', NULL, NULL, '1493643600', '1493647200', 0, 0, 0, NULL, 1),
