(244, 'live', '33085948964', 13, 0, 2, 'Chase the Sun Global Running & Walking Challenge 2017 - Save 40% -Minneapolis', '*Sign up here and use promo code SUNSHINEÂ to save 40%! Â (expires May 30th)\r\nSET FIRE TO YOUR FEETÂ in 2017! Are you ready to chase the sun? We are looking for runners, walkers and joggers of all shapes, sizes and fitness levels to join us on a journey toÂ the SunÂ in 2017! Â Log your miles and they will be added to our total miles as a group. Â Let''s log enough miles to get to the SUN! It''s a 93 million mile journey, so we need your help! Â You will move up the Moon Jogger rankings as you log more and more miles! Thousands of people worldwide have joined the challenge. Will you?Â SIGN UP NOW! Sign up throughout the year and log your miles back to January 1st!Â \r\n\r\nÂ \r\n Sign up now! FULL FLEDGED participants will receive:\r\n\r\nOfficial Chase the Sun tech T-Shirt\r\nChase the SunÂ Window Decal & bib\r\nChase the SunÂ Welcome Letter\r\nÂ Chase the Sun Participant''s Medal\r\n25% off all of our virtual races for 2017\r\nYour own personal mileage log on our website\r\nWe will also have other fun contests throughout the year, with great prizes, so be sure to join theÂ Moon Jogger Facebook Group Page\r\n\r\nParticipants that choose the MEDAL ONLY option will receive:\r\n\r\nEverything the fullÂ option will receive, besides the T-shirt.\r\n\r\nParticipants may also choose the DECAL ONLY option and receive:\r\n\r\nEverything the full option will receive, besides the T-shirt and medal.\r\n\r\n*Since we are going to the SUN, you better make sure you wear lots of sun screen to protect your skin! Because of this, a portion of all of the registration fees will be donated to the Skin Cancer Foundation.Â Â  Our goal is to raise $10,000 with this event!\r\n\r\n*Your shirts and/or medals will ship out in January 2017!\r\n\r\nHow It Works: 1. You sign up and set a goal for how many miles you will run/walk in 2017 and which ranking you will achieve. 2. 