(249, 'live', '33104630842', 13, 0, 2, 'Moon Day 7.20 Miles or Kilometers â€“ One Small Step For Man - St Paul', '*THIS IS A VIRTUAL RACE! EVERYONE IS WELCOME TO PARTICIPATE! Â WE ship your medals to you!\r\nNational Moon Day is July 20th, the day man first walked onÂ the moon. Â To celebrate we are holding aÂ Moon Day 7.20 - One Small Step For Man virtual race. Â  You can complete 7.20 Miles or Kilometers, it''s your choice. Â Everyone around the world is welcome to participate!Â \r\nAs Moon Joggers, we love this special day! Â Our first year, as an online running & walking group, we logged enough miles to land on the moon! Â In June 2017 we are having an Ultimate Moon Jogger Meet Up in Utah, where Moon Joggers from around the world will be gathering together to participate in a race together, in person! We will be donating at least 15% of each registration for this race towards our meet up and to donate to the race we will be participating in:Â AF Canyon Run Against Cancer.Â \r\nWhen:Â Complete your race any timeÂ in July 2017. Â Even better if you complete it on Moon Day, July 20th.Â \r\nWhere:Â  You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhat: Â Complete 7.20 miles or kilometers in the month of July.Why:Â Â Because we want as many people as we can get to celebrate the day man landed on the moon!Â \r\nCost:Â $17. Â Includes custom medal and bib that will be shipped directly to you. Â Â Plus, at least 15%Â of every entry will be donatedÂ towards our Ultimate Moon Jogger Meet Up and to donate to the race we will be participating in:Â AF Canyon Run Against Cancer.Â Â  *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them.\r\n*Medals will start shipping out at the end of June.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29623376%2F98886079823%2F1%2Foriginal.jpg?s=6bc022b64a2bde1da664bf8cb144633f', 'https://ww