(250, 'live', '33105283795', 13, 0, 2, '2017 SHARK BAIT HOO HA HA 5K & 10K - Lansing', 'Okay people! June is Shark Week and we want to celebrate in our own wayâ€¦with a SHARK BAIT HOO HA HA 5K & 10K! Â  Will you be able to run (or walk) fast enough to not be shark bait? THIS IS A VIRTUAL RACE!\r\nWe will be donating at least 15% of every registrationÂ toÂ The Ocean Foundation, Â which â€œis a unique community foundation with a mission toÂ support, strengthen, and promote those organizations dedicated to reversing the trend of destruction of ocean environments around the world.â€\r\nWhat:Â This is a 5K & 10K virtual run (or walk) toÂ celebrate SHARKS (and do move fast enough to not become shark bait)!\r\nWhen:Â Complete your race any time in JuneÂ 2017.\r\n*Medals and bibs will begin to ship out in May.\r\nWhere:Â Â You choose the course and you time yourself (youâ€™ll report your finishing time to us). We ship your medal to you.Â \r\nWhy:Â Â Because we love sharks (and donâ€™t want to be shark bait)Â and to help raise funds for an amazing organization:Â The Ocean Foundation.\r\nCost:Â Â The price is $17 and that includes your medal, bib and shipping. Plus, at least 15%Â of every entry will be donated toÂ The Ocean Foundation.Â  *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29624388%2F98886079823%2F1%2Foriginal.jpg?s=8bcdb67fa1dc0bd86126f3ba23ceb83d', 'https://www.eventbrite.com/e/2017-shark-bait-hoo-ha-ha-5k-10k-lansing-registration-33105283795?aff=ebapi', 'YOU CHOOSE, Lansing, MI 48924', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Lansing, MI 48924', NULL, NULL, '1497081600', '1498816800', 0, 0, 0, NULL, 1),
(251, 'live', '33106901634', 13, 0, 2, 'Strong By Choice 5K, 10K, 13.1, 26.2 - ONLY $8.00!  - Minneapolis', '*WE HAVE A LIMITED NUMBER OF MEDALS LEFT FROM OUR STRONG BY CHOICE VIRTUAL RACE IN SEPTEMBER! Â SIGN UP NOW FOR ONLY $8.00 AND COMPLETE YOUR RACE BY MAY 31, 2017!\r\nâ€œWe donâ€™t know howÂ STRONGÂ we really are until being strong is the onlyÂ CHOICE.â€ This yearâ€™s medal will be Â 3.5 inches and we are really excited with how theyâ€™ve turned out! Â Last September we raised money for a fellow Moon Jogger that had suffered a traumatic brain injury. Â This year, we continue to raise awareness for traumatic brain injury.\r\n\r\n\r\nWhen:Â Complete your race any time befor May 31, 2017\r\nWhere:Â  You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy:Â Â Because we want as many people as we can get to virtually run (or walk) a 5K, 10K, Half or Full Marathon to help raise awareness for traumatic brain injury. Â We will be donating a portion of each registration fee (at least 20% of each registration) to theÂ Brain Injury Association of America.Cost:Â $22. Â Includes custom medal and bib that will be shipped directly to you. Â  Plus, at leastÂ 20%Â of every entry will be donated to Brain Injury Association of America.Â (typically about $5). Â *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them. SIGN UP NOW FOR ONLY $8.00!Medals will ship within 2 to 5 days of signing up!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29626282%2F98886079823%2F1%2Foriginal.jpg?s=0d21f022457fb6448c404e1efe15e5c4', 'https://www.eventbrite.com/e/strong-by-choice-5k-10k-131-262-only-800-minneapolis-registration-33106901634?aff=ebapi', 'YOU CHOOSE, Minneapolis, MN 55401', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Minneapolis, MN 55401', NULL, NULL, '1492932600', '1496226600', 0, 0, 0, NULL, 1),
(252, 'live', '33120379948', 13, 0, 2, 'Emergency Response Technician Level III Annual Refresher Training in Lansing, MI', 'Emergency Responder Technician Level III Annual Refresher Training. According to OSHA regulations, each level of emergency responder must take an 8 hour annual refresher course to stay current on the techniques used in a hazardous materials incident. The 8-hour refresher course helps to meet the requirements of OSHA in an informative and interactive manner. Included in the course are numerous techniques used in keeping the responder safe while containing and mitigating a hazardous materials spill. In order to fully comply with OSHA standards, students must review their company Emergency Response Plan as a part of their annual refresher training.\r\nPREREQUISITES:  Emergency Response Technician Level III Training\r\nAct now and buy your ticket today. Classes do fill up quickly.\r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\n \r\nRegister Early! Pre-registration for all classes is required (no walk-in’s) and classes do fill up quickly.\r\n \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\n \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\n  5 to 9 students= 10%    10 or more = 15%\r\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29643173%2F51654302652%2F1%2Foriginal.jpg?s=8e83a14163df9e8b9450385c7be54881', 'https://www.eventbrite.com/e/emergency-response-technician-level-iii-annual-refresher-training-in-lansing-mi-tickets-33120379948?aff=ebapi', '3121 East Grand River Ave, Lansing, MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing, MI 48912', NULL, NULL, '1495785600', '1495821600', 0, 0, 0, NULL, 1),
