(254, 'live', '33142456981', 13, 0, 2, 'Friends Forever 5K - Who is the MAC to your CHEESE? - Lansing', 'Did you know that International Friendship Day is August 6, 2017?!?! What better way to celebrate than to run/walk the Friends Forever 5K in honor of the friends in our lives. Â Who is the Macaroni to your Cheese?Â \r\nâ€œThere is nothing on this earth more to be prized than true friendship.â€Â â€“Thomas Aquinas\r\nTo celebrate we are hosting aÂ VIRTUAL 5KÂ race, where you can choose to run (or walk) a 5K and dedicate to a friend in your life. You will get a Friends Forever 5K medal set and be able to give oneÂ of the medals to your friend! Better yet, get your friend to complete the 5K with you! Â We have 1,000 medal sets and they will sell out! Order NOW!\r\nAlong with celebrating BEST FRIENDS, Â we will also be donating at least 15% of each registration toÂ Soles 4 Souls.Â Since 2006 Soles4Souls has collected and distributed 26 million pairs of shoes to those in need in 127 countries around the world and all 50 states in the U.S.\r\nWhat:Â This is a 5K virtual run (or walk) to celebrate the FRIENDS in our lives.\r\nWhen:Â Complete your race any time in August. Even better if you complete it on August 6, Friendship Day!*Medals willÂ being shipping in July.Where:Â Â You choose the course and time yourself (youâ€™ll report your finishing time to us).\r\nWhy: Â This is our way of celebrating FriendshipÂ Day and to raise fundsÂ Soles 4 Souls.COST:Â Â $20, which includes your medal set, two bibsÂ and shipping. Â Plus,Â at least 15% of each registration will be donated toÂ Soles 4 Souls.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29672967%2F98886079823%2F1%2Foriginal.jpg?s=44ad73822ed702c6c4fe84f66a840b9d', 'https://www.eventbrite.com/e/friends-forever-5k-who-is-the-mac-to-your-cheese-lansing-registration-33142456981?aff=ebapi', 'YOU CHOOSE, Lansing, MI 48924', 42.6875, -84.5006, 'YOU CHOOSE, Lansing, MI 48924', NULL, NULL, '1502006400', '150417