(255, 'live', '33154634404', 13, 0, 2, '2017 Ice Cream Day 5K - Lansing', 'You scream. I scream. We all scream for ice cream! Did you know thatÂ National Ice Cream DayÂ is July 16, 2017!?! Letâ€™s run (or walk) for Ice Cream!Â \r\nÂ To celebrate we are hosting a virtual Â race, where you can choose toÂ run a 5KÂ to honor this special day and get a beautiful Ice Cream Day 5KÂ medal! We only have 500 medals available, so once theyâ€™re gone, theyâ€™re gone! Order NOW!\r\nAlong with celebrating Ice Cream, Â we will also be donating Â at least 15%Â of every registration toÂ Operation Smile,Â an incredible organization whichÂ â€Â believes every child suffering from cleft lip or cleft palate deserves exceptional surgical care.â€ Â July is National Cleft Awareness month and we are excited to donate to this fantastic organization.\r\n*THIS IS A VIRTUAL RUN!\r\nWhat:Â This is a virtual run (or walk) 5K to celebrate ICE CREAM!\r\nWhen:Â Complete your race anyÂ time July! National Ice Cream Day is July 16 if you want toÂ complete it on Ice Cream Day.Â \r\n*Medals will begin shipping out mid-June 2017.Â \r\nWhere:Â Â You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy:Â Â Because this is our way of celebrating National Ice Cream DayÂ and to help raise funds for an amazing organization:Â Operation Smile.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29687133%2F98886079823%2F1%2Foriginal.jpg?s=99fa0c9cc00052033f405c96174c4d10', 'https://www.eventbrite.com/e/2017-ice-cream-day-5k-lansing-registration-33154634404?aff=ebapi', 'YOU CHOOSE, Lansing, Michigan 48924', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Lansing, Michigan 48924', NULL, NULL, '1500192000', '1501495200', 0, 0, 0, NULL, 1),
(256, 'live', '33155089766', 13, 0, 2, 'PMPÂ® Classroom Training in Lansing, MI-USA | Eduscil', 'The PMPÂ® training course isÂ designed to ensure that you pass the PMP exam on the first try. Our hands-on training approach, entrusted by 52,000 learners, will help you to understand the workings of the 5 process groups and 10 knowledge areas defined by theÂ PMBOKÂ® Guideâ€”Fifth Edition. We guarantee youâ€™ll walk away with all the preparation and confidence you need to conquer the exam and earn the PMP certification.\nEduscil is conducting 4 days PMP certification training course in major cities in USA. Register for this 4-day PMP classroom training/4-day PMP Live Virtual classroom training course, spread over one weekdays and prepare for the PMP Exam from an expert trainer.Â \n\nFeatures of our PMP Certification Training:\n4 days instructor-led intense classroom training\nLearn from an expert Project Management Trainer\n60 days access to 4 sets of mock question and answers for practice\nHard copy of the latest PMBOK 5th edition\nCase studies in the classroom training session\n35 contact hours certificate which will help you apply for PMP exam.\nHelp with PMP Exam Application Process\nTips and Techniques to clear PMPÂ® Certification by the Trainer\nSupport till you clear the PMP exam with 100% money back guarantee*\nCourses conducted across the globe\n\nFor more information about our Project Management training courses, please e-mail support@eduscil.com or Call Now! OnÂ +1 (302)-604-7957\nWe also deliver onsite training for corporate groups. Contact us for group/corporate_discount.\n\n5.00% for 3-4 people\n10.00% for 5-9 people\n15.00% for 10 and above people\n\nVisit us atÂ PMPÂ® Certification Training Course to know more about our certification training courses in Program Management, ITIL, IT Service Management, Quality Management, Agile, Scrum, and related fields.\nWe conduct PMP certification training courses in Phoenix, Charlotte, Minneapolis, Boston, Chicago, Houston, Phoenix, Chicago, Washington, Los Angeles, Washington, Indianapolis, Dallas, San Diego, Baltimore and Richmond around USA... Please visit us atÂ http://www.eduscil.com/ to know more about our professional certification training courses in India and across the globe.\nPlease Contact Eduscil Learning Solutions:\nE-mail: support@eduscil.com or tony@eduscil.com\nWebsite:Â http://www.eduscil.com/\nCall Us Now!:\nUSA: +1 (302)-604-7957', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29687609%2F203533422144%2F1%2Foriginal.jpg?s=f989737f5b4ff992e7674569f4886075', 'https://www.eventbrite.com/e/pmp-classroom-training-in-lansing-mi-usa-eduscil-tickets-33155089766?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1492831800', '1492862400', 0, 0, 0, NULL, 1),
(257, 'live', '33162535035', 13, 0, 2, 'Lansing Cloud Computing Training*', 'Register for Upcoming Information Sessions:\nhttp://bit.ly/2myk1BP\nWednesday, March 29, 2017 at 12 PM Pacific time\nSaturday, April 1, 2017 at 9 AM Pacific time\nSaturday, April 8, 2017 at 9 AM Pacific time\n\nWhy Cloud Computing Training from Omni212?\n1. Omni212 is a AWS, Microsoft Azure partner and an avid Open stack cloudÂ practitioner2. Two of our most experienced, cloud computing instructors teach this class.3. We practice what we preach. All of our IT systems are on the cloud4. Class recordings, Training manual for this class will be made available.Â 5. Post class support6. Appropriate software accessÂ 7. Career advancement and Job placement assistance\n\nVideo Conference Link\nWill be sent upon registration and payment\n\nTraining Provider:\nOmni212Â \n\nDelivery Method:\nExclusively online via video conference. Virtual Instructor Led Training\n\nDates:\nApril 15, 16, 22, 23, 29, 30, May 6, 7,13,14 Â 2017Every Saturday and Sunday 9:00am - 11:00am US Pacific Time\n\nAudience:\n\n\nYou are interested in getting trained and building a career in Cloud Computing.\n\n\nYou are new to cloud computing but you have some experience using computers for a business or in personal life.\n\n\nYou do not need to have a background in computer science or computer programming.\n\n\nYou have an appreciation for cloud computing and desire to learn new cloud technologies that include open source technologies along with cloud offerings from leading cloud computing vendors\n\n\n\nPrerequisite:\nNone\n\nClass Schedule:\nEvery weekend, Sat, Sun 9am-11am US Pacific timeÂ \n\nCourse Outline:\n1. Introduction to Cloud Computing\n2. Advantages of Cloud Computing to Organizations\n3. Set up Cloud Computing Virtual machine\n4. Cloud Computing Terminology - NIST definition, SaaS, IaaS, PaaS service models, Public cloud, private cloud, hybrid cloud, community cloud deployment models\n5. Amazon Web Services, Microsoft Azure, Google cloud, Digital Ocean, Open Stack, Rackspace\n6. PaaS cloud platform service providers -Â Â Heroku, Openshift from Red Hat, Cloud Foundry, IBM BlueMix, Engine Yard and Deis\n7. Basics of virtualization and containerization.\n8. Docker\n9. SaaS landscapeÂ \n10. Challenges in migrating on-premise business applications to the cloud\n11. 12-factor appsÂ methodology of writing modern cloud native applications.\n\nPrice:\nUS $495\n\nClass size:\n22 max\n\n\nADVANTAGES OF TAKING THIS COURSE WITH OMNI212:1. Class recordings will be made available.Â 2. Post class support3. Course material available.Â 4. Hands on lab exercises on cloud infrastructure.5. Career advancement and Job placement assistance\n\n\nREFUND POLICY\n1. 100% refund will be provided under the following circumstances:\n\nIn case Omni212 cancels or reschedules the class.\nIf the student cancels or raises a refund up to 48 hours before the start of course.\nNo negative review is given without giving Omni212 the chance to remedy the situation within 15 days after the complaint was registered by the student.\n\n2. 50% refund will be issued under the circumstance that:\n\nStudent raises a refund request within 3 days after the first training session.\n\n3. No refund will be provided under the following circumstances:\n\nStudent raises a request more than 3 days after start of the course.\nStudent registers for the course and does not attend the course for whatever reason.\n\n4. Refunds will be issued within 15 days after the end of the class\n\n*Unlimited Training*\nÂ  Â  Â http://bit.ly/2nj9Obq\nNow you can enjoy unlimited training from Omni212.\nLook forÂ *Asterisk* on Omni212 Eventbrite courses.\nAny course published by Omni212 on eventbrite with *Asterisk* on the course title can be taken individually as well as a part of the Unlimited training program.\nThese are the terms and conditions:\n\nUnlimited training periods consist of 1, 3, 6, 9 and 12 months respectively. See appropriate ticket type for price.\nYou will have access to the training material, class recordings, across all of the published courses whether you attend or do not attend the Live Instructor Led Online sessions for the unlimited period purchased by you.\nYou will loose all access after your unlimited training period expires unless you are already enrolled in the course(s) which began within the unlimited training period (UTP) you registered for and continue beyond the end of the UTP\nAll of the course material, class recordings are yours to keep. You can download.\nYour unlimited training period will start from the first session of the first course that you take.\nThis applies only for the courses published by Omni212 on Eventbrite.\nStudents may enroll in a course and complete the course even if it starts on the last day of the Unlimited period.\nWhile Omni212 strives to maximize the benefit for the students who purchase any of the unlimited training periods, this program applies only to the published courses for the purchased time period.\nAlthough we will strive to have all of these courses published and available for you to take, we cannot guarantee that all the courses under each unlimited period will be available and published.\nCourse Availability and schedule is subject to availability of the instructors, enough enrollment, no overflow.\n\n\nThe following courses, if avaiable, if published and if held as originally scheduled will be available for unlimited training program:\n\nBRONZE - Included in Unlimited Training for 1 month\n1. Big Data, Analytics & Hadoop\n2. Cloud Computing Level 100\n3. Artifical Intelligence Level 100\n4. Tableau\n5. Scrum Master\n6. Certified Ethical Hacking\n7. Machine Learning\n8. How to Ace the Tech Interview\n9. PMP\n\nSILVER - Included in Unlimited training for 3 months\n1. All courses included in Unlimited training for 1 month\n2. Cloud Computing Level 200\n3. Data Science Level 100\n4. Artifical Intelligence Level 200\n5. DevOps\n6. Learn to Co