(265, 'live', '33264076749', 13, 0, 2, 'Total Eclipse of the Sun Run 5K & 10K - Minneapolis', 'These medals spin in the middle. One side of the spinner shows the sun, the other shows the sun being eclipsed by the moon.\r\n Did you know on August 21, 2017 there will be a total eclipse of the sun? A total solar eclipse was last seen in 1991. Â The total solar eclipse of June 8, 1918 crossed the United States from Washington State to Florida. This path is roughly similar to theÂ August 21, 2017Â total solar eclipse and was the last time totality crossed the nation from the Pacific to the Atlantic. We are so excited to celebrate a Total Eclipse of the Sun RunÂ 5K& 10K.\r\n\r\nWe will also be donating at least 15% of each registration to the Skin Cancer Foundation, which isÂ only international organization devoted solely to education, prevention, early detection, and prompt treatment of the worldâ€™s most common cancer. \r\nWhen:Â Complete your race any time in August. Â If you can, complete it on August 21, 2017, the day of the total eclipse of the sun! \r\nWhere:Â  You choose the course and you time yourself (youâ€™ll report your finishing time to us). You can complete a 5K or a 10K.\r\n Why:Â Â Because this rare total eclipse of the sun won''t be happening again until 2024! \r\nÂ \r\nCost: $17. Â Includes custom medal and bib that will be shipped directly to you. Â Plus, at least 15%Â of every entry will be donated toÂ Skin Cancer Foundation.Â  *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them. * Medals will begin shipping in July.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29820725%2F98886079823%2F1%2Foriginal.jpg?s=c4952fff385b7bd10007f494f50c2d41', 'https://www.eventbrite.com/e/total-eclipse-of-the-sun-run-5k-10k-minneapolis-registration-33264076749?aff=ebapi', 'YOU CHOOSE, Minneapolis, MN 55401', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Minneapolis, MN 55401', NULL, NULL, '1503320400', '1504191600', 0, 0, 0, NULL, 0),
(266, 'live', '33287158788', 13, 0, 2, 'What is Red Tea?', 'Tea varies in shapes, smells, and colors. So, what makes red tea special? Is it really tea? Learn about this curious beverage, and join us in honoring the founding of the Red Cross and its impact on global health.\nJoin Newby each month in rediscovering the art of tea. Each class features some of the worldâ€™s finest teas with trained tea specialists. All classes* are Saturday morning between 10am-12pm, where we will host a two-hour tea experience. Whether a tea connoisseur or a newbie, bring your family and friends and meet others who share the same passion for tea.\n\n*Looking to host a unique event? The C&NTER is available for private events. Contact 517 999 0590 or email center@newbyteas.us for inquiries.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29854238%2F203805350410%2F1%2Foriginal.jpg?s=9ef2d92baae7e162546d94b313113f83', 'https://www.eventbrite.com/e/what-is-red-tea-tickets-33287158788?aff=ebapi', '333 Albert Avenue Suite 606, East Lansing, MI 48823', 42.7356613, -84.47994519999997, '333 Albert Avenue Suite 606, East Lansing, MI 48823', NULL, NULL, '1495254600', '1495261800', 0, 0, 0, NULL, 1),
