(269, 'live', '33292751516', 13, 0, 2, 'Intro to Tea', 'Calling all tea newbies. Our introductory class will walk you through the history and culture of tea, and touch on the variety and characteristics of tea. If youâ€™re eager to expand your tea knowledge and try some new teas, this is for you.\nJoin Newby each month in rediscovering the art of tea. Each class features some of the worldâ€™s finest teas with trained tea specialists. All classes* are Saturday morning between 10am-12pm, where we will host a two-hour tea experience. Whether a tea connoisseur or a newbie, bring your family and friends and meet others who share the same passion for tea.\n\n*Looking to host a unique event? The C&NTER is available for private events. Contact 517 999 0590 or email center@newbyteas.us for inquiries.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29860421%2F203805350410%2F1%2Foriginal.jpg?s=d91e8547c93a73b03817df8939db4523', 'https://www.eventbrite.com/e/intro-to-tea-tickets-33292751516?aff=ebapi', '333 Albert Avenue Suite 606, East Lansing, MI 48823', 42.7356613, -84.47994519999997, '333 Albert Avenue Suite 606, East Lansing, MI 48823', NULL, NULL, '1498278600', '1498285800', 0, 0, 0, NULL, 1),
