(271, 'live', '33319118380', 13, 0, 2, 'Cocktail Class', 'Kick off the summer season with a cocktail! You have the day off, so, put the cocktail class in your scheduleÂ beforeÂ the BBQ!\nYou love our cocktails! Â Now we''ll teach you how to make them at home. Â You will learn about the history of four seasonal cocktails and why each spirit is used. You will receive the cocktail recipes and be able to practice the techniques needed to make them. Upon completion, you will be confident in your abilities to make fabulous crafted cocktails at home. The best part, you get to drink what you make!\nSpace is limited so reserve your spot, today!\nCost is $85 per person. Must be 21 years or older.Cost is $72.25 for Crystal Club Members.\nNEW COUPLES PRICING!\nCost is $150 per couple. Must be 21 years or older.Cost is $127.50 per couple for Crystal Club Members.\nPlease note:Â the reduced pricing is based onÂ oneÂ set of tools.\nIncluded with the price, you will receive:\n\nBoston shaker\nHawthorn strainer\nBar spoon\nMuddler\nJigger', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29899309%2F192380736024%2F1%2Foriginal.jpg?s=1a784f178111ed471ef1599f06cc3983', 'https://www.eventbrite.com/e/cocktail-class-tickets-33319118380?aff=ebapi', '112 N. Larch St., LANSING, Michigan 48912', 42.734056, -84.5442888, '112 N. Larch St., LANSING, Michigan 48912', NULL, NULL, '1496064600', '1496071800', 0, 0, 0, NULL, 1),
(272, 'live', '33327213593', 13, 0, 2, 'Lansing Cybersecurity Series: Certified Ethical Hacker Training', 'Register for one of our upcoming Certified Ethical Hacker Training Information SessionsÂ \nhttp://bit.ly/2ofFEY0\nMon, Apr 3, 2017 9:00 AM - 10:00 AM Pacific Standard TimeMon, Apr 10, 2017 9:00 AM - 10:00 AM Pacific Standard TimeMon, Apr 17, 2017 9:00 AM - 10:00 AM Pacific Standard Time\n\nVideo Conference Link for the Training\nWill be sent upon registration and payment for the course.\n\nWhy Certified Ethical Hacker Training from Omni212?\n1. Included with this course are:\n\nÂ  Â Print courseware (training manuals) prepared byÂ EC CouncilÂ shipped directly to you.\nÂ  Â Six months of iLabs subscription by EC Council.\nÂ  Â Course taught by EC Council certified instructor.\n\n2. Our CEH training is very hands on. You will use Virtual images including Kali Linux image for practical lab exercises.\n3. Our Instructors are Certifed Ethical Hackers who actively work on helping the police and Government with cybercrimes.\n4. Employees of Microsoft; Dept. of Homeland Security; TD Ameritrade; city, county and federal employees and other organizations have taken our CEH classes.\n5. Those with US Top Security Clearance have taken our class.\n6 Upon Registration and payment, immediate access to the course material on the cloud is immediately provided.\n7. Class recordings for this class will be made available.\n8. Post class support\n9. Career advancement and Job placement assistance\n\nCertified Ethical hacking Training\nA Certified Ethical Hacker is a skilled professional who understands and knows how to look for vulnerabilities in target systems and use the same knowledge and tools in a lawful and legitimate manner to assess the security posture of a target system(s). The CEH credential certifies individuals in the specific network security discipline of Ethical Hacking from a vendor-neutral perspective.\nÂ \nOverview\nThis course will immerse you into the hacking mindset so that you will be able to defend against future attacks with a systematic process. Here, you will be exposed to an entirely different way of achieving optimal information security posture. You will scan, test, hack and secure your own systems. The overall training covers five phases that include Reconnaissance, Gaining Access, Enumeration, Maintaining Access, and covering your tracks.\nÂ \nCertified Ethical hacking Training Curriculum Outline\n\n1. Introduction to Ethical Hacking\n\nInternet is Integral Part of Business and Personal Life - What Happens Online in 60 Seconds\nInformation Security Overview\nInformation Security Threats and Attack Vectors\nHacking Concepts, Types and Phases\nEthical Hacking Concepts and Scope\nInformation Security Controls\nInformation Security Laws and Standards\n\n\n2. Footprinting and Reconnaissance\n\nFootprinting Concepts\nFootprinting Methodology\nFootprinting Tools\nFootprinting Countermeasures\nFootprinting Penetration Testing\n\n\n3. Scanning Networks\n\nOverview of Network Scanning\nCEH Scanning Methodology\nScanning Beyond IDS\nBanner Grabbing\nScan for Vulnerability\nDraw Network Diagrams\nPrepare Proxies\nScanning Pen Testing\n\n\n4. Enumeration\n\nEnumeration Concepts\nNetBIOS Enumeration\nSNMP Enumeration\nLDAP Enumeration\nNTP Enumeration\nSMTP Enumeration\nEnumeration Countermeasures\nSMB Enumeration Countermeasures\nEnumeration Pen Testing\n\n\n5. System Hacking\n\nInformation at Hand Before System Hacking Stage\nSystem Hacking: Goals\nCEH Hacking Methodology (CHM)\nCEH System Hacking Steps\nHiding Files\nCovering Tracks\nPenetration Testing\n\n\n6. Malware Threats\n\nIntroduction to Malware\nTrojan Concepts\nTypes of Trojans\nVirus and Worms Concepts\nMalware Reverse Engineering\nMalware Detection\nCountermeasures\nAnti-Malware Software\nPenetration Testing\n\n\n7. Sniffing\n\nSniffing Concepts\nMAC Attacks\nDHCP Attacks\nARP Poisoning\nSpoofing Attack\nDNS Poisoning\nSniffing Tools\nSniffing Tool: Wireshark\nFollow TCP Stream in Wireshark\nDisplay Filters in Wireshark\nAdditional Wireshark Filters\nPacket Sniffing Tool: Capsa Network Analyzer\nNetwork Packet Analyzer\nCounter measures\nSniffing Detection Techniques\nSniffing Pen Testing\n\n\n8. Social Engineering\n\nSocial Engineering Concepts\nSocial Engineering Techniques\nImpersonation on Social Networking Sites\nIdentity Theft\nSocial Engineering Countermeasures\nPenetration Testing\n\n\n9. Denial of Service\n\nDoS/DDoS Concepts\nDoS/DDoS Attack Techniques\nBotnets\nDDoS Case Study\nDoS/DDoS Attack Tools\nCounter-measures\nDoS/DDoS Protection Tools\nDoS/DDoS Attack Penetration Testing\n\n\n10. Session Hijacking\n\nSession Hijacking Concepts\nApplication Level Session Hijacking\nNetwork-level Session Hijacking\nSession Hijacking Tools\nCounter-measures\nSession Hijacking Pen Testing\n\n\n11. Hacking Web Servers\n\nWebserver Concepts\nWebserver Attacks\nAttack Methodology\nWebserver Attack Tools\nCounter-measures\nPatch Management\nWebserver Security Tools\nWebserver Pen Testing\n\n\n12. Hacking Web Applications\n\nWeb App Concepts\nWeb App Threats\nWeb App Hacking Methodology\nWeb Application Hacking Tools\nCountermeasures\nSecurity Tools\nWeb App Pen Testing\n\n\n13. SQL Injection\n\nSQL Injection Concepts\nTypes of SQL Injection\nSQL Injection Methodology\nSQL Injection Tools\nEvasion Techniques\nCounter-measures\n\n\n14. Hacking Wireless Networks\n\nWireless Concepts\nWireless Encryption\nWireless Threats\nWireless Hacking Methodology\nWireless Hacking Tools\nBluetooth Hacking\nCounter-measures\nWireless Security Tools\nWi-Fi Pen Testing\n\n\n15. Hacking Mobile Platforms\n\nMobile Platform Attack Vectors\nHacking Android OS\nHacking iOS\nHacking Windows Phone OS\nHacking BlackBerry\nMobile Device Management (MDM)\nMobile Security Guidelines and Tools\nMobile Pen Testing\n\n\n16. Evading IDS, Firewalls and Honeypots\n\nIDS, Firewall and Honeypot Concepts\nIDS, Firewall and Honeypot System\nEvading IDS\nEvading Firewalls\nIDS/Firewall Evading Tools\nDetecting Honeypots\nIDS/Firewall Evasion Counter-measures\nPenetration Testing\n\n\n17. Cloud Computing\n\nIntroduction to Cloud Computing\nCloud Computing Threats\nCloud Computing Attacks\nCloud Security\nCloud Security Tools\nCloud Penetration Testing\n\n\n18. Cryptography\n\nMarket Survey 2014: The Year of Encryption\nCase Study: Heartbleed\nCase Study: Poodlebleed\nCryptography Concepts\nEncryption Algorithms\nCryptography Tools\nPublic Key Infrastructure (PKI)\nEmail Encryption\nDisk Encryption\nCryptography Attacks\nCryptanalysis Tools\n\nÂ \nNext class starting\nApril 24, 2017\n\nTraining Dates\nÂ  Â â€¢ Â Mondays and Fridays, April 24 - June 5Â  Â â€¢ Â Times: 9:00 AM - 11:00 AM (US Pacific Time) every sessionÂ  Â â€¢ Â Each session will be recorded and the recordings will be shared after each session with students.\n\nVideo Conference link\nWill be sent upon your registration and payment\n\nTraining Session Details\nThere will be 12 online sessions, each session being of 2 hours. Every session will have presentation about theory, concepts and technology, followed by Hands-on Lab practice exercises.\n\nClass Size:Â Maximum 22\nPrice:Â $900\n\nREFUND POLICY\n1. 100% refund will be provided under the following circumstances:\n\nIf the student cancels or raises a refund up to 48 hoursÂ beforeÂ the start of course.\nIn case Omni212 cancels or reschedules the class.\nNo negative review is given without giving Omni212 the chance to remedy the situation within 15 days after the complaint was registered by the student.\n\n2. 50% refund will be issued under the circumstance that:\n\nStudent raises a refund request within 3 days after the first training session.\n\n3. No refund will be provided under the following circumstances:\n\nStudent raises a request more than 3 days after start of the course.\nStudent registers for the course and does not attend the course for whatever reason.\n\n4. Refunds will be issued 15 days after the end of the class.\n\nOur Cybersecurity Consulting Offering\nLearn more about our Cybersecurity Consulting offering:\nhttps://www.omni212.com/technologies/cyber-security/\n\nOur Corporate Training Offering\nLearn more about our Corporate Training offering:\nhttps://www.omni212.com/services/corporate-training/', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29912926%2F59307985005%2F1%2Foriginal.jpg?s=25c1f39b25d5ae925cfac5bde9e6c80e', 'https://www.eventbrite.com/e/lansing-cybersecurity-series-certified-ethical-hacker-training-tickets-33327213593?aff=ebapi', 'Online - please disregard address & map locations., Lansing, MI', 42.732535, -84.55553470000001, 'Online - please disregard address & map locations., Lansing, MI', NULL, NULL, '1493015400', '1496651400', 0, 0, 0, NULL, 1),
