ago, Houston, Phoenix, Chicago, Washington, Los Angeles, Washington, Indianapolis, Dallas, San Diego, Baltimore and Richmond around USA... Please visit us atÂ http://www.eduscil.com/ to know more about our professional certification training courses in India and across the globe.\nPlease Contact Eduscil Learning Solutions:\nE-mail: support@eduscil.com or tony@eduscil.com\nWebsite:Â http://www.eduscil.com/\nCall Us Now!:\nUSA: +1 (302)-604-7957', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29922604%2F203533422144%2F1%2Foriginal.jpg?s=0e8ad7e7d206d4a2702d77e888f48267', 'https://www.eventbrite.com/e/itil-foundation-certification-training-in-lansing-mi-usa-eduscil-tickets-33334296779?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1492831800', '1492862400', 0, 0, 0, NULL, 1),
(274, 'live', '33435929766', 13, 0, 2, 'Quit Tobacco Workshop', 'Achieve Your Goals - Quit-Tobacco for Good in 2017!\nEnroll in a one-time two-hour Quit Tobacoo Workshop and develop a quit plan including :\n\nPreperationsÂ \nPlanning\nMedications\nRelapse PreventionÂ \n\nCome to the workshop and create a solid plan that will help you succeed in quiting, be more prepared and confident about quiting, and over come those challenges!Â \nLight meal will be providedÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30054522%2F165326206776%2F1%2Foriginal.jpg?s=67b99a61d1cd08e6dd3104d4af724468', 'https://www.eventbrite.com/e/quit-tobacco-workshop-tickets-33435929766?aff=ebapi', '2316 South Cedar Street, Lansing, MI 48910', 42.70790640000001, -84.54889500000002, '2316 South Cedar Street, Lansing, MI 48910', NULL, NULL, '1493724600', '1493731800', 0, 0, 0, NULL, 1),
