(276, 'live', '33465760992', 13, 0, 2, 'CLA Estate Planning Workshop', 'Free workshop providing valuable information for seniors on securing one''s estate and retirement planning. You will receive a workbook and gain useful information you can act upon immediately regarding:\n- Pros and cons of wills and trusts\n- How to avoid probate\n- Long term health care concerns\n- Tax reduction planning\nCLA Estate Services is a firm devoted to assisting area residents in protecting their assets and ensuring their money lasts. Our representatives have comprehensive knowledge of estate planning issues that will help you avoid common and sometimes irreversible mistakes.\nSeating is limited. Please call 1-866-252-8721 to confirm your attendance or for more information.\nInformation in this workshop comes from a wide range of sources. For over twenty years, we have been presenting concepts that come from clients, attorneys, financial planners, government agencies, and a wide variety of private and public sources. We hope the information presented will help you have a better understanding of your planning choices.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30098115%2F122717991559%2F1%2Foriginal.jpg?s=4464d66851c34d39c48063fcdaf3b4eb', 'https://www.eventbrite.com/e/cla-estate-planning-workshop-tickets-33465760992?aff=ebapi', '2838 East Grand River Avenue, East Lansing, MI 48823', 42.72799439999999, -84.455557, '2838 East Grand River Avenue, East Lansing, MI 48823', NULL, NULL, '1494390600', '1494401400', 1, 0, 0, NULL, 1),
(277, 'live', '33474041760', 13, 0, 2, 'Forest Taxes and YOU', 'How you can make the most of your forestâ€¦â€¦and pay your taxes too!Learn about state tax programs, income taxes, and estate taxes. What are your options? Yes,learning about taxes and saving money can be fun â€“ donâ€™t miss it! Free parking! Speakers fromMSU, MI Dept. of Ag and Rural Dev., MI Dept. of Natural Resources, and a tax assessor. Joinus!The registration fee of $25 covers materials and lunch. Â Late fee of $10 for registrations after April 21When: April 28, 2017 9:30 am â€“ 3:00 pmWhere: Michigan State University, Kellogg Center, East Lansing, MIFor more information: http://michiganforests.org/Or contact: Debra Huff info@michiganforests.org 517-651-5401', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30110710%2F145065973997%2F1%2Foriginal.jpg?s=0c01c42b64b3a3d91d3ba0f3f57f00e2', 'https://www.eventbrite.com/e/forest-taxes-and-you-tickets-33474041760?aff=ebapi', 'Kellogg Center, , East Lansing, MI', 42.7305769, -84.492884, 'Kellogg Center, , East Lansing, MI', NULL, NULL, '1493352000', '1493371800', 0, 0, 0, NULL, 1),
(278, 'live', '33476324588', 13, 0, 2, 'Lansing Azure Machine Learning Training Series*', 'Azure Machine Learning Preview\nhttps://1drv.ms/v/s!Am6Gx3MdTkENgUPyDb-shuGu_3Q4\n\nRegister for any of these upcoming Azure Machine Learning Courses in:\nMay -Â http://bit.ly/2nCMgLB\nJune -Â http://bit.ly/2o1sVHd\nJuly - Â http://bit.ly/2oAqm06\n\n\nVideo Conference details\nTo be sent after registration and payment.\n\n\nClasses starting\n\nMay 1, 2017 - Register & Make Payment :Â http://bit.ly/2nCMgLB\nJune 5, 2017 - Register & Make Payment:Â http://bit.ly/2o1sVHd\nJuly 5, 2017 - Register & Make Payment:Â http://bit.ly/2oAqm06\n\n\nWhy Azure Machine Learning training from Omni212?\n1. Our Azure Machine Learning training is very hands on. There will be data sets available to practice.2. Our Instructors are Azure Machine learning experts who actively work with customers and help them with Machine learning, data science, AI.3 Upon Registration and payment, immediate access to the course material on the cloud is immediately provided. (There will be no refund once access is provided)4. Class recordings for this class will be made available.5. Post class support6. Career advancement and Job placement assistance\n\nTraining Session Details\nThere will be 8 online sessions, each session being of 2 hours. Every session will have presentation about theory, concepts and technology, followed by time with Hands-on Lab practice exercises.\n\nTraining Dates\n\nAzure Machine Learning Training Starting May 1 - May 1, 3, 8, 10, 15, 17, 22, 24\nAzure Machine Learning TrainingÂ Starting June 5 - June 5, 7, 12, 14, 19, 21, 26, 28\nAzure Machine Learning Training Starting July 5 - July 5, 10, 12, 17, 19, 26, 31\n\nMonday and Wednesday every week\nTimes: 6:30 PM - 8:30 PM US Pacific Time\n\nPre-requisite\nDesired but not required - exposure to Python or R language\n\nCourse Outline\n\n1. Introduction to the Science of Data\nShows how Azure Machine Learning represents a critical step forward in democratizing data science by making available a fully-managed cloud service for building predictive analytics solutions.\n2.Â Getting Started with Azure Machine Learning\nCovers the basic concepts behind the science and methodology of predictive analytics.\n\nUsing Azure ML Studio\n\nExplores the basic fundamentals of Azure Machine Learning Studio and helps you get started on your path towards data science greatness.\n4. Creating Azure Machine Learning Client and Server Applications\nExpands on a working Azure Machine Learning predictive model and explores the types of client and server applications that you can create to consume Azure Machine Learning web services.\n5. Regression Analytics\nTakes a deeper look at some of the more advanced machine learning algorithms that are exposed in Azure ML Studio\n6. Cluster Analytics\nExplores scenarios where the machine conducts its own analysis on the dataset, determines relationships, infers logical groupings, and generally attempts to make sense of chaos by literally determining the forests from the trees.Â \n7. The Azure ML Matchbox Recommender\nExplains one of the most powerful and pervasive implementations of predictive analytics in use today on the web today and how it is crucial to success in many consumer industries.\n8. Retraining Azure ML models\nExplores the mechanisms for incorporating â€œcontinuous learningâ€ into the workflow for our predictive models.\n\nClass Size:Â Maximum 15\n\n\nREFUND POLICY\n1. 100% refund will be provided under the following circumstances:\n\nIn case Omni212 cancels or reschedules the class.\nIf the student cancels or raises a refund 48 hours before the start of course.\n\n2. 50% refund will be issued under the circumstance that:\n\nStudent raises a refund request no later than 3 days after the first training session.\n\n3. No refund will be provided under the following circumstances:\n\nStudent raises a request more than 3 days after start of the course.\nStudent registers for the course and does not attend the course for whatever reason.\nOnceÂ access to the course material on the cloud has been provided, no refund will be provided.\n\n4. Refunds will be issued within 15 days once the request has been approved.\n\n\nkeywords - azure ml, cortana', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30113943%2F59307985005%2F1%2Foriginal.jpg?s=2434ab8d8063025190cf25e24df197c5', 'https://www.eventbrite.com/e/lansing-azure-machine-learning-training-series-tickets-33476324588?aff=ebapi', 'Online - please disregard address & map locations., Lansing, MI', 42.732535, -84.55553470000001, 'Online - please disregard address & map locations., Lansing, MI', NULL, NULL, '1493654400', '1501524000', 1, 0, 0, NULL, 1),
(279, 'live', '33477606422', 13, 0, 2, 'Rise Up, Michigan: Capitol Day 2017', 'To celebrate and build upon the first 100 days of resistance, Michigan United & Michigan People''s Campaign will be in the state''s capital, bringing together hundreds of activist leaders from across the state. Join us for Capitol Day 2017 as we bring our communities'' policy demands directly to our legislators and we bring action to resistance.\nOver the years this has been a transformative leadership development experience for our members, and represents a significant investment in our people-centered theory of change. We need all the support we can get to continue to provide this free opportunity and maximize participation for our members. Can you support us with a donation to our Capitol Day Scholarship Fund at this critical moment in history? If so, click on the Register button and make a donation today!\nIn solidarity, and thanks!\n\n\nTransportation Options:\nDetroit Bus - 7:00am\n\nParking Lot behind Arab American National Museum, 13624 Michigan Ave., Dearborn, MI 48126\nSome organizations have coordinated with us to have a bus pick them up at another location. If you are with DAC or MI United''s ESL classes, please go to your specific pick-up location on May 23rd for your bus\n\nKalamazoo Bus - 7:00am\n\n1009 E Stockbridge Ave, Kalamazoo (Stockbridge UMC)\n\nFlint Van - 7:30am\n\n2610 M L King Ave, Flint (Salem Lutheran Church)\n\nGrand Rapids Van - 7:30am\n\nLocation TBD\n\nOwn Transportation - Arrive at Central UMC in Lansing at 9:30am\n\n\n\nQuestions with registration? Contact Henry Wisner at hank@miunited.org or 877-507-7774 x721.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30119640%2F204224414467%2F1%2Foriginal.jpg?s=945586853283b63cd9fb3f35a3acda09', 'https://www.eventbrite.com/e/rise-up-michigan-capitol-day-2017-tickets-33477606422?aff=ebapi', '215 N. Capitol Ave., Lansing, MI 48933', 42.735007, -84.55432910000002, '215 N. Capitol Ave., Lansing, MI 48933', NULL, NULL, '1495531800', '1495553400', 0, 0, 0, NULL, 1),
(280, 'live', '33479615431', 13, 0, 2, 'Comedy Coven Presents: Goodrich Gevaart', 'Goodrich Gevaart is an LA-based comic who began his career in Chicago. He''s returning to where he got started, visiting several Midwest cities this April. Heâ€™s gracing Lansing with his presence on Sunday, April 23 at the Robin Theatre, at show presented by Comedy Coven, Lansingâ€™s only occult comedy group.\nGoodrich is a wildly funny stand-up comic and performer, but his work in stand-up doesnâ€™t end there - he helped found, produce and host Chicagoâ€™s Comedy Exposition, the first DIY stand-up festival in Chicago, which ran for three years: 2014-2016. His official title on the festâ€™s website: Purveyor of Good Vibes.\nHeâ€™s a contributing writer at Hard Times, penning on-point articles like: â€œI Tried These Recipes From The Anarchist Cookbook and They Tasted Like Shitâ€ and the classic, â€œPunk House Giving Out Demo Tapes Instead of Candyâ€.\nAs if Goodrich isnâ€™t busy enough with all of that, heâ€™s appeared on two Nerdist podcasts: Competitive Erotic Fan Fiction #123 and Terrified #62.\nThis hustling comedy creating career has led to him working with comedians such as Kumail Nanjiani, Kyle Kinane, Chris Gethard, Rhea Butcher and Kurt Braunohler.\nThe headliner show will be produced and hosted by Comedy Coven, an all-female trio consisting of Lansing comedians Tricia Chamberlain, Stephanie Onderchanin, and Emily Syrja.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30118884%2F158549275015%2F1%2Foriginal.jpg?s=0e9783e0d10d857893bf596144fd7949', 'https://www.eventbrite.com/e/comedy-coven-presents-goodrich-gevaart-tickets-33479615431?aff=ebapi', '1105 South Washington Avenue, Lansing, MI 48910', 42.721602, -84.55200000000002, '1105 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1492957800', '1492963200', 0, 0, 1, NULL, 1),
(281, 'live', '33491019541', 13, 0, 2, 'FREE SEMINAR ABOUT HOW YOU CAN GET INCREASED LEADS  USING LINKEDIN', 'Come To The Linkedin Online Class\nClick Here - Join Me For The Linkedin Marketing Webinar\nDiscover how to build a huge client base by spending less than 30 minutes a day using Linkedin, even if youâ€™ve never used Linkedin before and don''t have money to spend on advertising.\nUse Linkedin To Get More Customers Than You Can Handle\nDiscover how to quickly connect with real decision makers and set meetings that turn to customers. There are over Four Million people on Linkedin and itâ€™s growing everyday.\nLinkedin is business centered. However, most people think it is a job site or a Facebook for business people. Discover how to leverage Linkedin to build a huge customer base of THE RIGHT clients with this online class.\nIf you are looking for something better than the networking events youâ€™ve been doing, this masterclass is the answer. If you are wanting to add a time and cost effect lead source for your businesses, youâ€™ve found it. Stop wasting time with all the bad networking and use Linkedin to laser focus your networking.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30134856%2F208689922736%2F1%2Foriginal.jpg?s=bb5696147d287bf003237ff9f370c846', 'https://www.eventbrite.com/e/free-seminar-about-how-you-can-get-increased-leads-using-linkedin-tickets-33491019541?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1491539400', '1491543000', 0, 0, 0, NULL, 1),
