(283, 'live', '33516938064', 13, 0, 2, 'CUSA senior Prom', 'This year, the Chinese Undergraduate Students Association will be holding a Senior prom for any students that attends Michigan State University. To celebrate this rite of passage from childhood to adulthood, we will hold a fairy tale like the evening at the Kellogg Hotel & Conference Center on April 22, 2017, from 6 pm to 11 pm. Upon entering, we will have an autograph booth and a themed photo wall where you can have photos taken with your friends. We will also have activities like an award ceremony for students that attends MSU, music and games throughout the entire night, an election for a prom King and Queen, and lastly, there will be an after party for those who want to stay longer. Come join us and check out our WeChat, Facebook, or Instagram page for more information and updates.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30168426%2F187469210336%2F1%2Foriginal.jpg?s=c18bff61855bb4ec1991c5f1d043c7da', 'https://www.eventbrite.com/e/cusa-senior-prom-tickets-33516938064?aff=ebapi', 'East Lansing, MI 48823', 42.7318506, -84.49336819999996, 'East Lansing, MI 48823', NULL, NULL, '1492864200', '1492882200', 0, 0, 1, NULL, 1),
(284, 'live', '29491759647', 13, 0, 2, 'Common Ground Music Festival July 2017', 'Welcome to the 2017 Common Ground Music Festival. The 18th annual festival in downtown Lansing will feature performances from national, regional, and local acts across two (2) stages. Large video walls give virtually every guest a front row experience at the Auto Value Main Stage, and a more intimate experience can be had at the Pavilion Stage with multiple performances throughout each evening.\n2017 Festival Lineup:\nThursday, July 6th - Alessia Cara, KYLE, James Arthur, AJR, Phoebe Ryan, CLUBHOUSE, Olivia Millerschin.\nFriday, July 7th - Toby Keith, LOCASH, The Railers, Aileeah Colgan, Drew Hale, Lisa Mary, DJ Jay Vee\nSaturday, July 8th - Shinedown, LiVE, Here Come The Mummies, The Legal Immigrants, and more!\nSunday, July 9th - Big Sean, Fetty Wap, Twista, and more!\nFor a break from the action or some great adult beverages, join us at the customer lounge, located in the Terminal bar near the Pavilion Stage in the north end of the park. Patrons can enjoy a wide variety of food and beverage offerings located throughout the park. More information including the lineup and schedule can be found at www.commongroundfest.com\nSeating is general admission; festival capacity is limited. \nChildren Admission:  Children 5 and under are free in the General Admission area with a paid adult. Children of all ages must have their own full priced "VIP" Uncommon Club ticket AND must be accompanied by a "parent" at all times while in the “VIP” Uncommon Club area.  \nFood and Beverages: No outside beverages or food of any kind is allowed. Once inside the Festival, you can purchase food and drink from a variety of vendors.\nYou must be 21 years of age to purchase and consume alcoholic beverages. You must have a photo ID.\nThere are certain items that are NOT permitted and cannot be brought into the Festival grounds. The Common Ground Music Festival reserves the right to alter carry-in policies at any time. Currently, items NOT permitted include, but are not limited to:\n\nNo backpacks\nNo large bags\nNo other carry-ins\nNo oversized umbrellas (golf umbrellas) or umbrellas with a pointed and/or metal tip\nNo outside food or beverages\nNo cans or glass bottles\nNo alcohol\nNo contraband\nNo pets (except service animals)\nNo video equipment\nNo professional cameras\nNo gopros poles or extenders\nNo recording devices\nNo laser pointers\nNo skateboards\nNo inline skates\nNo coaster wagons\nNo kites\nNo frisbees\nNo picnic baskets\nNo drones, remote control aircraft, toys/cars\nNo weapons of any kind\n\nPlease Note: All patrons subject to search upon entry.\nRe-Entry Procedure: To exit and “re-enter”, go to the “re-entry/exit” lane at the main gate. You must have a valid daily wristband. Upon re-entry, re-enter at the “Re-entry/exit” lane.  You MUST have your valid daily wristband, not cut or altered in any way to re-enter.\nAutomatic Teller Machines: ATM machines are located inside the festival grounds at the Customer Lounge.\nCameras:  Non-professional camera’s and cell phones are allowed in the venue. No other audio/video recording devices or professional cameras are allowed. The Common Ground Music Festival defines “professional” cameras to be anything with a removable lens. No GoPros poles or extenders allowed.\nHandicap Accessibility: There are handicap accessible restrooms, a designated seating area at the main stage that is for handicapped patrons and one companion, plus parking on Shiawassee Street (between Grand Avenue and Capitol Avenue) and additional parking under the Lansing Center.\nA limited number of wheelchairs are available at either entrance. There is no charge for usage, but a valid picture I.D. and/or driver''s license must be left with the gate attendant. When the wheelchair is returned to the same gate it was obtained at, the I.D. will be returned.\nGENERAL INFORMATION / FESTIVAL POLICIES:\nThe facility reserves the right to refuse admission or eject any person violating the facility, local, state, or federal laws or whose conduct is deemed illegal, disorderly or offensive by management.\nPerformers, performance times, programs, dates and times are subject to change without notice. The Festival is a Rain or Shine event, no refunds or exchanges.\nPersons entering the facility may be subjected to searches for weapons, contraband, professional cameras, video equipment and recording devices or other items that are expressly forbidden on the facility premises and are subject to confiscation.\nPatrons entering the facility are subject to having their image and/or likeness reproduced for promotional and/or publicity purposes in Festival photography and/or Web casts by the Festival, contractor or partner of the Festival.\nFirst Aid stations and EMT will be present on the festival grounds. \nPortable restrooms and handicap portable restrooms are available on the festival grounds. Hand washing stations are available; however guests are encouraged to bring their own hand sanitizer.\nEnjoy the music, friends, family and fun!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31044023%2F163994604354%2F1%2Foriginal.jpg?s=6fcb83a0407ac94b62bd5e9e2732f60a', 'https://www.eventbrite.com/e/common-ground-music-festival-july-2017-tickets-29491759647?aff=ebapi', '300 North Grand Avenue, Lansing, MI 48933', 42.7389428, -84.5500652, '300 North Grand Avenue, Lansing, MI 48933', NULL, NULL, '1499356800', '1499643000', 0, 0, 0, NULL, 1),
(285, 'live', '30952798654', 13, 0, 2, '2nd ANNUAL UNITE TO FACE ADDICTION MICHIGAN - RALLY ON THE CAPITOL STEPS', 'REGISTER TODAY!\nMay 18, 2017 9:00AM - 5:00PM UFAM hosts the 2nd Annual Rally and Advocacy Day at the Michigan State Capitol\nCOST- Free: Please Consider a Small Donation  (donations greatly appreciated)\nBe the Voice of ChangeThe Unite to Face Addiction – Michigan Rally is a great opportunity for those in Michigan to be heard! The UFAM Rally creates Strength in Unity to eliminate stigma, highlight improved access to treatment, support prevention, and promote recovery from addiction through advocacy, education, and outreach. As we Rally to unify the voices of Michigan Citizens impacted by the health crisis of addiction and the organizations working to CHANGE the way Addiction and Recovery are preceived and treated in our state.Be a Part of the SolutionJoin us Thursday, May 18th from 9:00AM - 5:00PM in Lansing as Community Resource Tables, Holistic Zen Tent featuring Alternative Therapies, Legislative Bullpen (Meet the Lawmakers), dynamic National & Local Speakers- representing every aspect of addiction services, and Entertainers provide the backdrop for action!! \n Please register if you are interested in receiving details about this event as they become available.\nFor more information on the group Unite to Face Addiction – Michigan you can go to our Website, www.UFAMichigan.orgUFAM Rally 2017 Speakers:Emcee - Mark Lundholm - San Jose CAJohn Shinholser - President McShin Foundation - Richmond VACraig DeRoche - Justice Fellowship - Washington DCMichael King - Facing Addiction - Seattle WAMatt Butler - Singer/Songwriter - Generation Found - New York NYTommy "Gunz" Kraus - Recovery Unplugged - Ft Lauderdale FLJudge Jodi Switalski - Stutman GroupMichael Johnson - Recovery VoiceJudge Clinton Canady - Ingham County Circuit CourtDave Santia - Artist, Speed PainterKatie Donovan - Hope not HandcuffsMike Hirst - Andy''s AngelsRISE Community Recovery Performanceand other Local Speakers James Angyal, Deborah Garrett, Attorney Mark Mandell, Mobilizing MI, Andrew Fortunato & Chris "Delvis" O''Droski\n\nUFAM Rally Sponsorship Levels:Memorial Acknowledgement in Event Flyer: $25-Name of Loved One or Short Saying (50 Characters) email to scott.masi@stjohn.orgInformation/Resource Table: $75Table, Identified on Resource Map & Flyer - (Facebook Acknowlegement)Bronze Sponsor - $150 -Table, Name & Logo on Event Flyer plus recognition on website and social media. Silver Sponsor - $250 -Table, Name & Logo on Event Flyer plus recognition on website and social media. Name on Event Signage.Gold Sponsor - $500 -Table, Name & Logo on Event Flyer plus recognition on website and social media. Name on Event Signage. Podium/Stage acknowledgement. Sponsor recognition in Press Releases**Following Sponsorship Levels include both UFAM Rally & Recovery Live Tour Platinum Sponsor - $1500 -(sponsor for 2 Events May 18th Rally & Recovery Live Tour December 6-9)-All the benefits of Gold for both Events, plus 5 Unite to Face Addiction MI T-shirts for your team, 2 Tickets  to each Recovery Live Community Performance and 2 Tickets to the 5 Course Pop-Up MealDiamond Sponsor- $2500 or more-(sponsor for 2 Events May 18th Rally & Recovery Live Tour December 6-9) -All the benefits of Gold for both Events, plus 10 Unite to Face Addiction MI T-shirts for your team, 4 Tickets  to each Recovery Live Community Performance and 4 Tickets to the 5 Course Pop-Up Meal\n\nPlease select your Sponsorship Level through the ticket link.  Thank you for your support!\n#strengthinunity #togetherwecan  #silentnomore  #UFAMShare this event on Facebook and TwitterWe hope you can make it!Strength in Unity,UNITE TO FACE ADDICTION - MICHIGAN\nand Organizing Committee SponsorsBrighton Center for RecoveryBryans HopeCapital Area Project VOXVillage Yoga', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30377534%2F94893765889%2F1%2Foriginal.jpg?s=c26ff7e528cb762599e532bb7da5b7e2', 'https://www.eventbrite.com/e/2nd-annual-unite-to-face-addiction-michigan-rally-on-the-capitol-steps-tickets-30952798654?aff=ebapi', 'Lansing, MI 100 North Capitol Avenue, LANSING, MI 48933', 42.7335633, -84.5553883, 'Lansing, MI 100 North Capitol Avenue, LANSING, MI 48933', NULL, NULL, '1495098000', '1495126800', 0, 0, 0, NULL, 1),
(286, 'live', '33544093286', 13, 0, 2, 'Grit, Glam, & Guts- InsideOut: Matters of the Heart', 'The Grit, Glam, & Guts Teen Conference is excited to embark upon itâ€™s 5th consecutive year of strengthening and equipping hundreds of young women from all across the state of Michigan ! The all girl free TEEN (ages 12-17) conference will kick off its state summer tour Saturday June 17, 2017. Itâ€™s a one-day FREE conference thatâ€™s dedicated to strengthening and equipping young women to overcome the challenges of the 21st woman and connect teens to existing resources during the summer months. \n\nIn conjunction with Michigan State Universityâ€™s Residential College of Arts & Science, and One Love Global, Grit, Glam, Guts conference has the goal of helping teen girls develop a positive self-image and establish unity and sisterhood among the next generation of women. This yearâ€™s conference tackles the internal social and emotional issues of identity, societal pressures, and lays of solid foundation of why sisterhood is essential to the success of individuals, families, and communities. \n\nThe statewide kick off conference will host girls from all over the state from Flint, Detroit, Grand Rapids & Lansing. Speakers will conduct lively and engaging breakout sessions. This kick off is beginning to more events in Flint, Detroit, & Lansing in the summer months. \n\nÂ Grit, Glam, & Guts invites you to be a part of its 2017 â€œInsideOut: Matters of the Heartâ€ Conference.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30276704%2F86108530727%2F1%2Foriginal.jpg?s=9d50a49c7633a0acb5f625e53ec5f9f8', 'https://www.eventbrite.com/e/grit-glam-guts-insideout-matters-of-the-heart-tickets-33544093286?aff=ebapi', '362 Bogue St, East Lansing, MI 48825', 42.72993899999999, -84.47306200000003, '362 Bogue St, East Lansing, MI 48825', NULL, NULL, '1497688200', '1497709800', 0, 0, 0, NULL, 1),
(287, 'live', '34212907728', 13, 0, 2, 'The Drinking Lunch - May Edition', 'Join us May 18th, 2017 at the Lansing Brewing Company. We look forward to networking with you at LBC!\nOur Happy Hour sponsor this month is Jae Byrd SEO.\n\nWe have sponsorship slots available every month so if you or your business are interested in those sponsorship opportunities please email meetup@thedrinkinglunch.com for a packet.\n______________________________________________________________________________________________\nThere was a time when it was expected that you’d have a few at your business lunch - and then it vanished. We’re PROUD to be bringing back the afternoon libation - without the judgment. So, bring your business cards, and raise a toast to The Drinking Lunch. Visit TheDrinkingLunch.com for more. \n*Please note that your email will be added to our mailing list - trust us, you won''t want to miss these monthly events.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31086405%2F174700953836%2F1%2Foriginal.jpg?s=37a94af0173403c5dabc2fafa5600322', 'https://www.eventbrite.com/e/the-drinking-lunch-may-edition-tickets-34212907728?aff=ebapi', '518 East Shiawassee Street, Lansing, MI 48912', 42.7369821, -84.54555519999997, '518 East Shiawassee Street, Lansing, MI 48912', NULL, NULL, '1495116000', '1495123200', 0, 0, 0, NULL, 1),
(288, 'live', '33630072452', 13, 0, 2, '2 DAY FIBERGLASS AND SPRAY FOAM INSULATION TRAINING', 'Our comprehensive insulation training classes cover everything you need to know about insulation, including proper application techniques and safety procedures, from spray foam to fiberglass and everything in between. Whether you’re an owner or manager, sales representative, contractor, or installer, these fiberglass and spray foam insulation classes cover vital information you can immediately put to use. We’ll show you how to produce a quality foam product, complete flawless installations, and ultimately increase your bottom line.\n\nUnderstand building science and codes\nLearn about product advancements\nDiscover new market trends and opportunities\nSales Techniques and Training\nTest to become a manufacturer-approved SPF applicator\n\n\nSpace is limited This class is complimentary and spots go fast!\nRegister online to reserve your seat! Complimentary continental breakfast, lunch, and afternoon snacks will be provided. Attendees are responsible for their making their own travel and lodging accommodations.\nBook a room at the East Lansing Marriott at University Place hotel and mention IDI for a discounted rate! ($149) Room cut-off date is 4/28/2017.   (517) 337.4440\nhttp://www.marriott.com/meeting-event-hotels/group-corporate-travel/groupCorp.mi?resLinkData=IDI%20Insulation%5ELANEA%60IDIIDIA%60149.00%60USD%60false%604%605/22/17%605/24/17%604/28/17&app=resvlink&stop_mobi=yes\nQuestions? Contact your local sales rep:\nGreg Thomas - (440) 821-9827         Brian Blesener - (734) 431-0614      Brad Walworth (616) 430-6616', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30300313%2F196578849541%2F1%2Foriginal.jpg?s=943c61504f96aac7bbda9a5723392492', 'https://www.eventbrite.com/e/2-day-fiberglass-and-spray-foam-insulation-training-tickets-33630072452?aff=ebapi', '300 M.A.C. Avenue, East Lansing, MI 48823', 42.7356888, -84.47999270000003, '300 M.A.C. Avenue, East Lansing, MI 48823', NULL, NULL, '1495526400', '1495641600', 0, 0, 0, NULL, 1),
(289, 'live', '34036797979', 13, 0, 2, '7 Bridges: The Ultimate Eagles Experience', 'Hear a stunningly accurate tribute to the music of The Eagles – the best-selling American band of all time! 7 Bridges recreates the hits and experience from the band’s most prolific period in the 1970s. Doors open at 4 p.m. and tickets are $5 online and $10 at the door. ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30746846%2F141977339849%2F1%2Foriginal.jpg?s=a0a91a24e5c0e31c0fa99eea0e6d91bd', 'https://www.eventbrite.com/e/7-bridges-the-ultimate-eagles-experience-tickets-34036797979?aff=ebapi', 'Lansing, MI 48917', 42.7287542, -84.63744840000004, 'Lansing, MI 48917', NULL, NULL, '1495224000', '1495236600', 0, 0, 0, NULL, 1);
INSERT INTO `app_event` (`id`, `event_type`, `eventfull_id`, `user_id`, `category_id`, `cityID`, `title`, `description`, `cover_image`, `website`, `venue`, `lat`, `lng`, `location`, `email`, `mobile`, `start_time`, `end_time`, `totallike`, `totalshare`, `totalfavorite`, `i_date`, `deleted`) VALUES
(290, 'live', '33789681848', 13, 0, 2, 'Light in the Attic Films - Showcase', 'Please join us at The View at Cooley Law School Stadium for a showcase of shorts created by Light in the Attic Films over the last year! We will be screening 4 films and some additional bonus content. \nThe View is located on the northwest corner of Cooley Law School Stadium (outside of left field), just south of Lansing Brewing Company.\nAttire: No dress-code, but Semi-Formal Faux Oscars garb optional. Attendees encouraged to wear their favorite ''red carpet'' outfit, but otherwise please come as you are :)\nCash bar available, non-alcoholic beverages provided. \nOptional donation to support costs of the Showcase and future Light in the Attic Films projects welcome at the event. \nFAQs\nAre there ID or minimum age requirements to enter the event?\nAll ages welcome, however some film content may be considered mature. If there are any questions or concerns, please feel free to contact organizer.  \nWhat are my transportation/parking options for getting to and from the event?\nParking is available in the Lansing Center parking lot on the west side of Cedar street, just across from the stadium. For guests attending an event at the View, it is $5.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30588565%2F169240429874%2F1%2Foriginal.jpg?s=ca5e31417dac6be73623c5f6b5d57a27', 'https://www.eventbrite.com/e/light-in-the-attic-films-showcase-tickets-33789681848?aff=ebapi', '505 East Michigan Avenue, Lansing, MI 48912', 42.7342188, -84.54559849999998, '505 East Michigan Avenue, Lansing, MI 48912', NULL, NULL, '1495312200', '1495319400', 0, 0, 0, NULL, 1),
(291, 'live', '34232433129', 13, 0, 2, '2017 STEAMlab', 'Ingham ISD, MSUâ€™s MAET program, and the tinkrEDU have teamed up to put together an exciting summer learning experience for educators. Join us on July 19th for STEAMLab, a FREE professional development opportunity focused on tinkering and making across the curriculum. Our goal is to help educators in all grade levels and subject areas reimagine teaching and learning with the use of STEAM concepts. STEAMlab will feature:\n\n\nKeynote Sessions\n\n\nOpen Makerspace Time\n\n\nYour Choice of Breakout Sessions\n\n\nLearning Through Play\n\n\nQuickfire Challenges\n\n\nPlus enter to win a Chromebook, Makey Makey and Ozobot for your classroom!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30973602%2F198130341490%2F1%2Foriginal.jpg?s=1d23398f7ccb85ba93d6b4ce3f0dc30a', 'https://www.eventbrite.com/e/2017-steamlab-tickets-34232433129?aff=ebapi', '160 Snow Road, Lansing, MI 48917', 42.7319619, -84.62142159999996, '160 Snow Road, Lansing, MI 48917', NULL, NULL, '1500453000', '1500476400', 0, 0, 0, NULL, 1),
(292, 'live', '34527382330', 13, 0, 2, 'Election 20XX City Leadership Forum', 'A community-driven candidate forum to hear from current City of Lansing elected officials and candidates for offices of Mayor, City Clerk and City Council what steps they are taking to produce equitable outcomes for all residents.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31460318%2F201402982734%2F1%2Foriginal.jpg?s=34890148d6324b45302e30512702544d', 'https://www.eventbrite.com/e/election-20xx-city-leadership-forum-tickets-34527382330?aff=ebapi', '500 South Martin Luther King Junior Boulevard, Lansing, MI 48915', 42.7281856, -84.5682807, '500 South Martin Luther King Junior Boulevard, Lansing, MI 48915', NULL, NULL, '1495735200', '1495742400', 0, 0, 0, NULL, 1),
(293, 'live', '34527661164', 13, 0, 2, 'Black Lives Matter Lansing Orientation & Action Planning', 'You must RSVP and provide a phone number to be contacted with meeting location.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31300413%2F201402982734%2F1%2Foriginal.jpg?s=6c11079634c4c039df1783d325b63321', 'https://www.eventbrite.com/e/black-lives-matter-lansing-orientation-action-planning-tickets-34527661164?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1495281600', '1495288800', 0, 0, 0, NULL, 1),
(294, 'live', '34181807707', 13, 0, 2, 'Network and Chill - A Lansing 5:01 Event', 'We''re kicking off the summer with our "Network and Chill" event in downtown Lansing. This event, exclusively for interns employed by sponsors of Lansing 5:01, will start at the Chevy Terrace inside Cooley Law School Stadium. Check-in will start at 5:30pm, with the formal program taking place from 6:30pm - 8:00pm, featuring networking and guest speakers from multiple local organizations. Complimentary food and beverages will be provided. Then we''ll head across the street to the City Market for a Movie on the Riverfront with River Town Adventures. Grab your popcorn, your LED-lit kayak, and watch the movie on a 20 ft X 10 ft inflatable screen. ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30922529%2F211816530854%2F1%2Foriginal.jpg?s=14c8225c96bb6045f7bc8ee7e817eda8', 'https://www.eventbrite.com/e/network-and-chill-a-lansing-501-event-tickets-34181807707?aff=ebapi', '505 East Michigan Avenue, Lansing, MI 48912', 42.7342188, -84.54559849999998, '505 East Michigan Avenue, Lansing, MI 48912', NULL, NULL, '1496338200', '1496356200', 0, 0, 0, NULL, 1),
(295, 'live', '33631106545', 13, 0, 2, 'Flip the Conversation | Make the Customer the Hero of Your Story', 'Presentation Summary:\nEric Hultgren, marketing director for MLive Media Group will be joining CMPRSA for our May 25th luncheon from noon to 1:15 p.m. Eric will present, Flip the Conversation | Make the Customer the Hero of Your Story. Looking at all things marketing, Eric will explore the use of digital media and integrating content marketing to flip the conversation and make your customers your biggest brand advocates. Check out Eric''s promo video here.\nAbout the Speaker:\nEric Hultgren is a driven market leader focusing on how human beings can connect pragmatically using technologies available right now. In addition to being the marketing director for MLive Media Group, he is an adjunct professor of mass media, CEO of a charity that helps at-risk kids experience the performing arts and a nationally recognized podcast host. For Hultgren, “everything is marketing” is not just a catchphrase, but a lens by which he views the world around him.\nVenue Sponsor:\nThank you to our May event venue sponsor, Martin Waymire. Martin Waymire is one of Michigan''s top public relations firms, specializing in strategic communications, digital marketing and issue advocacy. Learn more at www.MartinWaymire.com\n\nNot a Member?\nThe Central Michigan chapter offers exciting opportunities for networking and professional development to public relations professionals in the greater Lansing area. With a membership of more than 150 area communicators, CMPRSA meetings are a place to always meet someone new, but establish valuable connections over time as well. A diverse membership of young and seasoned professionals, a stimulating mix of programs and opportunities for involvement make CMPRSA the ideal organization to invest your time and resources. Learn more.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30360332%2F153283706253%2F1%2Foriginal.jpg?s=02d24e3f5b6727d70847d26521858b4b', 'https://www.eventbrite.com/e/flip-the-conversation-make-the-customer-the-hero-of-your-story-tickets-33631106545?aff=ebapi', '3435 Forest Road, Lansing, MI 48910', 42.70511700000001, -84.50247000000002, '3435 Forest Road, Lansing, MI 48910', NULL, NULL, '1495713600', '1495718100', 0, 0, 0, NULL, 1),
(296, 'live', '34493403699', 13, 0, 2, 'Voters Not Politicians Group-Wide Meeting - May', 'This is an internal (and confidential) group-wide meeting where we''ll be discussing campaign updates, strategy, and next steps! We will be meeting in the sanctuary. Please RSVP if you can make it! ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31259147%2F206202482693%2F1%2Foriginal.jpg?s=860dad166f0401e948530dcefbe240e6', 'https://www.eventbrite.com/e/voters-not-politicians-group-wide-meeting-may-tickets-34493403699?aff=ebapi', '469 North Hagadorn Road, East Lansing, MI 48823', 42.7363527, -84.46304909999998, '469 North Hagadorn Road, East Lansing, MI 48823', NULL, NULL, '1495274400', '1495285200', 0, 0, 0, NULL, 1),
(297, 'live', '34528415420', 13, 0, 2, 'Yoga at the Breslin', 'Yoga at the Breslin Center presented by Michigan Community Project.\nJoin us at the Breslin Center at Michigan State University for a day of yoga and mindfulness. Guest Speaker and Yoga Instructor, Dan Nevins, joined by local community yoga leaders to provide meditation and yoga. This event is open to the public and accessible to both yogis and non-yogis alike!Â Wheelchair and chair yoga will be available to those unable to practice on a mat.\nGates and regristraton open at 12:30pm EST. Local vendors and businesses will be located in the concourse highlighting the Greater Lansing community. The speaking engagement will commence at 2:00pm EST followed by a 60-minute meditation and yoga practice.\nGeneral Admission ticket includes admission to Breslin Center, speaking engagement and yoga practice: $20.00Â \nSeating Only ticket includes admission to Breslin Center and a seat to listen to speaking engagement and view the meditation and yoga practice: $10.00\nEvent T Shirt, provided by Breathe in Detroit: $20.00\nProceeds benefit Michigan Community Project, Wounded Warrior Project and Spartan Warrior Project to promote & provide yoga and meditation throughout Michigan.\nFor more information on Dan Nevins, please visit www.dannevins.com\nFor more information on Michigan Community Project, please visit www.90nyoga.com\nFor more information on Wounded Warrior Project, please visit www.woundedwarriorproject.org\nLike and follow Spartan Warrior Project on FacebookÂ www.facebook.com/SpartanWarriorProject', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33913838%2F213098027977%2F1%2Foriginal.jpg?s=e6043a48befebfcfb030eca32e16024f', 'https://www.eventbrite.com/e/yoga-at-the-breslin-tickets-34528415420?aff=ebapi', '534 Birch Road, East Lansing, MI 48824', 42.72833250000001, -84.4923695, '534 Birch Road, East Lansing, MI 48824', NULL, NULL, '1505556000', '1505574000', 0, 0, 0, NULL, 0),
(298, 'live', '27632343082', 13, 0, 2, 'Mental Health First Aid (ADULT) $25.00', 'What is Mental Health First Aid?\nMental Health First Aid is the initial help given to a person showing symptoms of mental illness or in a mental health crisis (severe depression, psychosis, panic attack, suicidal thoughts and behaviors, etc ...) until appropriate professional or other help, including peer and family support, can be engaged.\nMental Health First Aid Teaches You:\n    - Potential warning signs and risk factors for addictions and mental illness (depression, anxiety, trauma,      substance use, and disorders in which psychosis may occur)\n    - Impact of mental and substance use disorder and common mental health challenges for adults and    youth,  and typical adolescent development\n    - 5-step action plan (ALGEE) to assess a situation and provide help\n    - Local community resources and where to turn for help\nThese 8-hour courses prepare members of the public to provide Mental Health First Aid to those in need. \nAll trainings are held at CMHA-CEI, 812 E. Jolly Road, in the Atrium Lansing, MI 48910\nCost: $25.00 (includes manual and lunch) Limited scholarships are available upon request to help cover the fee.\nLunch is provided (please request any special dietary needs at the time of registration) \n7.5 Continuing Education Credits are available for Nurses, Social Workers and Substance Abuse Professionals.\nTeachers may qualify for 7.0 SCECH for a very small fee. Please inquire if you would like more information about earning the SCECH credits.   \nIf paying by check, please send your check for $25 payable to "CMHA-CEI" adding in the memo line who is attending and MHFA to CEI Community Mental Health c/o Prevention Secretary, 838 Louisa St. Suite B, Lansing, MI  48911.\n*NOTE: “Due to the popularity of MHFA, payment must be received to confirm registration prior to each training. Refunds will only be made available to those individuals who are not able to attend and request a refund at least 7 days prior to the actual training session.” \nPlease note that dates are subject to change and there is a minimum of 10 and a maximum of 25 seating limit per training. If less than 10 are registered, class will be cancelled.\nFor more information on MHFA trainings please go to www.ceicmh.org or call the Prevention Secretary at 517-887-5234 or via email at hoepfner@ceicmh.org. ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F24024475%2F128014205345%2F1%2Foriginal.jpg?s=a54ea7c6d9723f5b01a78bacb23e994b', 'https://www.eventbrite.com/e/mental-health-first-aid-adult-2500-tickets-27632343082?aff=ebapi', '812 E. Jolly Road Atrium, Lansing, MI 48910', 42.7043124, -84.53270379999998, '812 E. Jolly Road Atrium, Lansing, MI 48910', NULL, NULL, '1495528200', '1495558800', 0, 0, 0, NULL, 1),
(299, 'live', '34679881459', 13, 0, 2, 'Adriana Trigiani Book Signing benefitting St. Vincent Catholic Charities', 'This evening promises relaxation, laughter, and the gift of a beautiful book. Â Grab your book club, your mothers, daughters, husbands friends, and coworkers to enjoy a one of a kind evening with the world renowned author and film maker Adriana Trigiani as she tells the stories that make up her amazing books. Â Guaranteed to be a delightful evening with all proceeds going to St. Vincent Catholic Charities in Lansing. Â \nNote: All sales are final, books will be gven at event onlyÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31493314%2F212485259414%2F1%2Foriginal.jpg?s=d91adf9d547b5150aa5fc478f94e407c', 'https://www.eventbrite.com/e/adriana-trigiani-book-signing-benefitting-st-vincent-catholic-charities-registration-34679881459?aff=ebapi', '219 Harrison Road, East Lansing, MI 48823', 42.7353636, -84.49346270000001, '219 Harrison Road, East Lansing, MI 48823', NULL, NULL, '1498671000', '1498683600', 0, 0, 0, NULL, 1),
