equest a refund at least 7 days prior to the actual training session.” \nPlease note that dates are subject to change and there is a minimum of 10 and a maximum of 25 seating limit per training. If less than 10 are registered, class will be cancelled.\nFor more information on MHFA trainings please go to www.ceicmh.org or call the Prevention Secretary at 517-887-5234 or via email at hoepfner@ceicmh.org. ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F24024517%2F128014205345%2F1%2Foriginal.jpg?s=5a191b11d0e43abb8916a3cbb1831087', 'https://www.eventbrite.com/e/mental-health-first-aid-adult-2500-tickets-27632367154?aff=ebapi', '812 E. Jolly Road Atrium, Lansing, MI 48910', 42.7043124, -84.53270379999998, '812 E. Jolly Road Atrium, Lansing, MI 48910', NULL, NULL, '1501057800', '1501088400', 0, 0, 0, NULL, 1),
(301, 'live', '34182225958', 13, 0, 2, 'Bridge Fest - A Lansing 5:01 Event', 'A festival expo event highlighting local music, local artists, live art installations with chalk artists and muralists, and local eats on the Lansing River Trail. Come check out our expo featuring interactive booths for local galleries, museums, sports clubs, yoga, and other organizations to connect with Lansing. Feeling sporty? Try out a kayak or bike rental through Rivertown and get a bite to eat at our local food truck rally! Round out the evening with a FREE concert featuring Michigan favorites: The Accidentals, with special guests, Young Pioneer and Tangelo!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30922549%2F211816530854%2F1%2Foriginal.jpg?s=7712deb47fc5f833eff0829744994884', 'https://www.eventbrite.com/e/bridge-fest-a-lansing-501-event-tickets-34182225958?aff=ebapi', '325 City Market Drive, Lansing, MI 48912', 42.7358181, -84.5479229, '325 City Market Drive, Lansing, MI 48912', NULL, NULL, '1497547800', '1497565800', 0, 0, 0, NULL, 1),
(302, 'live', '34079756469', 13, 0, 2, 'Kathy Ford Band', 'Hear Michigan fan-favorite Kathy Ford Band live in concert! Doors open at 4:00 p.m. and tickets are free. ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30799364%2F141977339849%2F1%2Foriginal.jpg?s=7c62005ac5ab7138aaf0c2a9a9d2b55d', 'https://www.eventbrite.com/e/kathy-ford-band-tickets-34079756469?aff=ebapi', '5660 West Saginaw Highway, Lansing, MI 48917', 42.7440615, -84.62899379999999, '5660 West Saginaw Highway, Lansing, MI 48917', NULL, NULL, '1495137600', '1495150200', 0, 0, 0, NULL, 1),
(303, 'live', '34182774599', 13, 0, 2, 'Runway on the Runway - A Lansing 5:01 Event', 'Clear for landing! Lansingâ€™s fashion incubator is strutting the runway at the Capital Region International Airport for this yearâ€™s premiere fashion show. Discover our bustling creative economy and hub for international travel. End the evening by dancing the night away to live music during our silent disco â€“ thatâ€™s right, the ultimate music and dance experience!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30922588%2F211816530854%2F1%2Foriginal.jpg?s=8292523a78226624e6170f29e8341640', 'https://www.eventbrite.com/e/runway-on-the-runway-a-lansing-501-event-tickets-34182774599?aff=ebapi', 'Lansing, MI 48906', 42.7750893, -84.58923340000001, 'Lansing, MI 48906', NULL, NULL, '1500400800', '1500418800', 0, 0, 0, NULL, 1),
(304, 'live', '34377104846', 13, 0, 2, 'Trail Point Beer and Tacos Pairing at REO Town Pub', 'In May were trying a new brewery! This month''s pairing will take place on Monday, May 22th at REO Town Pub. The tacos will be made by Good Truckin Diner and paired with beers from Trail Point Brewing Company.\r\n\r\n\r\n\r\n As always, the event will be run in the style of a beer dinner to be served in order starting around 7:00. We strongly urge everyone to buy tickets online ahead of time, as these events tend to sell out quickly.\r\n\r\n\r\nWhere: Reo Town Pub\r\nWhen: Monday, May 22nd starting at 7pm\r\nThe Pairings: (4oz Trail Point Brewing Co. Beers paired with 5 Good Truckin Tacos)\r\n\r\nTrail Point Brewing Dr. Peelgood paired with Cali Taco refried beans,avocado, pickled red onions, queso cojita, cilantro and lime crema\r\n\r\n\r\nTrail Point Brewing HeizenBrau paired with Baja Taco seared shrimp topped with pickled red onion, pico de gallo and lime crema\r\nChasing Rays IPA paired with Diablo Taco with Chorizo, habanero relish, jalapeno cream cheese, cilantro, ghost pepper cheese & sriracha drizzle\r\n\r\nTrail Point Brewing Henry Lee (Strong-Old Ale) paired with Jamaican with Taco with jerk chicken, grilled pineapple, habanero relish cilantro, pepper jack, cheese and lime crema\r\n\r\nTrail Point Brewing Judo Hop (DIPA) paired with Bacon Me Crazy Taco with bacon, avocado, greens, cheddar and ranch\r\n\r\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31130222%2F15662373493%2F1%2Foriginal.jpg?s=5323933e4296d0f195136b79c952e414', 'https://www.eventbrite.com/e/trail-point-beer-and-tacos-pairing-at-reo-town-pub-tickets-34377104846?aff=ebapi', '1145 S Washington Ave, Lansing, MI 48910', 42.720432, -84.55201799999998, '1145 S Washington Ave, Lansing, MI 48910', NULL, NULL, '1495479600', '1495490400', 0, 0, 0, NULL, 1),
(305, 'live', '30294531760', 13, 0, 2, 'Leveraging Community Relations: Build Your Brand & Attract New Customers', 'Speaker Details:Alexandrea Thrubis, previously Community Relations Manager for the Detroit Tigers and the Boston Rox. Currently Manager of Marketing and Communications, Endeavor Detroit.Â \nThe Lansing HUG (HubSpot User Group)Â hosts marketing events for HubSpot users across mid-Michigan. These HUG networking events are our way of connecting inbound marketing aficionados to share ideas, get inspired, or get out and socialize! Weâ€™ll be hosting quarterly networking events in the Lansing area â€” featuring a variety of speakers and presentations to get you excited about ramping up your inbound marketing strategy. The great snacks weâ€™ve got planned donâ€™t hurt either!\nWhether youâ€™re an avid HubSpot user, a Lansing area marketing agency, a student looking to learn more about the marketing industry, or a business owner who needs a marketing boost â€” weâ€™d love for you to join us at our next Lansing Regional HUG meetup.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32159503%2F161772199662%2F1%2Foriginal.jpg?s=d9f3782a8e92b0d3953b8aab3766eef4', 'https://www.eventbrite.com/e/leveraging-community-relations-build-your-brand-attract-new-customers-tickets-30294531760?aff=ebapi', '1218 Turner Street, Lansing, MI 48906', 42.7480533, -84.54924549999998, '1218 Turner Street, Lansing, MI 48906', NULL, NULL, '1498579200', '1498586400', 0, 0, 0, NULL, 1),
(306, 'live', '33174207949', 13, 0, 2, 'Celebrating 20 Years of Entrepreneurial Passion!', 'The Entrepreneur Institute will be Celebrating 20 Years of Entrepreneurial Passion on Thursday June 8th, 2017.Â  We are inviting former Board Members, Committee Members, Contributors of past events, Government Officals and of course students of our Foundations of Business Planning & Credit Before Capital and Microborrowers!\nHelping us Celebrate, Former Lansing Mayor, David Hollister, the Vision behind the Entrepreneur Institute, Ms. Linda Hundt, Award Winning Baker and Owner of Sweetie-licious, Ms. Contance Logan, First Woman to ever hold the position of Michigan District Director for the U.S. Small Business Adminstration.\nAwards will be given to Entrepreneur Institute''s Legacy Entrepreneur, Legacy Volunteer and Legacy Contributor as well as Micro-Entrepreneur of the Year, Rising Micro-Entrepreneur of the Year, Volunteers and Contributor of the Year!Â  Come and join us as we Celebrate 20 Years of Entrepreneurial Passion!\nFor Sponsorship Opportunities email:info@yourfoundationforbusiness.com for more information.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30206447%2F25952638631%2F1%2Foriginal.jpg?s=c6c2362901c53f45bbb45da8f89c737a', 'https://www.eventbrite.com/e/celebrating-20-years-of-entrepreneurial-passion-tickets-33174207949?aff=ebapi', '219 S Harrison Rd, East Lansing, MI 48823', 42.731631, -84.49320999999998, '219 S Harrison Rd, East Lansing, MI 48823', NULL, NULL, '1496906100', '1496912400', 0, 0, 0, NULL, 1),
(307, 'live', '34182738491', 13, 0, 2, 'Lansing House - A Lansing 5:01 Event', 'In partnership with Gillespie Group, a premier Lansing 5:01 sponsor, we present Lansing House â€“ an interactive showcase of art, music, culture, tech, and entrepreneurship in Lansingâ€™s Stadium District. Happening on opening night of Lansingâ€™s Common Ground Music Festival, Lansing House will feature local artists, techies, and more. Stop by Lansing House to interact with LIVE artists, build your own prototype with easy-to-use 3D printers, and check out product being made by up and coming Lansing artistans. And don''t miss the musical talents of Mike Bass from 7:30pm - 9:00pm on stage inside the building! Interns and young professionals employed by Lansing 5:01 sponsors will have access to a FREE VIP lounge, stocked with food graciously provided by Lansing Brewing Company.Â \nThanks to our Lansing House event sponsors for making this event possible: Gillespie Group, Lansing Brewing Company, Spartan-Net, musician Mike Bass, and tinkrLAB.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30922560%2F211816530854%2F1%2Foriginal.jpg?s=d5410692ae9497d9d540402c492f5872', 'https://www.eventbrite.com/e/lansing-house-a-lansing-501-event-tickets-34182738491?aff=ebapi', '505 East Shiawassee Street, Lansing, MI 48912', 42.73739199999999, -84.54626200000001, '505 East Shiawassee Street, Lansing, MI 48912', NULL, NULL, '1499360460', '1499378400', 0, 0, 0, NULL, 1),
(308, 'live', '33802921448', 13, 0, 2, 'Military Connected Women Outreach Event', 'The purpose of this event is to encourage women who are affiliated with the military (veterans, spouses, other dependents, and supporters) to join and/or support the MSU chapter of the Student Veterans of America (SVA). It is important that women affiliated with the military know that, not only does the SVA need their support, but the SVA can provide support and recognition for them as well. \nIf you have any questions, please feel free to contact Brittney Beavers at beaversb@msu.edu or Valerie Stevenson at steve616@msu.edu.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30488245%2F192534501903%2F1%2Foriginal.jpg?s=4fc4fd49dbfe77f2ef51f13c8c6fba1e', 'https://www.eventbrite.com/e/military-connected-women-outreach-event-tickets-33802921448?aff=ebapi', '580 Frandor Avenue, Lansing, MI 48912', 42.7398435, -84.50570270000003, '580 Frandor Avenue, Lansing, MI 48912', NULL, NULL, '1495285200', '1495292400', 0, 0, 0, NULL, 1),
