(310, 'live', '34067075540', 13, 0, 2, 'Networking with Marcos Purty', 'The Lansing Chapter of GMAAN (General Motors African Ancestry Network) is pleased to present Marcos Purty, Plant Manager, Lansing Delta Township as the Key Networker for our first Networking event. Please come join us for food and Drinks on Thursday, May 18th at the Nuthouse Sport bar & Grill.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30784076%2F211294133492%2F1%2Foriginal.jpg?s=928dce22586d7500967e28b5c0aa1dde', 'https://www.eventbrite.com/e/networking-with-marcos-purty-tickets-34067075540?aff=ebapi', '420 E Michigan Ave, Lansing, MI 48917', 42.7332575, -84.54705849999999, '420 E Michigan Ave, Lansing, MI 48917', NULL, NULL, '1495125000', '1495135800', 0, 0, 0, NULL, 1),
(311, 'live', '34421127519', 13, 0, 2, 'Screening of The 13th', 'ACTION of Greater Lansing and Unitarian Universalist Church partner to bring a community screening of 13th, a compelling 2016 American documentary by director Ava DuVernay. Centered on race in the United States criminal justice system, the film is titled after the Thirteenth Amendment to the United States Constitution, which outlawed slavery (unless as punishment for a crime). DuVernay’s documentary argues that slavery is being effectively perpetuated through mass incarceration.  The progression from that second qualifying clause to the horrors of mass criminalization and the sprawling American prison industry is laid out by DuVernay with bracing lucidity. With a potent mixture of archival footage and testimony from a dazzling array of activists, politicians, historians, and formerly incarcerated women and men, DuVernay creates a work of grand historical synthesis which has already garnered critical acclaim.  Conversation and action group formation follow the screening.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31179558%2F204739079076%2F1%2Foriginal.jpg?s=e447770332fee5e2527a4297321169cf', 'https://www.eventbrite.com/e/screening-of-the-13th-tickets-34421127519?aff=ebapi', '5509 South Pennsylvania Avenue, Lansing, MI 48911', 42.67727199999999, -84.53610900000001, '5509 South Pennsylvania Avenue, Lansing, MI 48911', NULL, NULL, '1495387800', '1495402200', 0, 0, 0, NULL, 1),
(312, 'live', '74120238064', 13, 12, 4, 'Connections & Coffee Q2 2017', 'Join us at the second of this year''s four new locations! The next Connections & Coffee event will take place at Dart Development from 8 a.m.- 9 a.m.Be an active member of Lansing’s dynamic business community. Meet people from diverse industries to add to your network, reconnect with friends and find local resources.Join us for Connections & Coffee presented by Greater Lansing Business Monthly and Dart Development.\r\nNBS COMMERCIAL INTERIORSBUILT TO SUIT BY DART DEVELOPMENT3201 PINE TREE ROAD, SUITE ALANSING, MICHIGAN 48911', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30471877%2F65350359609%2F1%2Foriginal.jpg?s=4773fddc8914dc1452e274a185d01eac', 'https://www.eventbrite.com/e/connections-coffee-q2-2017-tickets-33783943685?aff=ebapi', '3201 Pine Tree Road, Lansing, MI 48911', 52.0515032, 52.0515032, '3201 Pine Tree Road, Lansing, MI 48911', 'admin@vros.com', '', '1497945600', '01-01-1970 00:00:01', 0, 0, 0, NULL, 1),
(313, 'live', '34001316854', 13, 0, 2, 'FARM Science Lab Open House', 'You are formally invited to an open house for the FARM Science Lab. With your help and support, Michigan''s first Lab has made its debut to schools already reaching more than 5,500 students on both the west and southeast sides of the state.\nJoin us from Noon - 3 p.m. in the SW parking lot for lunch, and program starting at 12:45 p.m. to explore the trailer and celebrate this accomplishment! We will have the event, rain or shine!\nRSVP by May 24. Questions? Contact Sara Miller at smille1@michfb.com or (517) 679-4781.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30709972%2F164990035938%2F1%2Foriginal.jpg?s=15ddc94fd8b26f87a054941e4fc2c52c', 'https://www.eventbrite.com/e/farm-science-lab-open-house-tickets-34001316854?aff=ebapi', '7373 West Saginaw Highway, Lansing, MI 48917', 42.7401561, -84.65691670000001, '7373 West Saginaw Highway, Lansing, MI 48917', NULL, NULL, '1496664000', '1496674800', 0, 0, 0, NULL, 1),
(314, 'live', '33594352613', 13, 0, 2, 'Introduction to Essential Oils', 'We will be hosting a *FREE* Introduction to Young Living Essential Oils class. The class itself will take about 45 minutes, the rest of the time will be devoted to answering your questions and helping you start the journey to wellness, purpose, and abundance.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30259804%2F147660885108%2F1%2Foriginal.jpg?s=8ecd77d0de333b99102c22c0b003a7d5', 'https://www.eventbrite.com/e/introduction-to-essential-oils-tickets-33594352613?aff=ebapi', '7413 Westshire Dr, Lansing, MI 48917', 42.73808, -84.65960899999999, '7413 Westshire Dr, Lansing, MI 48917', NULL, NULL, '1495130400', '1495139400', 0, 0, 0, NULL, 1),
(315, 'live', '34280010434', 13, 0, 2, 'June 2017 Oars & Ales', 'Lansing Brewing Company and River Town Adventures are partnering once again this summer to bring you Oars & Ales events on June 16th, July 15th, August 18th, and September 16th!\nParticipants will be picked up at Lansing Brewing Company and will be transported to the Red Cedar River at Aurelius Rd to begin their 2-hour kayaking or canoe trip, ending at the Lansing City Market! Participants will then return to Lansing Brewing Company for the afterparty to swap stories of their adventure!\nParticipants will receive a tshirt (register by June 3rd to guarantee Â your tshirt size), a to-go crowler, a crowler coozie, a snack for the river, and awesome giveaways!\nAdditional crowlers available for purchase.\n4 fleets of 25 will be available, starting at 5:00, 5:30, 6:00 and 6:30. A mixture of single kayaks, double kayaks, and canoes will be available for each fleet, on a first-come, first-serve basis. You are welcome to bring your own boat if you prefer, and it will be shuttled to the launch point by River Town Adventures and then back to your car. *Price of event remains the same if you choose to bring your own boat.\n21+ Only\nWeather Policy:No refunds will be issued due to inclement weather.Â In the event of light rain, Oars & Ales will still go on! If inclement weather causes event organizers to cancel due to saftey, you will still be invited to LBC to pick up your event pack, including a voucher to River Town Adventures to use at your convenience.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31025884%2F168320648158%2F1%2Foriginal.jpg?s=bb6eee7ea5b3de3ebdcf8c1d867aab27', 'https://www.eventbrite.com/e/june-2017-oars-ales-tickets-34280010434?aff=ebapi', '518 East Shiawassee Street, Lansing, MI 48912', 42.7369821, -84.54555519999997, '518 East Shiawassee Street, Lansing, MI 48912', NULL, NULL, '1497632400', '1497645000', 0, 0, 0, NULL, 1),
(316, 'live', '34445623788', 13, 0, 2, 'InnovateHER Lansing 2017', 'InnovateHER is anÂ exciting opportunity for our local entrepreneurs and innovators to enter aÂ nationwide business competition that drives attention and resources to innovative products and services that make our lives easier and longer. Locally based businesses will participate in this preliminary round ofÂ competition where the winner will be awarded $1,000 and a yearlong membership to the Technology and Innovation Center. The winner may also be selected to enter the final round of competition on a national level, where $70,000 in prize money, provided to SBA through a gift from the Sara Blakely Foundation, is distributed amongst winning participants. Â \nÂ \nThis event is in partnership with Tech Thursday, so come early for networking and free appetizers and drinks!Â Take a look at the link below to learn more about Tech Thursday:https://www.eventbrite.com/e/the-june-2017-edition-of-techthursday-registration-34486617401?aff=es2', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31214341%2F30237564611%2F1%2Foriginal.jpg?s=c935caea8a3c4b7f5300f13021bd3e42', 'https://www.eventbrite.com/e/innovateher-lansing-2017-tickets-34445623788?aff=ebapi', '325 E. Grand River Ave. Suite 300, East Lansing, MI 48823', 42.73461229999999, -84.48028720000002, '325 E. Grand River Ave. Suite 300, East Lansing, MI 48823', NULL, NULL, '1496338200', '1496345400', 0, 0, 0, NULL, 1),
(317, 'live', '34635697303', 13, 0, 2, 'Turf and Treat- The First Tee of Mid-Michigan', 'Join us for a fun and exciting day of golf, turf, and Spartan Athletics for The First Tee participants only!  \nThis event provides a unique way to kick off the spring golf season.  Youth participants will enjoy a meaningful day of high level education and experiences with golf and turfgrass research.  \n\nPractice with the MSU Golf Team & Coaches\nExperience hands-on science learning at  the MSU Turfgrass  Research Facility\nLearn about sports turf & tour a Spartan Athletics Facility', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31435747%2F190348429771%2F1%2Foriginal.jpg?s=b3bd6c6bf8ee62f264ad0a0be811fd16', 'https://www.eventbrite.com/e/turf-and-treat-the-first-tee-of-mid-michigan-tickets-34635697303?aff=ebapi', '1526 East Mount Hope Avenue, Lansing, MI 48910', 42.7118642, -84.53123099999999, '1526 East Mount Hope Avenue, Lansing, MI 48910', NULL, NULL, '1495267200', '1495285200', 0, 0, 0, NULL, 1),
(318, 'live', '27632425328', 13, 0, 2, 'Youth Mental Health First Aid $25.00', 'What is Mental Health First Aid?\nMental Health First Aid is the initial help given to a person showing symptoms of mental illness or in a mental health crisis (severe depression, psychosis, panic attack, suicidal thoughts and behaviors, etc ...) until appropriate professional or other help, including peer and family support, can be engaged.\nYouth Mental Health First Aid focuses on adolescents ages 12-18 years of age and  is designed to teach parents, family  members, caregivers, teachers, school staff, peers, neighbors, health and human services workers, and other  caring citizens how to help individuals who are experiencing a mental health or addictions challenge or is in crisis.\nMental Health First Aid Teaches You:\n    - Potential warning signs and risk factors for addictions and mental illness (depression, anxiety, trauma,      substance use, and disorders in which psychosis may occur)\n    - Impact of mental and substance use disorder and common mental health challenges for adults and    youth,  and typical adolescent development\n    - 5-step action plan (ALGEE) to assess a situation and provide help\n    - Local community resources and where to turn for help\nThese 8-hour courses prepare members of the public to provide Mental Health First Aid to those in need. \nAll trainings are held at CMHA-CEI, 812 E. Jolly Road, in the Atrium Lansing, MI 48910\nCost: $25.00 (includes manual and lunch) Limited scholarships are available upon request to help cover the fee.\nLunch is provided (please request any special dietary needs at the time of registration) \n7.5 Continuing Education Credits are available for Nurses, Social Workers and Substance Abuse Professionals.\nTeachers may qualify for 7.0 SCECH for a very small fee. Please inquire if you would like more information about earning the SCECH credits.   \nIf paying by check, please send your check for $25 payable to "CMHA-CEI" adding in the memo line who is attending and MHFA to CEI Community Mental Health c/o Prevention Secretary, 838 Louisa St. Suite B, Lansing, MI  48911.\n*NOTE: “Due to the popularity of MHFA, payment must be received to confirm registration prior to each training. Refunds will only be made available to those individuals who are not able to attend and request a refund at least 7 days prior to the actual training session.” \nPlease note that dates are subject to change and there is a minimum of 10 and a maximum of 25 seating limit per training. If less than 10 are registered, class will be cancelled.\nFor more information on MHFA trainings please go to www.ceicmh.org or call the Prevention Secretary at 517-887-5234 or via email at hoepfner@ceicmh.org. ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F24024578%2F128014205345%2F1%2Foriginal.jpg?s=37a3fe5521a4d99ea23e63ce548f06f6', 'https://www.eventbrite.com/e/youth-mental-health-first-aid-2500-tickets-27632425328?aff=ebapi', '812 E. Jolly Road Atrium, Lansing, MI 48910', 42.7043124, -84.53270379999998, '812 E. Jolly Road Atrium, Lansing, MI 48910', NULL, NULL, '1506501000', '1506531600', 0, 0, 0, NULL, 0),
(319, 'live', '33396178870', 13, 0, 2, 'CAMC Job Fair - Job Seeker Registration', 'The Capital Area Manufacturing Council is having a job fair with 14 local manufacturers! Â Please RSVP for the morning OR afternoon session. Employers include:Â \nAlro SteelCameron ToolCrest MarineDart ContainerDakkota Integrated SystemsDowding IndustriesEckhartEnprotechFranchino Mold and EngineeringGSE Industrial AutomationKIRCHHOFF AutomotiveMulti-Packaging SolutionsNeogenOrchid\nJob titles include:\nDesign Engineers (Design, Quality, Manufacturing)Production/Material Handler Machine Operator (CNC, press, laser, etc.)Technicians (Robotic, welding, maintanence)Tool and Die MakerShipping/Receiving ClerkField Service MillwrightRewind Operators and Utility Worker', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29998290%2F53738613406%2F1%2Foriginal.jpg?s=6b9fd666b18941fee9ccf98a42d414d5', 'https://www.eventbrite.com/e/camc-job-fair-job-seeker-registration-registration-33396178870?aff=ebapi', '2110 South Cedar Street, Lansing, MI 48910', 42.7100868, -84.54851880000001, '2110 South Cedar Street, Lansing, MI 48910', NULL, NULL, '1496397600', '1496415600', 0, 0, 0, NULL, 1),
(320, 'live', '32515625110', 13, 0, 2, 'Honoring Hometown Heroes 2017', 'The Chronicle Newspaperâ€™s 31st Anniversary Celebration\r\nÂ \r\nAnd Community Awards Ceremony\r\nÂ \r\nâ€œHonoring Hometown Heroesâ€ \r\nÂ \r\nThe Chronicle Newspaper celebrates 31 years of service and honors community members that made significant contributions to the Mid-Michigan Community.\r\nÂ \r\nÂ \r\nSaturday June 10th at 6:00 P.M.\r\nÂ \r\nThe Lansing Center\r\nÂ \r\n333 E. Michigan Avenue Lansing, MI 48933\r\nÂ \r\nCeremony Tickets $50.00 per person\r\nÂ \r\nRSVP by June 5th\r\nÂ \r\nhttps://hometownheroes2017.eventbrite.com\r\nÂ \r\n800-717-6390\r\nÂ \r\nÂ \r\nEvent Speakers/Special Guests include:Â \r\nKeynote Speaker the Honorable Judge Clinton Canady III\r\nCity of Lansing Councilwoman and Mayoral Candidate Judi Brown-Clarke\r\nState Representative and Mayoral Candidate Andy Schor\r\n\r\nÂ \r\nÂ Â Â Â  2017 Award Recipients:\r\nÂ \r\nLansing Mayor Virg Bernero-Public Service Award Recipient\r\nDr. Joan Jackson-Johnson Philanthropy Award Recipient\r\nMs. Shirley Rodgers Educational Excellence Award Recipient \r\n\r\nA portion of the proceeds will be donated to Mid-Michigan Environmental Action Council (MidMEAC) an organization dedicated to improving the quality of life by raising environmental consciousness and activism. \r\nhttp://www.midmeac.org\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31654433%2F171753116414%2F1%2Foriginal.jpg?s=3f4ee20ae36e7d37e6f677298b97f140', 'https://www.eventbrite.com/e/honoring-hometown-heroes-2017-tickets-32515625110?aff=ebapi', '333 E. Michigan Avenue, Lansing, MI 48933', 42.734142, -84.54798399999999, '333 E. Michigan Avenue, Lansing, MI 48933', NULL, NULL, '1497117600', '1497130200', 0, 0, 0, NULL, 1),
(321, 'live', '34280255166', 13, 0, 2, 'Baby & Me Classes (May 24, 31, June 14, 21) *no class June 7', 'Baby & Me \r\nConnect with your baby through the magic of musical movement at play!  Each week, this class will provide you with a special time for enhancing and nurturing your relationship with your little one through music, creative movement, singing, simple games, rhymes, finger plays, bounces, chants, instruments, and books. Research shows that music, reading, and singing play an enormous role in the brain development of very young children by positively impacting memory, attention, language, and speech. Babies are born with the innate ability to process musical sounds and patterns--they love hearing the rhythms of songs, repetition of melodies, and your singing voice.  As your child grows, he or she will enjoy singing songs, chanting rhymes, and reading words along with you.  Actively working with music increases the brain''s ability to adapt and change by adding and enhancing new neural connections, while setting any words to music helps the brain to learn them more quickly and retain them longer.  Music and active reading also have a calming, relaxing effect, resulting in stress reduction for both caregivers and little ones.  Classes are taught by Ms. Karrie. Wednesdays\r\n10:00-10:30am\r\n(May 24, 31, June 14, 21) *no class June 7\r\n(4 weeks, $40) \r\n10% discount for play. members.\r\nFree Open Play before and after class.\r\nAbsencesTuition is non-transferable and non-refundable if your child is absent. Make-up classes are not offered.  We have reserved space for each child exclusively during the designated weeks and maintain a waiting list for those who register after the space is full.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31026241%2F46645260091%2F1%2Foriginal.jpg?s=4c09afb0e4358c626cd9213ee9bce95e', 'https://www.eventbrite.com/e/baby-me-classes-may-24-31-june-14-21-no-class-june-7-registration-34280255166?aff=ebapi', '4972 Northwind Dr, East Lansing, MI 48823', 42.72562600000001, -84.45273700000001, '4972 Northwind Dr, East Lansing, MI 48823', NULL, NULL, '1495620000', '1498084200', 0, 0, 0, NULL, 1),
(322, 'live', '34490597305', 13, 0, 2, 'Color for Suicide Prevention', 'Our mission is to save lives and give hope to those affected by suicide.Â \n10$ will get you unlimited coloring pages!! We will also be having a raffle and door prizes!!Â \nCome help us bring awareness to mental health and suicide with the American Foundation for Suicide Prevention and our 3rd annual Lansing/Capital Area Out of the Darkness walk!!\nThis walk has helped fund the Crisis Intervention Team Training that our police force is doing, fund mental health first aid courses, put suicide prevention programs in our schools, advocacy at our 1st State Capital Day and so much more.\nCheck out our walk webpage at www.afsp.org/lansing', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31256308%2F163810653650%2F1%2Foriginal.jpg?s=6981579aaa555688943441f5baf41560', 'https://www.eventbrite.com/e/color-for-suicide-prevention-tickets-34490597305?aff=ebapi', '112 North Larch Street, Lansing, MI 48912', 42.7340842, -84.54437209999998, '112 North Larch Street, Lansing, MI 48912', NULL, NULL, '1498676400', '1498687200', 0, 0, 0, NULL, 1),
(323, 'live', '34546973929', 13, 0, 2, '5th Annual Lansing Beer Fest', 'The 5th Annual Lansing Beer Fest which is an outdoor beer festival on Washington Avenue between South St. and Elm St. in REO Town. This festival will feature 25 Michigan Breweries and 100 craft beers. If your looking for something else we have you covered by offering cider, spirits and wine. In addition to the great beer selection, we will have a food trucks, live music, vendors and more!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31325646%2F15662373493%2F1%2Foriginal.jpg?s=16195025d604536d5f13f834fb042091', 'https://www.eventbrite.com/e/5th-annual-lansing-beer-fest-tickets-34546973929?aff=ebapi', '1147 S Washington Ave, Lansing, MI 48910', 42.720377, -84.552019, '1147 S Washington Ave, Lansing, MI 48910', NULL, NULL, '1497715200', '1497733200', 0, 0, 0, NULL, 1);
