(324, 'live', '34305528760', 13, 0, 2, 'Climate Watch Training - Ingham', 'Audubon’s Climate Watch is a new community science program that explores how North American birds are responding to climate change.\nIn 2014, Audubon released the Audubon Birds and Climate Change report highlighting the risks that climate change poses to birds across North America. In response, thousands of people asked how they could help make the world a better place for birds.\nNow, we are training new Citizen Scientists to use our bird watching expertise to count bluebirds and nuthatches. Join us to learn how you can use your birding skills as a Citizen Scientist\nWHO: You and your fellow concerned birders throughout MichiganWHAT: Learn to become a Citizen Scientist as we study the effect of climate change on bluebirds and nuthatchesWHEN: May 18th, from 7-9:30 PMWHERE: Fenner Nature Center, 2020 E Mt Hope Ave, Lansing, MI 48910WHY: Audubon would like your help to learn how birds are responding to climate change and your participation will be a valuable and important part of that process.\nThis is an opportunity to make a difference for the birds in our communities.\nLight snacks will be available.Event is FREE but space is limitedEmail bmerlos@audubon.org or call 734-649-8243 for questionsIf you aren’t able to make it, there will be a live webinar in the coming weeks. Send an email to the address above to stay in the loop!\nTogether we can help birds facing the effects of climate change. And we can start in our backyard. ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31051564%2F208766832361%2F1%2Foriginal.jpg?s=ccaa6853b2463987dcaa98c2a59164fc', 'https://www.eventbrite.com/e/climate-watch-training-ingham-tickets-34305528760?aff=ebapi', '2020 East Mount Hope Avenue, Lansing, MI 48910', 42.7117359, -84.5230598, '2020 East Mount Hope Avenue, Lansing, MI 48910', NULL, NULL, '1495134000', '1495139400', 0, 0, 0, NULL, 1),
(325, 'live', '32622106599', 13, 0, 2, 'Pre-Ballet, Wednesday (ages 2 1/2-3)', 'By mixing proper technique with fun music, your ballerina will learn to pliÃ©, jÃ©te, and relevÃ© their way to a love of dance. This five week Pre-Ballet Class is designed for children ages 2.5 to 3 years old. Students will be led through a series of ballet-based activities that appeal to their age-range. The skills learned in Pre-Ballet will enhance the development of fine and gross motor skills as the children dance together; focusing on rhythm, movement, music, and fun! Students enrolled in this class will experience new ways of expanding their minds and bodies through movement and music. During this class, students will learn to express themselves with the art of ballet and creative movement. Toddlers Pre-Ballet is a preparation class for tap & ballet which starts at age 3.Â \r\n*Please note our location is hidden. We are located at 4976 1/2 Northwind Dr., East Lansing, MI 48823. We are in the same building as Capitol Lighting & Play., but in the back of the building, 5th door down.\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31401752%2F70074677955%2F1%2Foriginal.jpg?s=aa3f78e86528d58c47afc43fa94bfacf', 'https://www.eventbrite.com/e/pre-ballet-wednesday-ages-2-12-3-tickets-32622106599?aff=ebapi', '4976 1/2 Northwind Dr., East Lansing, MI 48823', 42.7257669, -84.45252690000001, '4976 1/2 Northwind Dr., East Lansing, MI 48823', NULL, NULL, '1496855700', '1503510300', 0, 0, 0, NULL, 1),
(326, 'live', '33243085965', 13, 0, 2, 'Geeked!: A Collection of Short Plays Saturday Night Performance', 'Get geeky with five short plays exploring a wide array of geek themes.\nDirected by Nicole Clyne & jeff croff\nCow by Scott MullenThe Physics of Now by Alex DremanSuperiority Complex by Jack KarpBetrayal Among the Grinning Gators by John WeaglyWhat We Do by Terry Palczewski', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30592209%2F100857207805%2F1%2Foriginal.jpg?s=2dc12024f57c52f03b2e6d23a8841f80', 'https://www.eventbrite.com/e/geeked-a-collection-of-short-plays-saturday-night-performance-tickets-33243085965?aff=ebapi', '1105 South Washington Avenue, Lansing, MI 48910', 42.721602, -84.55200000000002, '1105 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1495310400', '1495317600', 0, 0, 0, NULL, 1),
(327, 'live', '33320649961', 13, 0, 2, '"Run As You Are": In-Person Training w/ Shannon Garrett & Dawn Crandall (Lansing, MI)', 'Don’t know if you’re qualified to run for elected office? YOU ARE!\nThere’s no one way to be a political leader and no set of rules defining who gets to aspire to leadership. You already have the experience, talent, and networks to achieve your political ambition. Led by VRL’s co-founder and board chair, Shannon Garrett, & Founding Board Member, Dawn Crandall, this daylong training is for any woman ready to step into politics with a purpose. You’re Ready! We’ll prove it.\nDon’t believe us? Join VoteRunLead’s in-person “Run As You Are” training to:\n*articulate your experience as expertise\n*demystify the campaign trail\n*identify roles for your current squad\n*expand your local network\n*outline your path to political leadership\n\nOther training’s coming up!\nGrand Rapids, MI\nSaturday, June 3, 2017, 9:30am-4pm\nThe Source, 1409 Buchanan Ave. S.W. Grand Rapids, MI 49507\nSouthfield, MI\nSunday, June 11, 2017, 9:30am-4pm\nSheet Metal Workers Local 80, 17100 West 12 Mile Road, Southfield, MI 48076', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31194795%2F114741216277%2F1%2Foriginal.jpg?s=4c7b903711ff0cc5ab67d212de353ae7', 'https://www.eventbrite.com/e/run-as-you-are-in-person-training-w-shannon-garrett-dawn-crandall-lansing-mi-tickets-33320649961?aff=ebapi', '6427 Centurion Drive #150B , Lansing, Michigan 48917', 42.7236401, -84.64303789999997, '6427 Centurion Drive #150B , Lansing, Michigan 48917', NULL, NULL, '1495359000', '1495382400', 0, 0, 0, NULL, 1),
(328, 'live', '34019757009', 13, 0, 2, 'The Mammals in Concert', '"The Mammals'' newest tune, ''Culture War,'' gets right to the heart of the fight for the American soul.” - No Depression\nTHE MAMMALS ARE BACK!Mike + Ruthy, touring American folk act and founders of The Mammals are bringing back the band name that energized crowds in the 00''s and gave them their start. "We''ve always been Mammals at heart," laughs Ruth Ungar, the band''s soulful singer and fiddler. "The music we''re making has the same old-time and Americana roots, and our lyrics have gotten more political again." It''s true, The Mammals were known for their rabble-rousing musical statements which sometimes caused a stir with politically divided audiences from Louisiana to Michigan. "If you tell the whole truth you won''t please everyone," smiles Mike Merenda. He''s the songwriter and guitar/banjo player who''s 2004 Mammals anthem "The Bush Boys" made the Dixie Chicks seem downright polite.This time around their goals remain two-fold: raise positive social awareness & have a good party! In their recent tenure as "Mike + Ruthy" they began a home-town festival near Woodstock, NY called The Hoot which exemplifies these ideals. Pete Seeger, who performed at the inaugural Summer Hoot wrote "Dear Mike + Ruthy, your Hoot was one of the best song gatherings I''ve seen in all my 94 years." Perhaps it was the multi-generational celebration, the hand-built wooden stage, or the re-usable pint cups - either way, these musicians take pride in the small details that make a big difference."Our lives are about building community and growing together everywhere we go," says Ungar. In addition to organizing festivals, Mike + Ruthy have spent the past 9 years raising their two young children and recording and touring behind 5 albums that say "Wherever the good energy is, that''s where I wanna raise my kids," "Some people wanna tell you that you shouldn''t even try / but I wanna tell you that''s a lie," and "You''ve got to be as bright as you can."Back in 2001, The Mammals originated as a partnership between Ungar, Merenda and Tao Rodriguez-Seeger (Pete''s grandson) and later grew to include other players. The 2017 lineup includes some former Mammal members including Jacob Silver and Ken Maiuri when they are not touring with Lee Fields and the B-52''s respectively. "It''s a blessing to have a connection to the past and such great new players too," says Mike. "The alchemy of fiddle, banjo, guitar, bass and drums is magic… and when keys, pedal steel, and horns are in the mix we leap to the next level."The Mammals has released a rowdy live-in-the-living-room video of the song "On My Way Home" and are digitally sharing a pair of topical tunes, "Culture War" and "Beautiful One" from their website themammals.love this Spring.\nStay tuned for more news on the next full record, slated for release in early 2018. They''re in the studio capturing road-tested songs that like "Maple Leaf" and "When My Story Ends," experimental journeys like "I Dreamed" and "Open the Door" and some brand new beauties and foot-stompers to boot.\n"The Mammals are the finest young bluegrass/old-timey band in the country, the country-branch house band for the new weird America. They perform total energy, off-kilter folk that more resembles the twisted quirk of the Holy Modal Rounders than the clean jeans or alter-ninnies currently clawhammering banjos.Michael Simmons - LA WeeklyA PORTION OF THE PROCEEDS BENEFIT MUSIC IS THE FOUNDATION 501(c)(3) MUSIC PROGRAMS IN MID-MICHIGAN CLASSROOMS AND COMMUNITIES', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30724344%2F211095004277%2F1%2Foriginal.jpg?s=dd457e020ad211eca4b135022a98bccd', 'https://www.eventbrite.com/e/the-mammals-in-concert-tickets-34019757009?aff=ebapi', '1213 Turner Street, Lansing, MI 48906', 42.74787929999999, -84.54970070000002, '1213 Turner Street, Lansing, MI 48906', NULL, NULL, '1499369400', '1499380200', 0, 0, 0, NULL, 1),
(329, 'live', '20021359425', 13, 0, 2, 'Lansing Public Media Center Production 101', 'This is the sign up and pre-pay for the Lansing Public Media Center Production 101 class. The class takes place from 10am-5pm. At the conclusion of the class you will receive a 1 year membership at the media center. Tuition is $50 for Lansing residents and $100 for non-residents.\nTo register at the Lansing resident price you must bring a valid driver''s license, state ID, or passport to the class.\n \nClass size is limited to 15 people so register early!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F17370312%2F21719987028%2F1%2Foriginal.jpg?s=70526502b7a4f1b1a1f161adc90df3ce', 'https://www.eventbrite.com/e/lansing-public-media-center-production-101-tickets-20021359425?aff=ebapi', '2500 South Washington Avenue, Lansing, MI 48910', 42.707105, -84.55794200000003, '2500 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1495879200', '1495904400', 0, 0, 0, NULL, 1),
(330, 'live', '28505525795', 13, 0, 2, '2017 COGL Summits', 'What You Can Expect? \r\n\r\nStatistics show that 90% of pastors surveyed state they are frequently fatigued and worn out on a weekly and even daily basis. 57% said they would leave the ministry if they had a better place to go - including secular work and 75% felt they were unqualified and/or poorly trained by their seminaries to lead and manage the church or to counsel others, leaving them feeling disheartened in their ability to pastor.\r\nLooking at the broadest segment of practicing Christians (across the 7 spheres of influence), a group that includes Catholics, evangelicals, and mainline churchgoers, 54% say they feel misunderstood and 52% persecuted, while many others 44% feel “marginalized”, 40% “sidelined”, 38% “silenced”, 31% “afraid to speak up”, and 23% are “afraid to look stupid” when they describe living out their faith in today’s world.\r\nAt our summits you can expect to: \r\n\r\nBe a part of a movement greater than any one church that spans the 7 spheres of societal influence.\r\nBe warmly welcomed by your colleagues and brothers and sisters in Christ who have a passion to see our cities reached with Christ. \r\nLaugh and build high-trust relationships with your peers, while experiencing meaningful personal growth and networking opportunities. \r\nExperience The Church United! God is calling The Church (Big "C") in cities across the world to Unite to Transform their cities WITH Christ! As church and marketplace leaders, rather than viewing ourselves as disconnected islands within our own community, we are being intentional about seeing ourselves as interdependent Kingdom Agents appointed to seek the peace and prosperity of our city together!\r\n\r\nThe format of the quarterly summits will almost always include an element of worship, catered lunch, fellowship, mutual learning opportunities and ample time for networking.  You will be deeply encouraged and have the opportunity to inspire your peers.\r\nWhat Is The Cost?\r\n\r\nAs a service to Christian leaders we have chosen thus far to provide the luncheon free of charge. However, these events cost us approximately $800 in goods and $1200 in staffing & supplies. You will notice a Free Will Offering ticket option above, any donations you could offer would be welcomed. Also, would you be so kind to please help us be good stewards by honoring your reservation!  \r\nWhere Do I Park? \r\n\r\nYou can park in the front lot closest to the administrative building near the flag pole. Simply, follow the "COGL EVENT"  parking signs off the Willow road entrance and enter the door on the west side of the administrative building. (The one facing Waverly Road)\r\nClick Here if you would like to receive email updates regarding COGL Summits\r\nSpecial Thanks to Our 2016 Event Sponsors\r\n \r\nAnd Heartfelt thanks to our Event partners', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F22812196%2F14375471801%2F1%2Foriginal.jpg?s=b839430730b7aa1461605afd8d156a15', 'https://www.eventbrite.com/e/2017-cogl-summits-tickets-28505525795?aff=ebapi', '6211 West Willow Way, Lansing, MI 48917', 42.7482872, -84.60284539999998, '6211 West Willow Way, Lansing, MI 48917', NULL, NULL, '1505820600', '1505829600', 0, 0, 0, NULL, 0),
(331, 'live', '31262321445', 13, 0, 2, 'Student Laboratory Techniques Workshop at Michigan State University', '  PRODUCTS    SUPPORT    CONTACT\n\nStudent Laboratory Techniques Workshop Held at Michigan State University\n\n\n \n\n\n ADInstruments is excited to offer this workshop for Life Science Educators! \n\n\n Scheduled Topics Include:\n\n\nLabChart basics and selected human experiments\nECG & peripheral circulation\nEMG & muscle fatigue\nExercise physiology and repiratory gas analysis\nIntroduction to Lt\nSelected Psychophysiology experiments\nSelected LabTutor human experiments \n\n\n\n\n Who Should Attend: \n • Educators looking to perfect their skills & gain some new techniques in lab instruction.\n • Instructors looking to "jump-start" their Fall A&P course preparations.\n • Instructors from novice to expert skill levels using ADInstruments hardware & software. \n\n\n This Workshop Provides:\n • Hands-on experiments.  • One-on-one interaction.\n • An opportunity to network with your peers.\n \n\n Benefits From Taking This Workshop Include:\n • Learn new techniques for use in your upcoming courses.\n • Learn by doing to master your PowerLab system.\n • Invest in your professional development.\n  \n\nDetailed schedule and map directions will be sent to attendees one week before the event.\n\n\n\nAccommodations Several hotels are near campus, for a full list please visit this link\n\nTerms and Conditions: This event may be cancelled or rescheduled by Instructor due to adverse weather, low class enrollment, catastrophic event or for other reasons.  All registrants will be notified at least 30 days before the event and course registration fees will be fully refunded should course be cancelled. Course cancellations must be received prior to 30 days before the start date of the event to receive a full refund. No-show''s and late cancellations will be charged the full event price. If you would like to send someone in your place or receive a credit for a future training course, please contact the event coordinator at workshop.na@adinstruments.com.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27769687%2F77304309587%2F1%2Foriginal.jpg?s=ae9698c2e8d7e369f79be53c27d0e735', 'https://www.eventbrite.com/e/student-laboratory-techniques-workshop-at-michigan-state-university-registration-31262321445?aff=ebapi', 'Michigan State University Department of Physiology 567 Wilson Rd, East Lansing, MI 48824', 42.723166, -84.47573239999997, 'Michigan State University Department of Physiology 567 Wilson Rd, East Lansing, MI 48824', NULL, NULL, '1498636800', '1498755600', 0, 0, 0, NULL, 1),
(332, 'live', '33627600057', 13, 0, 2, 'MI ACP Conference', 'Event Objectives:\n\nIncrease awareness and understanding about the advance care planning (ACP) process\nIllustrate and share varied experiences with ACP\nEducate attendees about the culture and sustainability of ACP\nIncrease workforce capacity to engage and integrate ACP into more communities\n\nDates: Friday, October 13, 2017 (full-day) and Saturday, October 14, 2017 (half-day)\nFor full conference information visit mipcc.org/mi-acp-conference\nVenue: Crowne Plaza Lansing West,Â 925 South Creyts Road, Lansing, MI 48917There is a block of rooms reserved for the conference at a $155 rate. Click the link above or call 877-322-5544 to reserve your room. Â The group code is for the conference rate is MPC\nKeynotes:\n\nLinda Briggs, MSN, MA, RN,Â Director of Program Development and Research,Â Respecting ChoicesÂ®\nCathy Wurzer, Anchor of Morning Edition, Minnesota Public Radio, Co-Author of We Know How This Ends: Living while Dying\nCarole Montgomery, MD, FHM, CPE, MHSA, Vice President, Clinically Integrated Pathways, Spectrum HealthÂ \n\nCE Credits:Â Social Work - 9.5 credits over two days*Nursing - 9.5 credits over two days**AMA PRA Category 1A - 9.5 credits over two days***\nNetworking Reception:Â There will be a Networking Reception with heavy hor d''vouers and a cash bar on Friday evening from 6pm-8pm at the Crowne Plaza. Â This is a great opportunity to connect with conference speakers, planners and colleagues across the state who are also working in the Advance Care Planning space. Â If you are interested, please register for both the conference and the reception, as a fee is required for the reception and space is limited.\nCost:\nFriday and Saturday:Â  Â  Â Early Bird (Register by July 31) - $150Â  Â  Â Full price (August 1 - September 30) - $200Â  Â  Â Late registration (October 1 -11) - $250\nFriday Only - $175\nSaturday only - $100\nStudent rates:Â  Â  Â One day - $50Â  Â  Â Two days -Â $65\nFriday Evening Networking Reception - $25\n\n\nYou can pay by credit card or check when you purchase tickets. Â If you are paying by check, please print out your ticket confirmation and send it with payment to 2121 University Park Drive, Okemos, MI 48864 within two business days of purchase. Â We need to be able to connect the person registered with the check issued, so please make sure you include this with your payment.Â \n\n\n*Social Work Continuing Education Credit Statement: MidMichigan Medical Center-Midland is an approved provider with the Michigan Social Work Continuing Education Collaborative. Approved Provider Number: MICEC-0043\n**Continuing Nursing Education Credit Statement: Continuing education contact hours for these programs are provided by Ferris State University School of Nursing, as an approved provider of continuing education credits by Michigan Board of Nursing R338.10502G\n***AMA PRA Category 1 Statement: Statement ofAccreditation: MidMichigan Health is accredited by The Michigan State Medical Society to provide continuing medical education for physicians.\nAMA Credit Designation Statement: MidMichigan Health designates this live activity for a maximum of 3.5 AMA PRA Category 1 Credits â„¢. Physicians should claim only credit commensurate with the extent of their participation in the activity.\nAmerican Academy of Physician Assistants accepts certificates of participation for educational activities certified for AMA PRA Category 1 Creditâ„¢ from organizations accredited by ACCME or a recognized state medical society. PAs may receive a maximum of 3.5 Category 1 credits for completing this activity.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31282546%2F177916082289%2F1%2Foriginal.jpg?s=a99381d2434e3a5e72f8bdcebbb31ab1', 'https://www.eventbrite.com/e/mi-acp-conference-tickets-33627600057?aff=ebapi', '925 South Creyts Road, Lansing, MI 48917', 42.722862, -84.64103669999997, '925 South Creyts Road, Lansing, MI 48917', NULL, NULL, '15