(337, 'live', '34203502597', 13, 0, 2, 'Loungebrite 2017', 'Gravity Works Design + Development is hosting an open space for sharing ideas in creative design and web developmentÂ \nOpen space events follow a very small set of rules that allow people to interact with each other in a creative and productive way. Sessions are decided by the attendees when the event first starts, and are encouraged to move to a different session if they feel they are not getting enough out of their current session.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30940368%2F153071291687%2F1%2Foriginal.jpg?s=6aebd97c8b22fec9819b5b8d83d51abf', 'https://www.eventbrite.com/e/loungebrite-2017-tickets-34203502597?aff=ebapi', '1132 N. Washington, Lansing,  MI 48906', 42.747134, -84.55177129999998, '1132 N. Washington, Lansing,  MI 48906', NULL, NULL, '1496404800', '1496422800', 0, 0, 0, NULL, 1),
(338, 'live', '34281576117', 13, 0, 2, 'Movers + Shakers (May 24, 31, June 14, 21) *no class June 7', 'Mover + Shakers is a highly innovative and completely unique play-based movement and dance class, taught by Karrie Korroch, to encourage physical fitness and well-being for children 2-3 years old.  The class incorporates the art of storytelling, the principles of the Nia Technique, and extensive study of the importance of play to get parents and children moving, laughing, learning, and playing together.  This class offers something for everyone! \r\n\r\nUsing themes to enhance imaginative play, movement choices, and creative visualization, each class will feature: interactive movement-based stories, puppets, instruments, music appreciation & education, guided & creative movement, attention to body awareness, dance & martial arts concepts, yoga, cooperative play & dance, and singing! These wonderful elements are all seamlessly woven into a whole lot of magical movin'' and groovin'' fun!\r\n\r\nDAY / TI (4 weeks)\r\nMay 24, 31, June 14, 21 (*no class June 7)\r\n10:45am - 11:15am\r\nCOST\r\n$40 (4 weeks)\r\n$36 Member (4 weeks) \r\nFree open play before and after class.\r\n\r\nAGES\r\n2-3 years old\r\nLOCATION\r\nPlatinum Dance Academy\r\nLocated 5 steps from our back door.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31028013%2F46645260091%2F1%2Foriginal.jpg?s=02cc41f946a9469bbb7900dfcbfc586f', 'https://www.eventbrite.com/e/movers-shakers-may-24-31-june-14-21-no-class-june-7-registration-34281576117?aff=ebapi', '4972 Northwind Dr, East Lansing, MI 48823', 42.72562600000001, -84.45273700000001, '4972 Northwind Dr, East Lansing, MI 48823', NULL, NULL, '1495622700', '1498043700', 0, 0, 0, NULL, 1),
