(340, 'live', '31727229999', 13, 0, 2, 'Networking the new school way - Free Linkedin Masterclass', 'Learn How To Use Linkedin To Transform Your Business\nLearn how to build a massive client base spending 15-20 minutes a day on Linkedin, even if you''ve never used Linkedin before and don''t have an advertising budget.\nReserve Your Seat For The FREE Linkedin Marketing Training here\nLinkedin Is A Goldmine Filled With Business Opportunities\nLinkedin is a Gold Mine of great business. You have the ability to quickly connect with real decision makers. There are over 400,000 Million users on Linkedin and it''s growing everyday.\nLinkedin is where you go to do business. However, most people treat it like a resume or a business Facebook. Learn how to leverage Linkedin to get a massive client base of THE RIGHT CLIENTS with this training. This is business networking done the right way.\nLinkedin Marketing Training Event\nCome to my Linkedin Marketing training/webinar and I''ll show you step by step how to use Linkedin to grow your business.\nConnect With:\n\nClients\nReferral Partners\nPress Connections\nInvestors\n\nOkay, Okay, Reserve My Seat For The FREE Linkedin Marketing Training\nI look forward to seeing you at the training!\n- Tim Dodd\nCEO & Co Founder\nTEV Marketing\nGreat Build a great network for your business using Linkedin for your networking!\nRESERVE YOUR SEAT HERE\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27959703%2F198962458821%2F1%2Foriginal.jpg?s=8b8e473deeb5752a4d4799db67a41691', 'https://www.eventbrite.com/e/networking-the-new-school-way-free-linkedin-masterclass-tickets-31727229999?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1495101600', '1495150200', 0, 0, 0, NULL, 1),
(341, 'live', '32298573904', 13, 0, 2, 'Export/Import Seminar in Lansing ''International Logistics''', 'Seminar Information:  Take the fear out of international shipping.  Learn to control your international shipments by directly coordinating your documents with transportation rules and procedures.  This seminar is an overview of the air and ocean transportation process.  Registration includes a copy of "Managing Forwarders, Brokers & Carriers In Your International Supply Chain" reference book.  Classes Earn NCBFAA credits.\nRegister 30 days in advance and save $50!                                                            Early registration price is $545 per person.                                                                    Late registration price is $595 \nInstructor:  Arthur O''Meara\nWho Should Attend:  Import & Export Managers, Traffic department, Sales, Shipping Department Personnel, International Marketing Managers, Customer Service Staff, Credit Managers, Controllers, Purchasing, Logistics Specialists or Anyone involved or with the responsibility for International Documentation, Compliance Rules and Regulations.\nTo register or for more information, please visit: http://www.globaltrainingcenter.com/lansing-mi-international-trade-seminars\nGlobal Training Center(800) 860-5030', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28604224%2F20430922300%2F1%2Foriginal.jpg?s=144112f02f4e9a810a3bef0bdce85040', 'https://www.eventbrite.com/e/exportimport-seminar-in-lansing-international-logistics-tickets-32298573904?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1498465800', '1498492800', 0, 0, 0, NULL, 1),
(342, 'live', '32299758447', 13, 0, 2, 'Export/Import Seminar in Lansing ''Import Documentation and Procedures''', 'Seminar Information:  Too often importers expect their brokers to do all of the work when it comes to the importing process. Unfortunately the broker is NOT a tax advisor. Any errors they make could result in penalties for you, the importer. Learn the key compliance elements of importing, classification, valuation, country of origin duty payment and record keeping. Learn also how to decipher those cryptic forms your broker supplies to you. Registration includes a copy of the "U.S. Import Regulations Procedures & Guidelines" reference book.  Classes Earn NCBFAA credits.\nRegister 30 days in advance and save $50!                                                            Early registration price is $545 per person.                                                                    Late registration price is $595\nInstructor:  Arthur O''Meara\nWho Should Attend:  Import & Export Managers, Traffic department, Sales, Shipping Department Personnel, International Marketing Managers, Customer Service Staff, Credit Managers, Controllers, Purchasing, Logistics Specialists or Anyone involved or with the responsibility for International Documentation, Compliance Rules and Regulations.\nTo register or for more information, please visit:  http://www.globaltrainingcenter.com/lansing-mi-international-trade-seminars\nGlobal Training Center(800) 860-5030', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28605927%2F20430922300%2F1%2Foriginal.jpg?s=ff726da07e4a8a9071a95630959523ca', 'https://www.eventbrite.com/e/exportimport-seminar-in-lansing-import-documentation-and-procedures-tickets-32299758447?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1498552200', '1498579200', 0, 0, 0, NULL, 1),
(343, 'live', '32300363256', 13, 0, 2, 'Export/Import Seminar in Lansing ''Tariff Classification''', 'Seminar Information:  This class is for Importers, Exporters & FTA determination.  The classification and valuation of goods are major decisions!  This is critical  information not only for duty purposes, but also to determine whether goods are subject to quotas, restraints, embargoes or other restrictions. Registration includes a copy of the "Doing Your Duty- Product Classification According to the HTSUS" reference book.  Classes Earn NCBFAA credits.\nRegister 30 days in advance and save $50!                                                            Early registration price is $545 per person.                                                                    Late registration price is $595\nInstructor:  Arthur O''Meara\nWho Should Attend:  Import & Export Managers, Traffic department, Sales, Shipping Department Personnel, International Marketing Managers, Customer Service Staff, Credit Managers, Controllers, Purchasing, Logistics Specialists or Anyone involved or with the responsibility for International Documentation, Compliance Rules and Regulations.\nTo register or for more information, please visit:  http://www.globaltrainingcenter.com/lansing-mi-international-trade-seminars\nGlobal Training Center (800) 860-5030', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28606743%2F20430922300%2F1%2Foriginal.jpg?s=49d1f8d51d31340244d41e73b36d29cf', 'https://www.eventbrite.com/e/exportimport-seminar-in-lansing-tariff-classification-tickets-32300363256?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1498638600', '1498665600', 0, 0, 0, NULL, 1),
(344, 'live', '32301431451', 13, 0, 2, 'Export/Import Seminar in Lansing ''Export Documentation and Procedures''', 'Seminar Information:  An in-depth understanding of export procedures combined with a study of the appropriate documentation will give you a valuable advantage in making your international trade business a success.  Class reviews the many components that make up the exporting process.  Learn how to correctly prepare your Export Documents.  Registration includes a copy of "Exporting: Regulations, Documentation & Procedures" reference book.  Classes Earn NCBFAA credits.\nRegister 30 days in advance and save $50!                                                            Early registration price is $545 per person.                                                                    Late registration price is $595\nInstructor:  Arthur O''Meara\nWho Should Attend:  Import & Export Managers, Traffic department, Sales, Shipping Department Personnel, International Marketing Managers, Customer Service Staff, Credit Managers, Controllers, Purchasing, Logistics Specialists or Anyone involved or with the responsibility for International Documentation, Compliance Rules and Regulations.\nTo register or for more information, please visit:  http://www.globaltrainingcenter.com/lansing-mi-international-trade-seminars\nGlobal Training Center(800) 860-5030', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F28608214%2F20430922300%2F1%2Foriginal.jpg?s=c437fbc979627f12a4ca65b7399696c8', 'https://www.eventbrite.com/e/exportimport-seminar-in-lansing-export-documentation-and-procedures-tickets-32301431451?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1498725000', '1498752000', 0, 0, 0, NULL, 1),
(345, 'live', '32605479868', 13, 0, 2, 'PMP® Certification Training Course in Lansing, MI-USA | Eduscil', 'The PMP® training course is designed to ensure that you pass the PMP exam on the first try. Our hands-on training approach, entrusted by 52,000 learners, will help you to understand the workings of the 5 process groups and 10 knowledge areas defined by the PMBOK® Guide—Fifth Edition. We guarantee you’ll walk away with all the preparation and confidence you need to conquer the exam and earn the PMP certification.\nEduscil is conducting 4 days PMP certification training course in major cities in USA. Register for this 4-day PMP classroom training/4-day PMP Live Virtual classroom training course, spread over one weekdays and prepare for the PMP Exam from an expert trainer. \nFeatures of our PMP Certification Training:\n\nInteractive classroom training session spread over two weekends\nTwo Simulated PMP practice tests with 200 questions in each test\nAnswers and explanations for all the practice questions\nLearn from an expert Project Management Trainer\nGet 35 Contact Hours PDU certificate\nCase studies in the classroom training session\nLife time access to PMP recorded session\nHelp with PMP Exam Application Process\nGlobal Approvals and Accreditation\nConvenient classroom and online courses\nCourses conducted across the globe\n\nFor more information about our Project Management training courses, please e-mail support@eduscil.com or Call Now! On +1 (302)-604-7957\nVisit us at PMP® Certification Training Course to know more about our certification training courses in Program Management, ITIL, IT Service Management, Quality Management, Agile, Scrum, and related fields.\nWe conduct PMP certification training courses in Phoenix, Charlotte, Minneapolis, Boston, Chicago, Houston, Phoenix, Chicago, Washington, Los Angeles, Washington, Indianapolis, Dallas, San Diego, Baltimore and Richmond around USA... Please visit us at http://www.eduscil.com/ to know more about our p