(346, 'live', '32771580680', 13, 0, 2, 'LEARN WITH OUR TEAM - MAKE 6-FIGURES YOUR FIRST YEAR', 'Interested in getting one step closer to financial freedom? Making more time for yourself and your loved ones?\nJoin us as we invite you to a 15-minute recorded real estate income opportunity webinar. Let us empower you to make moves towards financial freedom and living life on your own terms.\nTOPICS:\n\npaying off a mortgage in as little as 7 years\nfixing and flipping properties\ngetting 10-15% return on investments\npaying 2/3 less in taxes!\nreducing risk and learning multiple exit strategies\nmanaging property the right way\nraising capital without using your own money\nSO MUCH MORE!\n\nWhether you are new to real estate investing or a seasoned investor, there is always something to be learned!\nThis is a complimentary event. Once registered, our team will send you an email with further instructions for viewing the webinar. Thank you for your interest! Connect with us on social media! @MakeMovesCorp\nDISCLAIMER: U.S. participants only. We will not share your information with anyone or any 3rd party organization. The information provided is strictly for registration purposes.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29208156%2F199761449880%2F1%2Foriginal.jpg?s=1c4cfa4690bab09cc2fe0f917daa3723', 'https://www.eventbrite.com/e/learn-with-our-team-make-6-figures-your-first-year-tickets-32771580680?aff=ebapi', 'Instructions Emailed After Registration, Lansing, MI', 42.732535, -84.55553470000001, 'Instructions Emailed After Registration, Lansing, MI', NULL, NULL, '1495065600', '1495150200', 0, 0, 0, NULL, 1),
(347, 'live', '32959177788', 13, 0, 2, '24-Hour HAZWOPER OSHA Training Seminar Class in Lansing, MI', 'Since 1995, Compliance Solutions, the nation''s largest provider of OSHA HAZWOPER Training has offered "Open Enrollment" 24-Hour HAZWOPER Training. Our classes are available in twelve different cities each and every week! \r\nThese highly interactive Instructor-Led seminars meet or exceed OSHA''s mandated training requirements under 29 CFR 1910.120(e) - HAZWOPER (40, 24, 16 & 8 Hour) as well as states with their own OSHA plans.\r\n \r\nWhat is 24-Hour HAZWOPER Training?\r\nOSHA requires 24 hours of safety training under OSHA 29 CFR1910.120(e) for individuals who work on controlled or uncontrolled hazardous sites. The 24-Hour HAZWOPER course is designed for workers either are NOT required to deal directly with cleanup (this would generally be described as not working in conditions that require a protection level of “C or above) such as drillers, surveyors, contractors, administrative personnel, drivers etc. These must be fully trained pursuant to the HAZWOPER standard (29 CFR 1910.120(e)). Workers attending this course cover health and safety procedures during work operations at hazardous material sites.\r\n \r\n \r\nCourse Objectives\r\nThe two main objectives of HAZWOPER training are:\r\n\r\nControl or eliminate the potential hazards and/or losses, and\r\nProtect the health and safety of workers, the public, and the environment.\r\n\r\nPER OSHA’s Hazardous Waste Operations and Emergency Response (HAZWOPER) Standard (29 CFR 1910.120), the purpose of this seminar is to ensure awareness and promote safety among employees who may be exposed to  hazardous waste and chemical hazards on work-sites. The objective is to ensure that employees operate in the safest possible manner in situations where contact with potentially hazardous materials is likely.\r\nAt the conclusion of the 24-Hour HAZWOPER course, students will:\r\n\r\nUnderstand how hazardous materials are handled, identified, and what the human responses to exposure are\r\nLearn the importance of the Health and Safety Plan (HSP)\r\nIncorporate the knowledge of what to do in case of site emergencies\r\nUse appropriate safety methods and work practice controls\r\nRecognize signs and labels that are used to alert personnel of danger involving hazardous material\r\n\r\nImportant Registration Note: All employees who have regular duties related to handling or cleaning up hazardous materials or waste in any of these functions should take the 40-hour HAZWOPER course. The 24-hour course is designed for “Occasional Site Workers” meaning those individuals whose job functions do not include the handling of waste or hazardous materials as an integral part of their job.\r\nAct now and buy your ticket today. Classes fill up quickly. Multiple registration discounts (same course, same class) are available. Please call 800-711-2706 for information!\r\nNote: This event does NOT issue paper tickets. After registration you will receive an email confirmation from Compliance Solutions that incoudes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to this policy and provisions.\r\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29438440%2F51654302652%2F1%2Foriginal.jpg?s=007c3dc630865cc7fc3122093ba3a6ea', 'https://www.eventbrite.com/e/24-hour-hazwoper-osha-training-seminar-class-in-lansing-mi-tickets-32959177788?aff=ebapi', '3121 East Grand River Ave Address 2, Lansing, MI 48912', 42.7376689, -84.51697569999999, '3121 East Grand River Ave Address 2, Lansing, MI 48912', NULL, NULL, '1495526400', '1495735200', 0, 0, 0, NULL, 1),
(348, 'live', '33049463836', 13, 0, 2, '16-Hour HAZWOPER OSHA Training Seminar in Lansing, MI', 'Since 1995, Compliance Solutions, the nation''s largest provider of OSHA HAZWOPER Training has offered "Open Enrollment" 24-Hour HAZWOPER Training. Our classes are available in twelve different cities each and every week! \r\nThese highly interactive Instructor-Led seminars meet or exceed OSHA''s mandated training requirements under 29 CFR 1910.120(e) - HAZWOPER (40, 24, 16 & 8 Hour) as well as states with their own OSHA plans.\r\n16-Hour HAZWOPER COURSE\r\nThis instructor-led training seminar is designed to "upgrade" the 24-Hour HAZWOPER certification under 29 CFR 1910.120(e) to the full 40-Hour HAZWOPER certification. If you initially took a 24-Hour (occasional site worker) HAZWOPER course and now have a requirement for 40-Hour HAZWOPER certification, this course eliminates the time and expense required to take the 40-Hour course in it''s entirety.\r\nStudents attending this course will receive the 16 additional hours of safety training (including a dress-out exercise) required under OSHA 29 CFR1910.120(e)(q). Workers attending the 16-Hour HAZWOPER seminar upgrade will cover health and safety procedures and personnel protection during work operations at hazardous material sites.\r\nUpon successfully completing this course, workers will be 40-Hour HAZWOPER certified under 29 CFR 1910.120(e) to participate in site clean-up and other related activities. Students will be issued a new 40-Hour HAZWOPER certificate and wallet card after completing the seminar and a certification exam. In order to issue a new certification, you need to provide a copy of the original 24-Hour certification. For this reason, you will be required to send a copy of the 24-Hour certificate (and any interim refresher courses) after you register for the course.\r\n\r\nPREREQUISITES: 24-Hour HAZWOPER OSHA Training\r\n\r\nSpecial Pricing for Compliance Solutions Students: If you took your 24-Hour HAZWOPER Training with Compliance Solutions, you will receive a $125.00 per student discount off our listed price. Verification of training is required prior to receiving the discount. Please call 800-711-2706 Ext 1 for questions.\r\n\r\nNote: This event does NOT issue paper tickets. After registration you will receive an email confirmation from Compliance Solutions that incoudes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to this policy and provisions.\r\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29553587%2F51654302652%2F1%2Foriginal.jpg?s=ec62263719da2959882cb0e52688e4d8', 'https://www.eventbrite.com/e/16-hour-hazwoper-osha-training-seminar-in-lansing-mi-tickets-33049463836?aff=ebapi', '', NULL, NULL, '', NULL, NULL, '1495699200', '1495821600', 0, 0, 0, NULL, 1);
