(354, 'live', '33491061667', 13, 0, 2, 'FREE BUSINESS NETWORKING EVENT SEMINAR ABOUT HOW YOU CAN GET INCREASED LEADS  USING LINKEDIN', 'Come To The Linkedin Online Class\nClick Here - Join Me For The Linkedin Marketing Webinar\nDiscover how to build a huge client base by spending less than 30 minutes a day using Linkedin, even if you’ve never used Linkedin before and don''t have money to spend on advertising.\nUse Linkedin To Get More Customers Than You Can Handle\nDiscover how to quickly connect with real decision makers and set meetings that turn to customers. There are over Four Million people on Linkedin and it’s growing everyday.\nLinkedin is business centered. However, most people think it is a job site or a Facebook for business people. Discover how to leverage Linkedin to build a huge customer base of THE RIGHT clients with this online class.\nIf you are looking for something better than the networking events you’ve been doing, this masterclass is the answer. If you are wanting to add a time and cost effect lead source for your businesses, you’ve found it. Stop wasting time with all the bad networking and use Linkedin to laser focus your networking.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30134856%2F208689922736%2F1%2Foriginal.jpg?s=bb5696147d287bf003237ff9f370c846', 'https://www.eventbrite.com/e/free-business-networking-event-seminar-about-how-you-can-get-increased-leads-using-linkedin-tickets-33491061667?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1495101600', '1495105200', 0, 0, 0, NULL, 1),
