s, San Diego, Baltimore and Richmond around USA... Please visit us at http://www.eduscil.com/ to know more about our professional certification training courses in India and across the globe.\nPlease Contact Eduscil Learning Solutions:\nE-mail: support@eduscil.com or tony@eduscil.com\nWebsite: http://www.eduscil.com/\nCall Us Now!:\nUSA: +1 (302)-604-7957', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30352498%2F203533422144%2F1%2Foriginal.jpg?s=874ee7cd9a079b944246cf1b80c44659', 'https://www.eventbrite.com/e/lean-six-sigma-green-belt-certification-training-in-lansing-mi-usa-eduscil-tickets-33678257575?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1495530000', '1495560600', 0, 0, 0, NULL, 1),
