(362, 'live', '33777779247', 13, 0, 2, 'REFLECTIONS, a Collage Concert of Actors, Singers and Dancers', 'How do we know where we''ve been and where we are going to? What makes us who we are? These existential questions are brought to the forefront in "Reflections", a collage concert for students of The Studio Performing Arts Center on June 10, 2017. Featuring dancers, singers and actors aged 3 1/2 to Senior Citizens, "Reflections" is a conglomeration of past and present, a reflection on where we''ve been and where we might be going, with a very hopeful look to the future. Featuring comedy, very different dance styles such as ballet, tap, jazz, lyrical, contemporary and hip hop, along with different music genres, ranging from classical to ragtime and rap, dancers, singers and actors present a variety of artistic pieces sure to entertain and enlighten! ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30464179%2F174546202104%2F1%2Foriginal.jpg?s=612f6cd777aedb4df711b0f0671a81b3', 'https://www.eventbrite.com/e/reflections-a-collage-concert-of-actors-singers-and-dancers-tickets-33777779247?aff=ebapi', '819 Abbot Road, East Lansing, MI 48823', 42.741536, -84.485592, '819 Abbot Road, East Lansing, MI 48823', NULL, NULL, '1497121200', '1497130200', 0, 0, 0, NULL, 1),
