(369, 'live', '33965523796', 13, 0, 2, 'SUPPORT OUR GIRLS: KNOCK OUT BREAST CANCER 5K and 10K!  - Minneapolis', 'Â \r\nJoin us on our thirdÂ annualÂ Breast Cancer Awareness themed virtual race: SUPPORT OUR GIRLS: KNOCK OUT BREAST CANCER 5K and 10K! We honor all women out there that are courageously battling this disease. Â  We will also be donating at least 15%Â of every registration to theÂ Breast Cancer Research Foundation,Â an amazing organization that is dedicated toÂ to prevent and cure breast cancer by advancing the worldâ€™s most promising research.\r\nWhat:Â Complete a 5K and/or 10K! Set a goal for what your finishing time will be and dedicate your run/walk to all those we are running for.When:Â Complete your race any timeÂ in October.\r\n*Medals willÂ begin shipping out in September.Â \r\nWhere:Â Â You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy:Â Â Because we want to honor incredible womenÂ and raise funds for theÂ Breast Cancer Research Foundation!\r\nCOST:Â Â $17, which includes your medal, bib and shipping. Â Plus,Â at least 15%Â of every registration will go toÂ Breast Cancer Research Foundation', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30671265%2F98886079823%2F1%2Foriginal.jpg?s=2d8da99721241101d8e4499f0ffc5bb6', 'https://www.eventbrite.com/e/support-our-girls-knock-out-breast-cancer-5k-and-10k-minneapolis-registration-33965523796?aff=ebapi', 'YOU CHOOSE, Minneapolis, MN 55401', 42.6875419, -84.50058790000003, 'YOU CHOOSE, Minneapolis, MN 55401', NULL, NULL, '1506862800', '1509462000', 0, 0, 0, NULL, 0),
(370, 'live', '33984839570', 13, 0, 2, 'Digital Marketing Course: Social Media 101', 'Digital Marketing Course: Social Media 101 Live Streaming Presentation!\nIf you haven’t attended one of our online sessions prepare to have your mind blown! We''ll be teaching you everything you need to know when it comes to Social Media and getting started, the right way. At the core, most social media platforms work in a very similar way, once you understand the fundamentals you can dominate any social network, old and new. The best part is, anyone can do it!\n\nSome things we''ll be reviewing in this course.\n\nFacebook Personal Pages\nFacebook Fan Pages\nFacebook Groups\nFacebook Growth Marketing Strategy\n\n\nLinkedIn Profiles\nLinkedIn Company Profiles\nLinkedIn Growth and Marketing Strategy\n\n\nInstagram Personal Profiles\nInstagram Business Profiles\nInstagram Growth and Marketing Strategy\n\n\nTwitter Business Accounts\nTwitter Personal Accounts\nTwitter Growth Strategy\n\n\nOnce you understand the fundamentals of social media and how to utilize these platforms for personal use, company use and branding, you can apply the same ideas to any social media platform. After our presentation, we''ll open up to questions.\n\n\nOur sessions are led by\n\nQuintin Ford\nQuintin has an extensive background in SEO, Social Media, and Growth Hacking. Since 2008, Quintin has been using his social media to drive sales both in person and online. He has built many successful social media accounts, websites and traffic generating systems that have contributed to his success in multiple industries. Quintin is currently the Founder of knw media and focused on bringing the Los Angeles startup community together through fun and productive events focused on business growth.\n\nAbraham Gomez\nAbraham Gomez is an extremely knowledgeable and successful social media marketing professional primarily focused on Facebook and Instagram growth. Abraham is currently the owner of multiple Facebook pages reaching over 100 million people every week. Additionally, he has grown several viral websites reaching millions of active users. He is the creator of a top 1000 website and has gained over 1 million email subscribers. Abraham is currently a partner at Fishermen Labs in Playa Vista, CA and founder of Lotus Gaming.\n\nDerek Fujinaga\nDerek’s background consists of social media growth, building businesses, and management. He’s participated in multiple startups over the last 6 years, including agencies, restaurants, service companies, and a brewery. When starting out, he found his love for entrepreneurship by leading young entrepreneurs in developing and creating their own startups in college. He is passionate about working with non-profits and managing their online growth.\n\nAngel Davalos\nAngel has an extensive knowledge of social media growth and advertising. He is currently the advertising director for both Fishermen Labs and Lotus Gaming. Over the years he has managed ads for celebrities, ecomm sites, non-profits, and startups. He is passionate about positive growth and reaches over 500,000,000 people a month.\n\n\n\n\nHow our sessions work.\nWe host these live online classes out of our office in Playa Vista, CA. Guests tune in online to watch the live presentation. During the presentation, we set up a question and answer platform where participants can submit questions and have them answered. You''ll be sent the live streaming link 30 minutes before our presentation goes live. The email will be labeled LIVE STREAMING SOCIAL MEDIA 101\n\n\nJoin our session now and see what all the hype is about.\nTickets are limited.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30757433%2F210380681778%2F1%2Foriginal.jpg?s=c0e9dff14877bc0a7110bd4fe0b65918', 'https://www.eventbrite.com/e/digital-marketing-course-social-media-101-tickets-33984839570?aff=ebapi', 'Lansing, MI', 42.732535, -84.5555347, 'Lansing, MI', NULL, NULL, '1495555200', '1495560600', 0, 0, 0, NULL, 1),
(371, 'live', '33994944795', 13, 0, 2, 'Girl Scouts Brewer''s Dinner', 'For the next Brewer''s Dinner, we invite you to enjoy a Girl Scout Cookie themed 4-course food & beer pairing with special commentary from our team of brewers and chefs! **$5 of each ticket will go to supporting Girls Scouts Heart of Michigan!**\nFirst CourseToffee bacon waffle topped with apricot syrup and Toffee-tastic Cookie crunchÂ Beer Pairing:Â Bock in Business\nSecond CourseÂ Spinach and blueberry salad served with honey yogurt dressing and a sweet oatmeal nut crumble with Do-Si-Do CookiesBeer Pairing:Â Liliko''i Gose\nThird CourseCoconut shrimp encrusted in Samoa Cookie served over linguine pasta with Samoa brown butter bechamelBeer Pairing:Â Amber Cream Ale\nFourth CourseThin Mint Cookie pie with a dark chocolate crumb crust and gooey mint chocolate fudge filling topped with whipped creamBeer Pairing:Â Velvet Villain Firkin (w/ coffee, cocoa nibs, vanilla bean)\nSeats are limited!Â Mug Club Members:Â In addition to the delicious dinner, you will take home a growler!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31073763%2F168320648158%2F1%2Foriginal.jpg?s=1655f4758d7448ca5f8711710a8aabf0', 'https://www.eventbrite.com/e/girl-scouts-brewers-dinner-tickets-33994944795?aff=ebapi', '518 East Shiawassee Street, Lansing, MI 48912', 42.7369821, -84.54555519999997, '518 East Shiawassee Street, Lansing, MI 48912', NULL, NULL, '1496340000', '1496350800', 0, 0, 0, NULL, 1),
