(378, 'live', '34089177648', 13, 0, 2, '7th Annual Arts Integration Summer Institute', 'Ingham ISD and MSU Federal Credit Union Institute for the Arts & Creativity at Wharton Center, under the direction of The Kennedy Center for the Performing Arts Partners in Education program,are proud to offer the 7th Arts Integration Summer Institute!\nThe 2017 Arts Integration Summer Institute will feature the intersection of English Language Arts, Science, and Dance. Experts in each area will share current trends in standards and classroom practices, while discussing the value of interdisciplinary approaches that impact student engagement and achievement. Our featured guest artists will be Cassie Meador, artistic director of the award-winning and internationally recognized Dance Exchange, and her colleague, Elizabeth Johnson, Dance Exchangeâ€™s associate artist and partnership director. \nA highlight of this summerâ€™s institute will be the introduction of sustained partnerships between teacher and teaching artists. These teams will begin relationship building and project creation at the Summer Institute, and then expand the experience with follow-up meetings, model teaching, and student participation over the school year. Academic year teaching artist specialize in visual arts, theatre, and dance.Workshop participants will deepen their understanding and practice of arts integration through activities, presentations, group discussions, peer learning, writing, and implementing an arts-integrated project. \nWhile the concept of arts integration is not new, there is an increased interest and a growing number of programs and schools focusing on arts integration. Why are educators showing interest? There are two main reasons:\n1. Arts Integration practices are aligned with how students learn.2. Arts Integration energizes by providing increases in professional satisfaction.\n\nSingle Registration $300.00\nTeam of Two $500.00\nTeam of Six $1,200.00\n\nSCECH available, pending approval\nQuestions about the program, please contact Bert Goldstein bert.goldstein@whartoncenter.comÂ Questions on registration, please contact Lonnie Thomas lthomas@inghamisd.org', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30809415%2F128158272807%2F1%2Foriginal.jpg?s=ac0a1ef51e80aa1868b0c2c8c7b39a2a', 'https://www.eventbrite.com/e/7th-annual-arts-integration-summer-institute-tickets-34089177648?aff=ebapi', '750 East Shaw Lane, East Lansing, MI 48824', 42.725742, -84.47057719999998, '750 East Shaw Lane, East Lansing, MI 48824', NULL, NULL, '1502181000', '1502380800', 0, 0, 0, NULL, 1),
