(381, 'live', '34256675639', 13, 0, 2, 'Lick the Sugar Habit - Gilead', 'Do you consider yourself a sugar addict? We know sugar is bad but why do we love it so much? Learn the 10 reasons why sugar is killing us and lick the habit for good! \nAll are welcome! Bring a friend, family member, or co-worker.\nQuestions, call 517-336-8880', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30996555%2F129191537381%2F1%2Foriginal.jpg?s=7a11b1a1bc2ea8c88d9cd82cb98438da', 'https://www.eventbrite.com/e/lick-the-sugar-habit-gilead-tickets-34256675639?aff=ebapi', '306 N Creyts, Lansing, MI 48917', 42.7310162, -84.64269560000002, '306 N Creyts, Lansing, MI 48917', NULL, NULL, '1496772900', '1496776500', 0, 0, 0, NULL, 1),
(382, 'live', '34321988993', 13, 0, 2, 'Careers in IT Roundtable Event', 'Exploring a new future in IT? Join us in learning what it takes to launch a career in IT. A future closer than you think!Youâ€™re already an IT Professional? Join in discussion with local leading IT businesses as they highlight: industry trends; desired skills; IT career pathways; and their current career opportunities!\nRoundtable Host and Moderator: Patrick Pung, Director of Career Development, New Horizons\n1. DEWPOINT2. ROCKETFUEL3. MICHIGAN STATE UNIVERSITY FEDERAL CREDIT UNION\nFriday, June 23, 201712:00 â€“ 1:30 Lunch served.Michigan Works! Capital Area2110 S. CedarLansing, MI', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31072293%2F137375137372%2F1%2Foriginal.jpg?s=d7e8274f6ad0b6a189b80b60523209bf', 'https://www.eventbrite.com/e/careers-in-it-roundtable-event-tickets-34321988993?aff=ebapi', '2110 South Cedar Street, Lansing, MI 48910', 42.7100868, -84.54851880000001, '2110 South Cedar Street, Lansing, MI 48910', NULL, NULL, '1498219200', '1498224600', 0, 0, 0, NULL, 1),
(383, 'live', '34346773123', 13, 0, 2, 'Lansing Scrum Master Certification Class*', 'Register for Upcoming Information session\r\nhttp://bit.ly/2qFhVi5 \r\n \r\nVideo Conference Details\r\nWill be sent after registration and payment\r\n \r\nScrum master Certification exam\r\nAt the end of the course, you will be able to take the Scrum master certification exam.\r\nWeekly Schedule\r\nMay 20, 21, June 3, 4, 11, 17, 2017\r\n8:00 AM - 10:00 AM US Pacific Time \r\n  \r\nScrum Master Certified (SMC™) – Training\r\nScrum Master Certification classroom trainings are offered by SCRUMstudy approved Authorized Training Partners (A.T.P.s). All trainers are highly experienced and accredited by SCRUMstudy. Course fee includes the certification exam fee. Participants will be awarded ‘Scrum Master Certified’ certificate from SCRUMstudy on successful completion of the exam.\r\n \r\nAudience Profile\r\nThis course is appropriate for professionals interested in obtaining a working knowledge of Scrum and planning to become a Scrum master. This would include Scrum team members, Product Owners, Product Managers, Project Managers, Project Sponsors, programmers, designers, testers, software engineers, executives, business owners, business analysts, and more.\r\n \r\nCourse Objectives\r\n\r\nTo provide an understanding of the principles in the Scrum framework\r\nTo provide a practical working knowledge of Scrum including roles, meetings, and artifacts.\r\nTo prepare participants to be comfortable with implementing Scrum in their organizations.\r\nTo prepare participants to take SMC™ exam upon completion of the course.\r\n\r\n \r\nCourse Benefits\r\n\r\nHigh quality hands-on training using role-plays and case-studies.\r\nCourse fee includes certification exam fee.\r\nComplimentary copy of the SBOK™ Guide.\r\nFree Lifetime Primary Membership.\r\nOne year Advanced Membership worth $120.\r\n\r\n \r\nScrum Master Certified (SMC™)\r\nScrum Master Certified (SMC™) is a certification for Scrum Masters and experienced practitioners needing or wanting more advanced instruction.\r\nThe objective of this certifiINSERT INTO `app_event` (`id`, `event_type`, `eventfull_id`, `user_id`, `category_id`, `cityID`, `title`, `description`, `cover_image`, `website`, `venue`, `lat`, `lng`, `location`, `email`, `mobile`, `start_time`, `end_time`, `totallike`, `totalshare`, `totalfavorite`, `i_date`, `deleted`) VALUES
(397, 'live', '34637174722', 13, 0, 2, 'Unifying a Brand Through Communications', 'Presentation Summary:\nPatrick Hayes, director of communications at Kettering University, will be joining CMPRSA for ourÂ June 22ndÂ luncheon fromÂ noon to 1:15 p.m.Â Patrick will present,Â Unifying a Brand Through Communications. Patrick will share how Kettering has strengthened its brand through a news-focused approach to storytelling, prospective student and alumni marketing campaigns, media placement strategies and even the physical location of the communications staff on campus.Â \nAbout the Speaker:\nPatrick Hayes is the director of communications at Kettering University, a nationally ranked STEM and business university in Flint, Michigan. At Kettering, he''s overseen a major rebranding initiative, launch of new social media and content strategies, a web redesign that split the previous website into two properties -- an external-facing site focused on prospective students and revenue generation and an internal site for students, faculty, staff and other stakeholders -- and a media placement strategy that has resulted in Kettering being featured regularly in prominent outlets including The New York Times, Fast Company, Fortune, Politifact, Automobile Magazine, Next City, NPR, The Atlantic and more.\nHayes has also worked in higher education communications for Michigan State University and was previously a journalist whose work has appeared inÂ ESPN.com, the Detroit Free Press, GOOD Magazine, MLive, SB Nation, The Classical, Belt Magazine and SLAM Magazine, among others.\nVenueÂ Sponsor:\nThank you to our event venue sponsor, Martin Waymire.Â Martin Waymire is one of Michigan''s top public relations firms, specializing in strategic communications, digital marketing and issue advocacy. Learn more atÂ www.MartinWaymire.com\n\nNot a Member?\nThe Central Michigan chapter offers exciting opportunities for networking and professional development to public relations professionals in the greater Lansing area. With a membership of more than 150 area communicators, CMPRSA meetings are a place to always meet someone new, but establish valuable connections over time as well. A diverse membership of young and seasoned professionals, a stimulating mix of programs and opportunities for involvement make CMPRSA the ideal organization to invest your time and resources. Learn more.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31437934%2F35996804046%2F1%2Foriginal.jpg?s=9ebfb06f8e667236444ad2431ff22ef9', 'https://www.eventbrite.com/e/unifying-a-brand-through-communications-tickets-34637174722?aff=ebapi', '3435 Forest Road, Lansing, MI 48910', 42.70511700000001, -84.50247000000002, '3435 Forest Road, Lansing, MI 48910', NULL, NULL, '1498132800', '1498137300', 0, 0, 0, NULL, 1),
