(401, 'live', '34682839306', 13, 0, 2, 'Only $8.00! Support Our Girls: Jogging for Jugs 5K & 10K - Lansing', '*WE HAVE JUST A LIMITED NUMBER OF MEDALS LEFT FROM OUR 2016 SUPPORT OUR GIRLS: JOGGING FOR THE JUGS 5K & 10! Â SIGN UP NOW FOR $8.00 AND COMPLETE YOUR RACE BY June 30th! THIS IS A VIRTUAL RACE SO YOU COMPLETE YOUR RACE ON YOUR OWN (OR WITH FRIENDS), SUBMIT YOUR TIME TO US AND WE SHIP YOUR MEDAL TO YOU!Â \r\nJoin us on our second annualÂ Breast Cancer Awareness themed virtual race: SUPPORT OUR GIRLS: JOGGING FOR THE JUGS 5K and 10K! October is Breast Cancer Awareness Month! We honor all women out there that are courageously battling this disease. Â  We will also be donating a portion of every registration to theÂ Breast Cancer Research Foundation,Â an amazing organization that is dedicated toÂ to prevent and cure breast cancer by advancing the worldâ€™s most promising research.\r\nWhat:Â Complete a 5K and/or 10K! Set a goal for what your finishing time will be and dedicate your run/walk to all those we are running for.\r\nWhen:Â Complete your race any time before April 30, 2017!\r\n*Medals will be shipped within 2 to 5 days of signing up. Â \r\nWhere:Â Â You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy:Â Â Because we want to honor incredible womenÂ and raise funds for theÂ Breast Cancer Research Foundation!\r\nCOST:Â Â $22, which includes your medal, bib and shipping. Â Plus,Â a portion of every registration will go toÂ Breast Cancer Research Foundation. Â NOW ONLY $8.00!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31495840%2F98886079823%2F1%2Foriginal.jpg?s=bf086bcd2009517d766d65aa1368ff8a', 'https://www.eventbrite.com/e/only-800-support-our-girls-jogging-for-jugs-5k-10k-lansing-registration-34682839306?aff=ebapi', 'Lansing, MI 48924', 42.6875419, -84.50058790000003, 'Lansing, MI 48924', NULL, NULL, '1497186000', '1498838400', 0, 0, 0, NULL, 1),
(402, 'live', '34695555340', 13, 0, 2, 'Baby & Me Classes (May 23, 30, June 13, 20) *no class June 6', 'Baby & Me \r\nConnect with your baby through the magic of musical movement at play!  Each week, this class will provide you with a special time for enhancing and nurturing your relationship with your little one through music, creative movement, singing, simple games, rhymes, finger plays, bounces, chants, instruments, and books. Research shows that music, reading, and singing play an enormous role in the brain development of very young children by positively impacting memory, attention, language, and speech. Babies are born with the innate ability to process musical sounds and patterns--they love hearing the rhythms of songs, repetition of melodies, and your singing voice.  As your child grows, he or she will enjoy singing songs, chanting rhymes, and reading words along with you.  Actively working with music increases the brain''s ability to adapt and change by adding and enhancing new neural connections, while setting any words to music helps the brain to learn them more quickly and retain them longer.  Music and active reading also have a calming, relaxing effect, resulting in stress reduction for both caregivers and little ones.  Classes are taught by Ms. Karrie. Tuesdays\r\n5:45-6:30pm\r\n(May 23, 30, June 13, 20) *no class June 6\r\n(4 weeks, $40) \r\n10% discount for play. members.\r\nFree Open Play before and after class.\r\nAbsencesTuition is non-transferable and non-refundable if your child is absent. Make-up classes are not offered.  We have reserved space for each child exclusively during the designated weeks and maintain a waiting list for those who register after the space is full.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31513504%2F46645260091%2F1%2Foriginal.jpg?s=a3eda592486b52e522ae847dd2676d28', 'https://www.eventbrite.com/e/baby-me-classes-may-23-30-june-13-20-no-class-june-6-registration-34695555340?aff=ebapi', '4972 Northwind Dr, East Lansing, MI 48823', 42.72562600000001, -84.45273700000001, '4972 Northwind Dr, East Lansing, MI 48823', NULL, NULL, '1495561500', '1497378600', 0, 0, 0, NULL, 1),
