(414, 'live', '34578879359', 13, 0, 2, 'PRIME MUSIC FESTIVAL - Lansing', 'PRIME FEST - LANSING, MI\nALL AGES\nALL SALES FINAL | NO REFUNDS | RAIN OR SHINE\nMARSHMELLO, MIGOS, MACHINE GUN KELLY, BLACKBEAR, CHEAT CODES, JOYRYDE, MICHAEL CHRISTMAS, PLAYBOI CARTI, PARTY THIEVES, PRINCE FOX, QUINN XCII, WAKA FLOCKA FLAME & MORE!\nSINGLE DAY LINEUPS TO BE REVEALED AT A LATER DATE!\nFrom the producers of Lansingâ€™s Common Ground Music Festival and the Columbus, Ohio, based Breakaway Music Festival brand, comes a fresh first year event! The multi-genre â€œPRIME Music Festival - Michiganâ€ will take place September 15-16, 2017, at Adado Riverfront Park.\nâ€œWe are excited to expand the fall music festival scene in the mid Michigan regionâ€ said Jenna Meyer, marketing director of MiEntertainment Group. â€œAdado Riverfront Park has proven itself as the premier outdoor concert venue in the East Lansing/Lansing marketplace over the past 18 years, and home to many successful events.â€\nMiEntertainment Group has produced the Common Ground Music Festival annually since 2000, bringing over 1 million guests to the mid-Michigan community and an added economic impact of over $60 million. In partnership with the company is Prime Social Group, known for its major stake in Midwest events including Breakaway Music Festival (which has now expanded into multiple markets) and the largest college music festival in the country, #Fest. \n----\nTickets: After completing your purchase on Eventbrite, you will receive an email confirmation with your attached PDF ticket(s). You MUST print and bring your PDF tickets AND VALID PHOTO IDENTIFICATION to be admitted for the event.Â \nTicket Transfer Policy: You may gain entry to the event even if your name is not on your ticket ONLY so long as the barcode is scannable. PSG is not responsible if ticket(s) cannot be scanned and the order is under a different name than the person presenting the ticket.Â \nImportant:Â If you do not see your order confirmation in your inbox, make sure to check your junk/spam folder. If you still do not see your order confirmation, click here to access the Eventbrite help center.Â If you are having any other technical ticketing-related issues with your order, click here to contact Eventbrite.Â \nVisitÂ primesocial.com/faqÂ for any additional ticketing questions.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32373844%2F107981700581%2F1%2Foriginal.jpg?s=40de2dc8eaaee76123aa03221b472d44', 'https://www.eventbrite.com/e/prime-music-festival-lansing-tickets-34578879359?aff=ebapi', '201 East Shiawassee Street, Lansing, MI 48933', 42.7405231, -84.54988879999996, '201 East Shiawassee Street, Lansing, MI 48933', NULL, NULL, '1505487600', '1505602800', 0, 0, 0, NULL, 0),
(415, 'live', '34607772780', 13, 0, 2, 'Cat Day 5K - Lansing', '*THIS IS A VIRTUAL RACE! You complete your race on your own (or with friends), submit your times and we ship your medal directly to you!\r\nSunday, October 29, 2017 is Cat Day! Â To help celebrate, we are hosting a Cat Day 5K!Â  We invite you to complete a 5K anytimeÂ in October,Â for, or with, your favorite four legged friend. Â 15% of every registration will be donated toÂ Alley Cat Allies!\r\nCompleteÂ a virtual 5K and weâ€™ll send you an awesome Cat Day 5K Medal, plus an attached bell charm for your cat!\r\nWhat:Â This is a 5K virtual run (or walk) to celebrate the day of the cats!\r\nWhen:Â Complete your race any time in October. Â Even better, do it on Cat Day, Â October 29th!\r\nWhere:Â Â You choose the course and you time yourself (youâ€™ll report your finishing time to us).\r\nWhy:Â Â Because this is our way of celebrating CATSÂ and to help raise funds for an amazing organization:Â Alley Cat Allies.\r\n\r\n*Medals and tags will start shipping out at the end ofÂ September.\r\nCost:Â Â The price is $18 and that includes your medal and a small bell charm for your cat, bib and shipping. Plus, at least 15%Â of every entry will be donated toÂ Alley Cat Allies.Â  *We are in no way affiliated with this charity, we like to choose a different charity for each of our races and are happy to raise funds for them.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31398710%2F98886079823%2F1%2Foriginal.jpg?s=81b3b4018b01e027a8c8324d7887534c', 'https://www.eventbrite.com/e/cat-day-5k-lansing-registration-34607772780?aff=ebapi', 'Virtual, Lansing, MI 48924', 42.699331, -84.49973299999999, 'Virtual, Lansing, MI 48924', NULL, NULL, '1509282000', '1509465600', 0, 0, 0, NULL, 0),
(416, 'live', '34720218107', 13, 0, 2, 'Fiserv Great Lakes User Group 2017 Fall Meeting Sponsors', 'The Fall 2017 Fiserv Great Lakes User Group event is on October 10-12, 2017.Â  The vendor room will be available for setup on October 10th and must be vacated on the 12th (detailed times TBA).Â  There will be 2-3 vendor presentation breakout sessions on October 11th, depending on need, and an evening vendor reception that evening (11th).Â  Attendees will be encouraged to speak with vendors by being entered into a raffle should they speak with a certain number.Â  Please choose one of the sponsorship levels listed below.\nGold Sponsor ($2,500) â€“ LIMITED QUANTITY\n\n\nTwo attendees and a table for my booth (6â€™x18â€) ($100 for additional attendees)\n\n\nListed as a Gold sponsor on the event advertising and highlighted as a named event sponsor\n\n\nVendor presentation opportunity - 30 minutes during main session (NEW this year!)\n\n\nListed as a meal sponsor for breakfast or lunch\n\n\nSilver Sponsor ($1,250)\n\n\nTwo attendees and a table for my booth (6â€™x18â€) ($100 for additional attendees)\n\n\nListed as a Silver sponsor on the event advertising\n\n\nVendor presentation opportunity - 15-20 minutes during breakout session\n\n\nBronze Sponsor ($600)\n\n\nTwo attendees and a table for my booth (6â€™x18â€) ($100 for additional attendees)\n\n\nListed as a Bronze sponsor on the event advertising\n\n\n\nThe meeting will be at the Marriott East Lansing at University Place â€“ 300 MAC Avenue East Lansing MIÂ  48823.Â  Please call the hotel at 1-517-337-4440 to reserve your rooms.Â  You must refer to the Michigan Great Lakes User Group to receive the discounted rate of $162.00 per night.Â  Room reservations for the meeting must be made by September 15, 2017 to receive the group rate.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31771636%2F182229108604%2F1%2Foriginal.jpg?s=4781df277cf2f2fdc056b3a2176d1163', 'https://www.eventbrite.com/e/fiserv-great-la