(422, 'live', '34723840943', 13, 0, 2, '24-Hour HAZWOPER OSHA Training Seminar Class in Lansing, MI', 'Since 1995, Compliance Solutions, the nation''s largest provider of OSHA HAZWOPER Training has offered "Open Enrollment" 24-Hour HAZWOPER Training. Our classes are available in twelve different cities each and every week! \r\nThese highly interactive Instructor-Led seminars meet or exceed OSHA''s mandated training requirements under 29 CFR 1910.120(e) - HAZWOPER (40, 24, 16 & 8 Hour) as well as states with their own OSHA plans.\r\n \r\nWhat is 24-Hour HAZWOPER Training?\r\nOSHA requires 24 hours of safety training under OSHA 29 CFR1910.120(e) for individuals who work on controlled or uncontrolled hazardous sites. The 24-Hour HAZWOPER course is designed for workers either are NOT required to deal directly with cleanup (this would generally be described as not working in conditions that require a protection level of “C or above) such as drillers, surveyors, contractors, administrative personnel, drivers etc. These must be fully trained pursuant to the HAZWOPER standard (29 CFR 1910.120(e)). Workers attending this course cover health and safety procedures during work operations at hazardous material sites.\r\n \r\n \r\nCourse Objectives\r\nThe two main objectives of HAZWOPER training are:\r\n\r\nControl or eliminate the potential hazards and/or losses, and\r\nProtect the health and safety of workers, the public, and the environment.\r\n\r\nPER OSHA’s Hazardous Waste Operations and Emergency Response (HAZWOPER) Standard (29 CFR 1910.120), the purpose of this seminar is to ensure awareness and promote safety among employees who may be exposed to  hazardous waste and chemical hazards on work-sites. The objective is to ensure that employees operate in the safest possible manner in situations where contact with potentially hazardous materials is likely.\r\nAt the conclusion of the 24-Hour HAZWOPER course, students will:\r\n\r\nUnderstand how hazardous materials are handled, identified, and what the human responses to exposure are\r\nLearn the importance of the Health and Safety Plan (HSP)\r\nIncorporate the knowledge of what to do in case of site emergencies\r\nUse appropriate safety methods and work practice controls\r\nRecognize signs and labels that are used to alert personnel of danger involving hazardous material\r\n\r\nImportant Registration Note: All employees who have regular duties related to handling or cleaning up hazardous materials or waste in any of these functions should take the 40-hour HAZWOPER course. The 24-hour course is designed for “Occasional Site Workers” meaning those individuals whose job functions do not include the handling of waste or hazardous materials as an integral part of their job.\r\nAct now and buy your ticket today. Classes fill up quickly. Multiple registration discounts (same course, same class) are available. Please call 800-711-2706 for information!\r\nNote: This event does NOT issue paper tickets. After registration you will receive an email confirmation from Compliance Solutions that incoudes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to this policy and provisions.\r\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31552686%2F51654302652%2F1%2Foriginal.jpg?s=cd7ca5a46bc0592c2de75a2d147caeee', 'https://www.eventbrite.com/e/24-hour-hazwoper-osha-training-seminar-class-in-lansing-mi-tickets-34723840943?aff=ebapi', '3121 East Grand River Ave Address 2, Lansing, MI 48912', 42.7376689, -84.51697569999999, '3121 East Grand River Ave Address 2, Lansing, MI 48912', NULL, NULL, '1502784000', '1502992800', 0, 0, 0, NULL, 0),
(423, 'live', '34723867021', 13, 0, 2, 'The Hootz', 'Hear the enthusiastic sound and experience the high energy of alternative country rock band The Hootz live in concert! Doors open at 4 p.m. and tickets are free.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31552717%2F141977339849%2F1%2Foriginal.jpg?s=42b1f0803d52fbce6aee2607716fdac7', 'https://www.eventbrite.com/e/the-hootz-tickets-34723867021?aff=ebapi', '5660 W Saginaw Hwy, Lansing, MI 48917', 42.7440639, -84.62898969999998, '5660 W Saginaw Hwy, Lansing, MI 48917', NULL, NULL, '1497729600', '1497742200', 0, 0, 0, NULL, 1),
(424, 'live', '34723972336', 13, 0, 2, 'Emergency Response Technician Level III Initial Training in Lansing, MI', 'The Emergency Response Technician Level III Initial Training Seminar from Compliance Solutions provides training mandated under OSHA 29 CFR1910.120(q). This course is conducted in conjunction with our 40-Hour HAZWOPER course. Workers attending this instructor-lead course will cover 18 different OSHA suggested topics including Health and Safety Procedures, PPE used during work operations, Medical Monitoring and many others. The course is held over four days, 10-hours each day.\r\nPersonnel who are involved in the cleanup of spills in manufacturing environments as well as those individuals who are responsible for control or containment of hazardous or potentially hazardous materials are required to receive Emergency Response training. This initial training course focuses on the identification and safe handling of hazardous materials. Individuals who are members of a response team should always have site specific training and drills tailored to their specific hazards before attempting cleanup or containment. In order to stay in compliance with OSHA regulations and maintain certification, a refresher course is required to be completed annually.\r\nAct now and get your ticket today. Classes do fill quickly.\r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\nÂ \r\nRegister Early! Pre-registration for all classes is required (no walk-inâ€™s) and classes do fill up quickly.\r\nÂ \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\nÂ \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\nÂ  5 to 9 students= 10% Â Â Â 10 or more = 15%\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31552824%2F51654302652%2F1%2Foriginal.jpg?s=cbf4321bf038ba018721a0ffb6ed6d7e', 'https://www.eventbrite.com/e/emergency-response-technician-level-iii-initial-training-in-lansing-mi-tickets-34723972336?aff=ebapi', '3121 East Grand River Ave, Lansing, MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing, MI 48912', NULL, NULL, '1502784000', '1503079200', 0, 0, 0, NULL, 0),
(425, 'live', '34724096708', 13, 0, 2, '16-Hour HAZWOPER OSHA Training Seminar in Lansing, MI', 'Since 1995, Compliance Solutions, the nation''s largest provider of OSHA HAZWOPER Training has offered "Open Enrollment" 24-Hour HAZWOPER Training. Our classes are available in twelve different cities each and every week! \r\nThese highly interactive Instructor-Led seminars meet or exceed OSHA''s mandated training requirements under 29 CFR 1910.120(e) - HAZWOPER (40, 24, 16 & 8 Hour) as well as states with their own OSHA plans.\r\n16-Hour HAZWOPER COURSE\r\nThis instructor-led training seminar is designed to "upgrade" the 24-Hour HAZWOPER certification under 29 CFR 1910.120(e) to the full 40-Hour HAZWOPER certification. If you initially took a 24-Hour (occasional site worker) HAZWOPER course and now have a requirement for 40-Hour HAZWOPER certification, this course eliminates the time and expense required to take the 40-Hour course in it''s entirety.\r\nStudents attending this course will receive the 16 additional hours of safety training (including a dress-out exercise) required under OSHA 29 CFR1910.120(e)(q). Workers attending the 16-Hour HAZWOPER seminar upgrade will cover health and safety procedures and personnel protection during work operations at hazardous material sites.\r\nUpon successfully completing this course, workers will be 40-Hour HAZWOPER certified under 29 CFR 1910.120(e) to participate in site clean-up and other related activities. Students will be issued a new 40-Hour HAZWOPER certificate and wallet card after completing the seminar and a certification exam. In order to issue a new certification, you need to provide a copy of the original 24-Hour certification. For this reason, you will be required to send a copy of the 24-Hour certificate (and any interim refresher courses) after you register for the course.\r\n\r\nPREREQUISITES: 24-Hour HAZWOPER OSHA Training\r\n\r\nSpecial Pricing for Compliance Solutions Students: If you took your 24-Hour HAZWOPER Training with Compliance Solutions, you will receive a $125.00 per student discount off our listed price. Verification of training is required prior to receiving the discount. Please call 800-711-2706 Ext 1 for questions.\r\n\r\nNote: This event does NOT issue paper tickets. After registration you will receive an email confirmation from Compliance Solutions that incoudes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to this policy and provisions.\r\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31552964%2F51654302652%2F1%2Foriginal.jpg?s=1027e6c035b974126f35a6ca73aa5528', 'https://www.eventbrite.com/e/16-hour-hazwoper-osha-training-seminar-in-lansing-mi-tickets-34724096708?aff=ebapi', '3121 East Grand River Ave, Lansing , MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing , MI 48912', NULL, NULL, '1502956800', '1503079200', 0, 0, 0, NULL, 0),
(426, 'live', '34724143849', 13, 0, 2, '8-Hour HAZWOPER OSHA refresher training in Lansinsg, MI', 'Compliance Solutions, the nation''s largest provider of OSHA Hazmat training is pleased to offer open enrollment for the 8-Hour OSHA HAZWOPER Annual Refresher trainingin twelve different cities every week!\r\nÂ \r\nOur instructor-led seminars meet or exceed OSHAâ€™s suggested training curricula and meet OSHAâ€™s mandated training requirements under 29 CFR 1910.120(e and q).\r\nÂ \r\nThe 8-Hour HAZWOPER course meets OSHAâ€™s annual refresher requirements for employees who have completed their initial 24-Houror 40-Hour HAZWOPER certification. Mandatedtraining can be found in 29 CFR1910.120. Students attending the 8-Hour HAZWOPER are updated on changes in related regulations, participate in multiple class safety activities, complete a mock dress-out and receive instruction in health and safety procedures, and personnel protection during work operations at hazardous material sites. Unlike our competitors, our training content and exercises are updated annually so your employees donâ€™t take the same class over and over again every year!\r\nÂ \r\nPrerequisites:Students must have completed an initial 24-Hour or 40-Hour HAZWOPER course and have maintained certification through annual refresher training. If certification has not been refreshed under OSHA guidelines, the 24-Hour or 40 Hour HAZWOPER should be re-taken to maintain certification.\r\nRegister Early! Pre-registration for all classes is required (no walk-inâ€™s) and classes do fill up quickly.\r\nÂ \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\nÂ \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\nÂ  5 to 9 students= 10%Â Â Â Â  10 or more = 15%\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31553053%2F51654302652%2F1%2Foriginal.jpg?s=d6db6ea19f254ce21efc5cb4350b3e4e', 'https://www.eventbrite.com/e/8-hour-hazwoper-osha-refresher-training-in-lansinsg-mi-tickets-34724143849?aff=ebapi', '3121 East Grand River Ave, Lansing , MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing , MI 48912', NULL, NULL, '1503043200', '1503079200', 0, 0, 0, NULL, 0);
