(434, 'live', '34730952213', 13, 0, 2, 'Lansing Entry Level Big Data Engineer Training with Guaranteed Job Placement in Big 4', 'Guaranteed Job Placement Ad\n http://smrtr.io/t_5zwg \nWe are looking to provide training with guaranteed job placement as a full time big data engineer in a Big 4 consulting company which is our direct client. This client is looking to hire multiple entry level big data engineers nationwide. \nTo take this training, you must meet the following criteria:\n\nMinimum 1 year of Building and deploying Java applications\nMinimum 1 year understanding of traditional ETL tools & RDBMS\nUS Citizen and Green card holders\nAble to travel 75% which is required by the job.\n\nIf you do not meet the prerequisite we can provide the prerequisite training for an extra cost, however you need to be US citizen or green card holder.\nDisclaimer - We will train you and prepare you for this job. We will act as your coach. However you have to pass the interview with our Big 4 client which we will prepare you for. You have to work very hard. If you are not willing to put in the required effort, we cannot guarantee your success in the end. We will provide regular feedback to each student during the class so you will know where you stand in terms of your readiness for this open position.\n\nWhy Big Data Training from Omni212?\n1. Omni212 is a Hortonworks Hadoop Consulting Partner.2. Two of our most experienced, Certifed Hadoop instructors teach this class.3. Employees of Microsoft, Cap Gemini, McKesson, FMR Boston, have taken our classes.4. Upon Registration and payment, immediate access to the previous class recordings, course material on the cloud is immediately provided. 5. Class recordings for this class will be made available. 6. Post class support7. Course material available. 8. Cloud account on Microsoft Azure with Hands-on lab exercises under the guidance of two experienced big data, hadoop instructors.9. Career advancement and Job placement assistance\n\nNext class starting\nMay 22, 2017\n\nVideo Conference link\nWill be sent upon your registration and payment\n\nPre-requisite\n\nMinimum 1 year of Building and deploying Java applications\nMinimum 1 year understanding of traditional ETL tools & RDBMS\nUS Citizen and Green card holders\nAble to travel 75% which is required by the job.\n\nIf you do not meet the pre-requisite we can provide the prerequisite training for an extra cost \n\nSoftware access\nA Microsoft cloud Azure account will be provided to every student where they will install hortonworks hadoop on the cloud virtual machines. Students will carry out the hands-on lab exercises with instructor guidance.\n\nCourse Outline\n\nSession 1: Big Data Basics\n• An introduction to Big Data?\n• Why is Big Data? Why now?\n• The Three Dimensions of Big Data (Three Vs)\n• Evolution of Big Data\n• Big Data versus Traditional RDBMS Databases\n• Big Data versus Traditional BI and Analytics\n• Big Data versus Traditional Storage\n• Key Challenges in Big Data adoption\n• Benefits of adoption of Big Data\n• Introduction to Big Data Technology Stack\n• Apache Hadoop Framework\n• Introduction to Microsoft HDInsight – Microsoft’s Big Data Service\nHands-On Lab:\n• Creating Azure Storage Account\n• Creating HDInsight Cluster\n• Using services on HDInsight Cluster\n\nSession 2: The Big Data Technology Stack\n• Basics of Hadoop Distributed File System (HDFS)\n• Basics of Hadoop Distributed Processing (Map Reduce Jobs)\nHands-On Lab:\n• Loading files to Azure storage account\n• Moving files across HDInsight Cluster\n• Remote Access to Azure Storage Account and HDInsight Cluster\n \nSession 3: Deep dive into Hadoop Storage System (HDFS) (1 Hour)\n• HDFS\n• Reading files with HDFS\n• Writing files with HDFS\n• Error Handling\nHands-On Lab:\n• Accessing Hadoop configuration files using HDInsight Cluster\n \nSession 4: Processing Big Data –MapReduce and YARN\n• How MapReduce works\n• Handling Common Errors\n• Bottlenecks with MapReduce\n• How YARN (MapReduceV2) works\n• Difference between MR1 and MR2\n• Error Handling\nHands-On Lab:\n• Running a simple MapReduce application (word count)\n• Running a custom MapReduce application (census data)\n• Running MapReduce via PowerShell\n• Running a MapReduce application using PowerShell\n• Monitoring application status\n \nSession 5: Big Data Development Framework\n• Introduction to HIVE\n• Introduction to PIG\n• HBase\nHands-On Lab:\n• Loading the data into HIVE\n• Submitting Pig jobs using HDInsight\n• Submitting Pig jobs via PowerShell\n \nSession 6: Big Data Integration and Management\n• Big Data Integration using Polybase\n• Big Data Management using Ambari\nHands-On Lab:\n• Fetching HDInsight data into SQL\n• Using Ambari for managing HDInsight cluster\n \nSession 7: Big Data – BI and Reporting using Power BI\n• Introduction to Power BI\n• Usual workflow of Power BI\n• Power BI Ecosystem\n• Getting Data into Power BI\n• Reports vs Dashboards\n• Additional elements of Power BI Reports\nHands-On Lab:\n• Fetching HDInsight Data into Power BI desktop\n• Data Modelling using Power BI desktop\n• Creating reports using Power BI desktop\n \nSession 8: PowerBI.com services – Deep dive\n• Power BI Dashboards\n• Natural Language Query\n• Power BI Workspaces – Personal and Group Workspaces\n• Sharing using OneDrive for Business\nHands-On Lab:\n• Publishing reports to Powerbi.com\n• Sharing reports using OneDrive for Business\nEnd-to-End Use Case Implementation- Lab Exercise\n• Use case -Healthcare Analytics using Hadoop framework through Microsoft HDInsight and Power BI\n\nClass Size: Maximum 22\n\nPrice: $595\n\nPLEASE NOTE:1. Each student get access to a login account on the cloud, Microsoft Azure, where they install Hadoop on a cloud virtual machine and perform hands-on lab exercises with instructor guidance.There will be 2 experienced big data, hadoop instructors supporting the students throughout the class.\n\nADVANTAGES OF TAKING THIS COURSE WITH OMNI212:\n1. Class recordings will be made available. 2. Post class support3. Course material available. 4. Appropriate software access provided5. Career advancement and Job placement assistance\n\nREFUND POLICY\n1. 100% refund will be provided under the following circumstances:\n\nIn case Omni212 cancels or reschedules the class.\nIf the student cancels or raises a refund up to 48 hours before the start of course.\nNo negative review is given without giving Omni212 the chance to remedy the situation within 15 days after the complaint was registered by the student.\n\n2. 50% refund will be issued under the circumstance that:\n\nStudent raises a refund request within 3 days after the first training session.\n\n3. No refund will be provided under the following circumstances:\n\nStudent raises a request more than 3 days after start of the course.\nStudent registers for the course and does not attend the course for whatever reason.\nOnce the student has access to training course material of previous or current class\n\n4. Refunds will be issued within 15 days once the request has been approved.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31562369%2F59307985005%2F1%2Foriginal.jpg?s=a8d2c3aedd8945a7e470469af1015aa4', 'https://www.eventbrite.com/e/lansing-entry-level-big-data-engineer-training-with-guaranteed-job-placement-in-big-4-tickets-34730952213?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1495481400', '1496957400', 0, 0, 0, NULL, 1),
(435, 'live', '34740834772', 13, 0, 2, '13th Screening and Book Signing - Lansing First Presbyterian', 'First Presbyterian Church of Lansing, Lansing Branch - ACLU, NorthWest Initiative, ARRO and ACTION of Greater Lansing partner to present this community screening on The13th , a 2016 American documentary by director Ava DuVernay. \nCentered on race in the United States criminal justice system, the film is titled after the Thirteenth Amendment to the United States Constitution, which outlawed slavery (unless as punishment for a crime). DuVernayâ€™s documentary argues that slavery is being effectively perpetuated through mass incarceration.\nJames Kilgore, who is featured in the film, will make a presentation following the screening. Copies of his book, â€œUnderstanding Mass Incarcerationâ€ will be available for the book signing.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31575750%2F204739079076%2F1%2Foriginal.jpg?s=7115b91ad4a18554f879151a748bc977', 'https://www.eventbrite.com/e/13th-screening-and-book-signing-lansing-first-presbyterian-tickets-34740834772?aff=ebapi', '510 West Ottawa Street, Lansing, MI 48933', 42.7350455, -84.55900500000001, '510 West Ottawa Street, Lansing, MI 48933', NULL, NULL, '1496426400', '1496437200', 0, 0, 0, NULL, 1),
(436, 'live', '34517131670', 13, 0, 2, 'Talent Investment Agency Employer Seminar-Lansing', 'The Talent Investment Agency is offering free seminars to acquaint employers with the Unemployment Insurance system in Michigan.\nThe seminars will have a new format this year. There will be 3 one-hour sessions, with an 30-minute period for individual questions after each presentation. Each session will include general information, navigating the Michigan Web Account Manager system and questions forwarded by you – the employer. Workforce Development and Michigan Works! will present resources available across the state to employers.  Employers will be provided a brief overview of services to assist in meeting their labor force needs. To submit questions prior to the event, please e-mail Employeradvisor@michigan.gov and put "2017 Employer Seminar" in the subject line.\n1. All About Benefits: 8:00-9:00 AM\n2. Your Tax Account: 9:30-10:30 AM\n3. Workforce Development and Michigan Works!: 11:00-12:00 PM\nStaff will be available from 12:00-1:00 PM to answer individual questions.\nThere will also be an agent on site for questions about Michigan''s Work Share program, which helps companies avoid layoffs and keep their skilled employees working.\nThe Unemployment Insurance Power Point presentations will be available on the UIA Website, www.michigan.gov/uia on May 25, 2017 to download (copies will not be provided at the seminars).', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31284938%2F3437998700%2F1%2Foriginal.jpg?s=25012031fe252ee2401caeaf1c63eae2', 'https://www.eventbrite.com/e/talent-investment-agency-employer-seminar-lansing-tickets-34517131670?aff=ebapi', '2110 S Cedar St, Lansing, MI 48910', 42.7100868, -84.54851880000001, '2110 S Cedar St, Lansing, MI 48910', NULL, NULL, '1502438400', '1502456400', 0, 0, 0, NULL, 0),
(437, 'live', '33979703207', 13, 0, 2, 'Beikoku Shido-kan Karate-do Association National Training Seminar (NTS-17)', 'Shido-kan Training Seminar \r\n(NTS-17)\r\n\r\nJuly 21-23, 2017 \r\nLansing Center | Lansing, Michigan USA\r\nThis is the annual summer conference to attend for all Shido-kan karate practitioners!\r\nInstruction is led by head master teacher, Seikichi Iha, Hanshi, 10th Dan, with Shido-kan senior teachers from throughout the Association.\r\nThroughout the seminar weekend, you will have the opportunity to improve your knowledge and skills in the fundamental techniques of Shido-kan karate as well as deepen your understanding of kata, kumite and one-on-one partnership drills and bunkai (group application of kata).\r\nYouth are invited to attend an action-packed Saturday seminar with Sensei Iha followed by the exciting youth and teen kata tournament.\r\nWho Should Attend?\r\n\r\nThere will be training opportunities for all ranks -- age 7 and above. Options include:\r\n\r\nFriday - Sunday adult seminars for ages 14 and above\r\nFriday - Saturday youth seminars and youth kata tournament for ages 7-13\r\nSaturday youth seminar with Iha Sensei for ages 7-13\r\nSaturday afternoon youth and teen tournament for ages 7-19\r\n\r\nSeminar sessions are designed so that people of all ranks can benefit and learn. Throughout the weekend you have the chance to meet, train with, share information and renew contacts with fellow students and teachers. After training there will be opportunities to socialize and enjoy friendships - old and new. \r\nAccommodations & Parking\r\nThe weekend events will be held in the Lansing Center - a spacious conference facility connected to the Radission Hotel by a skywalk. Features include:\r\n\r\nSpacious, air-conditioned and carpeted training areas in the ground floor conference center.\r\nEasy access to Radisson Hotel.\r\nDouble rooms at a reduced conference flat rate that can be split by multiple people.\r\nDelicious meals in the hotel restaurant. There are also many restaurants within walking distance from the hotel and conference center. (Saturday evening banquet is included in the "Seminar and Events" conference rate.)\r\nPlenty of close-by parking.\r\nFamily activity areas in the hotel (pool, whirlpool, fitness room in hotel).\r\nComplementary hotel shuttle to the airport.\r\nBus access from the hotel and conference center to MSU campus, Michigan Capitol, museums. restaurants and entertainment. "Entertainment Express" trolley service is available every 30 minutes from Thurs. through Saturday nights on Michigan Ave from MSU to the downtown area.\r\n\r\nVisit the Radisson Lansing web site at http://m.radisson.com/mweb/lansing-hotel-mi-48933/lansing for photos of rooms and map.\r\nIf you wish to stay at the conference location, you may place your room reservations directly through the hotel at discounted conference room rates. Book early while rooms are available in the discounted reservation block! Conference fixed double room rates may be split between multiple occupants. Pre-book a room by calling (517) 482-0188 and mention you are attending the karate "National Training Seminar" at the Lansing Center. Use the discount code "OOK717" when booking a room at the Radisson.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31633266%2F988101631%2F1%2Foriginal.jpg?s=728414c91292ad22540e1e5b701b8eeb', 'https://www.eventbrite.com/e/beikoku-shido-kan-karate-do-association-national-training-seminar-nts-17-tickets-33979703207?aff=ebapi', '333 E. Michigan Ave., Lansing, MI 48933', 42.734142, -84.54798399999999, '333 E. Michigan Ave., Lansing, MI 48933', NULL, NULL, '1500631200', '1500807600', 0, 0, 0, NULL, 1),
(438, 'live', '34832406666', 13, 0, 2, 'Sundance Head', 'Sundance Head, winner of NBCâ€™s The Voice and son of country music icon Roy Head, joins us for a live concert! Tickets are $5 in advance by purchasing online or $10 at the door. Doors open at 4:00 p.m. Â Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31696959%2F141977339849%2F1%2Foriginal.jpg?s=90e2568f80e0e8d44a3d7351c171b999', 'https://www.eventbrite.com/e/sundance-head-tickets-34832406666?aff=ebapi', '5660 West Saginaw Highway, Lansing, MI 48917', 42.7440615, -84.62899379999999, '5660 West Saginaw Highway, Lansing, MI 48917', NULL, NULL, '1500753600', '1500766200', 0, 0, 0, NULL, 1),
(439, 'live', '34795673797', 13, 0, 2, 'Conquer Accelerator Demo Week: East Lansing', 'After ten exciting weeks of concentration on their startups, Conquer Acceleratorâ€™s 2017 Cohort is ready to hit the road for our first-ever traveling Demo Week. We will be on the road, August 14thâ€“18th, starting in East Lansing on August 15th; heading to Detroit, August 16th; and rounding out the tour in Grand Rapids, on August 17th. Our four teams are AvidCor,Â Horizon IQ,Â LEAP Worldwide, andÂ PrndL.\nJoin us for an afternoon of great pitches, time with these exciting teams, light food and drinks!\nÂ \n\n\nFAQs\nÂ \nWhat are my parking options for getting to and from the event?\nParking is available in the Charles Street Garage and validation is available upon request.\nÂ \nHow can I contact the organizer with any questions?\nIf you have any questions, please do not hesitate to reach out to the Conquer Accelerator leadership team. Email Paul Jaques, Conquer''s program director, pjaques@spartaninnovations.org; or Tom Stewart, Conquer''s program manager,Â tom@conqueraccelerator.com.\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31647145%2F46594630145%2F1%2Foriginal.jpg?s=833aa87316f5e1ad078169554cbf59fb', 'https://www.eventbrite.com/e/conquer-accelerator-demo-week-east-lansing-tickets-34795673797?aff=ebapi', 'MSU Innovation Center 325 East Grand River Avenue, East Lansing, MI 48823', 42.734569, -84.48047229999997, 'MSU Innovation Center 325 East Grand River Avenue, East Lansing, MI 48823', NULL, NULL, '1502809200', '1502816400', 0, 0, 0, NULL, 0),
(440, 'live', '34842734557', 13, 0, 2, 'Coordinating the Care Coordinators Workshop #2', 'The second working meeting shall build upon the work product from the kick-off session and call #1. This will include discussing the technological and legal components of care coordination,Â the progress of the white paper, and an inventory of relevant activities from around the state.\r\nÂ \r\nThis workshop and conference call series will convene a broad community of multi-stakeholder constituents to frame a statewide approach to making care coordination more transparent. Right now, fragmentation and silos inhibit optimal care coordination throughout Michigan. This work seeks to help care teams know who is working with their patients, communicate with them, and reduce unnecessary provider burdens by avoiding duplication. Â \r\n\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31711383%2F137038342194%2F1%2Foriginal.jpg?s=28cce9c2c6f6588a46c8217385cb1224', 'https://www.eventbrite.com/e/coordinating-the-care-coordinators-workshop-2-tickets-34842734557?aff=ebapi', '1115 South Washington Avenue, Lansing, MI 48910', 42.72133189999999, -84.551893, '1115 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1496309400', '1496331000', 0, 0, 0, NULL, 1),
(441, 'live', '31727238023', 13, 0, 2, 'Networking the new school way - Free Linkedin Masterclass', 'Learn How To Use Linkedin To Transform Your Business\nLearn how to build a massive client base spending 15-20 minutes a day on Linkedin, even if you''ve never used Linkedin before and don''t have an advertising budget.\nReserve Your Seat For The FREE Linkedin Marketing Training here\nLinkedin Is A Goldmine Filled With Business Opportunities\nLinkedin is a Gold Mine of great business. You have the ability to quickly connect with real decision makers. There are over 400,000 Million users on Linkedin and it''s growing everyday.\nLinkedin is where you go to do business. However, most people treat it like a resume or a business Facebook. Learn how to leverage Linkedin to get a massive client base of THE RIGHT CLIENTS with this training. This is business networking done the right way.\nLinkedin Marketing Training Event\nCome to my Linkedin Marketing training/webinar and I''ll show you step by step how to use Linkedin to grow your business.\nConnect With:\n\nClients\nReferral Partners\nPress Connections\nInvestors\n\nOkay, Okay, Reserve My Seat For The FREE Linkedin Marketing Training\nI look forward to seeing you at the training!\n- Tim Dodd\nCEO & Co Founder\nTEV Marketing\nGreat Build a great network for your business using Linkedin for your networking!\nRESERVE YOUR SEAT HERE\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27959703%2F198962458821%2F1%2Foriginal.jpg?s=8b8e473deeb5752a4d4799db67a41691', 'https://www.eventbrite.com/e/networking-the-new-school-way-free-linkedin-masterclass-tickets-31727238023?aff=ebapi', '', NULL, NULL, '', NULL, NULL, '1495706400', '1495755000', 0, 0, 0, NULL, 1),
