(443, 'live', '32771587701', 13, 0, 2, 'LEARN WITH OUR TEAM - MAKE 6-FIGURES YOUR FIRST YEAR', 'Interested in getting one step closer to financial freedom? Making more time for yourself and your loved ones?\nJoin us as we invite you to a 15-minute recorded real estate income opportunity webinar. Let us empower you to make moves towards financial freedom and living life on your own terms.\nTOPICS:\n\npaying off a mortgage in as little as 7 years\nfixing and flipping properties\ngetting 10-15% return on investments\npaying 2/3 less in taxes!\nreducing risk and learning multiple exit strategies\nmanaging property the right way\nraising capital without using your own money\nSO MUCH MORE!\n\nWhether you are new to real estate investing or a seasoned investor, there is always something to be learned!\nThis is a complimentary event. Once registered, our team will send you an email with further instructions for viewing the webinar. Thank you for your interest! Connect with us on social media! @MakeMovesCorp\nDISCLAIMER: U.S. participants only. We will not share your information with anyone or any 3rd party organization. The information provided is strictly for registration purposes.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29208156%2F199761449880%2F1%2Foriginal.jpg?s=1c4cfa4690bab09cc2fe0f917daa3723', 'https://www.eventbrite.com/e/learn-with-our-team-make-6-figures-your-first-year-tickets-32771587701?aff=ebapi', '', NULL, NULL, '', NULL, NULL, '1495670400', '1495755000', 0, 0, 0, NULL, 1),
(444, 'live', '33155092775', 13, 0, 2, 'PMP® Classroom Training in Lansing, MI-USA | Eduscil', 'The PMP® training course is designed to ensure that you pass the PMP exam on the first try. Our hands-on training approach, entrusted by 52,000 learners, will help you to understand the workings of the 5 process groups and 10 knowledge areas defined by the PMBOK® Guide—Fifth Edition. We guarantee you’ll walk away with all the preparation and confidence you need to conquer the exam and earn the PMP certification.\nEduscil is conducting 4 days PMP certification training course in major cities in USA. Register for this 4-day PMP classroom training/4-day PMP Live Virtual classroom training course, spread over one weekdays and prepare for the PMP Exam from an expert trainer. \n\nFeatures of our PMP Certification Training:\n4 days instructor-led intense classroom training\nLearn from an expert Project Management Trainer\n60 days access to 4 sets of mock question and answers for practice\nHard copy of the latest PMBOK 5th edition\nCase studies in the classroom training session\n35 contact hours certificate which will help you apply for PMP exam.\nHelp with PMP Exam Application Process\nTips and Techniques to clear PMP® Certification by the Trainer\nSupport till you clear the PMP exam with 100% money back guarantee*\nCourses conducted across the globe\n\nFor more information about our Project Management training courses, please e-mail support@eduscil.com or Call Now! On +1 (302)-604-7957\nWe also deliver onsite training for corporate groups. Contact us for group/corporate_discount.\n\n5.00% for 3-4 people\n10.00% for 5-9 people\n15.00% for 10 and above people\n\nVisit us at PMP® Certification Training Course to know more about our certification training courses in Program Management, ITIL, IT Service Management, Quality Management, Agile, Scrum, and related fields.\nWe conduct PMP certification training courses in Phoenix, Charlotte, Minneapolis, Boston, Chicago, Houston, Phoenix