(448, 'live', '33769508509', 13, 0, 2, 'Real Estate Investing Webinar Lansing', 'Interested in real estate investing? Don''t know where to start?\nWant to learn real estate investing by networking with like minded indviduals?\nWant to learn how to get out the rat race?\nIf the answer is Yes, come join us!\nLearn real estate investment strategies such as fix and flip, buy, and hold, short sale, foreclosures, and multi family.\nLearn how to pay off your house in 10 years or less\nLearn how real estate investors fund real estate deals without your own money or credit!\nRSVP Now!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30454742%2F171787685717%2F1%2Foriginal.jpg?s=a78af935c72c231cae0e381057ead14c', 'https://www.eventbrite.com/e/real-estate-investing-webinar-lansing-tickets-33769508509?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1496174400', '1496176200', 0, 0, 0, NULL, 1),
(449, 'live', '34559037010', 13, 0, 2, 'Party Like It''s 1997 - Reunion Dinner and Drinks', 'Celebrate the East Lansing High School Class of 1997 20 year Reunion!\nJoin fellow 1997 classmates at Beggar''s Banquet for dinner and drinks starting at 7p.\nBe one of the first 10 ELHS Alumnus to use Promo Code: 97PARTY and recive a free T-Shirt.\nPurchase your 1997 Reunion T-shirtÂ hereÂ so we can stand out as a group and show our ELHS Pride!\nPlease feel free to join us for all or any events you can attend:\nFriday, October 6:\nÂ  - Walk in ELHS homecoming parade (families welcome): ClickÂ here to reserve - Â Time TBDÂ \nÂ  - Attend ELHS homecoming football game (families welcome): Click for resevered sectionÂ  - Time TBD*\nÂ  Â  Â  Â  Â  Â  Â  Â *Game tickets will need to be purchased seperately\n\nSaturday, October 7:\nÂ  - Tour the high school (families welcome): Â Reserve ticket HERE -Â 9:50amÂ meet in front of building\nÂ  - Dinner and drinks at Beggar''s Banquet (adults only, over 21 years old):Â 7pm**\nÂ  Â  Â  Â  Â  Â  Â Â Â **Each adult attending the dinner on October 7thÂ will need a ticket. Â \n\n\n\nFAQs\nAre there ID or minimum age requirements to enter the event?\nOnly for the Dinner and Drinks at Beggar''s Banquet - All attendants must be 21 years of age or older and must have a Photo ID.\n\nWhat are the different ticket prices?\nAll events are free of charge except for the Dinner and Drinks at Beggar''s Banquet and the football game.Â \nTickets for the football game must be purchased at the game. The free ticketÂ HEREÂ gets access to reserved section.Â \nThe breakdown of ticket prices for theÂ Dinner and Drinks at Beggar''s Banquet are as follows:\nBefore the Bell - $40 Â 6/1/17 - 7/31/17\nSecond Bell - $50 Â 8/1/17 - 8/31/17\nSaved by the Bell - $60 9/1/17 - 9/30/17\n\nWhat''s the refund policy?\nSorry - but there will be no refunds for this event\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31996994%2F7684303209%2F1%2Foriginal.jpg?s=a41cd20b889e439846e65705d2e421b2', 'https://www.eventbrite.com/e/party-like-its-1997-reunion-dinner-and-drinks-tickets-34559037010?aff=ebapi', '218 Abbot Road, East Lansing, MI 48823', 42.7357429, -84.48352239999997, '218 Abbot Road, East Lansing, MI 48823', NULL, NULL, '1507402800', '1507428000', 0, 0, 0, NULL, 0),
(450, 'live', '34755583887', 13, 0, 2, 'CLASS: Beginning Jewelry with Milt Gere', 'Join guest instructor Milt Gere for a one day, low cost, jewelry making (silversmithing/metalsmithing) class for beginning smiths using cut & solder fabrication methods. \nÂ Make a simple copper pendant or key fob. Learn basics of metal smithing (silversmithing) jewelry, using copper sheet and wire, etc. Learn work safety, basics of design, and basic processes of sawing, filing, texturizing, soldering and polishing. Go on to learn the process of how to bezel set a cabochon stoneÂ onto the pendant or key fob. Leave with a finished cab-set copper pendant or key fob.\nÂ To keep cost low the initial project, a pendant or key fob, will be done mostly in copper. Working with copper and sterling silver are somewhat similar, but less expensive in copper. All materials will be provided.\n\nFAQs\nNote: Additional class policies can be found on our website:Â https://www.lansingmakersnetwork.org/classes-and-workshops/class-policies/\nWhat should I wear or bring to the class?\nPlease wearÂ comfortable clothes you don''t mind getting dirty and closed toed shoed (no sandals!). Safety glasses are required and will be provided, but if you have a pair you''re comfortable in, consider bringing your own.\n\nAre there ID requirements or an age limit to enter the event?\nThis workshop is only for those 16+. Â (Participants under 18 must be accompanied by an adult)\n\nWhere can I contact the organizer with any questions?\nAny questions, feel free to contact us atÂ education@lansingmakersnetwork.orgÂ and we''ll try to get your question answered.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31596530%2F29464559187%2F1%2Foriginal.jpg?s=3ad0eb92d88752ef48ff429516932998', 'https://www.eventbrite.com/e/class-beginning-jewelry-with-milt-gere-tickets-34755583887?aff=ebapi', '2400 West Saint Joseph Street, Lansing, MI 48917', 42.72688220000001, -84.58436080000001, '2400 West Saint Joseph Street, Lansing, MI 48917', NULL, NULL, '1497088800', '1497110400', 0, 0, 0, NULL, 1),
