(455, 'live', '34860384348', 13, 0, 2, 'Baby & Me Classes (July 18, 25, Aug. 1, 8, 15, 22)', 'Baby & MeÂ \r\nConnect with your baby through the magic of musical movement at play! Â Each week, this class will provide you with a special time for enhancing and nurturing your relationship with your little one through music, creative movement, singing, simple games, rhymes, finger plays, bounces, chants, instruments, and books.Â Research shows that music, reading, and singing play an enormous role in the brain development of very young children by positively impacting memory, attention, language, and speech. Babies are born with the innate ability to process musical sounds and patterns--they love hearing the rhythms of songs, repetition of melodies, and your singing voice. Â As your child grows, he or she will enjoy singing songs, chanting rhymes, and reading words along with you. Â Actively working with music increases the brain''s ability to adapt and change by adding and enhancing new neural connections, while setting any words to music helps the brain to learn them more quickly and retain them longer. Â Music and active reading also have a calming, relaxing effect, resulting in stress reduction for both caregivers and little ones. Â Classes are taught by Ms. Karrie.Â Tuesdays\r\n5:45-6:30pm\r\nJuly 18, 25, Aug. 1, 8, 15, 22 (6 weeks, $60)\r\n(6 weeks, $60)Â \r\n10% discount for play. members.\r\nFree Open Play before and after class.\r\nAbsencesTuition is non-transferable and non-refundable if your child is absent. Make-up classes are not offered. Â We have reserved space for each child exclusively during the designated weeks and maintain a waiting list for those who register after the space is full.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31735823%2F46645260091%2F1%2Foriginal.jpg?s=b8a530f694a2cf6ba59401ea0477af6b', 'https://www.eventbrite.com/e/baby-me-classes-july-18-25-aug-1-8-15-22-registration-34860384348?aff=ebapi', '4972 Northwind Dr, 