(459, 'live', '34872528672', 13, 0, 2, 'Sexton Class of 1987 - 30th Reunion', '30 Years! How is that even possible?!? We look forward to a fun weekend of celebration with "old" friends! Here is the Itinerary for the Class of ''87 30th Reunion Weekend...\n****Thursday, July 27th - 7p - ?\nFor those who arrive early and want to stop in for a very casual meet-&-greet, we''ll be at Reno''s West (5001 W. Saginaw, Lansing).\n****Friday, July 28th - \nBased on feedback, we''ve elimiated the bowling/party bus options.  If you choose, you may meet at Royal Scot at 6p to bowl, there will be classmates there.  You will pay at the venue.  The Lansing Lugnuts also have a 7:05p game that evening if you''re looking for a fun, inexpensive activity prior to heading to the Dispatch.\n****Friday, July 28th - 9:00p - ?\nWe will all meet up at the Dispatch Bar (3004 W. Main St, Lansing). If you order a t-shirt, it will be available at the Dispatch. \n****Saturday, July 29th - 11a-3p\nPicnic at Grand Woods Park (4500 Willow Hwy, Lansing) . All food & soft drinks/water are included with your ticket. (Adult beverages ARE allowed but are BYOB). Family-friendly event if you choose to bring the kids :)\n****Saturday, July 29th - 6p-10:30p\nWe will board the Michigan Princess (Grand River Park, Lansing, MI 48917. Enter front gates of Grand River Park and turn left. Continue straight to the Michigan Princess) between 6p-6:15p, and "cruise" from 6:30p-10:30.  Tickets will cover the cost of the cruise, Hors d''oeuvres, the DJ, & professional photographer.  A cash bar will also be available.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31751829%2F13438971871%2F1%2Foriginal.jpg?s=e5813aff9944cd1bab4d582456740c11', 'https://www.eventbrite.com/e/sexton-class-of-1987-30th-reunion-tickets-34872528672?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1501182000', '1501365600', 0, 0, 0, NULL, 1),
