(462, 'live', '31727239026', 13, 0, 2, 'Networking the new school way - Free Linkedin Masterclass', 'Learn How To Use Linkedin To Transform Your Business\nLearn how to build a massive client base spending 15-20 minutes a day on Linkedin, even if you''ve never used Linkedin before and don''t have an advertising budget.\nReserve Your Seat For The FREE Linkedin Marketing Training here\nLinkedin Is A Goldmine Filled With Business Opportunities\nLinkedin is a Gold Mine of great business. You have the ability to quickly connect with real decision makers. There are over 400,000 Million users on Linkedin and it''s growing everyday.\nLinkedin is where you go to do business. However, most people treat it like a resume or a business Facebook. Learn how to leverage Linkedin to get a massive client base of THE RIGHT CLIENTS with this training. This is business networking done the right way.\nLinkedin Marketing Training Event\nCome to my Linkedin Marketing training/webinar and I''ll show you step by step how to use Linkedin to grow your business.\nConnect With:\n\nClients\nReferral Partners\nPress Connections\nInvestors\n\nOkay, Okay, Reserve My Seat For The FREE Linkedin Marketing Training\nI look forward to seeing you at the training!\n- Tim Dodd\nCEO & Co Founder\nTEV Marketing\nGreat Build a great network for your business using Linkedin for your networking!\nRESERVE YOUR SEAT HERE\n ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F27959703%2F198962458821%2F1%2Foriginal.jpg?s=8b8e473deeb5752a4d4799db67a41691', 'https://www.eventbrite.com/e/networking-the-new-school-way-free-linkedin-masterclass-tickets-31727239026?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1495792800', '1495841400', 0, 0, 0, NULL, 1),
(463, 'live', '32771589707', 13, 0, 2, 'LEARN WITH OUR TEAM - MAKE 6-FIGURES YOUR FIRST YEAR', 'Interested in getting one step closer to financial freedom? Making more time for yourself and your loved ones?\nJoin us as we invite you to a 15-minute recorded real estate income opportunity webinar. Let us empower you to make moves towards financial freedom and living life on your own terms.\nTOPICS:\n\npaying off a mortgage in as little as 7 years\nfixing and flipping properties\ngetting 10-15% return on investments\npaying 2/3 less in taxes!\nreducing risk and learning multiple exit strategies\nmanaging property the right way\nraising capital without using your own money\nSO MUCH MORE!\n\nWhether you are new to real estate investing or a seasoned investor, there is always something to be learned!\nThis is a complimentary event. Once registered, our team will send you an email with further instructions for viewing the webinar. Thank you for your interest! Connect with us on social media! @MakeMovesCorp\nDISCLAIMER: U.S. participants only. We will not share your information with anyone or any 3rd party organization. The information provided is strictly for registration purposes.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29208156%2F199761449880%2F1%2Foriginal.jpg?s=1c4cfa4690bab09cc2fe0f917daa3723', 'https://www.eventbrite.com/e/learn-with-our-team-make-6-figures-your-first-year-tickets-32771589707?aff=ebapi', 'Instructions Emailed After Registration, Lansing, MI', 42.732535, -84.55553470000001, 'Instructions Emailed After Registration, Lansing, MI', NULL, NULL, '1495843200', '1495927800', 0, 0, 0, NULL, 1),
