(503, 'live', '33990235710', NULL, 0, 2, 'Fashion 411: Khanh Nguyen, Nha Khanh', 'Nha Khanhâ€™s designs focus on modernÂ glamour; theyâ€™re inspired by art, architecture and, most importantly, nature. The designs are ethereal, meticulously constructed, and host an ease about them that allows for an effortless sensibility. The company offers seasonal â€œadvanced contemporaryâ€ Ready-to-Wear, a custom Atelier collection (which hosts one-of-a-kind custom pieces) and a bridal line.\nThe Nha Khanh mission is to empower women with inner-strength through their clothing while focusing on â€œfeminine elegance with a modern edge.â€ â€œNhaâ€, in Vietnamese, is a feminine word implying â€˜light and eleganceâ€™, whereas â€œKhanhâ€ is a masculine word, meaning â€˜victory and celebrationâ€™. The fusion of the words creates a balance ofÂ unisonÂ between feminine and masculine. The collection joins lightness and softness of silhouette and fabrication with the celebration of construction and classic forms. This is the fundamental philosophy and creative driving force behind the Nha Khanh label.\nKhanh Nguyen, the Creative Director and Designer of the Nha Khanh label, has been surrounded by fashion and art throughout her life. Khanh attended the University of North Texas and obtained a bachelorâ€™s degree in Fine Arts in Fashion Design. In 2010, the Nha Khanh label was established producing seasonal Ready-to-Wear lines, as well as, custom Atelier service to the public. Designs and manufacturing are 100% based in Dallas, Texas, while the sales,Â marketing, andÂ PR are based in New York City. The company takes pride in exceptionally well-made garments and strives to push the envelope on innovation,Â creative, and elegant designs.\nAbout Fashion 411\nThe Fashion 411 speaker series is designed to highlight individuals sharing their stories of success as well as their failures. Learning from others is critical to the success of budding entrepreneurs and this series is designed to motivate, inspire, and teach start-ups in the fashion industry and beyond.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31897625%2F139326116291%2F1%2Foriginal.jpg?s=2d641f81fc5ba48b2eb08bc29e26fae4', 'https://www.eventbrite.com/e/fashion-411-khanh-nguyen-nha-khanh-tickets-33990235710?aff=ebapi', 'Suite 100, Lansing, MI 48933', 42.730933, -84.55291799999998, 'Suite 100, Lansing, MI 48933', NULL, NULL, '1500571800', '1500577200', 0, 0, 0, NULL, 1),
(504, 'live', '33164135823', NULL, 0, 2, 'MAPI Level 2 AI Workshop', 'In December 2016, MAPI in cooperation with MDARD and the University of Minnesota, held a HPAI Training Exercise for producers. Â The training was so well-received that we are building on that foundation and hosting a Level 2 HPAI Training for Michigan poultry producers. Â Dr. Carol Cardona with the University of Minnesota will be joining us again to address many questions and topics that arose from the December training. Â This workshop will also include presentations from DCPAH on lab procedures, media training for farmers, insuring against a disease disaster, and review of the upcoming NPIP Biosecurity Plan audits. Â The training is FREE and lunch is provided. Â Whether you attended the Level 1 Training or not - you are strongly encouraged to join us on June 29 in Lansing for this very important workshop!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31932674%2F189693824386%2F1%2Foriginal.jpg?s=80a069f338f1facb3e75cd52620a285c', 'https://www.eventbrite.com/e/mapi-level-2-ai-workshop-tickets-33164135823?aff=ebapi', '4125 Beaumont Road, Lansing, MI 48910', 42.7022917, -84.4738031, '4125 Beaumont Road, Lansing, MI 48910', NULL, NULL, '1498728600', '1498753800', 0, 0, 0, NULL, 1),
