(510, 'live', '35022821201', NULL, 0, 2, 'AFP Foundation MI: Insight to Action Forum - Countering False Narratives of the Left - Lansing', 'You have been invited to join the MI chapter of the Americans for Prosperity Foundation for an exciting training event developed by the Grassroots Leadership Academy.Â Â \r\nâ€œCountering the False Narratives of the Leftâ€\r\nParticipants will understand how narratives are created, how narratives affect public policy, and how we can frame our issues and policy ideas to counter the opposition.Â \r\nBy attending this Americans for Prosperity Foundation event, you irrevocably consent and authorize AFP Foundation and its affiliates, related companies, and contractors, to record, film, photograph, or capture during the event and related events your likeness or image in any media whatsoever and to distribute, use, broadcast, or disseminate into perpetuity such media for any purpose whatsoever without any further approval from or any payment to you. Â The images in all media will constitute AFP Foundation sole property. By filling out this registration form, you confirm that you are at least 18 years of age.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30837691%2F2404788504%2F2%2Foriginal.jpg?s=62efe5f85993616f84e85af639cc9bc3', 'https://www.eventbrite.com/e/afp-foundation-mi-insight-to-action-forum-countering-false-narratives-of-the-left-lansing-tickets-35022821201?aff=ebapi', 'Lansing, MI 48933', 42.7371075, -84.5562878, 'Lansing, MI 48933', NULL, NULL, '1498672800', '1498680000', 0, 0, 0, NULL, 1),
(511, 'live', '35052542097', NULL, 0, 2, 'Rise Up Premier Event', 'The drug epidemic is currently sweeping across the Nation and many are left broken without a plan or a roadmap. Sexual abuse is invading our homes and families. Despair, grief and loss permeates our workplace and communities. Rise Up is hosting a line-up of talented speakers who share their stories of victory over adveristy and the enemy. You will leave with a new found awareness, hope and belief in yourself and your community.Â \n\n\nSenator Rick Jones\nState Senator Rick Jones was first elected to the Michigan Senate in November 2010 to represent the residents of the 24th District. Â He was re-elected for a second term in November 2014.\nEDUCATION\nJones received a Bachelorâ€™s Degree from Michigan State University and Executive Leadership Training from Central Michigan University. He received further training from the F.B.I. (Executive Leadership Training), the U.S. Department of Treasury (Crisis Management Training), and the U.S. Department of Justice (Correctional Leadership Training).\nPROFESSIONAL\nRick Jones was elected by his Senate colleagues as Assistant Majority Caucus Chair. He serves as chair of the Senate Judiciary Committee, vice-chair of the Senateâ€™s Regulatory Reform committee, and as a member of theÂ Families, Seniors, and Human Services,Â Health Policy, andÂ Insurance Committees.\nJones began service in the Legislature after being elected in 2004 to the Michigan House of Representatives in 2004 representing residents of Eaton County in the 71st District. He was reelected in 2006 and 2008. While in the House, Jones served on the Houseâ€™s Judiciary and Regulatory Reform committees and as minority vice-chair of the House Military and Veterans Affairs and Homeland Security Committee.\nPrior to his election to the House, Jones worked 33 years in law enforcement, serving more than 30 years with the Eaton County Sheriff Department. He started as a deputy and worked his way up through the ranks as sergeant, lieutenant, and captain before being elected sheriff in 2000.\nCOMMUNITY SERVICE AND AFFILIATIONS\nJones is the Vice President of the Eaton Community Hospice Board, a member of the Michigan Special Olympics Board, and has served on the Durand Union Station Railroad Board. He delivered Meals-On-Wheels to shut-ins for 10 years, and volunteers with Area 8 Special Olympics. He is a 22-gallon donor with the Red Cross.\nHe is a member of Grand Ledge Rotary, American Legion S.A.L Post 42, and Eaton County Farm Bureau. Jones has also been an active participant in charity events: Crop Walk, Relay for Life, and Walk for Warmth.\nSPECIAL AWARDS\nRick Jones has been awarded the Service to Children Award from the Eaton County Child Abuse and Neglect Prevention Council, the â€œVery Involved Personâ€ Award from the Greater Lansing 100 Club for volunteer work, as well as appreciation awards from the Dimondale Lions, the Olivet Rotary, and the American Legion. He received the Charlotte Community Excellence Award for volunteer work from the Charlotte Chamber of Commerce and was awarded Eaton County Sheriffâ€™s Award for Bravery.\nJones was also named the Â 2016 â€œLegislator of the Yearâ€ by the Michigan Dental Association, the 2015 â€œLegislator of the Yearâ€ by both the Michigan Probate Judges Association and the Michigan Optometric Association, the 2013 and 2015 Michigan Association of Chiefs of Police â€œLegislator ofÂ the Year,â€ and theÂ 2012 Michigan Drug Court Professionals â€œLegislator of the Yearâ€.\nPERSONAL\nRick has been married for 43 years to Charlene. They have two children, Kate and Charlie, and threeÂ grandchildren. They live in Grand Ledge, where they are active members of the Grand Ledge First United Methodist Church.\n\n\nJill Hunter grew up in Franklin Village, Michigan.Â  She is married to a wonderfully supportive husband, Terry and is the proud mom of two children, Matthew and Casey.Â  Jill is the co-founder of the Lakes Area Safe Harbor, a resource center for families affected by addiction.Â  She sits on the board of Lakes Area Youth Assistance and is actively involved in jail and youth recovery ministry.Â  Her team was responsible for bringing drug education and awareness to the schools in Walled Lake.Â  She has partnered with Michael DeLeon and the Steered Straight program to reach youth throughout Michigan.Â  The personal story of addiction in her family drives her to devote her time to advocate and share about this real-life epidemic happening throughout the United States.Â \n\nJoshua DeLong is a powerful motivational speaker, author, and activist for drug resistance, awareness and recovery. He is actively engaged in many Humanitarian efforts including the Joshua Place in his hometown Eaton Rapids, MI an outreach center for those who suffer from addictions and the families who dare to love them. He has 3 kids Jaycob, Christian and Noah who he loves dearly. His purpose and mission in life is to lead a life that influences people to follow Christ. He passionately hammers into peopleâ€™s minds and hearts that there is hope, there is freedom and there is redemption! Redemption is near! Rise Up!\n\n\n\n\n\n\nLaura DeLong has been married to Mike for 25 years, they have 2 boys, Joshua 32 and Kyle 24, & 3 amazing grandchildren. Laura is the mother to a recovering addict with a compelling story of her own difficult past. Her mission in life is to have people walk away from her feeling better than they did before they met her. Raised in Eaton Rapids, Laura is still actively involved in her home town community and it is her desire to make the world a better place, starting at home.\n\n\n\n\n\n\nMorgan Kelsey grew up in Eaton Rapids, Michigan. Morgan has always felt a spiritual call to service and healing, and has now opened her heart fully to that calling. Seven months ago Morgan felt guided to give up alcohol. Since releasing that dependency, she is in awe of the ways that her life has changed. Morgan owns a small business in Traverse City called Invoke, and lives with her husband and daughter.\n\n\nWyatt Howard is 22 years old. Raised by Penny and Randy Howard. Graduated from Eaton Rapids High School. Received a football scholarship to Concordia University in Ann Arbor. Studied at Concordia University and Lansing Community College. Now an entrepreneur and has a Job in \n\n\nAngela Glossop was born October 26 th 1982 with Cerebral Palsy. Even though she did not start walkingÂ until the age of 5, Angela has always lived her life to the fullest. She graduated from Eaton Rapids Highschool in 2001. After school, she has gone on to volunteer at the area 8 special Olympics, the MSUdepartment of Kineseology, various missions at Grace United Methodist church, and helping elders atMisty Cove Retirement home.\n\n\nScarlett Foote Sybrowsky is a native of Lansing, MI collecting her education in Lansing, East Lansing and Boston, MA. Scarlett deserves much credit for raising two accomplished and beautiful daughters who have blessed her with 7 grandchildren. Â \nFamily is a priority to Scarlett as she recognizes the family unit as the fundamental building block of society. Although she enjoyed a successful career as a business woman in the banking and finance industry, primarily in sales and marketing, and enjoyed the benefits of stepping away from corporate America to chase her entrepreneurial dreams â€“ Scarlett will be the first to tell you her family is her greatest success and blessing. Now she focuses most of her time helping her husband and playing an active role in influencing and educating her grandchildren. She has been married 27 years.\nBeing no stranger to adversity, Scarlett learned to effectively navigate through the challenges and pitfalls of being raised in an alcoholic home and later successfully pressing forward through years as a single mother. Faith has played an important part in Scarlettâ€™s life as a foundation and source of strength in enduring and overcoming. Scarlett has led faith based childrenâ€™s, young womenâ€™s and womenâ€™s groups at local and regional levels as an inspirational example, leader and mentor helping many to believe in themselves and realize their dreams.\nÂ \n\n\n\n\n\nMichael Liebermann was born and raised in Phoenix, Arizona! He was raised by a loving family and has 2 brothers and an amazing sister. Michael speaks passionately about overcoming adversity and victory over the enemy. He will testify that there is hope to be found even in your darkest hours. His story is one of finding gratitude, purpose, and faith even in the midst of lifes storms. Michael has chartered and chairs a local 12 step meeting of Alcoholics Anonymous and volunteers for the Joshua Project in his hometown of Eaton Rapids, MI.\n\nTifany Miller was born in Eaton Rapids, Michigan and attended school in ER until dropping out at the end of 9th grade to have her twin boys. In 1988 she met the love of her life Greg and has been married for 28 years. Together they raised three son''s have been blessed with six grandchildren and three daughters in law. Tifany has worked at the Ingham County Youth Detention Facility in Lansing, Michigan for over 17 years as the Head Cook/Food Service Director. Together with her family, friends and the grace of God has overcome much adversity and challenges in her life. She tells her life story to some of the kids at her work in hopes they see that you can rise above life''s challenges.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32143168%2F16278748123%2F1%2Foriginal.jpg?s=43136f8afde9b1e4d0eb2980d379334c', 'https://www.eventbrite.com/e/rise-up-premier-event-tickets-35052542097?aff=ebapi', '219 S Harrison Rd, East Lansing, MI 48823', 42.7317521, -84.49365799999998, '219 S Harrison Rd, East Lansing, MI 48823', NULL, NULL, '1497729600', '1497742200', 0, 0, 0, NULL, 1),
