(527, 'live', '34936221178', NULL, 0, 2, '13th Community Screening at Cristo Rey Parish Church', 'ACTION of Greater Lansing, Cristo Rey Church and ACLU-Lansing Branch partner to bring a community screening of 13th, a compelling 2016 American documentary by director Ava DuVernay. Centered on race in the United States criminal justice system, the film is titled after the Thirteenth Amendment to the United States Constitution, which outlawed slavery (unless as punishment for a crime). DuVernayâ€™s documentary argues that slavery is being effectively perpetuated through mass incarceration.  The progression from that second qualifying clause to the horrors of mass criminalization and the sprawling American prison industry is laid out by DuVernay with bracing lucidity. With a potent mixture of archival footage and testimony from a dazzling array of activists, politicians, historians, and formerly incarcerated women and men, DuVernay creates a work of grand historical synthesis which has already garnered critical acclaim.  Conversation and action group formation follow the screening.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31839930%2F204739079076%2F1%2Foriginal.jpg?s=57be7571c91d087576eef669e09c9b9e', 'https://www.eventbrite.com/e/13th-community-screening-at-cristo-rey-parish-church-tickets-34936221178?aff=ebapi', '201 West Miller Road, Lansing, MI 48911', 42.66888359999999, -84.55505970000002, '201 West Miller Road, Lansing, MI 48911', NULL, NULL, '1498762800', '1498770000', 0, 0, 0, NULL, 1),
