(534, 'live', '35027632592', NULL, 0, 2, 'How To Use Facebook For Marketing A-Z', 'How To Use Facebook For Marketing A to Z - Live Streaming Presentation!\nIf you havenâ€™t attended one of our online sessions prepare to have your mind blown! We''ll be teaching you everything you need to know when it comes to Facebook Marketing from getting started to more advanced techniques. Once you understand the fundamentals you can dominate you can dominate Facebook marketing and impelent tools to help you grow efficiently. The best part is, anyone can do it!\n\nSome things we''ll be reviewing in this course.\n\nSetting Up Facebook Personal Pages and Optimizing Properly\nGrowing A Personal Page for Marketing And Growing A Business\nDeveloping A Facebook Fan Page\nOptimizing And Growing Facebook Fan Pages\nContent That Works On Facebook Pages\nGrowing Your Engagement, Likes and Shares on Facebook Pages\nStarting Facebook Groups\nDeveloping Communities With Facebook Groups\nInspiring Users to Generate Content For You\nManaging A Content Calendar and Getting The Most From A Group\nComplete Facebook Growth Marketing Strategy\nTools Used For Facebook Growth and Effeciency\nPosting Strategy And Post Follow Up\nOrganic Growth and Not Spending Money\n\n\nOnce you learn these fundamentals you''ll be able to leverage Facebook for personal use, company use branding etc. You can apply the same ideas to almost any other social media platform. Our presentation is open to questions both during and after. You can ask questions and comment live. We make this class interactive so we can address the needs of our audience members.\nOur presentation is open to questions both during and after. You can ask questions and comment live. We make this class interactive so we can address the needs of our audience members.\n\n\nOur sessions are led by\n\nQuintin Ford\nQuintin has an extensive background in SEO, Social Media, and Growth Hacking. Since 2008, Quintin has been using his social media to drive sales both in person and online. He has built many successful social media accounts, websites and traffic generating systems that have contributed to his success in multiple industries. Quintin is currently the Founder of knw media, Social Media University, Wild and West Marketing and focused on bringing the Los Angeles startup community together through fun and productive events focused on business growth.\n\nAbraham Gomez\nAbraham Gomez is an extremely knowledgeable and successful social media marketing professional primarily focused on Facebook and Instagram growth.Â Abraham is currently the owner of multiple Facebook pages reaching over 100 million people every week. Additionally, he has grown several viral websites reaching millions of active users. He is the creator of a top 1000 website and has gained over 1 million email subscribers.Â Abraham is currently a partner at Wild and West Marketing in Playa Vista, CA and founder of Lotus Gaming.\n\nDerek Fujinaga\nDerekâ€™s background consists of social media growth, building businesses, and management. Heâ€™s participated in multiple startups over the last 6 years, including agencies, restaurants, service companies, and a brewery. When starting out, he found his love for entrepreneurship by leading young entrepreneurs in developing and creating their own startups in college. He is passionate about working with non-profits and managing their online growth.\n\nAngel Davalos\nAngel has an extensive knowledge of social media growth and advertising. He is currently the advertising director for both Wild and West Marketing and Lotus Gaming.Â Over the years he has managed ads for celebrities, ecomm sites, non-profits, and startups. He is passionate about positive growth and reaches over 500,000,000 people a month.\n\n\n\nHow our sessions work.\nWe host these live online classes out of our office in Playa Vista, CA. Guests tune in online to watch the live presentation. During the presentation, we set up a question and answer platform where participants can submit questions and have them answered.Â You''ll be sent the live streaming link 30 minutes before our presentation goes live. The email will be labeled LIVE STREAMING SOCIAL MEDIA 101\n\n\nJoin our session now and see what all the hype is about.\n\nTickets are limited!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F31947789%2F212220696346%2F1%2Foriginal.jpg?s=25d02c6462980c02a89378173d101b45', 'https://www.eventbrite.com/e/how-to-use-facebook-for-marketing-a-z-tickets-35027632592?aff=ebapi', 'East Lansing, MI', 42.7369792, -84.48386540000001, 'East Lansing, MI', NULL, NULL, '1498744800', '1498748400', 0, 0, 0, NULL, 1),
