(554, 'live', '35217534594', NULL, 0, 2, 'Digital Marketing Course: Instagram 101', 'Digital Marketing Course: Instagram 101 Live Streaming Presentation!\n\nIf you havenâ€™t attended one of our online sessions prepare to have your mind blown! We''ll be teaching you everything you need to know when it comes to growing a successful Instagram account, the right way. The best part is, anyone can do it!\n\n\nWhat you''ll learn in this course\n\nEquipping yourself with 2017 knowledge\nGrowing a massive following\nDetermining how Instagram can help your business\nInstagramâ€™s secret account health rating\nPrerequisite and Authentically engaging with others\nContent is king\nCreating and curating content\nStrategies to grow viral accounts\nUnderstanding algorithms\nAutomation method Targetted F/UF Auto-liking/commenting\nPower linking method. What is it and why does it work?Â \nTelegram groups/rounds\nOur Personal suggestions\n\n\nOnce you learn these methods you will be able to quickly grow an Instagram account for business or personal use. Many of our students are now running successful Instagram accounts with hundreds of thousands of followers.\n\n\nOur sessions are led by\n\nQuintin Ford\nQuintin has an extensive background in SEO, Social Media, and Growth Hacking. Since 2008, Quintin has been using his social media to drive sales both in person and online. He has built many successful social media accounts, websites and traffic generating systems that have contributed to his success in multiple industries. Quintin is currently the Founder of Wild and West Marketing and focused on bringing the Los Angeles startup community together through fun and productive events focused on business growth.\n\nAbraham Gomez\nAbraham Gomez is an extremely knowledgeable and successful social media marketing professional primarily focused on Facebook and Instagram growth.Â Abraham is currently the owner of multiple Facebook pages reaching over 100 million people every week. Additionally, he has grown several viral websites reaching millions of active users. He is the creator of a top 1000 website and has gained over 1 million email subscribers.Â Abraham is currently a partner at Wild and West in Playa Vista, CA and founder of Lotus Gaming.\n\nDerek Fujinaga\nDerekâ€™s background consists of social media growth, building businesses, and management. Heâ€™s participated in multiple startups over the last 6 years, including agencies, restaurants, service companies, and a brewery. When starting out, he found his love for entrepreneurship by leading young entrepreneurs in developing and creating their own startups in college. He is passionate about working with non-profits and managing their online growth.\n\nAngel Davalos\nAngel has an extensive knowledge of social media growth and advertising. He is currently the advertising director for both Fishermen Labs and Lotus Gaming.Â Over the years he has managed ads for celebrities, ecomm sites, non-profits, and startups. He is passionate about positive growth and reaches over 500,000,000 people a month.\n\n\n\nHow our sessions work.\nWe host these live online classes out of our office in Playa Vista, CA. Guests tune in online to watch the live presentation. During the presentation, we set up a question and answer platform where participants can submit questions and have them answered.Â You''ll be sent the live streaming link 30 minutes before our presentation goes live. The email will be labeled LIVE STREAMING INSTAGRAM 101\n\n\nJoin our session now and see what all the hype is about.\n\nTickets are limited!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32107384%2F212220623842%2F1%2Foriginal.jpg?s=20d186c46b47946e6381e3a4fb241ece', 'https://www.eventbrite.com/e/digital-marketing-course-instagram-101-tickets-35217534594?aff=ebapi', 'East Lansing, MI', 42.7369792, -84.48386540000001, 'East Lansing, MI', NULL, NULL, '1499954400', '1499958000', 0, 0, 0, NULL, 1),
