(574, 'live', '35383388668', NULL, 0, 2, 'II: Grit, Glam, & Guts- InsideOut: Matters of the Heart', 'The Grit, Glam, & Guts Teen Conference is excited to embark upon itâ€™s 5th consecutive year of strengthening and equipping hundreds of young women from all across the state of Michigan ! The all girl free TEEN (ages 12-17) conference will kick off its state summer tour Saturday June 17, 2017. Itâ€™s a one-day FREE conference thatâ€™s dedicated to strengthening and equipping young women to overcome the challenges of the 21st woman and connect teens to existing resources during the summer months. \n\nIn conjunction with Michigan State Universityâ€™s Residential College of Arts & Science, and One Love Global, Grit, Glam, Guts conference has the goal of helping teen girls develop a positive self-image and establish unity and sisterhood among the next generation of women. This yearâ€™s conference tackles the internal social and emotional issues of identity, societal pressures, and lays of solid foundation of why sisterhood is essential to the success of individuals, families, and communities. \n\nThe statewide kick off conference will host girls from all over the state from Flint, Detroit, Grand Rapids & Lansing. Speakers will conduct lively and engaging breakout sessions. This kick off is beginning to more events in Flint, Detroit, & Lansing in the summer months. \n\nÂ Grit, Glam, & Guts invites you to be a part of its 2017 â€œInsideOut: Matters of the Heartâ€ Conference.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32341419%2F86108530727%2F1%2Foriginal.jpg?s=b569f34bca279fc831b6c0ac79a97d84', 'https://www.eventbrite.com/e/ii-grit-glam-guts-insideout-matters-of-the-heart-tickets-35383388668?aff=ebapi', '362 Bogue St, East Lansing, MI 48825', 42.72993899999999, -84.47306200000003, '362 Bogue St, East Lansing, MI 48825', NULL, NULL, '1497688200', '1497709800', 0, 0, 0, NULL, 1),
