(583, 'live', '35420129561', NULL, 0, 2, 'Coordinating the Care Coordinators Workshop #3', 'The third working meeting will build upon the work product from the first two workshops and conference calls. This will include discussing the technological and legal components of care coordination,Â the progress of the white paper, and an inventory of relevant activities from around the state.\r\nÂ This workshop and conference call series will convene a broad community of multi-stakeholder constituents to frame a statewide approach to making care coordination more transparent. Right now, fragmentation and silos inhibit optimal care coordination throughout Michigan. This work seeks to help care teams know who is working with their patients, communicate with them, and reduce unnecessary provider burdens by avoiding duplication. Â \r\n\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32394201%2F137038342194%2F1%2Foriginal.jpg?s=8349550dd1824f838b6c330340f4c210', 'https://www.eventbrite.com/e/coordinating-the-care-coordinators-workshop-3-tickets-35420129561?aff=ebapi', '1115 South Washington Avenue, Lansing, MI 48910', 42.72133189999999, -84.551893, '1115 South Washington Avenue, Lansing, MI 48910', NULL, NULL, '1498728600', '1498836600', 0, 0, 0, NULL, 1),
