(591, 'live', '35409936072', NULL, 0, 2, 'Baseball & Softball Hitting Clinic - Lansing, MI', 'The All-New Coach Lisle Hitting Boot Camp Experience! This clinic isÂ designed for both Baseball & Softball hitters age 7-22 who want to get the best hitting instruction in the country from Coach Lisle the internets most followed and respected hitting instructor with over 400,000 followers online. \r\nCoach Lisle has developed a new 90 min clinic experience for hitters that includes a comprehensive program that not only includes swing mechanics and elite swing patterns teaches swing movements that will help increase bat speed, exit speed contact and more power! \r\nEach hitter will leave with my Hitters Handbook that will help guide them on their journey to an elite swing and give them a tool box filled with ways to increase things like bat speed, exit speed and more.\r\n\r\nHitters are placed into age/gender/ability appropriate groups at time of clinic. (to the best of our ability)\r\nSample Itinerary\r\n4:45 - 5:00: Check-in for session 1 (ages 7-11)\r\n5:00 - 6:30:Â  Session 1 (ages 7-11)\r\n6:30 - 7:00:Â  Record video analysis for session 1 (optional)\r\n7:00 - 7:15:Â  Break\r\n7:15 - 7:30:Â  Check-in session 2 (ages 12-22)\r\n7:30 - 9:00:Â  Session 2 (ages 12-22)\r\n9:00 - 9:30:Â  Record video analysis for session 2 (optional)\r\nÂ \r\nTopics & Stations Include\r\nÂ \r\n- Advanced Swing Mechanics and Elite Movement Patterns\r\n- Drills from Coach Lisle''s Excluvise SwingBuild Program\r\n- Building & Developing Bat Speed, Hand Speed and Exit Speed\r\n- Advanced Hitting Drills & Movements\r\n- Vision Training\r\n- Approach, Routine, Timing & The Batters Box Battle Mindset\r\nÂ \r\nCANCELLATION POLICY\r\nThere is a NO REFUND policy. If life happens and you will not be able to attend the event, you will needÂ to transfer your clinic credit to another player or you will lose your purchase.Â \r\n\r\n\r\n\r\n\r\nPlease let meÂ know if you transfer your ticket to another person so I can update their registration.\r\n\r\n\r\n\r\n\r\nCOACHES VIP BACKSTAGE PASS\r\nLimited to ONLY 10. The Coaches VIP Pass allows youth, travel ball, high school and college coaches backstage access to the clinic. They will get to arrive early and stay late and get to learn how to implement Coach Lisle''s SwingBuild Program with their own athletes.\r\nÂ \r\n\r\nTO LEARN MORE ABOUT COACH LISLE HITTING\r\nÂ \r\n\r\n\r\nTESTIMONIALS\r\nÂ \r\nâ€œCoach Matt Lisle breaks down the swing in a simple way.Â  This is great for all hitters that are learning the proper mechanics and fundamentals of how the body works.Â  His experience as a hitting coach is beneficial for all hitters of all ages.â€MIKE WHITEHead Softball Coach, University of Oregonâ€œI had the opportunity to meet Coach Lisle last fall and loved what he had to say about the swing and creating body awareness.Â  He does a fantastic job of articulating such a complex movement by using efficient terminology and tactical queues. Coach Lisle is definitely leading the charge in the hitting evolution.â€ Â KEITH BEAUREGARDAssistant Baseball Coach, D1 Santa Clara Universityâ€œCoach Lisleâ€™s hitting knowledge was displayed last season with the Menlo College Oaks total of 49 home runs, almost nearly double of their opponents. He has the ability to teach his hitters to hit gap to gap and for power.â€ MARIE THOMASON Head Softball Coach - Embry-Riddle University â€œI think Matt Lisle is one of the top hitting coaches in our game today. I look forward to implementing his drillsÂ  into our program on a daily basis.â€ KEVIN BLASKOWSKIHead Softball Coach, 2 Time National Champion, West Texas A&M\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32380160%2F108768228001%2F1%2Foriginal.jpg?s=be2b43d874160eca0acd4d5109247751', 'https://www.eventbrite.com/e/baseball-softball-hitting-clinic-lansing-mi-tickets-35409936072?aff=ebapi', '5910 Enterprise Dr, Lansing, MI 48911', 42.6717448, -84.52625469999998, '5910 Enterprise Dr, Lansing, MI 48911', NULL, NULL, '1504112400', '1504128600', 0, 0, 0, NULL, 0),
