(599, 'live', '35436771337', NULL, 0, 2, 'The Business Case for Diversity & Inclusion in the Workplace', 'Join theÂ Central Michigan Public Relations Society of America (CMPRSA) Inclusion, Diversity, Ethics & Advocacy (IDEA) Committee onÂ July 12, 2017Â fromÂ noon to 1:15 p.m., to hear fromÂ Tedi R. Parsons,Â President of The Professionals Forum. Tedi will discuss the importance and benefits of having a diverse and inclusive workplace. Register today and come ready to share yourÂ barriersÂ andÂ frustrationsÂ as it relates to diversity and inclusion in the workplace.\nAbout the Speaker:\nTedi R. ParsonsÂ is President of The Professionals Forum.Â TediÂ created The Professionals Forum (TPF) in 2011 with aÂ Mission to Help Todayâ€™s Professionals BecomeÂ Tomorrowâ€™sÂ World-Leaders.Â TediÂ hasÂ over 20-years of professional experience in human resources, operations and top level executive support, including holding positions as Vice-President of Operations & Human Resources, Sr. Executive Assistant, Facilities/Operations Manager, and Executive Administrator.Â \nTedi received his certification in Purchasing & Procurement after attending the University of Wisconsin â€“ Madison, School of Business.Â  Additionally, he holds designations as a Certified Career Coach (CCC), Certified Executive Coach (CEC) and Certified Professional Coach (CPC), including certifications in facilities management, ergonomics and human resources.Â Currently, Tedi isÂ enrolled in the prestigious Diversity Executive Leadership Academy (DTUI), working towards receiving his Certified Diversity Executive (CDE) certification.Â \nAlong with being President of the Professionals Forum, TediÂ serves as Director for the Lansing Economic Area Partnership''sÂ diversity initiative: Diversity Lansing. To date, over 1,350 individuals have takenpart in professional diversity education and training throughout the Lansing region.Â \nAs a CCC, Tedi providesÂ his services to non-profits in both Lansing and West Michigan by creating specialized career service programs on a pro-bono basis.Â  A believer in serving his community, Tedi provides assistance and direction for several community projects and nonprofits throughout the region, including serving as a Certified Tourist Ambassador (CTA) for the Greater Lansing CVB.\n\n\n\nLuncheon Sponsor:\n\nThe CMPRSAÂ IDEA Committee is the July luncheon sponsor.Â The CMPRSA IDEA Committee aimsÂ to educate members and industry professionals onÂ diversity and ethics issues inÂ the field of public relations. If you''re interested in joining or have suggestions for the IDEA committee contact Camara Lewis atÂ CMPRSA-IDEA@gmail.com.\n\nVenueÂ Sponsor:\nThank you to our event venue sponsor, Martin Waymire.Â Martin Waymire is one of Michigan''s top public relations firms, specializing in strategic communications, digital marketing and issue advocacy. Learn more atÂ www.MartinWaymire.com\n\nNot a Member?\nThe Central Michigan chapter offers exciting opportunities for networking and professional development to public relations professionals in the greater Lansing area. With a membership of more than 150 area communicators, CMPRSA meetings are a place to always meet someone new, but establish valuable connections over time as well. A diverse membership of young and seasoned professionals, a stimulating mix of programs and opportunities for involvement make CMPRSA the ideal organization to invest your time and resources. Learn more.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32417552%2F35996804046%2F1%2Foriginal.jpg?s=6bcd0d6a5f9ddd2b9ead9f7a84ec900e', 'https://www.eventbrite.com/e/the-business-case-for-diversity-inclusion-in-the-workplace-tickets-35436771337?aff=ebapi', '3435 Forest Road, Lansing, MI 48910', 42.70511700000001, -84.50247000000002, '3435 Forest Road, Lansing, MI 48910', NULL, NULL, '1499860800', '1499865300', 0, 0, 0, NULL, 1),
