(632, 'live', '35580689801', NULL, 0, 2, 'Lansing Prerequisite Course for Data Science Bootcamp (Python, Probability, Statistics)', 'Course Overview\nThis is a prerequisite course for the Data Science class. In this prerequisite course, students will learn Python, probability and statistics concepts which will be required before you take the Data Science class. You need to know these concepts if you want to learn data science.\n\nVideo Conference details\nWill be sent upon Registration and Payment\n\nWhat is a Prerequisite?\nPrerequisite is a course that must be completed (often with a certain minimum grade) or a skill that must be demonstrated before you can enroll in a more advanced course.\n\nWhat course(s) can i take after completing this Prerequisite course?\nYou can take the Data Science BootcampÂ after completing this course.\n\nPrerequisite Course + Data Science Bootcamp\nYou can take both courses for $800Â \n\nWho can take this course?\nAnyone who wants to know more about data science so it can help with their current job, or those who want to build a career in Data Science or Â become a Data Scientist.\n\nWhy Data Science Prerequisites Training from Omni212?\n1. Omni212 has a Data Science consulting practice2. Our Instructor has a Ph.D. in Data Science3. Upon Registration and payment, immediate access to the course material on the cloud is provided. 4. Class recordings for this class will be made available. 5. Post class support6. Course material available. 7. Every topic includes slides, code example, video and home assignments8. Career advancement and Job placement assistance\n\nTraining Session Details\nThere will be 8 online sessions, each session being 2 hours. Every session will have presentation about theory, concepts and technology, followed by Hands-on Lab practice exercises.\n\nTraining Dates\nJuly 6,10,13,17,20,24,27,31\nTimes: Mon, Thu 6:30 PM - 8:30 PMÂ (Pacific Standard Time)\nEach session will be recorded and the recordings will be shared after each session with studentsÂ \n\nPrerequisite\nNone\n\nSoftware access\nProper software access will be provided. Students will carry out the hands-on lab exercises with instructor guidance.\n\nCourse Outline\nPython, probability and statistics concepts:\n1. Overview, Environment Setup/Test and Basic Syntax.\n2. Variable Types, Basic Operators, Decision Making and Loops.\n3. Lists, Tuples, Dictionary and Files I/O.\n4. Functions, Modules, Classes and Exceptions Handling.\n5. MySQL Database Access and CRUD Operations.\n6. Numerical Descriptive Measures and Basic Probability.\n7. The Normal Distribution and Other Continuous Distributions.\n8. Linear and Non-linear Regression Analysis.\n\nClass Size:Â Maximum 22\n\nPrice:Â $495\n\nREFUND POLICY\n1. There are no refunds.\n2. If for any reason, students decide not to take this class, or the class is rescheduled or cancelled, the payment can be applied towards any future course by Omni212.Â \n\nOmni212 is aÂ GeekwireÂ 200 startup company https://www.geekwire.com/geekwire-200/\n\n\nKeywords: Data Science Lansing, Data Science Training Lansing, Data ScienceÂ bootcamp Lansing,Â Data Science Class Lansing, Data Science Training Lansing,Â Data ScientistÂ course Lansing, Data Scientist Lansing, Data Scientist Training Lansing, Data Scientist Bootcamp Lansing, Data Scientist Class Lansing, Data Scientist Training Lansing, Data Scientist Course Lansing', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32591797%2F59307985005%2F1%2Foriginal.jpg?s=b0443c18944eabc9028722da15baa570', 'https://www.eventbrite.com/e/lansing-prerequisite-course-for-data-science-bootcamp-python-probability-statistics-tickets-35580689801?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1499376600', '1501543800', 0, 0, 0, NULL, 1),
