(641, 'live', '35600891224', NULL, 0, 2, 'Emergency Response Technician Level III Initial Training in Lansing, MI', 'The Emergency Response Technician Level III Initial Training Seminar from Compliance Solutions provides training mandated under OSHA 29 CFR1910.120(q). This course is conducted in conjunction with our 40-Hour HAZWOPER course. Workers attending this instructor-lead course will cover 18 different OSHA suggested topics including Health and Safety Procedures, PPE used during work operations, Medical Monitoring and many others. The course is held over four days, 10-hours each day.\r\nPersonnel who are involved in the cleanup of spills in manufacturing environments as well as those individuals who are responsible for control or containment of hazardous or potentially hazardous materials are required to receive Emergency Response training. This initial training course focuses on the identification and safe handling of hazardous materials. Individuals who are members of a response team should always have site specific training and drills tailored to their specific hazards before attempting cleanup or containment. In order to stay in compliance with OSHA regulations and maintain certification, a refresher course is required to be completed annually.\r\nAct now and get your ticket today. Classes do fill quickly.\r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\nÂ \r\nRegister Early! Pre-registration for all classes is required (no walk-inâ€™s) and classes do fill up quickly.\r\nÂ \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\nÂ \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\nÂ  5 to 9 students= 10% Â Â Â 10 or more = 15%\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32615796%2F51654302652%2F1%2Foriginal.jpg?s=45ebb1f23672518dfa917df706123fea', 'https://www.eventbrite.com/e/emergency-response-technician-level-iii-initial-training-in-lansing-mi-tickets-35600891224?aff=ebapi', '3121 East Grand River Ave, Lansing, MI 48912', 42.742176, -84.50689899999998, '3121 East Grand River Ave, Lansing, MI 48912', NULL, NULL, '1506412800', '1506708000', 0, 0, 0, NULL, 0),
(642, 'live', '35601384700', NULL, 0, 2, 'Emergency Response Technician Level III Annual Refresher Training in Lansing, MI', 'Emergency Responder Technician Level III Annual Refresher Training. According to OSHA regulations, each level of emergency responder must take an 8 hour annual refresher course to stay current on the techniques used in a hazardous materials incident. The 8-hour refresher course helps to meet the requirements of OSHA in an informative and interactive manner. Included in the course are numerous techniques used in keeping the responder safe while containing and mitigating a hazardous materials spill. In order to fully comply with OSHA standards, students must review their company Emergency Response Plan as a part of their annual refresher training.\r\nPREREQUISITES:Â  Emergency Response Technician Level III Training\r\nAct now and buy your ticket today. Classes do fill up quickly.\r\nCompliance Solutions is the largest private provider of HAZWOPER and DOT Hazmat Training nationally and has earned the trust of the industry by providing quality training since 1995.\r\nÂ \r\nRegister Early! Pre-registration for all classes is required (no walk-inâ€™s) and classes do fill up quickly.\r\nÂ \r\nRegistration Note: This event does NOT issue paper tickets. After registration, you will receive an email confirmation from Compliance Solutions that includes the date, time and location of your class. Prior to registering read a copy of our cancellation and refund policy. Once registered, you acknowledge you have read and agree to be bound by this policy.\r\nÂ \r\nGroup Discounts: Offered for registrations of the same course type, date and city. To receive a group discount all students MUST register at the same time: \r\nÂ  5 to 9 students= 10% Â Â Â 10 or more = 15%\r\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32616492%2F51654302652%2F1%2Foriginal.jpg?s=ca5cabf4eaf367d5003188f42ea96e09', 'https://www.eventbrite.com/e/emergency-respons