(643, 'live', '35634115599', NULL, 0, 2, 'Laser Checkout Class', 'Laser Checkout Class\nWorkshop Description:\nLearn how to use the laser cutter at Lansing Makers Network to make cool projects. We''ll cover the ins and outs of getting your design into the laser cutter and onto a piece of material. Â \nAbout Checkout Classes\nCheckout classes are how LMN handles instruction for the dangerous or complicated machines at the makerspace to make sure everyone knows how to operate the machines safetly (from the perspective of both member''s safety, and the health and safety of the equipment). Â Checkout classes are generally free for members (there may be some cost for materials for some classes). Â Note: You must be a member of Lansing Makers Network to use equipment outside of a checkout class.Â \nBecoming a Member\nVisit https://www.lansingmakersnetwork.org/become-a-member to learn more about joining Lansing Makers Network. Â If you join the makerspace within 30-days of taking a checkout class as a non-member, we''ll discount apply the difference to your first month''s membership. Â \nFAQ:\nAdditional class policies can be found on our website: https://www.lansingmakersnetwork.org/classes-and-workshops/class-policies\nI have a question that''s not answered here. Â Can you help me?Of course, just send us an email at education@lansingmakersnetwork.org!\nIs there an age limit for this class ?This class is open to anyone 12 years of age or older. Any participant under 18 must be accompanied by a parent/guardian who is also enrolled in the class.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32648043%2F29464559187%2F1%2Foriginal.jpg?s=7a2ac418760863c7a7567ad5c9335bbd', 'https://www.eventbrite.com/e/laser-checkout-class-tickets-35634115599?aff=ebapi', '2400 W. St. Joseph St. STE F, Lansing, MI 48917', 42.727428, -84.58468800000003, '2400 W. St. Joseph St. STE F, Lansing, MI 48917', NULL, NULL, '1498500000', '1498503600', 0, 0, 0, NULL, 1);
