(662, 'live', '35579425018', NULL, 0, 2, 'July 2017 Oars & Ales', 'Lansing Brewing Company and River Town Adventures are partnering once again this summer to bring you Oars & Ales events on July 15th, August 18th, and September 16th!\nParticipants will be picked up at Lansing Brewing Company and will be transported to the Red Cedar River at Aurelius Rd to begin their 2-hour kayaking or canoe trip, ending at the Lansing City Market! Participants will then return to Lansing Brewing Company for the afterparty to swap stories of their adventure!\nParticipants will receive a tshirt (register by July 10th to guarantee your tshirt size), a to-go crowler, a pair of sunglasses and other awesome giveaways! Look for fun and games on the river, including a pitstop featuring our friends at Moosejaw and a taco snack stop!\nAdditional crowlers available for purchase.\n4 fleets of 22 will be available, starting at 4:30, 5:00, 5:30, and 6:00. A mixture of single kayaks, double kayaks, and canoes will be available for each fleet, on a first-come, first-serve basis. You are welcome to bring your own boat if you prefer, and it will be shuttled to the launch point by River Town Adventures and then back to your car. *Price of event remains the same if you choose to bring your own boat.\n21+ Only\nWeather Policy:No refunds will be issued due to inclement weather.Â In the event of light rain, Oars & Ales will still go on! If inclement weather causes event organizers to cancel due to saftey, you will still be invited to LBC to pick up your event pack, including a voucher to River Town Adventures to use at your convenience.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32589857%2F168320648158%2F1%2Foriginal.jpg?s=ffcea139798a5d9d6b66a0b4029cf683', 'https://www.eventbrite.com/e/july-2017-oars-ales-tickets-35579425018?aff=ebapi', '518 East Shiawassee Street, Lansing, MI 48912', 42.7369821, -84.54555519999997, '518 East Shiawassee Street, Lansing, MI 48912', NULL, NULL, '15001