(668, 'live', '35746253005', NULL, 0, 2, 'Art in the Wild Summer Reception - Art Sale and Auction', 'Join us at The Potter House for a Summer Reception, art show and silent auction - July 27, 6-9 pm, 1348 Cambridge Road, Lansing MI.\nOur mission is to enhance environmental restoration through the integration of art and human imagination.\nMidMEAC Art in the Wild Committee is raising funds to place sculptures, murals, and other forms of art near Low Impact Design infrastructure features and educational signage. Our goal is to show that water quality protection, responsible land use, art, and economic development can be brought together to benefit our whole community.Each art placement is an opportunity to celebrate the environment and our community. We are working with local leaders toward a fundraising goal of $10 milion to place and maintain art in areas of environmental reclamation.\nMidMichigan Environmental Action Council (MidMEAC) is a 501(c)(3) Public Charity. Donations are tax deductible.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32758974%2F169634961397%2F1%2Foriginal.jpg?s=30b3957697ada842058d4229c7d35f40', 'https://www.eventbrite.com/e/art-in-the-wild-summer-reception-art-sale-and-auction-tickets-35746253005?aff=ebapi', '1348 Cambridge Road, Lansing, MI 48911', 42.719366, -84.58468199999999, '1348 Cambridge Road, Lansing, MI 48911', NULL, NULL, '1501178400', '1501189200', 0, 0, 0, NULL, 1),
