(677, 'live', '35634143683', NULL, 0, 2, 'JMC 50th Anniversary Gala Weekend', 'Celebrate the Past; Inspire the Future!Â  Read the full 50thÂ Anniversary Gala schedule below, decide which events you can attend, reserve your space and purchase tickets at the green link to the right.Â  Please know space is limited for Saturday''s luncheon and the evening Gala dinner, so purchase your tickets today and encourage your Madison friends to join!\n\n\n\n50th Anniversary Gala Weekend Schedule\nThursday, October 12Â \nStudent-Alumni Pizza Night\nJMC''s Annual Student-Alumni Pizza Night brings together current Madison students and JMC alumni working in a variety of fields for an interactive, dynamic networking event.Â Dinner, drinks, and dessert will be provided to all participantsâ€”all you need to do is come prepared to engage with students and alumni!Club Spartan\nMADhouse Open Mic Night\nA longstanding JMC tradition showcasing the creative expressions of the college. Come share music, stories, poetry, comedy â€“ anything goes! Join to show your creative side or just listen.Club Spartan\n\nFriday, October 13\nAfternoon, 1:30-4:45 pm\nJMC Career Seminars\nJames Madison Collegeâ€™s Career Services Office is proud to present three â€œCareer Coursesâ€ aimed at engaging everyone from current students to alumni on a handful of career-related topics. Â Offerings will include courses on â€œBeing a Public Servant in a Partisan Eraâ€ and â€œShifting Gears: Professional Re-Branding.â€ Â Case Hall\nOffice Hours\nVisit with current and former faculty members in Case Hall â€“ but donâ€™t worry, thereâ€™s no assigned reading! Â Case Hall\n\nEvening\nDeanâ€™s Welcome Reception, 5:00 pm\nGather in Case Hall for a welcome address by Dean Sherman Garnett with light refreshments.Club Spartan\nField Parties, 6:00 pm\nJoin current students, alumni, and faculty at one of the parties for each JMC field.Dublin Square, Beggars Banquet, HopCat, Fieldhouse\n\nSaturday, October 14\nSaturday Morning/Afternoon\n50th Anniversary Seminars (Breakfast and Lunch included)\nEngage with fellow Madisonians to learn about and discuss the pressing issues of the past 50 years and today. Speakers and topics to be announced soon! Â Kellogg Center\nCampus Tours and Activities\nExplore MSU with a tour of campus, see the Facility for Rare Isotope Beams, visit the MSU or Broad Museum, or play a round of golf!MSU Campus\n\nEvening\nJMC 50th Anniversary Gala Dinner\nCelebrate the 50th Anniversary of James Madison College with students, alumni, faculty, staff, and friends of the college with dinner and dancing at the Huntington Club overlooking the Spartan Stadium. Cocktail reception at 5:30, dinner to follow.Â Huntington Club, Spartan Stadium\n\n\nHotel information: James Madison College has rooms reserved at theÂ Kellogg Center.\n**Student tickets will be available at the start of the fall semester!\nFor questions, please contact Sam Troutman (samtrout@msu.edu) or Kim Allan (allank@msu.edu).Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32750572%2F5328578766%2F1%2Foriginal.jpg?s=672cece318f64f0048d4eb9d24491a0b', 'https://www.eventbrite.com/e/jmc-50th-anniversary-gala-weekend-tickets-35634143683?aff=ebapi', 'East Lansing, MI', 42.7369792, -84.48386540000001, 'East Lansing, MI', NULL, NULL, '1507831200', '1508014800', 0, 0, 0, NULL, 0),
(678, 'live', '35765939889', NULL, 0, 2, '3rd Annual Grit and Grind Fitness competition', 'Welcome fitness fanatics! This is a BEGINNER and SCALED partner and individual competition, especially for those who have competed in a couple competitions or those who haven''t quite yet drummed up the courage to sign up for a competition. This competition is meant to be FUN, challenging, and inclusive.Â  It is meant to be empowering.Â \nÂ \nREGISTRATION: Registration closes two weeks prior to the competition date.Â  Workouts and movement standards will be released one month in advance on the event page! The competition will be hosted at Mid Mitten Crossfit (midmittencrossfit.com), a fantastic box with a welcoming, intimate space. Formula O2 is sponsoring the event! Space is limited toÂ 24 teams ...composed of 16 divisions: \n\nMale-Male Beginner \nFemale-Female Beginner\n Male-Male Scaled \nFemale-Female Scaled \nMale-MaleÂ  Beginner masters (ages must add up to 90)\nFemale-Female Beginner Masters (ages must add up to 90)\nMale-MaleÂ  Scaled masters (ages must add up to 90)\nFemale-Femal Scaled MastersÂ  (ages must add up to 90)\n\nBeginner Invidual Men\nBeginner Individual Women\nScaled Individual WomenÂ \nScaled Individual Men\nBeginner Masters Men (45+)\nBeginner Masters Women (45+)\nScaled Masters Men (45+)\nScaled Masters Women (45+0\n\n *There will be 3 workouts and 1 championship workout for the top two teams of each division.Â  Podium spots will consist of one team per division. Prizes for the Champions! Registration is $95/team and includes a t-shirt for each team member. REFUNDS: Once purchased, tickets are refundable for exceptional circumstances only.Â  If you have questions please contact Mid Mitten CrossFti @ midmittencrossfit@gmail.com', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32785505%2F108870370025%2F1%2Foriginal.jpg?s=f3f3f139ed7bfc8c382c43ca728ccfde', 'https://www.eventbrite.com/e/3rd-annual-grit-and-grind-fitness-competition-tickets-