(679, 'live', '35793009856', NULL, 0, 2, 'MFEL, NETWORK, and NBCT Annual Meeting and Retreat', 'Dear Michigan Foundation for Education Leadership (MFEL), The Network of Michigan Educators (NETWORK), and Michigan National Board Certified Teachers (Michigan NBCT),On Monday, July 17, 2017, Â we will be holding the Annual Meeting and Retreat. Â The purpose of the meeting is to inform the team on the organizational structure, set overall goals and goals for the individual entities, discuss topics for the Governorâ€™s Education and Talent Summit 2018 and hold the Annual Meeting where members of all entities will be formalized on the MFEL Board of Directors. Â In addition, we plan to have a speaker on acceptable advocacy practices as a 501c3.The Retreat is scheduled from 9am-3pm with the Annual Meeting following at 3-3:30pm. Â Everyone may attend the Annual Meeting but does not need to attend. Only current sitting board members will be able to vote.\nThank you for your interest and we look forward to seeing you on Monday July 17, 2017.Sincerely,Â Traci M. RiehlExecutive DirectorMichigan Foundation for Education Leadership517-643-0266', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32816156%2F218385790012%2F1%2Foriginal.jpg?s=78f3f02f19f6423e0f5ea6c16257e8d6', 'https://www.eventbrite.com/e/mfel-network-and-nbct-annual-meeting-and-retreat-tickets-35793009856?aff=ebapi', '416 South Cedar Street Suite C, Lansing, MI 48912', 42.7291472, -84.54587700000002, '416 South Cedar Street Suite C, Lansing, MI 48912', NULL, NULL, '1500282000', '1500303600', 0, 0, 0, NULL, 1),
