(687, 'live', '35658331028', NULL, 0, 2, 'Lansing Scrum Master Certification Class* (July 15 - August 5)', 'Register for Upcoming Information session\r\nhttp://bit.ly/2sZpKUi\r\nÂ \r\nVideo Conference Details\r\nWill be sent after registration and payment\r\nÂ \r\nScrum master Certification exam\r\nAt the end of the course, you will be able to take the Scrum master certification exam.\r\n\r\nTraining Dates\r\nJuly 15,16,22,23,29,30, Aug 5\r\nTimes: Every Sat, Sun 8:00 AM - 10:00 AM (Pacific Standard Time)\r\nEach session will be recorded and the recordings will be shared after each session with students\r\nÂ Â \r\nScrum Master Certified (SMCâ„¢) â€“ Training\r\nScrum Master Certification classroom trainings are offered by SCRUMstudy approved Authorized Training Partners (A.T.P.s). All trainers are highly experienced and accredited by SCRUMstudy. Participants will be awarded â€˜Scrum Master Certifiedâ€™ certificate from SCRUMstudy on successful completion of the exam.\r\nÂ \r\nAudience Profile\r\nThis course is appropriate for professionals interested in obtaining a working knowledge of Scrum and planning to become a Scrum master. This would include Scrum team members, Product Owners, Product Managers, Project Managers, Project Sponsors, programmers, designers, testers, software engineers, executives, business owners, business analysts, and more.\r\nÂ \r\nCourse Objectives\r\n\r\nTo provide an understanding of the principles in the Scrum framework\r\nTo provide a practical working knowledge of Scrum including roles, meetings, and artifacts.\r\nTo prepare participants to be comfortable with implementing Scrum in their organizations.\r\nTo prepare participants to take SMCâ„¢ exam upon completion of the course.\r\n\r\nÂ \r\nScrum Master Certified (SMCâ„¢)\r\nScrum Master Certified (SMCâ„¢) is a certification for Scrum Masters and experienced practitioners needing or wanting more advanced instruction.\r\nThe objective of this certification is to confirm that the applicants have achieved sufficient understanding of how to apply Scrum in projects, and how to tailor Scrum to a particular scenario.\r\nÂ \r\nCertification Prerequisites\r\nThere is no formal prerequisite for this certification.\r\nÂ \r\nWho should do this certification?\r\nThis certification is appropriate for anyone who is interested in working as a Scrum Master, or who is already a Scrum Master in his/her organization.\r\nÂ Â \r\nWhy take Scrum master Certification class from Omni212?\r\na)Â High quality hands-on training using role-plays and case-studies.\r\nb) Class recordings will be provided\r\nc) Training manual provided. \r\nd) Post class support and mentorship.\r\ne) Career advancement and Job Assistance provided.\r\nÂ \r\nOmni212 is a Geekwire 200 startup companyhttps://www.geekwire.com/geekwire-200/\r\n\r\nÂ \r\nCourse Benefits for an additional $250\r\n\r\nCertification exam fee.\r\nFree Lifetime Primary Membership.\r\nOne year Advanced Membership worth $120.\r\n\r\nÂ \r\nREFUND POLICY\r\n1. There are no refunds.2. If for any reason the course has not been taken, the payment can be applied towards any future course by Omni212.\r\n\r\n\r\n\r\n*Unlimited Training*\r\nhttp://bit.ly/2nj9Obq\r\nNow you can enjoy unlimited training from Omni212.\r\nLook forÂ *Asterisk* on Omni212 Eventbrite courses.\r\nAny course published by Omni212 on eventbrite with *Asterisk* on the course title can be taken individually as well as a part of the Unlimited training program.\r\nThese are the terms and conditions:\r\n\r\nUnlimited training periods consist of 1, 3, 6, 9 and 12 months respectively. See appropriate ticket type for price.\r\nYou will have access to the training material, class recordings, across all of the published courses whether you attend or do not attend the Live Instructor Led Online sessions for the unlimited period purchased by you.\r\nYou will loose all access after your unlimited training period expires unless you are already enrolled in the course(s) which began within the unlimited training period (UTP) you registered for and continue beyond the end of the UTP\r\nAll of the course material, class recordings are yours to keep. You can download.\r\nYour unlimited training period will start from the first session of the first course that you take.\r\nThis applies only for the courses published by Omni212 on Eventbrite.\r\nStudents may enroll in a course and complete the course even if it starts on the last day of the Unlimited period.\r\nWhile Omni212 strives to maximize the benefit for the students who purchase any of the unlimited training periods, this program applies only to the published courses for the purchased time period.\r\nAlthough we will strive to have all of these courses published and available for you to take, we cannot guarantee that all the courses under each unlimited period will be available and published.\r\nCourse Availability and schedule is subject to availability of the instructors, enough enrollment, no overflow.\r\n\r\n\r\nThe following courses, if avaiable, if published and if held as originally scheduled will be available for unlimited training program:\r\n\r\nBRONZE - Included in Unlimited Training for 1 month\r\n1. Big Data, Analytics & Hadoop\r\n2. Cloud Computing Level 100\r\n3. Artifical Intelligence Level 100\r\n4. Tableau\r\n5. Scrum Master\r\n6. Certified Ethical Hacking\r\n7. Machine Learning\r\n8. How to Ace the Tech Interview\r\n9. PMP\r\n\r\nSILVER - Included in Unlimited training for 3 months\r\n1. All courses included in Unlimited training for 1 month\r\n2. Cloud Computing Level 200\r\n3. Data Science Level 100\r\n4. Artifical Intelligence Level 200\r\n5. DevOps\r\n6. Learn to Code from Scratch\r\n\r\nGOLD - Included in Unlimited training for 6 months\r\n1.All courses included in Unlimited training for 3 months\r\n2. AWS (Amazon Web Services) Level 100\r\n3. Data Structures & Algorithms\r\n4. Microsoft Cloud (Azure) Level 100\r\n5. Design Thinking\r\n6. Microsoft Office 365\r\n