(709, 'live', '35091916868', NULL, 0, 2, 'Habitat Home-in-One Golf Outing', 'The third annual Habitat for Humanity Capital Region Home-in-One Golf Outing is a fundraiser supporting the Habitat vision in and around Ingham County - to create a world where everyone has a decent place to live.\nThis event is a unique opportunity to support Habitat and golf at the prestigious Country Club of Lansing. The well attended golf fundraiser is a chance to spend the day with colleagues and friends while supporting an organization that offers strength, stability, and self-reliance through homeownership.\nHabitat for Humanity Capital Region offers affordable home repairs to low-to-moderate income homeowners and interest free mortgages to individuals willing to partner in their home ownership. Habitat for Humanity Capital Region also operates two ReStore locations that sell used and new home goods to the general public (locations in Williamston and Lansing) to help fund the mission.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32025326%2F109712439537%2F1%2Foriginal.jpg?s=4f359ce8e69a5618e50485134b10d14e', 'https://www.eventbrite.com/e/habitat-home-in-one-golf-outing-registration-35091916868?aff=ebapi', '2200 Moores River Drive, Lansing, MI 48911', 42.7165787, -84.5813081, '2200 Moores River Drive, Lansing, MI 48911', NULL, NULL, '1503300600', '1503325800', 0, 0, 0, NULL, 0),
