(746, 'live', '36222364066', NULL, 0, 2, 'FARE presents: Queers Who Brunch', 'FARE: eat differently presents Queers Who Brunch. Sunday, August 13th is the third installment of this series which happens the second Sunday of every month. No, you do not need to be queer to attend, however the spirit of the event is most def queer. Tickets include pour over coffee or steeped tea, fresh squeezed orange juice and brunch. The event is BYOB, bring a little champagne or vodka to enjoy with your OJ or whatever you desire.Â You will receive an email after ticket purchase to confirm the location and other details.Â Be prepared for great food, good peeps and probably a nice dose of inappropriate humor!\nBrunch menu: your brunch will be inspired by the most fresh and in season items at the time of the event and will not have a set menu. Chef Kyle Holsinger-Johnson crafts these brunches out of love, joy and the desire to create a sense of connection. The attention to detail is paramount as we want you to savor this experience. This event does not have any prescribed dietary restrictions, however we are thinking more of a pescatarian route for this one. If you are vegetarian or gluten free, don''t fret, we will have specific brunches that will be just that!Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33251635%2F204076270669%2F1%2Foriginal.jpg?s=58b3995a28ccb1cda84faef52d2584a8', 'https://www.eventbrite.com/e/fare-presents-queers-who-brunch-tickets-36222364066?aff=ebapi', 'Lansing, MI', 42.73253499999999, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1502623800', '1502631000', 0, 0, 0, NULL, 0),
