(748, 'live', '36230702005', NULL, 0, 2, 'CNC Router Checkout', 'CNC Router Checkout Class\nWorkshop Description:\nLearn how to use the 5''x9'' CNC wood router in the LMN woodshop. Â In this class we''ll cover everything you need to know to get started making parts. Â We''ll start with using Vectric VCarve to design our toolpaths and then move to the machine and cover the ins and outs of running our toolpaths.\nAbout Checkout Classes\nCheckout classes are how LMN handles instruction for the dangerous or complicated machines at the makerspace to make sure everyone knows how to operate the machines safetly (from the perspective of both member''s safety, and the health and safety of the equipment). Â Checkout classes are generally free for members (there may be some cost for materials for some classes). Â Note: You must be a member of Lansing Makers Network to use equipment outside of a checkout class.Â \nBecoming a Member\nVisit https://www.lansingmakersnetwork.org/become-a-member to learn more about joining Lansing Makers Network. Â If you join the makerspace within 30-days of taking a checkout class as a non-member, we''ll Â apply the checkout class registration fee to your first month''s membership. Â \nFAQ:\nAdditional class policies can be found on our website: https://www.lansingmakersnetwork.org/classes-and-workshops/class-policies\nI have a question that''s not answered here. Â Can you help me?Of course, just send us an email at education@lansingmakersnetwork.org!\nIs there an age limit for this class ?This class is open to anyone 16 years of age or older. Any participant under 18 must be accompanied by a parent/guardian who is also enrolled in the class.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33263350%2F29464559187%2F1%2Foriginal.jpg?s=70f9fe1e5be4b950cbb973244778f65c', 'https://www.eventbrite.com/e/cnc-router-checkout-tickets-36230702005?aff=ebapi', '2400 W. St. Joseph St. STE F, Lansing, MI 48917', 42.727428, -84.58468800000003, '2400 W. St. Joseph St. STE F, Lansing, MI 48917', NULL, NULL, '1500127200', '1500132600', 0, 0, 0, NULL, 1),
