rt Vector Machine.\n5. K-means and Hierarchical Clustering.\n6. Natural Language Processing.\n7. Artificial Neural Networks.\n8. Convolutional Neural Network.\n\nClass Size:Â Maximum 22\n\nPrice:Â $495\n\nREFUND POLICY\n1. There are no refunds.\n2. If for any reason, students decide not to take this class, the class is rescheduled or cancelled, the payment can be applied towards any future course by Omni212.Â \n\n\nKeywords: Lansing Data Science Course, Lansing Data Science class, Lansing Data Science, Lansing Data Science Training', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33269208%2F59307985005%2F1%2Foriginal.jpg?s=e06e3fc2f2612056d0d5517cb3c67a98', 'https://www.eventbrite.com/e/lansing-data-science-bootcamp-tickets-36234764155?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1502141400', '1504222200', 0, 0, 0, NULL, 1),
