(763, 'live', '33769516533', NULL, 0, 2, 'Real Estate Investing Webinar Lansing', 'Interested in real estate investing? Don''t know where to start?\nWant to learn real estate investing by networking with like minded indviduals?\nWant to learn how to get out the rat race?\nIf the answer is Yes, come join us!\nLearn real estate investment strategies such as fix and flip, buy, and hold, short sale, foreclosures, and multi family.\nLearn how to pay off your house in 10 years or less\nLearn how real estate investors fund real estate deals without your own money or credit!\nRSVP Now!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30454742%2F171787685717%2F1%2Foriginal.jpg?s=a78af935c72c231cae0e381057ead14c', 'https://www.eventbrite.com/e/real-estate-investing-webinar-lansing-tickets-33769516533?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1501012800', '1501014600', 0, 0, 0, NULL, 1),
