(765, 'live', '36157664548', NULL, 0, 2, 'Burgers & Brews', 'Attention Burger fans! Burgers & Brews Crafted by Adventure Credit Union \nFriday, August 4, 2017, from 4P-9P on the plaza at Cooley Law School Stadium.\nFriday nights in August are made for music, burgers, and brews! Join us for a burger competition between local restaurants paired with you favorite on-air personality. these collaborations will make your mouth water as you sample each competitor''s creation and wash it down with a cold brew. After everyone votes for their favorite burger, we will crown the winner of Burgers & Brews!\nFull burgers, beverages, and sides will be available for purchase and we will have great summertime tunes playing in the background.Â \nCOMPETITORS INCLUDE\nBellingars Speciality Meats\nMitten Raised Bakery\nChampps\nGood Hops at Cooley Law School Stadium\nAND MORE\nÂ \nON SITE VENDORS\nAdventure Credit Union\nSleep Number\nU.S. Marines\nAND MORE \nÂ \n\n\nFAQs\nÂ \nAre there ID or minimum age requirements to enter the event?\nNo however, everyone needs a ticket to enter and a valid ID is required for everyone that wants to purchase alcohol. WE EVEN CARD OUR GRANDMA!\nWE EVEN CARD OUR GRANDMA!\nÂ \nWhat are my parking options for getting to and from the event?\nAll City of Lansing parking lots/ramps should be available for parking. Parking lots/ramps can be found here http://www.lansingmi.gov/336/Event-Parking \nÂ \nWhat can I bring into the event?\nPlease note that NO outside food or beverages are allowed to be brought into the venue. \nÂ \nHow can I contact the organizer with any questions?\nPlease email Jennifer Taylor at Jennifer.Taylor@TownSquareMedia.com\nÂ \nWhat''s the refund policy?\nUnfortunately, there are no refunds or exchanges\nÂ \nDo I have to bring my printed ticket to the event?\nPlease bring your printed or electronic ticket to the event. We will be scanning tickets.\nÂ \nIs my registration fee or ticket transferrable?\nYes, you or anyone you authorize may use your ticket. However, each ticket may only be used one time.\nÂ \nIs it ok if the name on my ticket or registration doesn''t match the person who attends?\nYes, that is ok.\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33188095%2F162618101816%2F1%2Foriginal.jpg?s=dd8f83b33376ec3a7cf7c0e046e40cea', 'https://www.eventbrite.com/e/burgers-brews-tickets-36157664548?aff=ebapi', '505 East Michigan Avenue, Lansing, MI 48912', 42.7342188, -84.54559849999998, '505 East Michigan Avenue, Lansing, MI 48912', NULL, NULL, '1501862400', '1501880400', 0, 0, 0, NULL, 1),
