(770, 'live', '36415591013', NULL, 0, 2, 'Urban Environment: Solutions for a Sustainable Future Research Symposium', 'Over the past four years, the symposium has been a major success drawing 300 attendees from at least six different colleges within MSU along with a significant number of participants from other universities, government, private sector, and general public. Our theme for the 5th annual symposium is Urban Environment: Sustainable Solutions for the Future.\nOur vision for the event is to bring together multiple communities on campus that are working on different aspects of the urban environment to share their experiences and identify collaborative opportunities.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33468297%2F175969309609%2F1%2Foriginal.jpg?s=fc9992674d7901bb16e2630e6bfbfeae', 'https://www.eventbrite.com/e/urban-environment-solutions-for-a-sustainable-future-research-symposium-tickets-36415591013?aff=ebapi', 'http://environment.msu.edu, East Lansing, MI 48823', 42.7369792, -84.48386540000001, 'http://environment.msu.edu, East Lansing, MI 48823', NULL, NULL, '1509091200', '1509123600', 0, 0, 0, NULL, 0);
