(772, 'live', '36421173711', NULL, 0, 2, 'Lansing AWS Training | Amazon Web Services Training | Cloud Computing Training', 'Now become an Omni212 Prime member and get $100 off every training course published by Omni212 on eventbriteÂ \nSign up for Omni212 Prime membership:Â http://bit.ly/2vh4UNNÂ \n\nOverview\nIn this course we start at foundational level with AWS technical essentials where you can learn the foundations of cloud computing, storage, and networking on AWS in this course for anyone who wants to get started using AWS. The first 4 sessions (8 hours) are dedicated to this.\nIn the next 12 sessions (24 hours), we cover AWS cloud architecture where you can learn cloud best practices, architecture patterns, case studies, and other practical ways of thinking about how to architect infrastructure on AWS.\n\nDescription\nAWS Technical Essentials introduces you to AWS products, services, and common solutions. It provides you with fundamentals to become more proficient in identifying AWS services so that you can make informed decisions about IT solutions based on your business requirements and get started working on AWS.\nArchitecting on AWS covers the fundamentals of building IT infrastructure on AWS. The course is designed to teach solutions architects how to optimize the use of the AWS Cloud by understanding AWS services and how these services fit into cloud-based solutions. Because architectural solutions may differ depending on industry, type of applications, and size of business, this course emphasizes AWS Cloud best practices and recommended design patterns to help students think through the process of architecting optimal IT solutions on AWS. It also presents case studies throughout the course that showcase how some AWS customers have designed their infrastructures and the strategies and services they implemented. Opportunities to build a variety of infrastructures via a guided, hands-on approach are also provided.Â \n\nCourse Objectives\nThis course teaches you how to:\n\nRecognize terminology and concepts as they relate to the AWS platform and navigate the AWS Management Console.\nUnderstand the foundational services, including Amazon Elastic Compute Cloud (EC2), Amazon Virtual Private Cloud (VPC), Amazon Simple Storage Service (S3), and Amazon Elastic Block Store (EBS).\nUnderstand the security measures AWS provides and key concepts of AWS Identity and Access Management (IAM).\nUnderstand AWS database services, including Amazon DynamoDB and Amazon Relational Database Service (RDS).\nUnderstand AWS management tools, including Auto Scaling, Amazon CloudWatch, Elastic Load Balancing (ELB), and AWS Trusted Advisor.\nMake architectural decisions based on the AWS-recommended architectural principles and best practices.\nLeverage AWS services to make your infrastructure scalable, reliable, and highly available.\nLeverage AWS managed services to enable greater flexibility and resiliency in an infrastructure.\nMake an AWS-based infrastructure more efficient in order to increase performance and reduce costs.\nUse the Well-Architected Framework to improve architectures with AWS solutions.\n\n\nIntended Audience\nThis course is intended for:\n\nIndividuals responsible for articulating the technical benefits of AWS services to customers\nIndividuals interested in learning how to get started with using AWS\nSysOps administrators, Solution Architects and developers interested in using AWS service.\nYou are interested in getting trained and building a career in AWS Cloud Computing.\nYou are new to aws and cloud computing but you have some experience using computers for a business or in personal life.\nYou do not need to have a background in computer science or computer programming.\nYou have an appreciation for cloud computing and desire to learn new cloud technologies that include open source technologies along with cloud offerings from leading cloud computing vendors\n\n\nWhy AWS Training from Omni212?\n1. Omni212 is a AWS partner.2. Two of our most expeast longmeadownced, aws cloud computing instructors teach this class.3. We practice what we preach. All of our IT systems are on the cloud4. Class recordings, Training manual for this class will be made available.Â 5. Post class support6. Appropriate software accessÂ 7. Career advancement and Job placement assistance\n\nVideo Conference Link\nWill be sent upon registration and payment\n\nTraining Provider:\nOmni212Â \n\nDelivery Method:\nExclusively online via video conference. Virtual Instructor Led Training\n\nDates:\nSeptember 23,24,30, October 1,7,8,14,15,21,22,28,29, November 4,5,11,12,2017Every Saturday and Sunday 9:00am - 11:00am US Pacific Time\n\nPrerequisite:\nLevel 100 Cloud Computing Training by Omni212 - http://bit.ly/2u8Cw27Â \n\nClass Schedule:\nEvery weekend, Sat, Sun 9am-11am US Pacific timeÂ \n\nCourse Outline:\n\nIntroduction and History of AWS\nAWS Foundational Services: EC2, VPC, S3, EBS\nAWS Security, Identity, and Access Management: IAM\nAWS Databases: RDS, DynamoDB\nAWS Management Tools: Auto Scaling, CloudWatch, Elastic Load Balancing, Trusted Advisor\nCore AWS Knowledge\nCore AWS Services\nDesigning Your Environment\nMaking Your Environment Highly Available\nForklifting an Existing Application onto AWS\nEvent-Driven Scaling\nAutomatingÂ \nDecoupling\nBuild a new environment\nThe Well-Architected Framework\nTroubleshooting Your Environment\nLarge-Scale Design Patterns and Case Studies\n\n\nPrice:\nUS $795\n\nClass size:\n22 max\n\n\nADVANTAGES OF TAKING THIS COURSE WITH OMNI212:1. Class recordings will be made available.Â 2. Post class support3. Course material available.Â 4. Hands on lab exercises on cloud infrastructure.5. Career advancement and Job placement assistance\n\n\nREFUND POLICY\n1. There will be no refunds.\n2. If for any reason, students decide not to take this class, the class is rescheduled or cancelled, the payment can be applied towards any future course by Omni212.Â \n\n*Unlimited Training*\nhttp://bit.ly/2uAXJCN\nNow you can enjoy unlimited training from Omni212.\nLook forÂ *Asterisk* on Omni212 Eventbrite courses.\nAny course published by Omni212 on eventbrite with *Asterisk* on the course title can be taken individually as well as a part of the Unlimited training program.\nThese are the terms and conditions:\n\nUnlimited training periods consist of 1, 3, 6, 9 and 12 months respectively. See appropriate ticket type for price.\nYou will have access to the training material, class recordings, across all of the published courses whether you attend or do not attend the Live Instructor Led Online sessions for the unlimited period purchased by you.\nYou will loose all access after your unlimited training period expires unless you are already enrolled in the course(s) which began within the unlimited training period (UTP) you registered for and continue beyond the end of the UTP\nAll of the course material, class recordings are yours to keep. You can download.\nYour unlimited training period will start from the first session of the first course that you take.\nThis applies only for the courses published by Omni212 on Eventbrite.\nStudents may enroll in a course and complete the course even if it starts on the last day of the Unlimited period.\nWhile Omni212 strives to maximize the benefit for the students who purchase any of the unlimited training periods, this program applies only to the published courses for the purchased time period.\nAlthough we will strive to have all of these courses published and available for you to take, we cannot guarantee that all the courses under each unlimited period will be available and published.\nCourse Availability and schedule is subject to availability of the instructors, enough enrollment, no overflow.\n\n\nThe following courses, if avaiable, if published and if held as originally scheduled will be available for unlimited training program:\n\nBRONZE - Included in Unlimited Training for 1 month\n1. Big Data, Analytics & Had