(790, 'live', '36490976493', NULL, 0, 2, 'Partner XE Regional Learning Event in Lansing, Michigan - August 31', 'The Partner XE Regional Learning Event delivers relevant and practical information to improve everday use of Partner XE for every role and task in the agency. Â In addition, you''ll get exposed to advanced topics to maximize the use of the system. Beyond learning the most efficient and effective ways to leverage the latest Partner XE, you''ll also experience networking opportunities with Partner Community members and get a chance to meet the team behind Partner XE.\r\nThe event will be held in the Boardroom at the MAIA in Lansing. Â Lunch is provided. Â The cost to attend the event is $50 per person and will be billed to the agency at a later date.\r\nSome of the main topics covered during the event are below. Â You can also expect to cover other topics as they come up during discussions.\r\nI. Getting the Most from Partner XE\r\n\r\nNew capabilities introduced in Spring of 2017\r\nStreamlining everyday tasks\r\nManaging policies\r\nReporting and data management\r\nImproving Document management\r\nCreating certificates - tips & tricks\r\nUtilizing ACORD forms\r\nBest practices with Outlook Plug-in\r\nProposal Creator\r\nClient Portal\r\n\r\nII. Question & Answer\r\nIII. Share highlights for the Fall release of 2017 as well as plans for 2018', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33533452%2F139009372497%2F1%2Foriginal.jpg?s=327d781f5a3262f27aa6e7c70db8c26b', 'https://www.eventbrite.com/e/partner-xe-regional-learning-event-in-lansing-michigan-august-31-tickets-36490976493?aff=ebapi', '1141 Centennial Way, Lansing, MI 48917', 42.721124, -84.64653599999997, '1141 Centennial Way, Lansing, MI 48917', NULL, NULL, '1504173600', '1504188000', 0, 0, 0, NULL, 0),
(791, 'live', '36280422721', NULL, 0, 2, 'IEEE RAS Humanitarian Technology Day', 'The Humanitarian Technology Day will discuss several humanitarian challengesÂ and potential solutions to them using diverse engineering backgrounds for betterÂ living. This conference, organized by students for students, will bring togetherÂ specialists, entrepreneurs, and non-profit organization officials from differentÂ IEEE Regions to discuss the current and emerging humanitarian issues across theÂ globe. This event not only promotes humanitarian awareness in our localÂ community, but it also will train students on how to build strategies forÂ identifying humanitarian problems, and designing and implementing solutions inÂ their region. It has the support of IEEE Robotics and Automation Society (RAS) and IEEE RAS-SIGHT group.\nConference Website:Â http://sites.ieee.org/sb-msu-htc\nDirections for Venue:Â https://union.msu.edu/directions\nFAQs\nWhat am I paying for?\nAll tickets include: Continental Breakfast + Lunch + T-Shirt\nKellogg Catering:Â https://catering.msu.edu\nWhat are my transportation/parking options for getting to and from the event?\nParking Options:\n\n\nAlbert Avenue Parking Lot 1Â in downtown East Lansing, directlyÂ behind the storefronts acrossÂ Grand River Avenue from the Union. Click the link for a map and directions. When you park there, you will get a ticket out of the machine.Â Parking costs $1Â for each half hour.Â This location has a parking lot attendant.\n\n\nMSUâ€™sÂ Ramp 6,Â which has access from Grand River Avenue or East Circle Drive. Visitor parking is available in designated â€œPay by Plateâ€Â parking spaces, using the â€œPay by Plateâ€ kiosks.Â Parking in a space not designated as â€œPay by Plateâ€ parking may result in a parking violation.\n\n\nWhat''s the refund policy?\nAttendees can receive refunds up to 7 days before your event start date.\nHow can I contact the organizer with any questions?\nRegistration Chair: Brendan Murphy,Â murph582@msu.edu\nConference Chair: Thassyo Pinto, thassyo@ieee.org\nConference Co-Chair: Monica Garcia,Â garci256@msu.edu', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33595511%2F67878223653%2F1%2Foriginal.jpg?s=e58e063c5dc7a04a613c13d3d28810f1', 'https://www.eventbrite.com/e/ieee-ras-humanitarian-technology-day-tickets-36280422721?aff=ebapi', '49 Abbot Rd 2nd Floor, East Lansing, MI 48824', 42.7341101, -84.48288309999998, '49 Abbot Rd 2nd Floor, East Lansing, MI 48824', NULL, NULL, '1507968000', '1508007600', 0, 0, 0, NULL, 0),
