(793, 'live', '31490674455', NULL, 0, 2, 'CHILD AND ADULT CARE FOOD PROGRAM NEW MEAL PATTERN TRAINING', 'Michigan Department of Education\r\nOffice of School Support Services\r\nChild and Adult Care Food Program\r\nPRESENTS: THE INSTITUTE OF CHILD NUTRITION\r\nCACFP NEW MEAL PATTERN TRAINING \r\nYou must go to:Â Â  www.Eventbrite.com to register for this workshop.\r\nÂ \r\nCACFP reserves the right to cancel trainings due to low participation.\r\n(You must be registered and have your ticket to attend this training.)\r\nThis training consists of an introductory lesson and four core-content lessons. Each lesson is designed to provide information on the different components of the new meal pattern, published on April 25, 2016, which will be fully implemented in the CACFP effective October 1, 2017. Participants attending the ICN CACFP New Meal Patterns Training will be charged a $25 fee to cover the cost of meals at the training location.\r\nÂ \r\nTraining Overview:\r\n\r\n\r\nInfant New Meal Patterns\r\n\r\n\r\nChild and Adult New Meal Patterns\r\n\r\n\r\nChild and Adult Meal Services\r\n\r\n\r\nBest Practices\r\nÂ \r\n8:00am â€“ 5:00pm New Meal Pattern Training \r\nÂ \r\nLunch Break â€“ (12:00pm â€“ 1:00pm) \r\nParticipants will be charged a fee for meals at this training.\r\nÂ \r\nNOTE: You must create a log in and password on\r\nwww.Eventbrite.com to register for CACFP trainings.\r\nÂ \r\nPlease save your Log in name and Password information. \r\nCACFP staff will not have access to any log in or password information. \r\nÂ \r\nPLEASE PRINT OUT YOUR REGISTRATION CONFIRMATION!\r\nYou must bring your registration ticket to this training.\r\nDue to limited seating, no walk-in participants will be allowed to attend.\r\nAttention: Persons with disabilities needing reasonable accommodations for effective participation in the workshop should contact the Child and Adult Care Food Program office at 517-373-7391. Requests for accommodations should be made at least two weeks pri