(801, 'live', '36499913223', NULL, 0, 2, 'Lansing Scrum Master Certification Class - Omni212', 'Omni212 Prime membership\r\nNow become an Omni212 Prime member and get $100 off every training course published by Omni212 on eventbriteÂ \r\nSign up for Omni212 Prime membership:Â http://bit.ly/2vh4UNNÂ \r\nTo see all currently published Omni212 courses - type ''Lansing Omni212'' in the search box.\r\nÂ \r\nUnlimited Training\r\nNow you can enjoy unlimited training from Omni212. Find out more about our Unlimited training Plan:\r\nhttp://bit.ly/2uAXJCN\r\n\r\nVideo Conference Details\r\nWill be sent after registration and payment\r\n\r\nScrum master Certification exam\r\nAt the end of the course, you will be able to take the Scrum master certification exam.\r\n\r\nTraining Dates\r\nAug 19, 20, 26, September 9, 10, 16\r\nTimes: Every Sat & Sun 8:30 AM - 10:30 AM (Pacific Standard Time)\r\nEach session will be recorded and the recordings will be shared after each session with students\r\nÂ Â \r\nScrum Master Certified (SMCâ„¢) â€“ Training\r\nScrum Master Certification classroom trainings are offered by SCRUMstudy approved Authorized Training Partners (A.T.P.s). All trainers are highly experienced and accredited by SCRUMstudy. Participants will be awarded â€˜Scrum Master Certifiedâ€™ certificate from SCRUMstudy on successful completion of the exam.\r\nÂ \r\nAudience Profile\r\nThis course is appropriate for professionals interested in obtaining a working knowledge of Scrum and planning to become a Scrum master. This would include Scrum team members, Product Owners, Product Managers, Project Managers, Project Sponsors, programmers, designers, testers, software engineers, executives, business owners, business analysts, and more.\r\nÂ \r\nCourse Objectives\r\n\r\nTo provide an understanding of the principles in the Scrum framework\r\nTo provide a practical working knowledge of Scrum including roles, meetings, and artifacts.\r\nTo prepare participants to be comfortable with implementing Scrum in their organizations.\r\nTo prepare participants to take SMCâ„¢ exam upon completion of the course.\r\n\r\nÂ \r\nScrum Master Certified (SMCâ„¢)\r\nScrum Master Certified (SMCâ„¢) is a certification for Scrum Masters and experienced practitioners needing or wanting more advanced instruction.\r\nThe objective of this certification is to confirm that the applicants have achieved sufficient understanding of how to apply Scrum in projects, and how to tailor Scrum to a particular scenario.\r\nÂ \r\nCertification Prerequisites\r\nThere is no formal prerequisite for this certification.\r\nÂ \r\nWho should do this certification?\r\nThis certification is appropriate for anyone who is interested in working as a Scrum Master, or who is already a Scrum Master in his/her organization.\r\nÂ Â \r\nWhy take Scrum master Certification class from Omni212?\r\na)Â High quality hands-on training using role-plays and case-studies.\r\nb) Class recordings will be provided\r\nc) Training manual provided. \r\nd) Post class support and mentorship.\r\ne) Career advancement and Job Assistance provided.\r\nÂ \r\nOmni212 is a Geekwire 200 startup companyhttps://www.geekwire.com/geekwire-200/\r\nÂ \r\nCourse Benefits for an additional $250\r\n\r\nCertification exam fee.\r\nFree Lifetime Primary Membership.\r\nOne year Advanced Membership worth $120.\r\n\r\nÂ \r\nREFUND POLICY\r\n1. There are no refunds.2. If for any reason the course has not been taken, the payment can be applied towards any future course by Omni212.\r\n\r\n\r\n\r\nÂ \r\nKeywords: Scrum Master Lansing,Â Scrum MasterÂ Training Lansing,Â Scrum MasterÂ Class Lansing, Scrum Master Training Lansing, Scrum Certification Lansing, Scrum Master Certification Lansing, Scrum Master Certificate Lansing, Scrum Certified Lansing, Scrum Master Certified Lansing', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33546196%2F59307985005%2F1%2Foriginal.jpg?s=4ad6a5feb6c69f9ce788413688e83ad1', 'https://www.eventbrite.co