(811, 'live', '36564197499', NULL, 0, 2, 'Lansing PMP Certification Prep | Project Management | Project Manager Training Course - Omni212', 'Omni212 Prime membership\nNow become an Omni212 Prime member and get $100 off every training course published by Omni212 on eventbriteÂ \nSign up for Omni212 Prime membership:Â http://bit.ly/2vh4UNNÂ \nTo see all published Omni212 courses - type ''Lansing Omni212'' in the search box.\n\nUnlimited Training\nNow you can enjoy unlimited training from Omni212. Find out more about Unlimited training by Omni212:\nhttp://bit.ly/2uAXJCN\n\nWhy PMP Certification exam Prep Training from Omni212?\n1. We follow the Gold standard in PMP Certification exam Prep Training.2. Our Instructors have at least 1000 hours of real life Project Management Experience plus they are PMI Certified Instructors.3 Class recordings, Training manual for this class will be made available. 4. Post class support and mentorship.5. Career advancement and Job placement assistance.6. We are a vmedu partner and pmstudy Authorized Training partner which helps us provide you included in the training price, in addition to Instructor Led Online training:a) High Quality Videos for PMP Certification exam prep.b) Four Simulated Practice Tests (4-hours, 200 Questions each).c) Downloadable Study Guides - All Knowledge Areas.d) Chapter Tests - All Knowledge Areas.e) Terms and Concepts - All Knowledge Areas.f) Mobile Apps for PMP Cert. exam prep - iPhone and Android.g) 40 PMI Approved Contact Hours.h) Course Validity - 60 days.\n\nVideo Conference Link for Training\nWill be sent upon registration and payment\n\nTraining Provider:\nOmni212\n\nDelivery Method:\nExclusively online via video conference. Virtual Instructor Led Training\n\nDates:\nAug 26 - Oct 8, 2017\nAudience:\n\n\nYou are interested in getting trained so you can take the PMP Certification exam.\n\n\n\nPrerequisite:\nNone\n\nClass Schedule:\nEvery weekend, Sat, Sun 10am - 1pm US Pacific time\n\nCourse Outline:\n1. In