(812, 'live', '36585385874', NULL, 0, 2, 'Preschool Prep | Fall Semester', 'Preschool Prep at play. is an educational enrichment program that provides children ages 3 to 5 years old with an opportunity to experience a classroom setting and social learning environment. Preschool Prep classes are facilitated by our creative and enthusiastic teachers who will provide your child with fun and engaging activities that foster creativity, independence, and self-discovery.Â Your child will participate in art, stories, music, creative movement, sensory activities, and games based on weekly themes such as nature, colors, the solar system, and many more.Â This program is a perfect segue into a school environment for your budding preschooler.Â Preschool PrepÂ will occur daily from 9am - 12pm, Tuesday.\r\nÂ \r\nPlease pack a snack for you child. No peanut products please.\r\n*Payment is due in full upon registration for your confirmed preschool sessions. Please inquire about our flex-payment plan options.\r\n...................................................\r\n- Sample Schedule -\r\n9:00-9:25 Â  Â  Drop Off + Free Play9:25-9:35 Â  Â  Welcome + Circle Time9:35-10:10 Â  Â Hands-on Creative Activity10:10-10:20 Â  Storytime10:20-10:30 Â  Bathroom Break + Hand Washing10:30-10:45 Â  Healthy Snack10:45-11:15 Â  Free Play11:15-11:45 Â  Gross Motor Activity11:45-12:00 Â  Storytime + Pick Up\r\n..................................................................\r\nFall Semester..........................September{10 weeks}9am - 12pm\r\nAges 3 - 5Â Children must be fully potty trainedschedule +Â tuition:\r\n1 day {Tuesday} Â // Â $200 per semester*\r\nUnlimited Use of Playspace Pass 7 Days a Week: $75\r\n*plus 5% administrative fee\r\n10% discount on additional siblings {when enrolled simultaneously}.Â \r\n..................................................................\r\nOur Preschool Prep classes are directed/co-taught by Shelley Thomas and MSU Elementary Education staff members. Shelley graduated with a B.A. in Elementary Education from the #1 teaching program in the Nation, Michigan State University. Â Shelley instructed K-8th grade Elementary Education for 3 years and was a member of the curriculum committee. Shelley believes that children learn through play and socialization with peers and adults. She is excited to facilitate passion for learning and exploration atÂ play.!\r\n..................................................................\r\nPreschool HoursChildren must be dropped off atÂ play.Â between 9am â€“ 9:15am. Â Scheduled activities begin promptly at 9:25am. Children must be picked up by 12pm. Â Late pick-up charges will apply. Â Note thatÂ our playspaceÂ is open to the public during preschool hours. Structured activities/projects will be held in aÂ seperate area at play; Free play will be held in the playspace.Cancellation Policyplay.Â reserves the right to cancel any program if enrollment is insufficient. Â Any tuition paid will be refunded in full. If you must cancel your childâ€™s enrollment, please let us know as soon as possible so that we may offer the space to another child. If we are able to fill your child''s space, you will be issued a refund.AbsencesTuition for Preschool Prep cannot be refunded or pro-rated if your child is absent. Â Make-up classes are not offered. Â We have reserved space for each child exclusively during the designated weeks and maintain a waiting list for those who register after the space is full.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33645796%2F46645260091%2F1%2Foriginal.jpg?s=e89882b8ccd654dc203d792dbc155fc6', 'https://www.eventbrite.com/e/preschool-prep-fall-semester-registration-36585385874?aff=ebapi', '4972 Northwind Dr, East Lansing, MI 48823', 42.72562600000001, -84.45273700000001, '4972 Northwind Dr, East Lansing, MI 48823', NULL, NULL, '1505206800', '1510660800', 0, 0, 0, NULL, 0),
(813, 'live', '36618821882', NULL, 0, 2, '2017 Capital Area IT Vendor Roadshow', 'Trivalent Group is bringing the IT Vendor Roadshow back to Lansing! Join us for this free executive seminar with some of our strategic partners, including Dell, VDA Labs, Barracuda and WatchGuard on September 20th at the Radisson Hotel Lansing at the Capital. Here you will discover the latest solutions from some of the world''s leading vendors in cyber security, software, cloud, wireless, storage and more!\nContinental breakfast will be provided, followed by a keynote address to kick-start the Roadshow. There will be four 40-minute sessions from some of our top strategic partners in IT afterwards, and then a lunch during which door prizes will be given away (must be present to win).\nSeating is limited â€” be sure to register to claim your free seat today! A complete agenda of the day''s activities will be available soon.\nUpon arrival, please park in the ramp, and we will provide validation at check-in. If you have any questions or for more information, please email us at events@trivalentgroup.com or call us at (616) 301-6301.Â \nWe look forward to seeing you on September 20th at the Radisson Hotel!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33785234%2F127424542397%2F1%2Foriginal.jpg?s=516c518aff87236d9dda5708ad55de7f', 'https://www.eventbrite.com/e/2017-capital-area-it-vendor-roadshow-tickets-36618821882?aff=ebapi', '111 North Grand Avenue, Lansing, MI 48933', 42.7341643, -84.55084679999999, '111 North Grand Avenue, Lansing, MI 48933', NULL, NULL, '1505894400', '1505912400', 0, 0, 0, NULL, 0),
(814, 'live', '36670597745', NULL, 0, 2, 'Lansing EC Council CEH v9 Training Course - Omni212 | Certified Ethical Hacker training', 'Omni212 Prime membership\nNow become an Omni212 Prime member and get $100 off every training course published by Omni212 on eventbriteÂ \nSign up for Omni212 Prime membership:Â http://bit.ly/2vh4UNNÂ \nTo see all currently published Omni212 courses in eventbrite, type ''Lansing Omni212'' in the evenbrite search box.\nÂ \nUnlimited Training\nNow you can enjoy unlimited training from Omni212. Find out more about our Unlimited training Plan:\nhttp://bit.ly/2uAXJCN\n\nVideo Conference Details\nWill be sent after registration and payment\n\nThe Certified Ethical Hacker V9 Class\nIntroduction\nThe Certified Ethical Hacker program is the pinnacle of the most desired information security training program any information security professional will ever want to be in. To master the hacking technologies, you will need to become one, but an ethical one! The accredited course provides the advanced hacking tools and techniques used by hackers and information security professionals alike to break into an organization. As we put it, â€œTo beat a hacker, you need to think like a hackerâ€. This course will immerse you into the Hacker Mindset so that you will be able to defend against future attacks. The security mindset in any organization must not be limited to the silos of a certain vendor, technologies or pieces of equipment.\nThis ethical hacking course puts you in the driverâ€™s seat of a hands-on environment with a systematic process. Here, you will be exposed to an entirely different way of achieving optimal information security posture in their organization; by hacking it! You will scan, test, hack and secure your own systems. You will be taught the five phases of ethical hacking and taught how you can approach your target and succeed at breaking in every time! The five phases include Reconnaissance, Gaining Access, Enumeration, Maintaining Access, and covering your tracks!\n\nÂ­Â­Video Conference Details\nWill be sent to you once you register and make the payment\n\nWhy EC Council Certified Ethical Hacker Class?\n1. EC Council Certified Instructor teaches the class2. Printed Training Manuals (EC Council Training kits)3. 6 months of iLabs Activation - access to EC Council portal4. Class recordings uploaded on the cloud after every session5. EC Council Certification Exam Voucher\n\nNext class starting\nSeptember 14, 2017\n\nTraining Session Details\nThere will be 18 online sessions, each session being of 2 hours. Every session will have presentation about theory, concepts and technology, followed by Hands-on Lab practice exercises.Â  Â  Â  Â  Â  Â  Â  Â \nTraining Dates\n\nBegins September 14, 2017, taught over 6 weeks ending October 23, 2017\nEvery week, Mon, thu 6:00 PM - 8:00 PM (US Pacific Time) and Sat 8:30 - 10:30 am pacific.Â \nClass dates: September 14,16,18,21,23,25,28,30,October 2,5,7,9,12,14,16.19.21,23\nEach session will be recorded and the recordings will be shared after each session with students.\n\n\nTarget Audience\nThis course will significantly benefit security officers, auditors, security professionals, site administrators, and anyone who is concerned about the integrity of the network infrastructure.\nÂ \nPrerequisites\nThe knowledge and skills that a learner must have before attending this course is as follows:\n\nHave successfully completed EC-Councilâ€™s Certified Network Defender (CND) course or\nHave successfully completed CompTIAâ€™s Security+ (IN-SE) course\n\nThere is a minimum age requirement that applies and attendance of the Ethical Hacking and Countermeasures training course or attempts at the relevant exam, is restricted to candidates who are at least 18 years old.\nÂ \nWhy Certified Ethical Hacker Training from Omni212 ?\n\nOur CEH training is very hands on. You will use Virtual images including Kali Linux image for practical lab exercises.\nOur Instructors are EC Council Certified Ethical Hackers and penetration testers who actively work on helping the police and Government with cybercrimes.\nEmployees of Microsoft, Dept. of Homeland Security, TD Ameritrade, a Minnesota county and other companies have taken our classes.\nThose with US Top Security Clearance have taken our class.\n\nÂ \nWho should take this class?\nOur typical student profile is someone who wants to learn ethical hacking to enhance their cybersecurity skills, those who want to take the CEH V9 certification exam, software engineer, cybersecurity, information security professionals, IT professional, network engineer, students.\nÂ \nCourse Objectives\nUpon completing this course, the learner will be able to:\nMaster an ethical hacking methodology that can be used in a penetration testing or ethical hacking situation. You walk out the door with ethical hacking skills that are highly in demand, as well as the internationally recognized Certified Ethical Hacker certification! This course prepares you for EC-Council Certified Ethical Hacker exam 312-50. Cost of exam is included in the price.\nÂ \nCourse Content\nÂ 1.Â Introduction to Ethical Hacking\n\nInternet is Integral Part of Business and Personal Life - What Happens Online in 60 Seconds\nInformation Security Overview \nInformation Security Threats and Attack Vectors \nHacking Concepts, Types and Phases \nEthical Hacking Concepts and Scope \nInformation Security Controls \nInformation Security Laws and Standards\n\n\nÂ 2.Â Footprinting and Reconnaissance\n\nFootprinting Concepts \nFootprinting Methodology \nFootprinting Tools \nFootprinting Countermeasures \nFootprinting Penetration Testing\n\n\n3. Scanning Networks\n\nOverview of Network Scanning \nCEH Scanning Methodology \nScanning Beyond IDS \nBanner Grabbing \nScan for Vulnerability \nDraw Network Diagrams \nPrepare Proxies \nScanning Pen Testing\n\n\nÂ 4.Â Enumeration\n\nEnumeration Concepts \nNetBIOS Enumeration \nSNMP Enumeration \nLDAP Enumeration \nNTP Enumeration \nSMTP Enumeration \nEnumeration Countermeasures \nSMB Enumeration Countermeasures \nEnumeration Pen Testing\n\n\n5. System Hacking\n\nInformation at Hand Before System Hacking Stage \nSystem Hacking: Goals \nCEH Hacking Methodology (CHM) \nCEH System Hacking Steps \nHiding Files \nCovering Tracks \nPenetration Testing\n\n\n6. Malware Threats\n\nIntroduction to Malware \nTrojan Concepts \nTypes of Trojans \nVirus and Worms Concepts \nMalware Reverse Engineering \nMalware Detection \nCountermeasures \nAnti-Malware Software \nPenetration Testing \n\n\nÂ 7.Â Sniffing\n\nSniffing Concepts \nMAC Attacks \nDHCP Attacks \nARP Poisoning \nSpoofing Attack \nDNS Poisoning \nSniffing Tools \nSniffing Tool: Wireshark \nFollow TCP Stream in Wireshark \nDisplay Filters in Wireshark \nAdditional Wireshark Filters \nPacket Sniffing Tool: Capsa Network Analyzer \nNetwork Packet Analyzer \nCounter measures \nSniffing Detection Techniques \nSniffing Pen Testing\n\n\nÂ 8.Â Social Engineering\n\nSocial Engineering Concepts \nSocial Engineering Techniques\nImpersonation on Social Networking Site\nIdentity Theft \nSocial Engineering Countermeasures \nPenetration Testing\n\n\nÂ 9.Â Denial of Service\n\nDoS/DDoS Concepts \nDoS/DDoS Attack Techniques \nBotnets \nDDoS Case Study \nDoS/DDoS Attack Tools \nCounter-measures \nDoS/DDoS Protection Tools \nDoS/DDoS Attack Penetration Testing\n\n\nÂ 10.Â Session Hijacking\n\nSession Hijacking Concepts \nApplication Level Session Hijacking \nNetwork-level Session Hijacking \nSession Hijacking Tools \nCounter-measures \nSession Hijacking Pen Testing\n\n\nÂ 11.Â Hacking Web Servers\n\nWebserver Concepts \nWebserver Attacks \nAttack Methodology \nWebserver Attack Tools \nCounter-measures \nPatch Management \nWebserver Security Tools \nWebserver Pen Testing\n\n\nÂ 12.Â Hacking Web Applications\n\nWeb App Concepts \nWeb App Threats \nWeb App Hacking Methodology \nWeb Application Hacking Tools \nCountermeasures \nSecurity Tools \nWeb App Pen Testing\n\n\nÂ 13.Â SQL Injection\n\nSQL Injection Concepts \nTypes of SQL Injection \nSQL Injection Methodology \nSQL Injection Tools \nEvasion Techniques \nCounter-measures\n\n\nÂ 14.Â Hacking Wireless Networks\n\nWireless Concepts \nWireless Encryption \nWireless Threats \nWireless Hacking Methodology \nWireless Hacking Tools \nBluetooth Hacking \nCounter-measures \nWireless Security Tools \nWi-Fi Pen Testing\n\n\nÂ 15.Â Hacking Mobile Platforms\n\nMobile Platform Attack Vectors \nHacking Android OS \nHacking iOS \nHacking Windows Phone OS \nHacking BlackBerry \nMobile Device Management (MDM) \nMobile Security Guidelines and Tools \nMobile Pen Testing \n\nÂ \n16. Evading IDS, Firewalls and Honeypots \n\nIDS, Firewall and Honeypot Concepts \nIDS, Firewall and Honeypot System \nEvading IDS \nEvading Firewalls \nIDS/Firewall Evading Tools \nDetecting Honeypots \nIDS/Firewall Evasion Counter-measures \nPenetration Testing \n\nÂ \n17. Cloud Computing \n\nIntroduction to Cloud Computing \nCloud Computing Threats \nCloud Computing Attacks \nCloud Security \nCloud Security Tools \nCloud Penetration Testing \n\nÂ \n18. Cryptography \n\nMarket Survey 2014: The Year of Encryption \nCase Study: Heartbleed \nCase Study: Poodlebleed \nCryptography Concepts \nEncryption Algorithms \nCryptography Tools \nPublic Key Infrastructure (PKI) \nEmail Encryption \nDisk Encryption \nCryptography Attacks \nCryptanalysis Tools \n\nÂ \nClass Size:Â Maximum 22\n\nPrice:Â $2495\n\nOmni212Â is aÂ GeekwireÂ top 200 startup in the Lansing area -Â http://www.geekwire.com/geekwire-200/Â Â Â \n\nREFUND POLICY\n1. There are no refunds.2. If for any reason the course has not been taken, the payment can be applied towards any future course by Omni212.\nÂ \nkeywords - ceh trainingÂ Lansing, ceh v9 training Lansing, LansingÂ certified ethical hacker training, LansingÂ ethical hacker training,Â ceh trainingÂ Lansing,Â LansingÂ ceh v9 training, certified ethical hacker trainingÂ Lansing, ethical hacker trainingÂ