(826, 'live', '36751226909', NULL, 0, 2, 'The Nutcracker', 'At a gala Christmas Eve party, Claraâ€™s godfather presents her with an amazing Nutcracker in the form of a wooden soldier. In the night, he comes alive to tell her he is a prince under the wicked enchantment of the Mouse King, and the two set o to regain his throne. When she wakes, the Nutcracker is gone. Was it all a dream? Music by Pyotr Ilyich Tchaikovsky.Â \n*please note we do not own this artwork*', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33870248%2F216298412943%2F1%2Foriginal.jpg?s=f7c895731c7d4085ff6b80343e6cb784', 'https://www.eventbrite.com/e/the-nutcracker-tickets-36751226909?aff=ebapi', '1120 N. Pennsylvania, Lansing, MI 48906', 42.74615, -84.53738799999996, '1120 N. Pennsylvania, Lansing, MI 48906', NULL, NULL, '1512673200', '1512680400', 0, 0, 0, NULL, 0),
(827, 'live', '36755611022', NULL, 0, 2, 'i.d.9:16 Lansing Summit: The Furnace', 'The Furnace:\nEveryone suffers.Throughout our lives on earth, we deal with hardships, circumstances, and events that leave us wounded, bleeding, confused, and damaged. In the midst of these times, we have a choice of whether or not we surrender it to Jesus or try to make it on our own. Sometimes the fiery ordeal is caused by outside influences and sometimes by inner forces. Either way, disciples of Christ must learn to walk in the midst of the fire, with Jesus, while growing in holiness and actively engaged in mission. How does the Lord heal us? How can He bring good out of the suffering especially surrounding our evangelistic efforts? How can the saints speak so fondly of suffering and see it as a tremendous blessing? Letâ€™s dive into the Word of God to seek answers to these questions. We are a community on the move, yet often the community is hurting, so letâ€™s take the time to look at suffering, persecution, pain, and the â€˜furnace of humiliationâ€™ and together decide to remain His disciples.\nDate:Â Aug. 26\n\nPlace:Â Church of the Resurrection & Resurrection Parish Hall\n\nTime:Â 8:15 a.m. to 2 p.m.\n\nCost: $10', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33877277%2F221777708392%2F1%2Foriginal.jpg?s=8006a7db153ee6027218aedb74cb8548', 'https://www.eventbrite.com/e/id916-lansing-summit-the-furnace-tickets-36755611022?aff=ebapi', '1521 East Michigan Avenue, Lansing, MI 48912', 42.73375499999999, -84.5278975, '1521 East Michigan Avenue, Lansing, MI 48912', NULL, NULL, '1503735300', '1503756000', 0, 0, 0, NULL, 0),
