(831, 'live', '36629914059', NULL, 0, 2, 'Lansing PMI-ACP Certification Prep | PMI - ACP training | PMI-ACP Training Course - Omni212', 'Omni212 Prime membership\nNow become an Omni212 Prime member and get $100 off every training course published by Omni212 on eventbrite\nSign up for Omni212 Prime membership: http://bit.ly/2vh4UNN\n\nUnlimited Training\nNow you can enjoy unlimited training from Omni212. Find out more about Unlimited training by Omni212:\nhttp://bit.ly/2uAXJCN\n\nWhy PMI-ACP Certification exam Prep Training from Omni212?\n1. We follow the Gold standard in PMI-ACP Certification exam Prep Training.2. Our Instructors have at least 1000 hours of real life PMI-ACP Experience plus they are PMI Certified Instructors3 Class recordings, Training manual for this class will be made available. 4. Post class support and mentorship5. Career advancement and Job placement assistance\nVideo Conference Link for Training\nWill be sent upon registration and payment\n\nTraining Provider:\nOmni212\n\nDelivery Method:\nExclusively online via video conference. Virtual Instructor Led Training\n\nDates:\nAug 26 - Oct 8, 2017\nAudience:\n\n\nYou are interested in getting trained so you can take the PMP Certification exam.\n\n\n\nPrerequisite:\nNone\n\nClass Schedule:\nEvery weekend, Sat, Sun 10am - 1pm US Pacific time\n\nCourse Outline:\n1. Introduction\n2. Project Management Framework\n3. Project Integration Management\n4. Project Scope Management\n5. Project Time Management\n6. Project Cost Management\n7. Project Quality Management\n8. Project Human Resource Management\n9. Project Communication Management\n10. Project Risk Management\n11. Project Procurement Management\n12. Project Stakeholder Management\n13. Professional Responsibility\n14. Review & Final Evaluation Test\n\nREFUND POLICY\n1. There are no refunds.\n2. If for any reason, students decide not to take this class, the class is rescheduled or cancelled, the payment can be applied towards any future course by Omni212.Â \n\nPROJECT MANAGEMENT INSTITUTE AGILE CERTIFIED PRACTITIONER (PMI-ACP)Â® EXAM PREP COURSE FAQ\nAN INTRODUCTION TO THE (PMI-ACP)Â®\nIn the mid 1990â€™s, the Agile development process emerged as an alternative to traditional plan-driven project management methodologies. Plan-driven methodologies had worked well for small projects with a limited scope of work and few variables, but as the IT industry evolved, development projects grew increasingly more complex. Agile ascribes to the principles of lean development, which emphasizes efficiency in order to optimize the delivery of value to the end customer. The pillars of Agile processes are laid out the Agile Manifesto as follows:\n\nIndividuals and interactions over processes and tools.\nWorking software over comprehensive documentation.\nCustomer collaboration over contract negotiation.\nResponding to change over following a plan.\n\nMore generally, Agile emphasizes flexibility, nimbleness and adaptability. It is also iterative as opposed to cyclical, delivering capabilities to customers incrementally and mitigating risk relating to project scope and schedule uncertainty. Agile is now increasingly embraced as the development process of choice for project managers. Gartner estimates that 80% of all software development projects will utilize Agile methods by the end of 2012. Accordingly, the PMIÂ® is now offering a new Agile certification â€” the (PMI-ACP)Â®. If youâ€™re a project manager with Agile experience, you will demonstrate your knowledge of how Agile is applied and practiced. This certification is designed to verify project managersâ€™ mastery of Agile principals and processes, validating their existing expertise to companies looking to adopt the Agile methodology.\nHOW IS THE (PMI-ACP)Â® DIFFERENT FROM OTHER AGILE/SCRUM CERTIFICATIONS?\nIf you are new to Agile, Omni212 recommends first taking ourÂ Scrum master certified course. For project managers in the IT industry, learning the fundamentals, terminology, practices and principles of the roles of the Scrum Master or Scrum Team Member is a great introduction to the larger Agile framework. Additionally, there is no experience prerequisite for the Certified Scrum Master exam, which consists of 25 questions and is administered on a â€œno failâ€ basis. By contrast, the (PMI-ACP)Â® is specifically designed for Project & Program Managers, Product Owners, Scrummasters, Scrum Product Owners, Agile Coaches,Â Agile Trainers, Sr. Developers, Business and IT Managers with extensive experience in multiple Agile methodologies (Scrum, kanban, XP, lean, DSDM, TDD, ATDD, etc.). General project experience is required in addition to Agile-specific experience and education. The exam is designed to test both the practitionerâ€™s level of professionalism in Agile practices of project management and professional versatility in project management tools and techniques.Â \n\nWHAT ARE THE (PMI-ACP)Â® REQUIREMENTS?\nTo see if your project management experience satisfies the eligibility requirements, first download and review theÂ (PMI-ACP)Â® Handbook. You can alsoÂ RegisterÂ for free, which youâ€™ll need to do eventually to apply to take the exam. The site a great tool, with lots of additional resources and information on other PM certifications.Â Pages 7-8 of the PMI ACP HandbookÂ provide a detailed explanation of the specific education, experience, and project management study prerequisites that must be met to qualify for the exam.\n1. Project Management Experience\n\nMinimum of 2000 hours of general project experience.\nMinimum of 12 months of project management experience (gaps in experience and overlapping experience will not be counted). Each month in which you worked on multiple, overlapping projects (projects that ran simultaneously) counts as one month toward the total requirement.\nAll applicable experience must not date back further than five years from the application submittal date.\n\n2. Agile Project Experience\n\n\nMinimum of 1500 hours of Agile project experience.\n\n\nMinimum of 8 months of Agile project experience (gaps in experience and overlapping experience will not be counted). Each month in which you worked on multiple, overlapping projects (projects that ran simultaneously) counts as one month toward the total requirement.\n\n\nAgile project experience not dating back further than three years from application submittal date.\n\n\n3. Training in Agile Practices\n\nMinimum of 21 contact hours of formal education (Professional Development Units) in Agile project philosophy, methodologies, principles and practices (one contact hour is equivalent to one actual hour of training or instruction received).\nThere is no timeframe associated with this requirement; therefore, candidates can document all Agile project management education, regardless of when it was accrued. Coursework must be complete at the time of examination.\nCourses, workshops and training sessions offered by one or more of the following types of education providers:\n\nA. PMIÂ® Registered Education Providers(R.E.P.s)*\nB. PMIÂ® component organizations*\nC. Employer/company-sponsored programs\nD. Training companies or consultants (e.g., training schools)\nE. Distance-learning companies, including an end-of-course assessment\nF. University/college academic and continuing education programs\n\nSelf-directed learning (e.g., reading books, watching instructional videos or sessions with coaches or mentors) does not qualify.\n\n\n(PMI-ACP)Â® EXAM DETAILS\nThe exam is comprised of a total of 120 multiple-choice questions â€” 20 of which are pretest questions that do not affect the score. Computer-based testing is the standard method for PMIÂ® certification exams, although paper-based testing is available in certain situations. The time allotted for the exam is three hours. Exam questions are divided evenly â€” 50% Agile tools and techniques and 50% knowledge and skills. The Agile tools and techniques covered include: Communications; Planning, monitoring and adapting; Agile estimation; Agile analysis and design; Product quality; Soft skill negotiation; Value-based prioritization; Risk management; Metrics; and Value stream analysis.Â ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33706972%2F59307985005%2F1%2Foriginal.jpg?s=ba0b761e4a71efcae93cc32a864a7217', 'https://www.eventbrite.com/e/lansing-pmi-acp-certification-prep-pmi-acp-training-pmi-acp-training-course-omni212-tickets-36629914059?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1503752400', '1507478400', 0, 0, 0, NULL, 0),
(832, 'live', '36803277594', NULL, 0, 2, 'MAA Leadership Symposium 2017', 'The Michigan AfterSchool Association Leadership SymposiumÂ 2017 is forÂ leadersÂ who work in, and with, the out-of-school time sector. Â The purpose of this Leadership Symposium is to equip leaders to create policies, programs, and practices that ensure all youth to reach their full potential. Â This is an opportunity forÂ leadersÂ at all levels, including youth, to engage with national and state thoughtÂ leadersÂ to gain new perspectives and skills to create high-quality OST learning opportunities for all youth in Michigan. Â \nThe Michigan AfterSchool Association Leadership Symposium will draw approximately 300 youth development professionals from across the state of Michigan.Â  The conference will be held Friday, September 29, at the Crowne Plaza-West hotel in Lansing, Michigan.\nPresenters will focus on how leaders from different levels can work together to create high-quality learning environments that reduce disparities among youth.Â  MAA understands that the out-of-school time sector must provide different types of supports to different youth (urban, rural, suburban) in order to ensure all youth are successful in school and in life.Â \nMAA has identified these NAA core competencies as priorities for the Leadership Symposium:\n\nCultural competency;\nProgram planning and development;\nProfessional development/leadership; and\nFamily, school, and community relations.\n\nOther priority areas include:\n\nGetting to equity through high-quality OST programming;\nCreating a culture of social emotional learning (SEL);\nCreating trauma-informed organizations and programs.\n\n\n\n\nRegistration:\nVendors: Register Now Through Eventbrite\nMAA Members: Check your email for Earlybird Registration Information\nMAA Non-Members: Registration available August 15, 2017\n\n\n\nSchedule:\n\nRegistration Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  7:30 to 8:30\nWelcome & State of MAA Address Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â 8:30 to 9:30\nMorning Keynote: Engaging Youth as Agents of Change - Fausto LopezÂ  Â  Â  Â  Â 9:00 to 10:00 Â \nBREAK Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â 10:00 to 10:15\nSessionsÂ Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  10:15 to 11:45\nLunchÂ Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  11:45 to 12:30\nPanel Discussion: What Does it Mean to Lead in the OST? Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  12:30 to 1:30\nPeerÂ Table Conversation Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  1:30 to 2:30\nBREAKÂ Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  2:30 to 2:45\nSessions Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  2:45 to 4:15\nSilent Auction Results Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  4:15 to 4:30Â \n\n\nKeynote: Â Engaging Youth as Agents of Change\nThe success of the future leaders of the world greatly depends on the efforts made today. All over the world, nations and communities are preparing for an uncertain future. In this very challenging time, it is critical to develop the next generation of leaders and activists to combat poverty, violence, and global issues that will shape their lives. This effort requires radical approaches to analyzing and developing solutions. So, how do we, as out-of-school time leaders and practitioners, influence tomorrowâ€™s leaders? We must begin by meaningfully engaging young people as partners, empower them as change agents, and inspire our future leaders to make a lasting difference. As adult leaders and decision makers, we must be prepared to adapt our strategies, challenge our biases, and shift the attitudes of our society to value youth input and invest in their success.\nKeynote Speaker: Fausto A. LÃ³pez\nFausto A. LÃ³pezÂ is a bilingual, Spanish speaking, afterschool and expanded learning specialist at American Institutes for Research. LÃ³pez is a youth development advocate and he provides comprehensive technical assistance, training, and professional development to diverse audiences in the education and out-of-school time sectors. LÃ³pez works with new and emerging afterschool and education systems to design resources and tools that support programs in the development, implementation, and evaluation of quality youth programs. LÃ³pez specializes in U.S. Department of Education, Every Student Succeeds Act (21st Century Community Learning Centers [21st CCLC], Gaining Early Awareness for Undergraduate Programming [Gear Up], and Upward Bound).\n\nLÃ³pez is native to Chicago where he has led and organized youth programs for 15 years, engaging youth in art based service projects, community organizing, and civic leadership. Most recently, he led the development of an expanded learning guide and training model for afterschool programs in Latin America (Mexico and Argentina) and contributed to the Beyond the Bell Toolkit-4th edition. He is a nationally recognized presenter on education and afterschool topics (e.g., youth development, social and emotional learning, college and career readiness) and facilitates national, regional, and statewide educational workshops that connect research and practice. His areas of expertise include Educational Psychology, Youth Participatory Action Research, Structured Youth Sports, Participatory Planning, and Youth Organizing/Civic Engagement. LÃ³pez holds a masterâ€™s degree in education psychology and youth development from the University of Illinois at Chicago.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33939993%2F183653165710%2F1%2Foriginal.jpg?s=f26ef710704a8041da514d5854d36a2b', 'https://www.eventbrite.com/e/maa-leadership-symposium-2017-tickets-36803277594?aff=ebapi', '925 South Creyts Road, Lansing, MI 48917', 42.7228773, -84.64103560000001, '925 South Creyts Road, Lansing, MI 48917', NULL, NULL, '1506670200', '1506702600', 0, 0, 0, NULL, 0),
