or more info please contact Jocelyn Hoover Davis at davisjkhd@gmail.com\nÂ ', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33980092%2F128340803641%2F1%2Foriginal.jpg?s=b38d1d55e572729af5e14027799b011a', 'https://www.eventbrite.com/e/eastern-hs-class-of-1977-40th-reunion-tickets-36321602892?aff=ebapi', '16460 Old U.S. 27, Lansing, MI 48906', 42.7773295, -84.5436171, '16460 Old U.S. 27, Lansing, MI 48906', NULL, NULL, '1505556000', '1505570400', 0, 0, 0, NULL, 0),
(835, 'live', '35516518864', NULL, 0, 2, 'LBC 50th Anniversary Celebration', 'Join LBC alumni, faculty, staff, and students to commemorate half a century of living and learning in Holmes Hall.\nIn 1967, Lyman Briggs College was created to bridge the gap between the sciences and the humanities. Now the Lyman Briggs community invites alumni, family, and friends to help us celebrate 50 years of LBC!\nSchedule of Events\nWednesday, October 18\nRegistration\nRegistration will be held at Holmes Hall from 1:00-6:00. Complimentary parkingÂ will be availableÂ in lot 89 (Mt. Hope and Farm Lane). Shuttles will run from lot 89 to Holmes Hall from 12:00-3:00.\nGathering at the Huntington Club\nÂ Join LBC for dinner and drinks at the Huntington Club inside Spartan Stadium from 6:00-8:00 to kick off the event.\nThursday, October 19\nBug House Open House\nThe MSU Bug House is open to visitors from 9:00-12:00.\nCyclotron Tour\nTours MSU''s cyclotron are from 2:00-3:30. Only 50 tickets are available for this tour.\nHolmes Hall Tours\nSee some of the exciting changes to Holmes Hall, including the physics studio and REAL classroom! Tours are from 4:00-5:00.\nDinner\nDine in Holmes Hall cafeteria from 6:00-7:00.\nAlumni Discussion Panel\nFrom 7:00-9:00, a panel of alumni will discuss their LBC experience.\nGame Night\nJoing your fellow Briggsies for a game night in Holmes Hall! Time and location to be determined.\nFriday, October 20\nHorticulture Garden Tours\nTours of MSU''s Horticulture Garden will run from 1:30-2:30.\nHolmes Hall Tours\nSee some of the exciting changes to Holmes Hall, including the physics studio and REAL classroom! Tours are from 4:00-5:00.\nHomecoming Parade\nWatch the MSU Homecoming parade from the bleachers with your fellow alumni! The parade is from 5:00-6:00. Seating is limited to 50 people.\nStudent Sharing\nLBC students will be sharing their study abroad stories, reseach experiences, and more from 6:00-9:00 in Holmes Hall.\nSaturday, October 21\nHomecoming Tailgate\nTailgate with LBC! Food and games will be available outside Holmes Hall before the Homecoming game. Shuttles will be running from Holmes Hall to the stadium, and also to lot 89.\nParking Information\nParking will be available free of chargeÂ in lot 89 (Mt. Hope and Farm Lane). Shuttles will run from the lot to Holmes Hall.\nThere will be a fee to park in the lot on Saturday, as it is the day of the Homecoming football game.\nT-Shirts\nEvent T-shirts can be added to your order during checkout. Adult sizes only. For those who register before October 1st, event T-shirts will be $15.00. After early registration ends, T-shirts will be $20.00. Extra t-shirts can be purchased at the event for $20.00. Supplies will be limited.\n$5 from the proceeds of each T-shirt sold will be given to the Lyman Briggs Learning Assistant Support Fund.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32507859%2F217386960810%2F1%2Foriginal.jpg?s=e830dfaf77f4ba978c5cdedd2b4d90c6', 'https://www.eventbrite.com/e/lbc-50th-anniversary-celebration-registration-35516518864?aff=ebapi', '919 East Shaw Lane, East Lansing, MI 48825', 42.7255269, -84.46544949999998, '919 East Shaw Lane, East Lansing, MI 48825', NULL, NULL, '1508331600', '1508623200', 0, 0, 0, NULL, 0),
(836, 'live', '36843086664', NULL, 0, 2, 'Taste of Blacksmithing - Hook', 'Learn the basics of using heat,Â hammers,Â and anvil to form metal into beautiful and useful objects!Â  In this 3 hourÂ workshop,Â you''ll learnÂ traditionalÂ blacksmithingÂ methods including tapering, bending, twisting and punching while youÂ forgeÂ anÂ attractiveÂ wall hook.Â  No previous experienceÂ necessary, we''ll show you everything it takes to make! Class size is limited to 6 participantsÂ to ensureÂ everyoneÂ receivesÂ one on one instruction.\nFAQs\nNote: Additional class policies can be found on our website:Â https://www.lansingmakersnetwork.org/classes-and-workshops/class-policies/\nWhat should I wear or bring to the class?\nPlease wearÂ work boots or shoes made from leather or canvas (no nylon, it melts!). WearÂ natural fiber clothing (cotton is best). Safety glasses are required and will be provided, but if you have a pair you''re comfortable in, consider bringing your own.\n\nAre there ID requirements or an age limit to enter the event?\nThis workshop is only for those 16+. Â (Participants under 18 must be accompanied by an adult)\n\nWhere can I contact the organizer with any questions?\nAny questions, feel free to contact us at education@lansingmakersnetwork.org and we''ll try to get your question answered.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33990068%2F29464559187%2F1%2Foriginal.jpg?s=5cf5b7d841d7f1d4f9df404cdfb9886f', 'https://www.eventbrite.com/e/taste-of-blacksmithing-hook-tickets-36843086664?aff=ebapi', '2400 West Saint Joseph Street, Lansing, MI 48917', 42.72688220000001, -84.58436080000001, '2400 West Saint Joseph Street, Lansing, MI 48917', NULL, NULL, '1506160800', '1506171600', 0, 0, 0, NULL, 0),
(837, 'live', '36843234105', NULL, 0, 2, 'Taste of Blacksmithing - Hook', 'Learn the basics of using heat,Â hammers,Â and anvil to form metal into beautiful and useful objects!Â  In this 3 hourÂ workshop,Â you''ll learnÂ traditionalÂ blacksmithingÂ methods including tapering, bending, twisting and punching while youÂ forgeÂ anÂ attractiveÂ wall hook.Â  No previous experienceÂ necessary, we''ll show you everything it takes to make! Class size is limited to 6 participantsÂ to ensureÂ everyoneÂ receivesÂ one on one instruction.\nFAQs\nNote: Additional class policies can be found on our website:Â https://www.lansingmakersnetwork.org/classes-and-workshops/class-policies/\nWhat should I wear or bring to the class?\nPlease wearÂ work boots or shoes made from leather or canvas (no nylon, it melts!). WearÂ natural fiber clothing (cotton is best). Safety glasses are required and will be provided, but if you have a pair you''re comfortable in, consider bringing your own.\n\nAre there ID requirements or an age limit to enter the event?\nThis workshop is only for those 16+. Â (Participants under 18 must be accompanied by an adult)\n\nWhere can I contact the organizer with any questions?\nAny questions, feel free to contact us at education@lansingmakersnetwork.org and we''ll try to get your question answered.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33990312%2F29464559187%2F1%2Foriginal.jpg?s=db8a351ad91d8cff5c66582860ab6fcd', 'https://www.eventbrite.com/e/taste-of-blacksmithing-hook-tickets-36843234105?aff=ebapi', '2400 West Saint Joseph Street, Lansing, MI 48917', 42.72688220000001, -84.58436080000001, '2400 West Saint Joseph Street, Lansing, MI 48917', NULL, NULL, '1507370400', '1507381200', 0, 0, 0, NULL, 0),
(838, 'live', '36843263192', NULL, 0, 2, 'Introduction to Blacksmithing', 'Learn the basics of using heat, hammer, and anvil to form metal into beautiful and useful objects. In this 5-week class, you will be introduced to fundamental skills including tapering, dishing, bending, cutting and twisting of hot steel while making small projects, such as spoons, forks, bottle openers, and hooks. Class size is limited to 7 participants to ensure everyone receives one on one instruction.\nPlease note that this is a 5-week class meeting on Mondays from 6:30pm to 9:30pm (September 25th, October 2nd, 9th, 16th, 23rd).Â  Participants must be able to attend all class sessions.\nFAQs\nNote: Additional class policies can be found on our website:Â https://www.lansingmakersnetwork.org/classes-and-workshops/class-policies/\nWhat should I wear or bring to the class?\nPlease wearÂ work boots or shoes made from leather or canvas (no nylon, it melts!). WearÂ natural fiber clothing (cotton is best). Safety glasses are required and will be provided, but if you have a pair you''re comfortable in, consider bringing your own.\n\nAre there ID requirements or an age limit to enter the event?\nThis workshop is only for those 16+. Â (Participants under 18 must be accompanied by an adult who is also enrolled in the course)\n\nWhere can I contact the organizer with any questions?\nAny questions, feel free to contact us at education@lansingmakersnetwork.org and we''ll try to get your question answered.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33990366%2F29464559187%2F1%2Foriginal.jpg?s=c4b377f3ec14580959ed21a3eef8e15c', 'https://www.eventbrite.com/e/introduction-to-blacksmithing-tickets-36843263192?aff=ebapi', '2400 West Saint Joseph Street, Lansing, MI 48917', 42.72688220000001, -84.58436080000001, '2400 West Saint Joseph Street, Lansing, MI 48917', NULL, NULL, '1506364200', '1508794200', 0, 0, 0, NULL, 0),
(839, 'live', '36843576128', NULL, 0, 2, 'Introduction to Blacksmithing', 'Learn the basics of using heat, hammer, and anvil to form metal into beautiful and useful objects. In this 5-week class, you will be introduced to fundamental skills including tapering, dishing, bending, cutting and twisting of hot steel while making small projects, such as spoons, forks, bottle openers, and hooks. Class size is limited to 7 participants to ensure everyone receives one on one instruction.\nPlease note that this is a 5-week class meeting on Mondays from 6:30pm to 9:30pm (November 6th, 13th, 20th, December 4th, 11th).Â  Participants must be able to attend all class sessions.\nFAQs\nNote: Additional class policies can be found on our website:Â https://www.lansingmakersnetwork.org/classes-and-workshops/class-policies/\nWhat should I wear or bring to the class?\nPlease wearÂ work boots or shoes made from leather or canvas (no nylon, it melts!). WearÂ natural fiber clothing (cotton is best). Safety glasses are required and will be provided, but if you have a pair you''re comfortable in, consider bringing your own.\n\nAre there ID requirements or an age limit to enter the event?\nThis workshop is only for those 16+. Â (Participants under 18 must be accompanied by an adult who is also enrolled in the course)\n\nWhere can I contact the organizer with any questions?\nAny questions, feel free to contact us at education@lansingmakersnetwork.org and we''ll try to get your question answered.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F33990749%2F29464559187%2F1%2Foriginal.jpg?s=9c885689b3020362f33e3d0b5bf777bf', 'https://www.eventbrite.com/e/introduction-to-blacksmithing-tickets-36843576128?aff=ebapi', '2400 West Saint Joseph Street, Lansing, MI 48917', 42.72688220000001, -84.58436080000001, '2400 West Saint Joseph Street, Lansing, MI 48917', NULL, NULL, '1509993000', '1513027800', 0, 0, 0, NULL, 0),
(840, 'live', '36556765269', NULL, 0, 2, 'Drinking Lunch - August 17, 2017', 'There was a time when it was expected that youâ€™d have a few at your business lunch - and then it vanished. Weâ€™re PROUD to be bringing back the afternoon libation - without the judgment. So, bring your business cards, and raise a toast to The Drinking Lunch. Visit TheDrinkingLunch.com for more.Â \n*Please note that your email will be added to our mailing list - trust us, you won''t want to miss these monthly events.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F34008623%2F174700953836%2F1%2Foriginal.jpg?s=b63b3f67f2f612e10ddb9a19882d47f3', 'https://www.eventbrite.com/e/drinking-lunch-august-17-2017-tickets-36556765269?aff=ebapi', '518 East Shiawassee Street, Lansing, MI 48912', 42.7369821, -84.54555519999997, '518 East Shiawassee Street, Lansing, MI 48912', NULL, NULL, '1502978400', '1502985600', 0, 0, 0, NULL, 0),
(841, 'live', '33769519542', NULL, 0, 2, 'Real Estate Investing Webinar Lansing', 'Interested in real estate investing? Don''t know where to start?\nWant to learn real estate investing by networking with like minded indviduals?\nWant to learn how to get out the rat race?\nIf the answer is Yes, come join us!\nLearn real estate investment strategies such as fix and flip, buy, and hold, short sale, foreclosures, and multi family.\nLearn how to pay off your house in 10 years or less\nLearn how real estate investors fund real estate deals without your own money or credit!\nRSVP Now!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F30454742%2F171787685717%2F1%2Foriginal.jpg?s=a78af935c72c231cae0e381057ead14c', 'https://www.eventbrite.com/e/real-estate-investing-webinar-lansing-tickets-33769519542?aff=ebapi', 'Lansing, MI', 42.732535, -84.55553470000001, 'Lansing, MI', NULL, NULL, '1502827200', '1502829000', 0, 0, 0, NULL, 0),
(842, 'live', '36891019031', NULL, 0, 2, 'Film Screening: 12th and Clairmount', 'Home movie footage donated by metro Detroiters provides the spine of â€œ12th and Clairmount,â€ which looks back at the Detroit riot of 1967 â€” and its causes and aftermath.\nThose five days in July were among the most pivotal â€” and divisive â€” in the cityâ€™s history, with the turmoil leaving 43 dead. While the 50th anniversary of the summer of â€™67 was the impetus for the film, the home movie footage in â€œ12th and Clairmountâ€ captures a wide spectrum of Detroit life, from proud streetscapes to dance parties to neighborhood sporting events.\nDrawing from more than 400 reels of donated home movies from the era, other unearthed footage and newly recorded oral histories, the documentary is being produced by the Free Press in collaboration with Bridge Magazine and WXYZ-TV (Channel 7) and a group of metro Detroit cultural institutions, led by the Detroit Institute of Arts.\nThe Michigan History Center is hosting a free outdoor showing of â€œ12th and Clairmountâ€ at the Michigan Library and History Center on Thursday, August 24, 2017 from 8:00pm to 10:00pm. The event will be held outdoors on the buildingâ€™s stunning second floor courtyard. Doors open at 7:00pm, and the Michigan History Museum will be open for pre-show viewing.\nAt 8:00pm, a short program will provide background information on the civil unrest of 1967, and the development of the film. The film will begin once it is fully dark, around 8:30pm.\nLimited seating will be available on the courtyard, but guests are encouraged to bring camp chairs or blankets. Please note that the courtyard is pavement, so chairs are encouraged.\nSnacks, such as popcorn and ice cream, will be available for purchase.\nDue to the documentaryâ€™s graphic scenes and language, this film is not recommended for young children.\nIn the event of rain or inclement weather, the event will be rescheduled. Visit Michigan.gov/michiganhistory and facebook.com/MichiganHistoryCenter for any scheduling changes the day of the event.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F34053595%2F222322998892%2F1%2Foriginal.jpg?s=211d9b09f7ca3b040d084c12ea66cece', 'https://www.eventbrite.com/e/film-screening-12th-and-clairmount-tickets-36891019031?aff=ebapi', '702 West Kalamazoo Street, Lansing, MI 48915', 42.7321647, -84.56312479999997, '702 West Kalamazoo Street, Lansing, MI 48915', NULL, NULL, '1503604800', '1503612000', 0, 0, 0, NULL, 0),
