(6, 'live', '34578879359', 13, NULL, 4, 'PRIME MUSIC FESTIVAL - Lansing', 'PRIME FEST - LANSING, MI ALL AGES ALL SALES FINAL | NO REFUNDS | RAIN OR SHINE MARSHMELLO, MIGOS, MACHINE GUN KELLY, BLACKBEAR, CHEAT CODES, JOYRYDE, MICHAEL CHRISTMAS, PLAYBOI CARTI, PARTY THIEVES, PRINCE FOX, QUINN XCII, WAKA FLOCKA FLAME & MORE! SINGLE DAY LINEUPS TO BE REVEALED AT A LATER DATE! From the producers of Lansingâ€™s Common Ground Music Festival and the Columbus, Ohio, based Breakaway Music Festival brand, comes a fresh first year event! The multi-genre â€œPRIME Music Festival - Michiganâ€ will take place September 15-16, 2017, at Adado Riverfront Park. â€œWe are excited to expand the fall music festival scene in the mid Michigan regionâ€ said Jenna Meyer, marketing director of MiEntertainment Group. â€œAdado Riverfront Park has proven itself as the premier outdoor concert venue in the East Lansing/Lansing marketplace over the past 18 years, and home to many successful events.â€ MiEntertainment Group has produced the Common Ground Music Festival annually since 2000, bringing over 1 million guests to the mid-Michigan community and an added economic impact of over $60 million. In partnership with the company is Prime Social Group, known for its major stake in Midwest events including Breakaway Music Festival (which has now expanded into multiple markets) and the largest college music festival in the country, #Fest. ---- Tickets: After completing your purchase on Eventbrite, you will receive an email confirmation with your attached PDF ticket(s). You MUST print and bring your PDF tickets AND VALID PHOTO IDENTIFICATION to be admitted for the event.Â  Ticket Transfer Policy: You may gain entry to the event even if your name is not on your ticket ONLY so long as the barcode is scannable. PSG is not responsible if ticket(s) cannot be scanned and the order is under a different name than the person presenting the ticket.Â  Important:Â If you do not see your order confirmation in your inbox, make sure to check your junk/spam folder. If you still do not see your order confirmation, click here to access the Eventbrite help center.Â If you are having any other technical ticketing-related issues with your order, click here to contact Eventbrite.Â  VisitÂ primesocial.com/faqÂ for any additional ticketing questions.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F32373844%2F107981700581%2F1%2Foriginal.jpg?s=40de2dc8eaaee76123aa03221b472d44', 'https://www.eventbrite.com/e/prime-music-festival-lansing-tickets-34578879359?aff=ebapi', '201 East Shiawassee Street, Lansing, MI 48933', 42.7405231, -84.54988879999996, '201 East Shiawassee Street, Lansing, MI 48933', '', '', '1505487600', '1505602800', NULL, 0);
